(37, 'IJERSS-1386759115', 'editor@ijerss.com', 'TRAIT ANXIETY AMONG ATHLETES - A TRAINING ANALYSIS  WITH YOGIC ROUTINE ', 'Research', 'PHYSICAL EDUCATION AND SPORTS AND YOGA', 'ABSTRACT\n	\n	The Purpose of the study was to find out, the intervened effect of yoga on Trait Anxiety among the university sportsmen. The subjects chosen for the study were 30 Sportsmen from University of Madras, aged between 20 and 25 years. They were randomly divided into two groups of 15 each, one being the experimental group and the other a control group. The experimental group underwent a scheduled yoga practice for a period of 8 weeks, 6 days/week as the control group was on daily regular routine. The status of Trait Anxiety was measured before (Pre-test) and after (Post-test) the experimental period using Manual of State-trait Inventory developed by Spielberger (1970). The data were analyzed statistically for significant differences. Later applying analysis of variance and analysis of co-variance (in case of insignificance), significance in variance is shown, and further Scheffeâ€™s test was applied. The result proves that the yogic scheduled practices have made a significant impact on the Trait Anxiety of the experimental group compared to the control group. \n\n\nKey words: Yogic Practices, Experimental group, Control group, Manual of State-	          	         Trait Inventory.\n', '1386759115_IJERSS-TRAIT_ANXIETY.doc', '2013-12-11', 'DR.C.JOHNSON PREMKUMAR , DR. V. MAHADEVAN', 'jopremkumar@yahoo.co.in', NULL, 'No:6, Shanmuga Street, Gandhinagar', 'Panambattu Road', 'Villupuram', 'Tamilnadu', 635602, 'IN', 'In Processing', 'Forwarded to Editorial Committee', 'HEALTH SCIENCE', '1394001871_New_Microsoft_Office_Word_Document.docx', 1, 1, 'IJERSS', 1, 1, 'Volume I - Issue I, January 2014.', 0, 0),
(38, 'IJERSS-1387125055', 'editor@ijerss.com', 'BD - REVIEW AND ANALYSIS ON BIG DATA', 'Review', 'Computer Science', 'BD - Review and Analysis on BIG DATA', '1387125055_BD_ÃƒÂ¢Ã¢â€šÂ¬Ã¢â‚¬Å“_Review_and_Analysis_on_BIG_DATA.doc', '2013-12-15', 'V. SIRI DURGA, M SANTOSHI KUMARI, Y RAMA KRISHNA', 'mukesh4009@yahoo.com', NULL, '', '', '', '', 0, 'IN', 'Completed', 'Journal in Online', 'COMPUTER SCIENCE', '1389114924_2.pdf', 1, 1, 'IJERSS', 1, 1, 'Volume I - Issue I, January 2014.', 331, 0),
(40, 'IJERSS-1387126675', 'editor@ijerss.com', 'POWER CONSUMPTION MANAGEMENT IN CLOUD COMPUTING ENVIRONMENT', 'Review', 'Computer Science', 'Power Consumption Management in Cloud Computing Environment', '1387126675_Power_Consumption_Management_in_Cloud_Computing_Environment.doc', '2013-12-15', 'V DEEPAK, T.V.VISHNU PRASAD', 'mukesh4009@yahoo.com', NULL, '', '', '', '', 0, 'IN', 'Pending', '', 'COMPUTER SCIENCE', '1389115138_3.pdf', 1, 1, 'IJERSS', 1, 1, 'Volume I - Issue I, January 2014.', 327, 0),
(42, 'IJERSS-1388036597', 'editor@ijerss.com', 'INFLUENCE OF INTERVAL TRAINING, CIRCUIT TRAINING AND COMBINED TRAINING ON SELECTED SKILL RELATED PHYSICAL FITNESS VARIABLES AND PERFORMANCE VARIABLES AMONG FOOTBALL PLAYERS', 'Research', 'Sports Sciene & Physical Education', 'The present study was designed to analyse the influence of interval training, circuit training and combined training on selected skill related physical fitness variables (speed, agility, explosive power, balance, coordination and cardio respiratory endurance) and performance variables (dribbling, kicking and passing) among high school football players. Interval training, circuit training and combined interval and circuit training were selected as independent variables for this study.\r\nTo achieve the purpose of the study, 60 football players studying in the Malla Reddy Group of Engineering Colleges HYD Districts of Andhra Pradesh, India were randomly selected as subjects during the academic year 2013-2014. The age of the subjects ranged from 18 to 21 years. The selected subjects were randomly assigned to three experimental groups and one control group of fifteen (n=15) each for experimental group I (Group I), experimental group II (Group II), experimental group III (Group III) and control group (Group IV). Group I underwent interval training, Group II underwent circuit training, Group III underwent combined interval and circuit training for duration of 12 weeks. The control group (Group IV) was asked to refrain from any special training except their regular practice and playing schedule.\r\nAll the subjects of two groups were tested on selected physical fitness variables performance variables before and after the treatment. The analyses were carried out through various statistical techniques such as the dependent t-test, the analysis of covariance (one-way ANCOVA). Whenever the ÃƒÂ¢Ã¢â€šÂ¬Ã‹Å“FÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢ ratio for adjusted test was found to be significant, the ScheffeÃƒÂ¢Ã¢â€šÂ¬Ã¢â€žÂ¢s test was applied as post-hoc test to find out paired mean difference. In all the cases 0.05 level was fixed as significant level to test the hypotheses.  The results were drawn accordingly.\r\n', '1388036597_1388036597_1388036597_raj_gopal_full_paper.doc', '2013-12-26', 'E.RAJA GOPAL, DR. Y. GOPI KRISHNA', 'rajagopal.mrcet@gmail.com', NULL, 'H:No. 2-8-3/1, Laxmi nagar, Hanuman nilayam', 'Suraram Village, Post: Jeedimetla', 'Hyderabad', 'Andhra Pradesh', 500055, 'IN', 'Pending', '', 'HEALTH SCIENCE', '1389115222_4.pdf', 1, 1, 'IJERSS', 1, 1, 'Volume I - Issue I, January 2014.', 351, 0),
