(45, 'IJERSS-1388421711', 'editor@ijerss.com', 'REVIEW : CLOUD COMPUTING DATA SECURITY MODELS', 'Review', 'Computer Science', 'The universe of information figuring is getting bigger and unpredictable step by step. Could processing is the most mainstream model for supporting expansive and unpredictable information. Associations are moving to distributed computing for getting profit of its cost lessening and versatility characteristics. However distributed computing has potential risks and vulnerabilities. One of significant leap in moving to distributed computing is its security and protection concerns. As in distributed computing environment information is out of client ownership this prompts incredible danger of information uprightness, information privacy and information weakness and so on. Various security models have been created to adapt to these security dangers. Our research points at exploring security models that were produced for securing information throughout entire lifecycle of distributed computing', '1388421711_1388421711_1388421711_Cloud_Computing_Data_Security_models.doc', '2013-12-30', 'R CHANDRASHEKHAR, K.NANDA KISHORE', 'deepikarani.d@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', '', 'COMPUTER SCIENCE', '1389115455_7.pdf', 1, 1, 'IJERSS', 1, 1, 'Volume I - Issue I, January 2014.', 792, 0),
(46, 'IJERSS-1388653000', 'editor@ijerss.com', 'CONSIDERING THREE-LEVEL INVERTERS FOR CONTROLLING VOLTAGE IN CONVERTER SYSTEM', 'Research', 'VLSI', 'variety on inverter exchanging states is receptive\r\nand intended for three-level inverter. In this paper for once\r\nmore to-back framework by incorporating five-level diode\r\ncinched topologies we are proposing a novel Dc connection\r\nadjusting strategy. The calculation which we proposed here is\r\nthe change of variable exchanging recurrence control\r\napproach which was formerly presented by method of threelevel\r\nover to-back framework which relies on upon\r\ncomputations of neighbouring capacitor voltages which\r\nconcentrates on three-level Dc interface system to distinguish\r\nthe data about potential variety in back to back hubs.\r\nAccording to the above proposal, every one of the four\r\ncapacitors in Dc join system are successfully equalizing the\r\nvoltage. Because of streamlining of exchanging misfortunes\r\nthe proposed technique has focal points over the variable\r\nexchanging recurrence. Watchword: Multi level Inverter\r\nvoltage offset.', '1388653000_1388653000_1388653000_CONSIDERING_THREELEVEL_INVERTERS_FOR_CONTROLLING_VOLTAGE_IN_CONVERT', '2014-01-02', 'LOWKYA CHANDAKA', 'lowkyac@sreenidhi.edu.in', NULL, '', '', '', '', 0, 'IN', 'Pending', '', 'ENGINEERING', '1391755979_IJERSS1388798549EFFECT_OF_YOGA_ON_ACADEMIC_PERFORMANCE_IN_RELATION_TO_STRESS.pdf', 1, 1, 'IJERSS', 1, 1, 'Volume I - Issue I, January 2014.', 1817, 0),
(47, 'IJERSS-1388791261', 'editor@ijerss.com', 'ENHANCING SECURITY FOR E-HEALTH RECORDS OF PATIENTS THROUGH TECHNIQUE OF MULTI-CLOUD', 'Research', 'Cloud Computing', 'Today, most healing canters and therapeutic focuses have a database to oversee patients medicinal records. It is important to gather and access this data all over the place, to expand gainfulness and enhance nature of health forethoughts. Requirement to gain entrance to electronic health data over the planet and enhance the nature of human services to patients will highlight criticalness of utilizing distributed computing structural planning as a part of this range. On the other hand, regardless of the profits of distributed computing provisions for medicinal services, the security tests of cloud ought to be addressed. In this paper, we present and portray another proposed model called EHR-MCDB (Electronic Health Record with Multi-Clouds Databases). This model will guarantee the security of persons in a system and multi-cloud environment utilizing cryptographic calculation and circulated space. This model has the capacity to store any kind of information, for example, number, string, picture, and so on in a Cloud Environment. the EHR-MCDB avoid from illicit interruption and access to information in cloud environment and give administrations, for example, information honesty, privacy and lasting accessibility of information in a sheltered and secure way. The assessment effects of proposed EHR-MCDB indicate that notwithstanding expanding time of data space and recovery, System overhead is so it might be overlooked ,against the profits that it gives, and it doesn\\''t harm to Normal framework movement. Additionally contrasting the proposed model and information dispersion system on distinctive servers indicates that it is enhanced very nearly \\"something like 10% contrasted with the same multi-cloud model', '1388791261_1388791261_1388791261_ENHANCING_SECURITY_FOR_EHEALTH_RECORDS_OF_PATIENTS_THROUGH_TECHNIQU', '2014-01-03', 'SWATHI SAMBANGI, ADDANKI UDAYA KUMAR', 'ssambangi555@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', '', 'COMPUTER SCIENCE', '1391756039_ENHANCING_SECURITY_FOR_EHEALTH_RECORDS_OF_PATIENTS_THROUGH_TECHNIQUE_OF_MULTICLOUD.pdf', 1, 1, 'IJERSS', 1, 1, 'Volume I - Issue I, January 2014.', 330, 0),
(48, 'IJERSS-1388798347', 'editor@ijerss.com', 'A STUDY ON EFFECT OF AQUA AEROBICS EXERCISES FOR DEVELOPMENT OF ENDURANCE DURING THE SUMMER SEASON AMONG ATHLETES', 'Review', 'SPORTS', 'The aim of the present study was to study the effects of Aqua Aerobics Exercises during hot weather in Athletes. The 40 Male Long distance Athletes between the age group of 18 to 24 years i.e. 20 Experimental and 20 Control group were taken for the study. The 6 weeks aqua aerobic exercises for experimental group were given on alternate days at IGMC Swimming Pool, Vijayawada and controlled group were given the general training. The Pre and Post Training 12 Run Cooper Test were used to evaluate the effects of Aqua Aerobics Exercises during the Summer Season among experimental and controlled group. The Study shows that the Aqua Aerobic Exercises are very good for development of endurance among athletes.', '1388798347_1388798347_1388798347_A_STUDY_ON_EFFECT_OF_AQUA_AEROBICS_EXERCISES_FOR_DEVELOPMENT_OF_END', '2014-01-04', 'MOHIDDIN SATTAR KHAN', 'sareenakhanp@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', '', 'HEALTH SCIENCE', '1391756012_IJERSS1388798347A_STUDY_ON_EFFECT_OF_AQUA_AEROBICS_EXERCISES_FOR_DEVELOPMENT_OF_ENDURANCE_DURING_THE_SUMMER_SEASON_AMONG_ATHLETES.pdf', 1, 1, 'IJERSS', 1, 1, 'Volume I - Issue I, January 2014.', 293, 0),
(49, 'IJERSS-1388798549', 'editor@ijerss.com', 'EFFECT OF YOGA ON ACADEMIC PERFORMANCE IN RELATION TO STRESS', 'Review', 'SPORTS', 'Scholastic accomplishment is an achieved capability or level of fitness in school assignment, generally measured by state administered tests and communicated in evaluations or units dependent upon standards determined from a vide testing of students\\'' execution. Studies uncover that even low or moderate levels of anxiety can meddle with errand execution. Cognitive responses of anxiety bring about the powerlessness to think. Yoga, which is a lifestyle, is described by parity, health, amicability, and delight. Contemplation, being a piece of yoga, which is the seventh appendage of Asthanga Yoga - a state of caution rest as expressed by Maharishi Mahesh Yogi, who established another method of reflection, prominently reputed to be transcendental contemplation. By polishing yoga, an individual should achieve a state of mental poise, where reactions to favourable or unfavourable outside occasions are well under the singular\\''s control, and reactions are direct in power. The art of yoga is a capable stream of learning, which empowers the specialists to accomplish brilliant physical health, tranquil personality, proceeds otherworldly inspire, and makes the capability for amicable social living', '1388798549_1388798549_1388798549_effect_of_yoga_on_academic_performance_in_relation_to_stress.doc', '2014-01-04', 'D. BALA KRISHNA', 'ppspaulkumar@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', '', 'HEALTH SCIENCE', '1390017971_11.pdf', 1, 1, 'IJERSS', 1, 1, 'Volume I - Issue I, January 2014.', 0, 0),
(50, 'IJERSS-1388798614', 'editor@ijerss.com', 'SPORTS INJURIES AND THEIR MANAGEMENT', 'Review', 'SPORTS', 'The vast majority of the wounds might be forestalled, yet one ought to be cognizant how he may as well get ready fittingly. Extending activities for warming up down ought to be carried out and some sensible however basic safety measures to be taken. A harm unit is a real fundamental and may as well dependably be close-by when sportsman & ladies are either preparing or polishing their game. A few damages are clearly genuine, however you can at present be of assistance until the entry of a qualified individual. This separated there are an assemblage of knocks and wounds so normal that ever one knows digger to treat them. At that point there are the less clear damages, ones that damage when you get a racket or up a mount. Find the torment, its comes and cure. At that point you may as well need to recover your general fitness. At that point figure out which normal specialized flaws cause damages in your specific game and how to forestall, treat or lighten these wounds', '1388798614_1388798614_1388798614_SPORTS_INJURIES_AND_THEIR_MANAGEMENT.doc', '2014-01-04', 'P.MADHU', 'ppspaulkumar@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', '', 'HEALTH SCIENCE', '1391755951_IJERSS1388798614SPORTS_INJURIES_AND_THEIR_MANAGEMENT.pdf', 1, 1, 'IJERSS', 1, 1, 'Volume I - Issue I, January 2014.', 260, 0),
(51, 'IJERSS-1388798671', 'editor@ijerss.com', 'THE NEED FOR PREVENTION AND REHABILITATION OF SPORTS INJURIES', 'Review', 'SPORTS', 'Physical instruction assumes a paramount part to accomplish national coordination, which incorporates feeling of fraternity, companionship and unity. Subsequently, physical instruction is the medium of country\\''s solidarity. The most imperative for the country\\''s solidarity is collaboration and respect for the emotions of others.  This comes just through the cooperation in diversions and games and visit an alternate states or countries, where they run into the diriment methods for living, traditions, religion, customs, dialects, dietary patterns and so forth  In games camps, players hail from diverse states live together, practice to take an interest in one diversion regardless of much assorted qualities.  Therefore, amusements and games are the necessary a piece of physical training, which without a doubt assume a fundamental part in advertising national mix', '1388798671_1388798671_1388798671_The_Need_for_Prevention_and_Rehabilitation_of_Sports_Injuries.doc', '2014-01-04', 'P.MADHU', 'ppspaulkumar@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', '', 'HEALTH SCIENCE', '1391755918_IJERSS1388798671THE_NEED_FOR_PREVENTION_AND_REHABILITATION_OF_SPORTS_INJURIES.pdf', 1, 1, 'IJERSS', 1, 1, 'Volume I - Issue I, January 2014.', 352, 0),
(52, 'IJERSS-1388806311', 'editor@ijerss.com', 'EFFECTS OF DIFFERENT EXERCISE TRAINING PROTOCOLS ON TRIGLYCERIDE LEVELS AMONG MIDDLE AGED MEN 	', 'Review', 'SPORTS', 'The vitality of activity in a system of preventive solution has fortified the part of physical movement. There is relationship between physical action levels or cardio-respiratory fitness and danger of lethal and nonfatal Ischemic Heart Disease demonstrate that a stationary lifestyle or a low level of frequent physical movement expands the danger of IHD mortality. All the three separate lengths of time chose for the high-impact activity container viz YG, AG and CREG at the fifty percent maximal heart rate force brought about for the noteworthy reduction in the Triglyceride levels of the subjects. With respect to the variable of Triglyceride levels, the activity convention of CREG carried more critical lessening than the other experimentation conventions.', '1388806311_1388806311_1388806311_EFFECTS_OF_DIFFERENT_EXERCISE_TRAINING_PROTOCOLS_ON_TRIGLYCERIDE_LE', '2014-01-04', 'K. SATISH', 'kotasatish2011@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', '', 'HEALTH SCIENCE', '1391755890_IJERSS1388806311EFFECTS_OF_DIFFERENT_EXERCISE_TRAINING_PROTOCOLS_ON_TRIGLYCERIDE_LEVELS_AMONG_MIDDLE_AGED_MEN.pdf', 1, 1, 'IJERSS', 1, 1, 'Volume I - Issue I, January 2014.', 272, 0),
(53, 'IJERSS-1388808702', 'editor@ijerss.com', 'EFFECT OF ENDURANCE TRAINING AND RESISTANCE TRAINING IN SERIES AND PARALLEL ON MAXIMAL CARDIO VASCULAR PARAMETERS AMONG MEN', 'Review', 'SPORTS', 'present study was conducted to explore the effect of endurance training and resistance training in series and parallel on maximal Cardiovascular Parameters among men.  Thirty men students aged between 20 and 23 years were randomly selected and they were divided into three groups and each group contained 10 students.  Group I (n=10) underwent resistance and endurance training in series, group II (n=10) underwent resistance and endurance training in parallel and group III (n=10) acted as control.  For all groups Heart rate maximum (HR max), Stroke Volume maximum (SV max) and Cardiac output maximum ( max) were measured by using Bio-Monitor, M-Mode Doppler Echo Cardiogram and treadmill respectively.  The training groups underwent 12 weeks of resistance and endurance training in series and parallel and no specific training was given to control group.  Two days prior to and after training HR max, SV max were measured.  Finally ( max)was calculated by multiplying HR max and SV max.  It concluded that series and parallel trainings have significantly improved the selected cardiovascular parameters as compared to control group', '1388808702_1388808702_1388808702_EFFECTS_OF_DIFFERENT_EXERCISE_TRAINING_PROTOCOLS_ON_TRIGLYCERIDE_LE', '2014-01-04', 'K. SATISH', 'kotasatish2011@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', '', 'HEALTH SCIENCE', '1391755864_IJERSS1388808702EFFECT_OF_ENDURANCE_TRAINING_AND_RESISTANCE_TRAINING_IN_SERIES_AND_PARALLEL_ON_MAXIMAL_CARDIO_VASCULAR_PARAMETERS_AMONG_MEN.pdf', 1, 1, 'IJERSS', 1, 1, 'Volume I - Issue I, January 2014.', 325, 0),
(54, 'IJERSS-1388886534', 'editor@ijerss.com', 'A STUDY PHYSICAL EDUCATION AND YOGA', 'Review', 'SPORTS', 'Yoga and physical instruction are not opposite controls yet correlative orders.  Today, we find absence of legitimate co-appointment between yoga and physical training.  This may be because of absence of understating about the conceivable commitment of yoga for the profit of physical instruction. We are, therefore, unable to exploit yoga in improving the field of physical instruction and games. The technique and systems of yoga and physical instruction vary in their degree and methodology. When we talk about yoga and physical training we should first unmistakably comprehend the thoughts of yoga and physical instruction', '1388886534_1388886534_1388886534_STUDY_PHYSICAL_EDUCATION_AND_YOGA.doc', '2014-01-05', 'V.V.M.U. PHANINDRA', 'Phanispports7@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', '', 'HEALTH SCIENCE', '1391755826_IJERSS1388886534A_STUDY_PHYSICAL_EDUCATION_AND_YOGA.pdf', 1, 1, 'IJERSS', 1, 1, 'Volume I - Issue I, January 2014.', 333, 0),
(55, 'IJERSS-1388886675', 'editor@ijerss.com', 'IMPROVING ECONOMYAND PERFORMANCE OF LONG DISTANCE RUNNERS', 'Review', 'SPORTS', 'The point of the study was to research the studies in Improving running economy and Performance of long separation runners from Acharya Nagarjuna University, Andhra Pradesh, India have indicated that running economy (RE) is the most essential variable for long separation runners and sets exclusive players separated regarding execution. In spite of the fact that other physiological components are critical, for example, Strength preparing, Altitude introduction, Training in a warm to the earth. Standard way of thinking says its high-impact limit, or Vo2 Max. Anyway look at the 5 quickest runners at any race, and the champ won\\''t essentially have the most noteworthy Vo2 max. So what\\''s the mystery? It\\''s running economy', '1388886675_1388886675_1388886675_IMPROVING_ECONOMYAND_PERFORMANCE_OF_LONG_DISTANCE_RUNNERS.doc', '2014-01-05', 'S. GAFOOR', 'ppspaulkumar@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', '', 'HEALTH SCIENCE', '1391755787_IJERSS1388886675IMPROVING_ECONOMYAND_PERFORMANCE_OF_LONG_DISTANCE_RUNNERS.pdf', 1, 1, 'IJERSS', 1, 1, 'Volume I - Issue I, January 2014.', 876, 0),
(56, 'IJERSS-1388886826', 'editor@ijerss.com', 'EFFECT OF PRANAYAMA AND TRANCEDENTAL MEDITATION ON PULSE-RATE AND BLOOD PRESSURE OF MALE STUDENTS OF A.N.U. ANDHRA PRADESH', 'Review', 'SPORTS', 'The reason for the study was to figure out the impact of Pranayama and Transcendental Meditation on beat rate and circulatory strain of the Male scholars of the  Acharya Nagarjuna University,  Andhra Pradesh. The theory of the examination researcher were that if (1) Pranayama or Transcendental Meditation or both have an impact on individual as to his physiological parameters, specifically beat rate, systolic pulse and diastolic circulatory strain and (2) in the event that any or all have positive impacts on a singular\\''s physiological parameters in particular beat rate systolic and diastolic pulse which one has more impact', '1388886826_1388886826_1388886826_EFFECT_OF_PRANAYAMA_AND_TRANCEDENTAL_MEDITATION_ON_PULSERATE_AND_BL', '2014-01-05', 'M. SUDHAKAR BABU', 'ppspaulkumar@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', '', 'HEALTH SCIENCE', '1391755758_IJERSS1388886826EFFECT_OF_PRANAYAMA_AND_TRANCEDENTAL_MEDITATION_ON_PULSERATE_AND_BLOOD_PRESSURE_OF_MALE_STUDENTS_OF_A.N.U.pdf', 1, 1, 'IJERSS', 1, 1, 'Volume I - Issue I, January 2014.', 657, 0),
(57, 'IJERSS-1388886916', 'editor@ijerss.com', 'A STUDY ON ANTHROPOMETRIC MEASUREMENTS AND BMI AMONG THE BADMINTON PLAYERS', 'Research', 'SPORTS', 'In the present study, an attempt is made to study Anthropometric measurements and BMI (Body mass index) among the 25 Badminton players. The sample included 25 athletes, 20 male athletes, mean age 17.56 years and 5 female athletes, mean age 15.5 years respectively. The mean body weight (53.5 kg), and mean height (162 cm) etc.., were calculated and compared .The mean BMI among the 25 Badminton players is 20.35.', '1388886916_1388886916_1388886916_A_study_on_Anthropometric_measurements_and_BMI_among_the_Badminton_', '2014-01-05', 'T. SUSEELAMMA', 'ppspaulkumar@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', '', 'HEALTH SCIENCE', '1391755728_IJERSS1388886916A_STUDY_ON_ANTHROPOMETRIC_MEASUREMENTS_AND_BMI_AMONG_THE_BADMINTON_PLAYERS.pdf', 1, 1, 'IJERSS', 1, 1, 'Volume I - Issue I, January 2014.', 443, 0),
(58, 'IJERSS-1388888336', 'editor@ijerss.com', 'TECHNIQUE OF ULTRASONIC DISTANCE MEASUREMENT & BRAKING SYSTEM', 'Review', 'Mechanical Engineering', 'The point is to outline and advance a control framework based a wise electronically regulated auto slowing mechanism is called \\"AUTOMATIC BRAKING SYSTEM\\". This Braking framework is comprises of ultrasonic sensor, Control Unit, Pneumatic breaking framework. The Ultrasonic sensor is utilized to recognize the deterrent. There is any deterrent in the way, the ultrasonic sensor faculties the hindrance and giving the control indicator to the breaking framework. The pneumatic breaking framework is utilized to break the framework', '1388888336_1388888336_1388888336_TECHINUQE_OF_ULTRASONIC_DISTANCE_MEASUREMENT_&_BRAKING_SYSTEM.doc', '2014-01-05', 'VIVIAN ANURAG', 'ppspaulkumar@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', '', 'MECHANICAL ENGINEERING', '1391755676_IJERSS1388888336TECHNIQUE_OF_ULTRASONIC_DISTANCE_MEASUREMENT_&_BRAKING_SYSTEM.pdf', 1, 1, 'IJERSS', 1, 1, 'Volume I - Issue I, January 2014.', 745, 0),
(59, 'IJERSS-1390882999', 'editor@ijerss.com', 'TRAINING FOR FITNESS', 'Research', 'HEALTH SCIENCE', 'It is ability of the human body to function with vigor and alertness, without undue fatigue and with ample energy to engage in leisure activities, and to meet physical success.\r\nIn this modern and busy days college students are lacking with fitness this is because of inadequate knowledge about fitness, food habits and having a luxious habits without participating in any physical activities I there day to day life style. So there is a need of physical fitness training to over come the deformities and diseases \r\n', '1390882999_lawrence2.docx', '2014-01-28', 'DR. (SMT) U.LAWRENCE, DR.M.SYAM BABU', 'satyapaulkumarpp@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', '', 'HEALTH SCIENCE', '1395065161_IJERSS1390882999TRAINING_FOR_FITNESS.pdf', 1, 1, 'IJERSS', 1, 2, 'Volume I - Issue II, February 2014.', 354, 0),
(60, 'IJERSS-1390883153', 'editor@ijerss.com', 'SPORTS INJURY MANAGEMENT, FIRST AID AND SAFETY MEASURES', 'Research', 'HEALTH SCIENCE', 'Sports injuries are an unfortunate risk of participating in athletic activities. Accidents, improper warm ups, or poor training habits can cause sports injuries to occur with increased frequency. Some of the most common sustained sports injuries include:', '1390883153_lawrence3.docx', '2014-01-28', 'DR. (SMT) U.LAWRENCE', 'satyapaulkumarpp@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', '', 'HEALTH SCIENCE', '1395065211_IJERSS1390883153SPORTS_INJURY_MANAGEMENT_FIRST_AID_AND_SAFETY_MEASURES.pdf', 1, 1, 'IJERSS', 1, 2, 'Volume I - Issue II, February 2014.', 341, 0),
(61, 'IJERSS-1390883255', 'editor@ijerss.com', 'PHYSICAL DEVELOPMENT THROUGH PHYSICAL EDUCATION', 'Research', 'HEALTH SCIENCE', '     Physical Education is an Integral part of total Education process. According to Aristotle Education develop manÃ¢â‚¬â„¢s faculty especially mind and able to gain the contemplation of supreme truth goodness and beauty in which perfect happiness essentially consists. And creation at a sound mind in a sound bodyÃ¢â‚¬Â Education designed process to promote the harmonious development of a person. \r\nAccording Charles A.Bercher Physical Education is a integral part of total Education part. Its aims and development of physically, mentally, emotionally, and socially fit Citizens through the medium of physical activities. \r\n', '1390883255_lawrence4.docx', '2014-01-28', 'DR. (SMT) U.LAWRENCE, PROF. M.SYAM BABU', 'satyapaulkumarpp@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', '', 'HEALTH SCIENCE', '1395065263_IJERSS1390883255PHYSICAL_DEVELOPMENT_THROUGH_PHYSICAL_EDUCATION.pdf', 1, 1, 'IJERSS', 1, 2, 'Volume I - Issue II, February 2014.', 454, 0),
(62, 'IJERSS-1390883372', 'editor@ijerss.com', 'ROLE OF SPORTS TO IMPROVE THE HEALTH OF THE POPULATION', 'Research', 'HEALTH SCIENCE', 'Regular physical activity is a significant factor in reducing the severity of cardiovascular and other diseases among the peoples of the world.  Of all deaths in developing countries more than half are due to cardiovascular diseases. ', '1390883372_lawrence5.docx', '2014-01-28', 'DR. (SMT) U.LAWRENCE, PROF. M.SYAM BABU', 'satyapaulkumarpp@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', '', 'HEALTH SCIENCE', '1395065303_IJERSS1390883372ROLE_OF_SPORTS_TO_IMPROVE_THE_HEALTH_OF_THE_POPULATION.pdf', 1, 1, 'IJERSS', 1, 2, 'Volume I - Issue II, February 2014.', 301, 0),
(69, 'IJERSS-1391699616', 'editor@ijerss.com', 'EFFECT OF SAQ TRAINING ON SPEED AGILITY AND BALANCE AMONG INTER COLLEGIATE ATHLETES', 'Research', 'SPORTS SCIENCE', 'The purpose of the study was to find out the effect of SAQ (Speed Agility Quickness)Training on Speed, Agility and Balance among Inter Collegiate Athletes. Twenty four male athletes studying from Department of Physical Education and Centre for Research, H. H. The RajahÃ¢â‚¬â„¢s College, Pudukkottai were selected randomly as subjects. The age of the subjects ranged from 17 to 23 years. The selected subjects were divided into two groups. Group I underwent SAQ training and Group II acted as control. The experimental group was subjected to the SAQ training for alternative three days per week up to six weeks. The SAQ training was selected as independent variable and the criterion variables speed, agility and balance were selected as dependent variables and the selected dependent variables were assessed by the standardized test items. Speed was assessed by 50m run and the unit of measurement in seconds, agility was assessed by shuttle run and the unit of measurement in seconds and the balance was assessed by stork stand test and the unit of measurement in seconds. The experimental design selected for this study was pre and post test randomized design.  The data were collected from each subject before and after the training period and statistically analyzed by using dependent Ã¢â‚¬ËœtÃ¢â‚¬â„¢ test and analysis of covariance (ANCOVA). It was found that there was a significant improvement and significant different exist due to the effect of SAQ training on speed, agility and balance among inter collegiate athletes when compared to control group', '1391699616_Dr._ASN_Paper.doc', '2014-02-06', 'DR.NAGESWARAN.A.S', 'asnageswaran@rediffmail.com', NULL, 'ASSOCIATE PROFESSOR IN PHYSICAL EDUCATION', 'H. H. The Rajah''s College,(AUT)', 'PUDUKKOTTAI', 'TAMIL NADU', 622001, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1395065332_IJERSS1391699616EFFECT_OF_SAQ_TRAINING_ON_SPEED_AGILITY_AND_BALANCE_AMONG_INTER_COLLEGIATE_ATHLETES.pdf', 1, 1, 'IJERSS-2014', 1, 2, 'Volume I - Issue II, February 2014.', 946, 0),
(70, 'IJERSS-1391760534', 'editor@ijerss.com', 'FAULT DIAGNOSIS IN MEMORY CHIPS USING FPGA - BY COMPLEX TEXT PATTERN GENERATION', 'Research', 'ENGINEERING', 'There are several test circuits available for testing the memory chips. However no test setup is developed so far for testing the memory blocks inside the FPGA. The BRAM blocks of FPGA are designed to work at much higher frequency than the FPGA core logic. Hence testing the BRAMs at higher speed is essential. The conventional memory test circuits cannot be used for this purpose. Hence the proposed work develops a memory testing tool based on March tests for FPGA based BRAM (block RAM testing). The code modules for March test generator shall be developed in VHDL and shall be synthesized for Xilinx Spartan 3 Family device. A PC based GUI tool shall send command to FPGA using serial port for selecting the type of test. The FPGA core gets the command through UART and performs the appropriate and sends the test report back to PC. The results shall be verified in simulation with Xilinx ISE simulator and also in hardware by using Chip scope. Xilinx Spartan 3 family FPGA board shall be used for hardware verification of the developed March test generator.', '1391760534_Fault_diagnosis_in_memory_chips_using_FPGA.docx', '2014-02-07', 'VASUJADEVI MIDASALA, S NAGAKISHORE BHAVANAM', 'satyabhavanam@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', NULL, 'ENGINEERING', '1395065402_IJERSS1391760534FAULT_DIAGNOSIS_IN_MEMORY_CHIPS_USING_FPGA_BY_COMPLEX_TEXT_PATTERN_GENERATION.pdf', 1, 1, 'IJERSS-2014', 1, 2, 'Volume I - Issue II, February 2014.', 454, 0),
(71, 'IJERSS-1391760652', 'editor@ijerss.com', 'PRINTED MICROSTRIP COMPACT ANTENNA WITH SLOTS IN GROUND PLANE AND PATCH USING HFSS', 'Research', 'ENGINEERING', 'The inherent property of patch antenna is its narrow bandwidth, typically a few percent. To improve the impedance bandwidth characteristics of the patch antenna the ground shape is modified. This letter focuses on single layer printed  compact   rectangular patch fed by  a microstrip feed line and a partial ground plane for XÃ¢â‚¬â€œ Band  applications. The FR4 with Ã¢â€žâ€¡r =  4.6   is selected as substrate and its total size is 30 mmÃƒâ€” 22 mm. To improve the Impedance Bandwidth of the antenna a rectangular slot on patch and the modiÃ¯Â¬Âed ground plane with semielliptical shaped slots on its top edge are incorporated. The impedance Band width of the antenna with and without slots are compared. The Simulation studies are carried in the X band  using Electromagnetic Simulator HFSS -14.0 version. ', '1391760652_Printed_Microstrip_Compact_Antenna_with_Slots_in_Ground_Plane_and_Patch_using_HFSS.docx', '2014-02-07', 'S NAGAKISHORE BHAVANAM, DR. P. SIDDAIAH, VASUJADEVI M', 'siddaiah_p@yahoo.com', NULL, '', '', '', '', 0, 'IN', 'Pending', NULL, 'ENGINEERING', '1395065466_IJERSS1391760652PRINTED_MICROSTRIP_COMPACT_ANTENNA_WITH_SLOTS_IN_GROUND_PLANE_AND_PATCH_USING_HFSS.pdf', 1, 1, 'IJERSS-2014', 1, 2, 'Volume I - Issue II, February 2014.', 854, 0),
(72, 'IJERSS-1392441384', 'editor@ijerss.com', 'WAVELET BASED FORENSIC METHOD FOR COPY-MOVE FORGERY DETECTION', 'Research', 'Computer & Communication', 'Digital images are easily subjected to forgeries due to the availability of powerful image processing tools. Now-a-days it is possible to add or remove essential features in an image without leaving any clues in an image. As digital cameras and video camera\\''s replace their analog counterparts, the need for authenticating digital images and their contents detecting forgeries will only increase. In particular, we are aiming for detecting a special type of digital forgery called copy-move attack in which part of the image is copied and pasted somewhere else in the same image with the intent to cover an important image feature. In this project we are investigating the problem of detecting the copy-move forgery in which portion of the image is copied and pasted on the same image somewhere else, with the intent to cover an important image feature. In this project we are investigating the problem of detecting the copy-move forgery by using wavelet based forensic method. This method will successfully detect the forged part even when the copied area is enhanced / realtered to merge it with the background. Then the forged image will be saved in a lossy format such as joint photographic experts group.', '1392441384_WBF.docx', '2014-02-15', 'R.REETA', 'rreeta164@gmail.com', NULL, 'No.34, Bharathi Nagar', 'Kaniyambadi', 'Vellore ', 'Tamilnadu', 632, 'IN', 'Pending', '', 'NCRACE-2014 Conference', '1394819138_IJERSS1392441384.pdf', 1, 1, 'NCRACE-2014', 0, 0, 'Conference', 535, 0),
(73, 'IJERSS-1392447659', 'editor@ijerss.com', 'A Study on the Effect of Plyometric exercises  for development of Speed in 50 M Back Stroke in Swimming ', 'Research', 'HEALTH SCIENCE', 'Plyometrics are designed for the maximum generation of force by your muscles in the shortest amount of time possible.Back stroke in swimming  are referred to the long-axis strokes, as you are rotating on the long-axis of your body while swimming.The purpose of the present study to find out the effect of Plyometric exercises for the development of speed in Back Stroke  style in swimming.The sample for the present study consists of 20 Male Swimmers of Hyderabad  out of which 10 are experimental group and 10 are controlled group.Plyometric Exercises such as hopping,bounding,chest pass, Power drop, box jumps, tuck jumps etc were given to experimental group for six weeks. Pre Test and Post Test were conducted  50 M Back Style Swimming to assess the speed.This study shows that due to the Plyometric training there is a improvement of experimental group in the 50 M back stroke. Swimming compare to the controlled group.Plyometric training is essential for elite swimming performance. To optimise the benefit of land-based training, you must select exercises with mechanical relevance to the swimming action, particularly those movements which propel the swimmer through the water, such as the arm pull and leg kick', '1392447659_Rajesh_Kolkatta.doc', '2014-02-15', 'Prof.Rajesh Kumar', 'rajesh2sports@yahoo.co.in', NULL, '', '', '', '', 0, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(74, 'IJERSS-1392731397', 'editor@ijerss.com', 'A NOVEL METHOD FOR GLAUCOMA DETECTION THROUGH DISC AND CUP EXTRACTION', 'Research', 'computer and communication', 'Glaucoma is an eye disease which leads to vision loss when untreated, so detecting the disease in time is very important. Many glaucoma risk factors are the vertical cup to disc ratio (CDR), disc diameter, peripapillary atrophy (PPA) etc. here the CDR ratio is mainly calculated to detect the presence of the disease. The nerves enter into the eye through the optic disc and optic cup is interior of the disc. As the disease gets affected the optic cup enlarges and occupies the disc area. The current test based on intraocular pressure is not sensitive for glaucoma screening. The proposed method makes use of the region growing algorithm for Glaucoma detection by optic disc and optic cup segmentation on both normal and glaucoma images. Experimental results are expected to show a better performance.\r\n', '1392731397_GTEC_stud1.docx', '2014-02-18', 'N.SHALINI', ' sshal9760@gmail.com', NULL, '307/A Manthoppu second street ', 'kamalakshipuram,otteri ', 'VELLORE', 'Tamilnadu', 632002, 'IN', 'Pending', NULL, 'NCRACE-2014 Conference', '1394819230_IJERSS1392731397.pdf', 1, 1, 'NCRACE-2014', 0, 0, 'Conference', 902, 0),
(75, 'IJERSS-1392731754', 'editor@ijerss.com', 'PACKET ENCRYPTION AND SCHEDULING TO ENHANCE SECURITY AND QOS IN NETWORK', 'Research', 'computer and communication', 'The Internet has become a commercial entity that need  to provide its customers with quality-of-service  (QoS) guarantees.  Real-time network applications have been congesting the Internet. To provide the real-time network applications with the QoS  guarantees, network technologies were developed by applying a scheduling algorithm. Conventional schedulers focus on the timing constraints but are much less effective in satisfying the security requirements. In this paper, an adaptive security-aware scheduling system for packet switched networks using a multi-agent design model is used. The system combines scheduling with security service enhancement. The scheduling unit uses the Diff-EDF scheduler and the security enhancement scheme adopts a congestion control mechanism. This approach helps meet both QoS and security requirements for data flows. ', '1392731754_GTEC_stud2.docx', '2014-02-18', 'M. SWATHY', 'mswathysai@gmail.com', NULL, 'Ganadipathy TulsiÃ¢â‚¬â„¢s Jain Engineering college', 'kaniyambadi,vellore', 'VELLORE', 'Tamilnadu', 632102, 'IN', 'Pending', NULL, 'NCRACE-2014 Conference', '1394819185_IJERSS1392731754.pdf', 1, 1, 'NCRACE-2014', 0, 0, 'Conference', 380, 0),
(76, 'IJERSS-1392731938', 'editor@ijerss.com', 'AN EFFICIENT ROUTING APPROACH FOR REDUCING DEAD LOCK IN MOBILE ADHOC NETWORKS', 'Research', 'computer and communication', 'Multicast communication has been commonly used in mesh networks. Current multicast routing methods such as tree based and path based may suffer from problem of multicast deadlock or long routing delay. The main idea of the proposed hybrid multicast routing is to combine the advantages of the tree-based and path-based methods such that the routing can vary adaptively according to the traffic of the network. Very high routing efficiency is achieved by the hybrid multicast routing algorithm due to an adaptive routing strategy according to the traffic load. In this project the hybrid multicast routing algorithm is implemented using DSDV protocol. Deadlocks in routing can occur when messages block waiting for channel resources while holding onto other channel resources. Cyclic dependencies formed by groups of such blocked messages can lead to the indefinite postponement of messaging activities and, if allowed to persist, can bring the entire system to a halt. Handling deadlocks is essential for providing reliable communication paths between processing nodes and that can be performed by hybrid multicast routing protocol. In this paper an efficient hybrid multicast routing approach used to reduce the deadlocks that occurs in mobile adhoc network.', '1392731938_GTEC_stud3.docx', '2014-02-18', 'V . ABILASHA', 'mailstoabilasha@yahoo.com', NULL, 'Ganadipathy TulsiÃ¢â‚¬â„¢s Jain Engineering college', 'kaniyambadi,vellore', 'VELLORE', 'Tamilnadu', 632102, 'IN', 'Pending', NULL, 'NCRACE-2014 Conference', '1394783221_IJERSS1392731938.pdf', 1, 1, 'NCRACE-2014', 0, 0, 'Conference', 333, 0),
(77, 'IJERSS-1392732059', 'editor@ijerss.com', 'ROLE BASED ACCESS POLICIES FOR CONTROLLED INFORMATION SHARING IN EMERGENCY SITUATIONS', 'Research', 'computer and communication', 'An emergency situation caused due to natural and    man-made disasters create needs for developing an effective  emergency management scheme for information sharing. Generally during an emergency there is often the need to access resources that are not allowed during the normal system operations but this may disturb the control of content security. In this paper, we represent an control access model to force controlled content sharing in emergency cases by creating an emergency policies based on users roles and attributes.This provides access to the users based on the temporary access polices created to cope with that current situations and enhance the content security.', '1392732059_rbcap1.docx', '2014-02-18', 'P.UMA MAHESWARI', 'umatech2012@gmail.com                             ', NULL, 'Ganadipathy TulsiÃ¢â‚¬â„¢s Jain Engineering college', 'kaniyambadi,vellore', 'VELLORE', 'Tamilnadu', 632102, 'IN', 'Pending', NULL, 'NCRACE-2014 Conference', '1394818998_IJERSS1392732059.pdf', 1, 1, 'NCRACE-2014', 0, 0, 'Conference', 468, 0),
(78, 'IJERSS-1392735502', 'editor@ijerss.com', 'REDUCING THE ENERGY CONSUMPTION OF THE NETWORK BY FINDING THE SHORTEST PATH USING HYBRID ROUTING ALGORITHM IN DSDV PROTOCOL', 'Research', 'Research Scholar', 'A mobile ad hoc network (MANET) is a self-configuring infrastructure less network of mobile devices connected by wireless.  In particular, a manet has no base stations: a node communicates directly with nodes within wireless range and indirectly with all other nodes using a dynamically-computed, multi-hop route via the other nodes of the manet. Each device in a MANET is free to move independently in any direction, and will therefore change its links to other devices frequently.energy is the one of the important factor in designing manet. In this paper the energy consumption is reduced by finding the shortest path using hybrid multicast algorithm in DSDV protocol.', '1392735502_GTEC_staff2.doc', '2014-02-18', 'B.THENRAL', 'thenrallakshmipathy@gmail.com', NULL, 'Ganadipathy TulsiÃ¢â‚¬â„¢s Jain Engineering college', 'kaniyambadi,vellore', 'VELLORE', 'Tamilnadu', 632102, 'IN', 'Pending', NULL, 'NCRACE-2014 Conference', '1394818955_IJERSS1392735502.pdf', 1, 1, 'NCRACE-2014', 0, 0, 'Conference', 784, 0),
(79, 'IJERSS-1392736321', 'editor@ijerss.com', 'Applications of Wide-Area Network Slicing for Improving Cloud Platform Access by OpenTag', 'Research', 'PG Scholar', 'Recently, cloud computing has been extensively used worldwide  and  network  slicing  has  attracted  attentions  for improving the access to the cloud platform. We have recently proposed a tag based slicing mechanism for coordinated wide- area  packet  processing,  called  OpenTag.  In  this  paper,  we introduce a viable application on top of an OpenTag slice to demonstrate the usefulness and benefit of OpenTag architecture and tag-based resource slicing for high-speed packet processing. Our contributions are three-fold: (1) designing the OpenTag architecture  for  enabling  user-oriented  packet  processing,  (2) implementing  a  prototype  of  OpenTag  system  with  all  the components along end-to-end paths, (3) evaluating the feasibility of applications on top of OpenTag for improving the robustness\r\nof the access to cloud platforms.\r\n', '1392736321_Applications_of_widearea_network_slicing.doc', '2014-02-18', 'K.Sathishkumar', 'techsathish@gmail.com', NULL, 'St.PeterÃ¢â‚¬â„¢s University,', 'Avadi', 'chennai', 'Tamilnadu', 632002, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'NCRACE-2014', 0, 0, 'New', 0, 0),
(80, 'IJERSS-1392736863', 'editor@ijerss.com', 'A VLSI FRAMEWORK FOR PARALLEL LONG-PERIOD RANDOM NUMBER GENERATOR BASED ON THE RESEEDING METHOD', 'Research', 'PG Scholar', 'This paper presents hardware architecture for well-organized implementation of the reseeding method. Our aim achieves a throughput of one sample-per-cycle and runs on a Xilinx XC5VFX130T field-programmable gate array (FPGA) device.  In this paper, a novel type of FPGA Random Number Generator (RNG) takes benefit and the ability to turn lookup tables (LUTs) into Static Random Access memory (SRAM).Experimental  result shows  the proposed reseeding method achieves better performance  for  both  security  applications  as well as monte-carlo simulation using non- repeating pattern', '1392736863_AMAZE_stud1.doc', '2014-02-18', 'S.MUKILESWARI', 'mukileswari@gmail.com', NULL, 'Arulmigu Meenakshi Amman College of Engineering', 'Vadamavandal,kanchipuram', 'VELLORE', 'Tamilnadu', 632002, 'IN', 'Pending', NULL, 'NCRACE-2014 Conference', '1394818892_IJERSS1392736863.pdf', 1, 1, 'NCRACE-2014', 0, 0, 'Conference', 675, 0);
INSERT INTO `papers` (`id`, `paper_id`, `paper_referral`, `paper_title`, `paper_type`, `subject_category`, `abstract`, `paper_attachment`, `uploaded_on`, `author`, `email`, `pnumber`, `address_line1`, `address_line2`, `city`, `state`, `pincode`, `country`, `status`, `comments`, `subject`, `pdf`, `active`, `news`, `conference`, `volume`, `issue`, `volume_issue_title`, `downloads`, `blogspot`) VALUES
(81, 'IJERSS-1392737160', 'editor@ijerss.com', 'PATIENT MONITORING SYSTEM USING EMBEDDED MODULE FOR BIOMEDICAL ENGINEERING', 'Research', 'Research Scholar', 'In hospitals, the patients in ICU need a constant monitoring of their temperature, respiration and heart rate. This paper is a working model which incorporates sensors to measure patientÃ¢â‚¬â„¢s physiological parameters namely temperature, respiration rate, ECG, heart rate and evoked potential with the sensors interfaced to computer. Monitoring and control of all the specified parameters are done using particular sensor for each parameter. These sensors are sensitive to infrared rays, which are not harmful to human body. As, all the signals of the patients are interfaced to the computer, the patients condition can be analyzed by doctors in any part of the hospital wherever they are. Thus, it reduces doctorÃ¢â‚¬â„¢s work load and also gives more accurate results. Whenever there is an abnormality felt by the patient, this system will give an alarm signal, by which the doctor rushes to the patient. This paper also incorporates some special features like online videography i.e. the doctor in charge of the patient can diagnose the patient from his cabin. All the results and diagnosis of the patient are stored in a secondary storage tool or in the computer itself as database for future reference. The results are represented in the desired forms as graphs, wave forms, statistics, picture etc., using graphics', '1392737160_sncet_staff1.doc', '2014-02-18', 'C.PRAGASH', 'pragash323@gmail.com', NULL, 'Sri Nandhanam College of Engineering and Technolog', 'Tirupattur', 'VELLORE', 'Tamilnadu', 632002, 'IN', 'Pending', NULL, 'NCRACE-2014 Conference', '1394818835_IJERSS1392737160.pdf', 1, 1, 'NCRACE-2014', 0, 0, 'Conference', 630, 0),
(82, 'IJERSS-1392782675', 'editor@ijerss.com', 'ADVANCED DOOR LEVEL SECURITY SYSTEM FOR THEFT DETECTION', 'Research', 'Computer & Comunication', 'This project is developed with aims to improve security systems available in current market. This project claims to produce a prototype camera and global system for mobile communication (GSM) interfacing system for security surveillance. This system uses sensor, namely passive infrared receiver (PIR). The PIR function is to detect changes in temperature of human in infrared radiation.This project presents a technique for human Face Recognitionis based on PCA algorithm (i.e., eigenface method). In this project, the microcontroller used is PIC 16, where it sends data to the computer to activate the camera when the microcontroller receives signals from PIR. MAX232 is used as an interface circuit connecting the microcontroller to the computer. To develop software for the control circuits, software MATLAB is used because the software supports microcontroller PIC 16. Once the camera is activated, it will capture images of intruder and the itwill be saved and sent to the mobile phone, through commands the alarm and door lock gun will be activated. For the transmission of picture (MMS), the software used is MATLAB because they support the process of sending picture from computer to phone via GSM modem.', '1392782675_CONFERENCE.docx', '2014-02-19', 'B.KAMATCHI', 'bkamatchi.ace@gmail.com', NULL, 'Dept. of IT', 'Adhiyamaan College of Engineering', 'Hosur', 'Tamilnadu', 0, 'IN', 'Pending', NULL, 'NCRACE-2014 Conference', '1394818779_IJERSS1392782675.pdf', 1, 1, 'NCRACE-2014', 0, 0, 'Conference', 1140, 0),
(83, 'IJERSS-1392782951', 'editor@ijerss.com', 'WCET ANALYSIS ON REAL TIME EMBEDDED SYSTEMS FOR MEMORY CONSTRAINS', 'Research', 'Computer & Communication', 'The growing density of integration and the increasing percentage of system-on-chip memory occupied by embedded programs have led to an increase in the expected amount of power consumption. In order to reduce the integrity and iterations of the embedded programs the WCET has been implemented. In this paper, a compiler level optimization, namely WCET-aware rescheduling register allocation, is proposed to achieve WCET minimization for real-time embedded systems. The novelty of the proposed approach is that the effects of register allocation, instruction scheduling, and cluster assignment on the quality of generated code are taken into account for WCET minimization. These three compilation processes are integrated into a single phase to obtain a balanced result. By monitoring the Worst Case Execution time we can reduce the clock cycles required by each instruction of the program, which parallely increase the memory consumption based on both RAM and ROM memory in the embedded system and also power consumption criteria.', '1392782951_BALACHANDAR_CONFERENCE1.doc', '2014-02-19', 'BALACHANDAR JAYAPALAN', 'balu26.2007@gmail.com ', NULL, 'Dept. of ECE, M.E ( Applied Electronics )', 'Arulmigu Meenakshi Amman College of Engg', 'Kanchipuram', 'Tamilnadu', 0, 'IN', 'Pending', NULL, 'NCRACE-2014 Conference', '1394818720_IJERSS1392782951.pdf', 1, 1, 'NCRACE-2014', 0, 0, 'Conference', 785, 0),
(84, 'IJERSS-1392783334', 'editor@ijerss.com', 'INTELLIGENCE INFORMATION SYSTEM FOR TRAIN LOCATION USING GPS & GSM', 'Research', 'Computer & Communication', 'Travel time information is a vital component of many intelligent   transportation   systems  (ITS)  applications.   In  recent years, the number of passengers travels in train & number of trains in  India  has  increased   tremendously.   Due  to  the  increase  in number of trains the train times may be delayed and the passengers have to wait at railway stations.   A desirable strategy to deal with such issues is to provide better service (comfort, convenience and so on) the notification  of location  of time  through  GSM. One such application provides accurate information about train arrivals to passengers,  leading  to reduced  waiting  times  at railway  stations. This  needs  a  real-time  data  collection  technique,  a  quick  and reliable data and informing the passengers regarding the same. The scope of this proposed  system  is to use global positioning  system data collected from trains in the city in India, to show the location.\r\nThe system  consists of three modules:  Vehicle  section  Module, BASE   Station   section   Module,   User   mobile   section   Module. Equipped with PC and GSM modem, BASE Station Module sends the  initialization   information   containing   the  train   number   to Vehicle  section  Module  using  SMS.  The  microcontroller  based vehicle  section  Module  consisting  mainly  of a GPS  receiver  and GSM modem then starts transmitting its location to BASE Station Module.  BASE  Station  Module  equipped  with  a  microcontroller unit and GSM modems interfaced to PCs is designed to keep track record of every train, processes  user request   about   a particular train location out of BASE Station and updates trains location at stations. GPS Module is installed at every station  and consists of a GSM modem, memory unit and dot matrix display all interfaced to a microcontroller. This module receives trains location information coming  towards  that  station  from  BASE  Station  module  and displays the information on a dot matrix display. The performance of the proposed system is found to be promising and expected to be valuable  in  the  development  of  advanced  public  transportation systems (APTS) in India. The work presented here is one of the first attempts at real-time short-term  prediction of arrival time for ITS applications in India.\r\n', '1392783334_SINGARAM.docx', '2014-02-19', 'SINGARAM.M', 'singarambe92@gmail.com', NULL, 'Adhiparasakthi college of engg.', 'Kalavai', 'Vellore', 'Tamilnadu', 0, 'IN', 'Pending', NULL, 'NCRACE-2014 Conference', '1394818499_IJERSS1392783334.pdf', 1, 1, 'NCRACE-2014', 0, 0, 'Conference', 644, 0),
(85, 'IJERSS-1392808010', 'editor@ijerss.com', 'OPTIMAL SELECTION OF WAVELET FAMILIES FOR SPECK IMAGE CODEC SCHEME', 'Research', 'Computer & Communication', 'Image coding is classical, still challenging problem of data compression, necessary in communication networks to deliver the information content. In this paper, bi-orthogonal wavelet filter coefficients are used for wavelet decomposition and reconstruction of image. When the image is compressed by using these filter coefficient in discrete wavelet domain, then SPECK coding schema is performed. The compression result by using these filter coefficient show that the reconstructed image has higher PSNR and low MSE than other wavelet families.  For the performance study, all the standard wavelet family membersÃ¢â‚¬â„¢ outcomes were tested.', '1392808010_SPEC_IEEE_format.docx', '2014-02-19', 'D.REGAN', 'reganoct@gmail.com', NULL, 'Dept. of ECE', 'Sri Balaji Chockalingam Engg., College', 'Arni', 'Tamilnadu', 632317, 'IN', 'Pending', NULL, 'NCRACE-2014 Conference', '1394818432_IJERSS1392808010.pdf', 1, 1, 'NCRACE-2014', 0, 0, 'Conference', 335, 0),
(86, 'IJERSS-1392823176', 'editor@ijerss.com', 'SECURITY AWARE SCHEDULER', 'Research', 'Research Scholar', 'The Internet has become a commercial entity that need to provide its customers with quality-of-service (QoS) guarantees.  Real-time network applications have been congesting the Internet. To provide the real-time network applications with the QoS guarantees, network technologies were developed by applying a scheduling algorithm. Conventional schedulers focus on the timing constraints but are much less effective in satisfying the security requirements. In this paper, an adaptive security-aware scheduling system for packet switched network is used. The system combines scheduling with security service enhancement (authentication security service). The scheduling unit uses the Diff-EDF scheduler and the security enhancement scheme adopts a congestion control mechanism. This approach helps meet both QoS and security requirements for data flows', '1392823176_GTEC_staff1_001.doc', '2014-02-19', 'D.SANTHOSH KUMARI  ', 'santhosh_kumari2004@yahoo.co.in', NULL, 'Ganadipathy TulsiÃ¢â‚¬â„¢s Jain Engineering college', 'kaniyambadi,vellore', 'VELLORE', 'Tamilnadu', 632102, 'IN', 'Pending', NULL, 'NCRACE-2014 Conference', '1394818354_IJERSS1392823176.pdf', 1, 1, 'NCRACE-2014', 0, 0, 'Conference', 360, 0),
(87, 'IJERSS-1392835151', 'editor@ijerss.com', 'ADVANCED DOOR LEVEL SECURITY SYSTEM FOR THEFT DETECTION', 'Research', 'INFORMATION TECHNOLOGY', 'This project is developed with aims to improve security systems available in current market. This project claims to produce a prototype camera and global system for mobile communication (GSM) interfacing system for security surveillance. This system uses sensor, namely passive infrared receiver (PIR). The PIR function is to detect changes in temperature of human in infrared radiation.This project presents a technique for human Face Recognitionis based on PCA algorithm (i.e., eigenface method). In this project, the microcontroller used is PIC 16, where it sends data to the computer to activate the camera when the microcontroller receives signals from PIR. MAX232 is used as an interface circuit connecting the microcontroller to the computer. To develop software for the control circuits, software MATLAB is used because the software supports microcontroller PIC 16. Once the camera is activated, it will capture images of intruder and the itwill be saved and sent to the mobile phone, through commands the alarm and door lock gun will be activated. For the transmission of picture (MMS), the software used is MATLAB because they support the process of sending picture from computer to phone via GSM modem.', '1392835151_JOURNAL.docx', '2014-02-19', 'Anupriya.S,Elakya.P,Kamatchi.B,Manasa.D,G.Rohini ', 'bkamatchi.ace@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(88, 'IJERSS-1392889124', 'editor@ijerss.com', 'ENHANCING CLOUD SECURITY USING SEDAS', 'Research', 'Computer & Communication', 'TodayÃ¢â‚¬â„¢s technical and legal landscape presents formidable challenges to personal data privacy. First, our increasing reliance on Web services  and cloud computing causes personal data to be cached, copied, and archived by third parties, without our knowledge or control. Second, the disclosure of private data has become commonplace due to carelessness, theft, or legal actions. Self destructing data aim at protecting user data privacy through integration of cryptographic techniques with active storage framework based on T10 standard.In SeDas,the data stored will get destructed after user specified time,in addition the decryption key ll also get destructed.  We evaluate experimentally and analytically the functionality, security, and performance properties of SeDas, demonstrating that it is practical to use and meets the privacy-preserving goals described above. ', '1392889124_Enhancing_cloud_security_using_SeDas.docx', '2014-02-20', 'N.SWETHA', 'swethasai304@gmail.com', NULL, 'Dept. of IT', 'Adhiyaman College of Engineering', 'Hosur', 'Tamilnadu', 0, 'IN', 'Pending', NULL, 'NCRACE-2014 Conference', '1394818279_IJERSS1392889124.pdf', 1, 1, 'NCRACE-2014', 0, 0, 'Conference', 490, 0),
(89, 'IJERSS-1392977410', 'editor@ijerss.com', 'ENHANCED CELL-EDGE  PERFORMANCE WITH TRANSMIT   POWER-SHAPING AND MULTIPOINT,   MULTIFLOW TECHNIQUES', 'Research', 'Computer & Communication', 'We present a technique called Ã¢â‚¬Å“fuzzy cellsÃ¢â‚¬Â that builds on the multicarrier\r\n\r\nfeatures of Long Term Evolution-Advanced (LTE-A) and high-speed packet access \r\n\r\n(HSPA). Multiple carriers are aggregated to create a larger system bandwidth, \r\n\r\nand these carriers are transmitted at different powers by each sector antenna. This \r\n\r\ncreates a set of cell-edge locations that differ from one frequency to the next. \r\n\r\nSystem-level simulations are performed to estimate individual user and average \r\n\r\nthroughput for a hexagonal deployment of 3-sector base stations. For moderately \r\n\r\nhigh loads, a fuzzy cell deployment can improve tenth percentile (cell-edge) user \r\n\r\nthroughput by 100% and can improve average throughput by about 30% compared \r\n\r\nwith a reuse 1 scheme. Fuzzy cells reduce inter-cell interference in the same way \r\n\r\nas higher-order reuse schemes and allow users to access the full system bandwidth.', '1392977410_sivasankaran.doc', '2014-02-21', 'SIVASANKARAN.SK', 'Shivvaa.sk@gmail.com', NULL, 'NO:-3 GREEN GARDEN JAYALAKSHMI  NAGAR', 'NAGAR,KONDUR POST,', 'CUDDALORE', 'tamilnadu', 607006, 'IN', 'Pending', NULL, 'NCRACE-2014 Conference', '1394869830_IJERSS1392977410.pdf', 1, 1, 'NCRACE-2014', 0, 0, 'Conference', 423, 0),
(90, 'IJERSS-1392977615', 'editor@ijerss.com', 'BER ANALYSIS FOR Q-OFDMA  SPATIAL MULTIPLEXING  USING OSTBC AND SPATIAL MULTIPLEXING', 'Research', 'Computer & Communication', 'A Quadrature OFDM (Q-OFDMA) system has been recently\r\n\r\nproposed in the single-input single-output environment to reduce the \r\n\r\nhigh peak-to-average power ratio (PAPR), high complexity in user \r\n\r\nterminal and sensitivity to carrier frequency offset (CFO) problems \r\n\r\nin current orthogonal frequency division multiple access (OFDMA) \r\n\r\nsystems. Based on the relationship between frequency-domain signal \r\n\r\nand intermediate- domain, we propose an OSTBC encoded in the \r\n\r\nintermediate domain for Q-OFDMA systems to exploit the transmit\r\n\r\n- and receive- diversity. In contrast to extend spatial multiplexing\r\n\r\ntechniques, where the main objective is to provide higher bit rates\r\n\r\ncompared to a single-antenna system, spatial diversity techniques \r\n\r\npredominantly aim at an improved error performance. This is \r\n\r\naccomplished on the basis of a diversity gain and a coding gain. \r\n\r\nIndirectly, spatial diversity techniques can also be used to enhance bit \r\n\r\nrates, when employed in conjunction with an adaptive modulation/\r\n\r\nchannel coding scheme. In order to further improve the performance \r\n\r\nof space-time coded MIMO systems, the space-time encoder can be \r\n\r\nconcatenated with an outer channel encoder. This is of particular interest \r\n\r\nfor OSTBCs, which offer only a diversity gain, but no built-in coding \r\n\r\ngain.', '1392977615_suresh.doc', '2014-02-21', 'SURESH N', 'Suresh28369@yahoo.com', NULL, '44, S.N.H.ILLAM, RAM NAGAR,', 'KONDUR', 'CUDDALORE', 'Tamilnadu', 607006, 'IN', 'Pending', NULL, 'NCRACE-2014 Conference', '1394869921_IJERSS1392977615.pdf', 1, 1, 'NCRACE-2014', 0, 0, 'Conference', 559, 0),
(94, 'IJERSS-1393170663', 'editor@ijerss.com', 'EDAC FOR MEMORY PROTECTION IN ARM PROCESSOR', 'Research', 'ENGINEERING', 'The ARM processor core is a key component of many successful 32-bit embedded systems. Embedded systems often use multiple memory devices. The probability of having multiple errors is increased only when the size of memory increased. In order to maintain good level of reliability, it is necessary to protect memory cells from errors by protection codes. Error Detection And Correction (EDAC) codes plays a main role in memory protection and for reliability improvement.  So, in this paper, an error detection and correction method to protect the memory against the errors is proposed. HVD is high level error detection and correction method to protect against errors based on 4D parities checking for each row, column and diagonal in slash and black slash directions. It can correct up to 3 upsets in a data block but it can detect huge number of multiple faults in memories. It can improve the fault detection and correction coverage using parity codes which having low computation latency and implementation complexity.', '1393170663_ieee_EDAC_FOR_MEMORY_PROTECTION_IN_ARM_PROCESSOR.docx', '2014-02-23', 'Ms.Srija Nadendla', 'nadendlasrija.a4@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'NCRACE-2014', 0, 0, 'New', 0, 0),
(96, 'IJERSS-1393172836', 'editor@ijerss.com', 'EDAC FOR MEMORY PROTECTION IN ARM PROCESSOR', 'Research', 'ENGINEERING', 'The ARM processor core is a key component of many successful 32-bit embedded systems. Embedded systems often use multiple memory devices. The probability of having multiple errors is increased only when the size of memory increased. In order to maintain good level of reliability, it is necessary to protect memory cells from errors by protection codes. Error Detection And Correction (EDAC) codes plays a main role in memory protection and for reliability improvement.  So, in this paper, an error detection and correction method to protect the memory against the errors is proposed. HVD is high level error detection and correction method to protect against errors based on 4D parities checking for each row, column and diagonal in slash and black slash directions. It can correct up to 3 upsets in a data block but it can detect huge number of multiple faults in memories. It can improve the fault detection and correction coverage using parity codes which having low computation latency and implementation complexity.', '1393172836_ieee_EDAC_FOR_MEMORY_PROTECTION_IN_ARM_PROCESSOR.docx', '2014-02-23', 'MS.SRIJA NADENDLA,MRS. A. RUHAN BEVI', 'nadendlasrija.a4@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', NULL, 'NCRACE-2014 Conference', '1394818184_IJERSS1393172836.pdf', 1, 1, 'NCRACE-2014', 0, 0, 'Conference', 403, 0),
(97, 'IJERSS-1393173615', 'editor@ijerss.com', 'NEXT GENERATION AUTO THEFT PREVENTION OF A VEHICLE', 'Research', 'real time embedded systems', 'As vehicles become more sophisticated, vehicle security systems must be stronger than ever before. A modern vehicle utilizes remote keyless entry system and immobilizer system as the main weaponry against vehicle theft. Some of the problems we are facing in the existing auto theft prevention systems are there is no protection for the vehicle when the keyfob is stolen. So a smart keyfob sold in the market is not actually smart. Vehicle tracking devices will not be able to locate a vehicle in GPS denied environments such as within buildings, underground and dense city regions, resulting in the vehicle loss. Currently used motion and tilt alarms will alert the owner even for an unintentional touch by a passing person or an accidental hit by a ball from a playing child. There is no central user interface to configure and customize the vehicle security system.\r\nA next generation auto theft prevention system is designed by adding significant enhancements and modernizing the existing security features. The enhancements that are made to the exiting security system are Smart gravitational lock, Cryptographic keyless entry, Touch screen ignition, Adjustable motion alarm sensitivity, Ubiquitous vehicle tracking, Car finder, GPS fencing and Remote fuel cut-off.\r\nThis project proposes the development of two units i.e. a vehicle unit, which will be deployed in the vehicle and will act as a central user interface to the vehicle and a smart keyfob unit, which will be the remote keyless entry to unlock the vehicle. Both the vehicle unit and the smart keyfob unit are designed and implemented using LPC1313, a 32-bit ARM Cortexx-M3 microcontroller, the programming is done in embedded C and LPC Xpresso IDE is used to debug the programmed code and to dump the program into the microcontroller.', '1393173615_abstract.docx', '2014-02-23', 'M.K.TARUN', 'krishna.tarun12@gmail.com', NULL, 'no.5, perumal koil street', 'behind S.R.M college, potheri, kattankulathur', 'chennai', 'tamil nadu', 603203, 'IN', 'Pending', NULL, 'NCRACE-2014 Conference', '1394868724_IJERSS1393173615.pdf', 1, 1, 'NCRACE-2014', 0, 0, 'Conference', 1059, 0),
(98, 'IJERSS-1393232991', 'editor@ijerss.com', 'ENHANCING AOMDV ROUTING PROTOCOL BASED ON NEW ROUTING METRICS USING CROSS LAYER APPROACH', 'Research', 'Computer & Communication', 'In Ad Hoc networks, route failure may occur due to less received power, mobility, congestion and node failures. Many approaches have been proposed in literature to solve this problem, where a node predicts pre-emptively the route failure that occurs with the less received power. However, these approaches encounter some difficulties, especially in scenario without mobility where route failures may arise. In this paper, we propose an improvement of AOMDV protocol called LO-PPAOMDV (Link Quality and MAC-Overhead aware Predictive Preemptive AOMDV). This protocol is based on new metric combine two routing metrics (Link Quality, MAC Overhead) between each node and one hop neighbor. Also we propose a cross-layer networking mechanism to distinguish between both situations, failures due to congestion or mobility, and consequently avoiding unnecessary route repair process. The LO-PPAOMDV was implemented using NS-2. The simulation results demonstrate the merits of our proposed LO-PPAOMDV with approximately 10-15% increase in the packet delivery ratio while average end-to-end delay is reduced by 20%, and normalized routing load is reduced about 45%, also with 7% increase in the throughput, when compared with PPAOMDV.', '1393232991_V.VINOTH_KUMAR.docx', '2014-02-24', 'V.VINOTH KUMAR', 'vinoth.mtechit@gmail.com', NULL, 'Department of IT', 'Sri Balaji Chockalingam Engg., College, Irumbedu', 'Arni', 'Tamilnadu', 632317, 'IN', 'Pending', NULL, 'NCRACE-2014 Conference', '1397144681_IJERSS1393232991.pdf', 1, 1, 'NCRACE-2014', 0, 0, 'Conference', 387, 0),
(99, 'IJERSS-1393233231', 'editor@ijerss.com', 'Video-Based Fire Alert Using Surveillance camera', 'Research', 'Computer & Communication', 'This paper proposes a method to detect the fire using video based detection technology. This detection technology becomes the focal point of research with the advantages of high speed and anti-jamming capability. The computational-based fire detection is based on vision has drawn significant attention in the past years with camera surveillance systems. The key idea to detect the fire is based on color and motion information, computed from video sequences. This approach is based on creating a Gaussian-flattened color histogram to detect the fire-colored pixels, and then these fire-colored pixels are examined using temporal variation to detect which of these pixels are actually fire pixels. Finally support vector machine classifier is used to separate fired and non-fired images. The proposed method can work in a variety of conditions, and that it can automatically determine when it has insufficient information.', '1393233231_Shamini_sbc.docx', '2014-02-24', 'J.Shamini', 'shaminijames@gmail.com', NULL, 'Dept. of ECE, M.E', 'GTEC, Kaniyambadi', 'Vellore', 'tamilnadu', 0, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'NCRACE-2014', 0, 0, 'New', 0, 0),
(100, 'IJERSS-1393233438', 'editor@ijerss.com', 'BEE COLONY OPTIMIZATION FOR SELECTIVE HARMONIC ELIMINATION PWM IN MULTILEVEL INVERTERS', 'Research', 'Computer & Communication', 'Multilevel inverter is one of the most popular inverter in power electronics. In this paper multilevel inverter with Bee algorithm is introduced for solving the nonlinear equations by determining optimum switching angles in 7 level cascaded multilevel inverter. The algorithm is based on the food foraging behavior of a swarm of a honeybees and it may performs a neighborhood search combined with a random search. The main objective is to eliminate the lower order harmonics using selective harmonic elimination pulse width modulationstrategy(SHEPWM) and theirby the total harmonic distortion(THD) is mitigated by obtaining optimum switching angles. The efficiency is enhanced significantly and has higher precision when compared to genetic algorithm(GA). Simulation work is carried out by using the MATLAB software which validates the proposed method and finally THD comparison is presented for analysis.', '1393233438_prathima.docx', '2014-02-24', 'V.PRATHIMA', 'prathimavignesh.17@gmail.com', NULL, 'Adhiparasakthi College of Engg.,', 'GB Nagar , Kalavai', 'Vellore', 'tamilnadu', 0, 'IN', 'Pending', NULL, 'NCRACE-2014 Conference', '1394868433_IJERSS1393233438.pdf', 1, 1, 'NCRACE-2014', 0, 0, 'Conference', 652, 0),
(101, 'IJERSS-1393233917', 'editor@ijerss.com', 'DriverÃ¢â‚¬â„¢s fatigue detection based on eye tracking and pressure sensing ', 'Research', 'Computer & Communication', 'The main idea behind this project is to develop a nonintrusive system which can detect fatigue of the driver and checks whether driver consumed alcohol and issue a timely warning. Since a large number of road accidents occur due to the driver drowsiness, over speed and also by drunk and drive. Hence this system will be helpful in preventing many accidents, and consequently save money and reduce personal suffering. This system will makes sure that the driver did not consumed alcohol, then monitor the driverÃ¢â‚¬â„¢s eyes using eye blink sensor and by developing an algorithm we can detect symptoms of driver fatigue early enough to avoid accident. So this project will be helpful in detecting driver fatigue in advance and will gave warning output in form of sound and notification. Moreover the warning will be deactivated manually rather than automatically. So for this purpose a deactivation switch will be used to deactivate warning.', '1393233917_nivetha_B.E_GTEC.docx', '2014-02-24', 'M.NIVETHA', 'nive.mathi@gmail.com', NULL, 'Dept. of ECE', 'GTEC, Kaniyambadi', 'Vellore', 'tamilnadu', 0, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'NCRACE-2014', 0, 0, 'New', 0, 0),
(103, 'IJERSS-1393238835', 'editor@ijerss.com', 'Multi-split-row Threshold Method for Low-Complexity Message-Passing Algorithm in LDPC Decoders', 'Research', 'Computer & Communication', 'A low-complexity message-passing algorithm, called Split-Row Threshold, is used to implement low-density parity-check code which is a linear error correcting code, a method of transmitting a message over a noisy transmission channel, and is constructed using a sparse bipartite graph. Five LDPC decoders that are compatible with the 10GBASE-T standard are implemented using MinSum Normalized and MinSum Split-Row Threshold algorithms. The noise threshold defines an upper bound for the channel noise, up to which the probability of lost information can be made as small as desired. To avoid congestion at receiver end to design Low-Complexity Message- Passing Algorithm that avoids bottlenecking to make decoding faster. An spn = 16 decoder achieves improvements in area, throughput, and energy efficiency of 4.1 times, 3.3 times, and 4.8 times, respectively, compared to a MinSum Normalized implementation. Spn = 16 decoder in 65-nm CMOS operatesnat 195 MHz at 1.3 V with an average throughput of 92.8 Gbits/s with early termination enabled. Low-power operation at 0.7 V gives a worst case throughput of 6.5 Gbits/sÃ¢â‚¬â€just above the 10GBASE-T requirementÃ¢â‚¬â€and an estimated average power of 62 mW, resulting in 9.5 pJ/bit. To overcome this disadvantage of  we replace a FIFO to enhance processing speed of the Message-Passing Algorithm.', '1393238835_gnana_kamban.docx', '2014-02-24', 'S. Gnanamurugan', 'sgmphenom@gmail.com', NULL, 'Dept of ECE', 'Arunai College of Engineering', 'Tiruvannamalai', 'tamilnadu', 0, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'NCRACE-2014', 0, 0, 'New', 0, 0),
(104, 'IJERSS-1393239415', 'editor@ijerss.com', 'ON CHIP DATA ENCODING FOR LOW POWER DISSIPATION', 'Research', 'Computer & Communication', 'VLSI circuit design consuming low power become necessary for present technologies .one way of reducing dynamic power consumption in a CMOS circuit is to reduce the number of switching activity. In fact, self-switching and coupling switching activity is responsible for link power dissipation. The aim of low power data encoder is to transmit the data on the bus with reduced switching activity. In this paper the improved form of bus invert coding is implemented which is based on odd line and even line invert condition. Odd and even line condition is used to minimize the unwanted transitions on the data path which provides better results in terms of power dissipation and switching activity when compared to traditional bus invert method', '1393239415_Gowthami.docx', '2014-02-24', 'N.Gowthami', 'gowthamiz.nagaraj@gmail.com', NULL, 'No.8,Govindarajan street', 'Gopalapuram,Gandhinagar,', 'V', 'tamilnadu', 0, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'NCRACE-2014', 0, 0, 'New', 0, 0),
(105, 'IJERSS-1393239897', 'editor@ijerss.com', 'Design of Microstrip UWB Antenna for Wireless Application ', 'Research', 'Computer & Communication', 'A planar  ultrawideband (UWB) antenna with  notched band is proposed and to be investigated.It consists of square patch and a grounded plane.The notched band characteristics are analysed using T-shaped stub embedded in the square slot of the radiation patch and a pair of U-shaped parasitic strips beside the feed line.The results that are to be measured using the proposed notched-band planar antenna is the rejection of the bands, 3.3-4.0 GHz (WiMAX) and 5.05-5.90GHz (WLAN),5.5GHz (DSRC),6.1-9.5 GHz (FIXED WIRELSS AND  RADIO LOCATION) respectively.And to offer dedicated service for fixed satellite regions (3.9-5.05 GHz) .Both the experimental and simulated results of the proposed antenna are to be analysed indicating that the antenna is attracted for various UWB applications. ', '1393239897_nivitha.docx', '2014-02-24', 'D.Nivitha ', 'nivithadayalan@gmail.com', NULL, 'No.391,Saraswathi street,', 'Gandhi Nagar East', 'vellore', 'tamilnadu', 0, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'NCRACE-2014', 0, 0, 'New', 0, 0),
(106, 'IJERSS-1393248535', 'editor@ijerss.com', 'ANALYSIS OF MIMO-OFDM SYSTEM FOR  ULTRA WIDE BAND (UWB) COMMUNICATIONS', 'Research', 'Research Scholar', 'Multiple-input multiple-output (MIMO) systems hold the potential to drastically improve the Spectral efficiency and link reliability in future Wireless communications systems. The Multi Input Multi Output (MIMO) Orthogonal Frequency Division Multiplexing (OFDM) based Ultra-Wideband (UWB) systems are set to revolutionize consumer electronics, in the near future. With low power consumption, high data rates up to 480 Mbps, large spatial capacity and low interference with other wireless services due to low power spectral density, MIMO-OFDM based UWB systems are the most sought after for wireless communications. The application targeted by this design was the band 1 of Ã¢â‚¬ËœBand group 1Ã¢â‚¬â„¢ based UWB system with a center frequency of 3.432 GHz and a bandwidth of 528 MHz\r\n', '1393248535_gom.docx', '2014-02-24', 'N.GOMATHI', 'gomathynataraj@gmail.com', NULL, 'Sree Sastha Institute of Engineering and Technolog', 'chennai', 'chennai', 'Tamilnadu', 632002, 'IN', 'Pending', NULL, 'NCRACE-2014 Conference', '1394868937_IJERSS1393248535.pdf', 1, 1, 'NCRACE-2014', 0, 0, 'Conference', 934, 0),
(107, 'IJERSS-1393249504', 'editor@ijerss.com', 'AN EFFICIENT ROUTING ALGORITHM FOR MANET', 'Research', 'Research Scholar', 'Ad hoc networks are non-infrastructure networks consisting of mobile nodes. Battery power being limited, extending the lifetime of batteries is an important issue, especially for Mobile Ad Hoc Networks (MANETs). To reduce the energy consumption in mobile devices, there have been efforts in physical and data link layers as well as in the network layer related to the routing protocol. Mobile ad hoc network (MANET) is an autonomous system of mobile nodes connected by wireless links. Each node operates not only as an end system, but also as a router to forward packets. The nodes are free to move about and organize themselves into a network. These nodes change position frequently. The power-aware routing protocols should consider energy consumption from the viewpoints of both, the network and the node level. From the network point of view, the best route is one that minimizes the total transmission power. On the other hand, from the viewpoint of a node, it is one that avoids the nodes with lower power. Minimizing the total energy consumption tends to favour minimum hop (min-hop) routes. Our proposed a novel on-demand power aware routing algorithm, DEEAR (Distributed Energy efficient AODV Routing) protocol. By using DEEAR also improves network throughput as well as improvement in data packet delivery ratio.', '1393249504_sncet.pdf', '2014-02-24', 'N.SELVAKUMAR', 'selsudh@gmail.com', NULL, 'Sri Nandhanam College of Engineering and Technolog', 'Tirupattur', 'VELLORE', 'Tamilnadu', 632002, 'IN', 'Pending', NULL, 'NCRACE-2014 Conference', '1394868842_IJERSS1393249504.pdf', 1, 1, 'NCRACE-2014', 0, 0, 'Conference', 1043, 0),
(108, 'IJERSS-1393249701', 'editor@ijerss.com', 'PREVENTION OF DEADLOCK USING DMP IN WSN', 'Research', 'PG Scholar', 'Scheduling different types of packets, at sensor nodes with resource constraints in Wireless Sensor Networks (WSN) is to reduce sensorsÃ¢â‚¬â„¢ energy consumptions and end to end data transmission delays. Most of the existing packet scheduling mechanism of WSN use First Come First Serve (FCFS), non-preemptive priority and preemptive priority scheduling algorithm. These algorithms incur a high processing overhead and long end to end data transmission delay. Dynamic Multilevel Priority (DMP) packet scheduling scheme is introduced to reduce end to end data transmission delay. It includes three levels of priority queues. Real time, Non-real time remote data packet received from lower level nodes, Non-real time data traffic with same priority. The leaf nodes donÃ¢â‚¬â„¢t receive data from other nodes thus it reduces end to end delay. The result of this paper is conventional schemes in terms of average data waiting time and end to end delay. ', '1393249701_preethi_gtec.doc', '2014-02-24', 'R. PREETHI', 'pree.2903@gmail.com', NULL, 'Ganadipathy TulsiÃ¢â‚¬â„¢s Jain Engineering college', 'kaniyambadi,vellore', 'VELLORE', 'Tamilnadu', 632102, 'IN', 'Pending', NULL, 'NCRACE-2014 Conference', '1394869015_IJERSS1393249701.pdf', 1, 1, 'NCRACE-2014', 0, 0, 'Conference', 553, 0),
(109, 'IJERSS-1393249973', 'editor@ijerss.com', 'ENERGY LOAD BALANCED CLUSTERED NETWORKS INCREASES CONNECTIVITY OF WIRELESS NETWORKS', 'Research', 'PG Scholar', 'Connectivity is a basic concern in designing and implementing the wireless networks, which is also a key factor in reducing the packet delay. In this project we are going to deal with mobile adhoc wireless networks. Most common method used for enhancing the connectivity in adhoc networks is a cluster based technique. General cluster algorithms select the stationary node as its cluster head without considering the fact that the each node in mobile adhoc wireless network runs on battery power. It produces an energy imbalance with in the wireless network. So we propose an energy load balanced clustered networks in order to increase the connectivity of wireless networks. Our cluster head selection method considers the     energy level along with the mobility pattern of each node for increasing the connectivity of wireless nodes.\r\n \r\n', '1393249973_sangeetha_gtec.doc', '2014-02-24', 'V.SANGEETHA                                                               ', 'sngth.sangeetha@gmail.com         ', NULL, 'Ganadipathy TulsiÃ¢â‚¬â„¢s Jain Engineering college', 'kaniyambadi,vellore', 'VELLORE', 'Tamilnadu', 632102, 'IN', 'Pending', NULL, 'NCRACE-2014 Conference', '1394869118_IJERSS1393249973.pdf', 1, 1, 'NCRACE-2014', 0, 0, 'Conference', 371, 0),
(110, 'IJERSS-1393250789', 'editor@ijerss.com', 'PERFORMANCE ANALYSIS ON TECHNIQUES IN IMAGE SUPER RESOLUTION', 'Research', 'Research Scholar', 'In this paper, we study and represent various techniques of image super resolution (SR). Super resolution        reconstruction produces high resolution image from sequence of low resolution images. Super-resolution (SR) aims to increase the spatial resolution of images from a single low resolution (LR) images. Super resolution is a technique where there is a availability of multiple LR images captured from the same scene. It is an algorithm to reconstruct HR images from the under sampled LR images. The main aim of super resolution is to improve visual quality of available low resolution image. This paper focuses on interpolation based; reconstruction based and learning based super-resolution methods. We presented various existing super resolution techniques, advantages, disadvantages and the recent works and methods of SR reconstruction.', '1393250789_SKP_stud.doc', '2014-02-24', 'M.APPADURAI', 'appaduraibe@gmail.com', NULL, 'SKP ENGINEERING COLLEGE                           ', 'TIRUVANNAMALAI', 'TIRUVANNAMALAI', 'Tamilnadu', 632002, 'IN', 'Pending', NULL, 'NCRACE-2014 Conference', '1394869416_IJERSS1393250789.pdf', 1, 1, 'NCRACE-2014', 0, 0, 'Conference', 462, 0),
(112, 'IJERSS-1393326479', 'editor@ijerss.com', 'MODELING OF 2DEG SHEET CARRIER DENSITY, DC CHARACTERIZATION AND FREQUENCY ANALYSIS OF  InxAl1-xN/InAlN/GaN-BASED HEMTs.', 'Review', 'Conference paper', 'In this paper, 2-D physics based model for two-dimensional electron gas (2DEG) Sheet Carrier density ns and DC characteristic of the proposed spacer layer based InxAl1-xN/InAlN/GaN High Electron Mobility Transistors (HEMTs) is modeled by considering the triangular quantum well. To obtain Charge density ns, the variation of Fermi level with supply voltage and the formation of Energy Sub-bands E0, E1 is considered. The obtained results are simple and easy to analyze the sheet Charge density, DC characteristics model for spacer layer based InxAl1-xN/InAlN/GaN HEMT power devices. Due to large two-dimensional electron gas (2DEG) Sheet carrier density and high velocity, the maximal drain current density achieved is very high. The transconductance and frequency also analysed. All results are calibrated and verified with experimental data. This work presents a model to forecast the simplified sheet carrier density, drain current performance and this model show excellent agreement with experimental data that proves the validity of our model.', '1393326479_Conference.docx', '2014-02-25', 'M.Arthi', 'arthi2502@gmail.com', NULL, '129-B,Krishnagiri Main Road,Singarapettai Post', 'Uthangarai Taluk', 'Krishnagiri', 'Tamilnadu', 635307, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'NCRACE-2014', 0, 0, 'New', 0, 0),
(113, 'IJERSS-1393326595', 'editor@ijerss.com', 'An Analytical Physics Based Model For Dual Channel HEMT', 'Review', 'Conference Paper', 'The high electron mobility transistors (HEMTÃ¢â‚¬â„¢s) in general and InAlN/GaN/InAlN  dualheterojunction high electron mobility transistors (DHHEMT) specifically have been studied in this paper.These devices show superior characteristics over other types of FETÃ¢â‚¬â„¢s for high frequency microwave power applications. The structure of a heterojunction have been discussed. Several models have been reviewed for calculating the density of charge in the dual 2-dimensional electron gas (2DEG) channels present in DH-HEMT  GaN layer, which leads to the device current-voltage characteristics. To obtain Charge density ns, the variation of Fermi level with supply voltage and the formation of Energy Sub-bands E0, E1 is considered. The obtained results are simple and easy to analyze the sheet Charge density, DC characteristics model for spacer layer based InxAl1-xN//GaN/InAlN  HEMT power devices. An InAlN/GaN/InAlN  DH-HEMT has been designed based on the theories provided in earlier sections with describing several steps taken to optimize its performance and simulations showing the effects of various design parametrers.', '1393326595_dual_channel.docx', '2014-02-25', 'A.M.Sabeena', 'sabe30ece@gmail.com', NULL, 'No:214, Palli Vasal St.,T.Velur Vill.,Thanipadi Po', 'Thandarampattu Tk., Tiruvannamalai Dt-606708', 'Tiruvannamalai', 'Tamil Nadu', 606708, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'NCRACE-2014', 0, 0, 'New', 0, 0),
(114, 'IJERSS-1393326829', 'editor@ijerss.com', 'analytical large signalmodel for graphene based transistor', 'Review', 'graphene', 'We propose a semi-empirical graphene field-effect transistor (G-FET) model for analysis and design of G-FET-based circuits. The model describes the currentÃ¢â‚¬â€œvoltage characteristic for a G-FET over a wide range of operating conditions. The gate bias dependence of the output power spectrum is studied and compared with the simulated values. Good agreement between the simulated and the experimental power spectrums up to the third harmonic is demonstrated, which confirms the model validity. Moreover, S-parameter measurements essentially coincide with the results obtained from the simulation. The model contains a small set of fitting parameters, which can be straightforwardly extracted from  S-parameters and dc measurements. The developed extraction method gives a more accurate estimation of the drain and source contact resistances compared with other approaches. As a design example, we use a harmonic balance load-pull approach to extract optimum embedding impedance values for a subharmonic G-FET mixer.  ', '1393326829_kalai_paper.docx', '2014-02-25', 'RA.S.KALAI SELVI', 'kalaiselviece07@gmail.com', NULL, 'mullai nagar last street', 'gingee', 'gingee', 'tamilnadu', 604202, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'NCRACE-2014', 0, 0, 'New', 0, 0),
(116, 'IJERSS-1393332770', 'editor@ijerss.com', 'ADVANCED DRIVER SAFETY AWARENESS AND ASSISTANCE SYSTEM FOR COGNITIVE VEHICLE CONTROL', 'Research', 'real time embedded systems', 'Nowadays, safety has become one of the most important attributes of a vehicle. A modern vehicle has a plethora of active driver assistance systems such as cruise control, collision avoidance, automatic parking and stability control. These systems are heavily focused on vehicular control aspect. But experimental and real-world study shows the root cause of majority of accidents can be tracked back to the behavior of the one who drives the vehicle, the driver himself.\r\nPresently, automotive manufacturers develop more active safety features to avoid car accidents, it is equally important to develop cost-effective technological solutions that can accurately identify the driving behavior of drivers and to assist them. Many automotive companies have created driver monitoring systems previously. Most of them will check and alert a driver who is falling asleep using camera based eye blink sensing technology. But this is a very narrow situation because It does not provide mobile phone usage while driving, It does not identify driver fatigue condition, No knowledge of whether a driver is drunken alcohol or not, No way to identify if a collision is about to happen or not.\r\nAdvanced driver safety awareness and assistance system for cognitive vehicle control is designed that will monitor the driver and command the vehicle to take those vital safety measures. The project features the following modules Mobile Baseband Monitor, Hands Free Auto Reply SMS, Driver Fatigue Warning, Drunken Drive Prevention, Collision Presafe Activation, GPS and GSM Based Accident/Panic Alert.\r\n', '1393332770_abstract.docx', '2014-02-25', 'sadam mahesh', 'mahisidhu90@gmail.com', NULL, 'plot no.: 8b, jini builders', 'sarojini street, karthick nagar, gudvancherry', 'chennai', 'tamil nadu', 603202, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'NCRACE-2014', 0, 0, 'New', 0, 0),
(117, 'IJERSS-1393388001', 'editor@ijerss.com', 'Wireless Sensors Network for Continuous Monitoring ECG Signals Using ZIGBEE', 'Research', 'Computer & Communication', 'In this paper provides the design of a remote Medical Monitoring system uses Zigbee technology and wireless sensor network structure to monitor patient continuously with chronic diseases in their own homes. The Monitoring system using several sensors can detect the patientÃ¢â‚¬â„¢s real-time body temperature, heart rate, respiratory rate and other Physiological informationÃ¢â‚¬â„¢s, and transmit them to the control center present at the hospital. The system consists of an electronic device which is worn on the wrist, finger and abdomen by an at-risk person. The transmitter section consists of an heart rate sensor, temperature sensor, pressure sensor, pulse oximeter, PIC microcontroller and zigbee  transceiver, ordinarily placed on the patient. The receiver section consists of PIC microcontroller , zigbee receiver, PC and buzzer where data is collected and vital signals are calculated for displaying and subsequent clinical interpretation. The device detects if a person is medically distressed and sends an alarm to a receiver unit that is connected to a computer. At the same time message is also being send to the doctor\\''s mobile for the immediate treatment to be given. The device is battery powered for use outdoors. The device can be easily adapted to monitor athletes and infants. ', '1393388001_Haripaper.docx', '2014-02-26', 'S.Hariprasad ', 'hariece90@gmail.com', NULL, 'Dept. of ECE', 'Ranipettai Engineering College, Walaja', 'Vellore', 'Tamilnadu', 0, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'NCRACE-2014', 0, 0, 'New', 0, 0),
(118, 'IJERSS-1393388193', 'editor@ijerss.com', 'LOW FREQUENCY NOISE ANALYSISIN TWIN SILICON NANOWIRE TRANSISTORS', 'Research', 'Computer & Communication', 'Because of its ability to effectively suppress off-leakage current with its gate-around configuration, the Si nanowire FET is considered to be the ultimate structure for ultra-small CMOS devices to the extent that the devices would be approaching their downsized limits. Recently, several experimental studies of Si nanowire FETs with on-currents much larger than those of planar MOSFETs have been published. Consequently, Si nanowire FETs are now gaining significant attention as the most promising candidate for mainstream CMOS devices in the 2020s. In this paper, the Low-frequency noise (LFN) in n-type silicon nanowire MOSFETs (SNWTs) is investigated for various gate lengths and various material for improving drain current and reducing short channel effects.As a result, design optimizations to reduce the impact of parasitic resistance in SNWTs are necessary for analog/RF applications.', '1393388193_revathi.docx', '2014-02-26', 'K.Revathi', 'revathi.kece@gmail.com', NULL, 'Dept. of .ECE', 'SKP Engineering College', 'Tiruvannamalai', 'tamilnadu', 0, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'NCRACE-2014', 0, 0, 'New', 0, 0);
INSERT INTO `papers` (`id`, `paper_id`, `paper_referral`, `paper_title`, `paper_type`, `subject_category`, `abstract`, `paper_attachment`, `uploaded_on`, `author`, `email`, `pnumber`, `address_line1`, `address_line2`, `city`, `state`, `pincode`, `country`, `status`, `comments`, `subject`, `pdf`, `active`, `news`, `conference`, `volume`, `issue`, `volume_issue_title`, `downloads`, `blogspot`) VALUES
(119, 'IJERSS-1393388856', 'editor@ijerss.com', 'CANBIS IN AUTOMOBILES', 'Research', 'Computer & Communication', 'There are so many ways in which we can send a message by using different protocols. But here we are going to implement our project using CAN protocol. CAN bus (for controller area network) is a vehicle bus standard designed to allow microcontrollers and devices to communicate with each other within a vehicle without a host computer. The goal was to make automobiles more reliable, safe and fuel-efficient while decreasing wiring harness weight and complexity. Here we are using numerous micro controller based devices which are connected to stand alone CAN transceivers which are intern connected using CAN bus for atomization of automotive electronics.\r\n\r\n        In this project we have four sensors in which two sensors are analog (The Generic Analog Sensor service support analog sensors that measure continuous information). And two sensors are digital (digital sensors which use discrete (discontinuous) values to represent information for input). If there is any change in the PID values of any sensors then it is sent to the LPC 2129 controller through the sensor channel. From the LPC 2129 controller it is transmitted to the next LPC 2129 controller through the CAN bus the change in the PID values is shown in the LCD display which is digital and is also denoted through a buzzer. Now the value is sent to the GSM through the UART \r\n', '1393388856_saranya_rec.doc', '2014-02-26', 'M.Saranya', 'm.saranya012@gmail.com', NULL, 'PG Scholar, Dept of ECE', 'Ranipettai engineering College', 'Walaja', 'tamilnadu', 0, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'NCRACE-2014', 0, 0, 'New', 0, 0),
(120, 'IJERSS-1393389562', 'editor@ijerss.com', 'Wireless Sensors Network for Continuous Monitoring ECG Signals Using ZIGBEE', 'Research', 'Computer & Communication', 'In this paper provides the design of a remote Medical Monitoring system uses Zigbee technology and wireless sensor network structure to monitor patient continuously with chronic diseases in their own homes. The Monitoring system using several sensors can detect the patientÃ¢â‚¬â„¢s real-time body temperature, heart rate, respiratory rate and other Physiological informationÃ¢â‚¬â„¢s, and transmit them to the control center present at the hospital. The system consists of an electronic device which is worn on the wrist, finger and abdomen by an at-risk person. The transmitter section consists of an heart rate sensor, temperature sensor, pressure sensor, pulse oximeter, PIC microcontroller and zigbee  transceiver, ordinarily placed on the patient. The receiver section consists of PIC microcontroller , zigbee receiver, PC and buzzer where data is collected and vital signals are calculated for displaying and subsequent clinical interpretation. The device detects if a person is medically distressed and sends an alarm to a receiver unit that is connected to a computer. At the same time message is also being send to the doctor\\''s mobile for the immediate treatment to be given. The device is battery powered for use outdoors. The device can be easily adapted to monitor athletes and infants. ', '1393389562_Haripaper.docx', '2014-02-26', 'S.Hariprasad ', 'hariece90@gmail.com', NULL, 'PG Scholar, Dept of ECE, ', 'Ranipettai Engineering College', 'Walaja, Vellore', 'Tamilnadu', 0, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'NCRACE-2014', 0, 0, 'New', 0, 0),
(121, 'IJERSS-1393390240', 'editor@ijerss.com', 'SIMULATION OF 2DEG SHEET CARRIER DENSITY AND CHARACTERIZATION OF InxAl1-xN/InAlN/GaN-BASED HEMTs', 'Review', 'Conference paper', 'In this paper,am going to analyse and simulate  the sheet carrrier density and dc characterization of InAlN/InAlN/GaN HEMT devices.', '1393390240_Palani_Conference_Paper.docx', '2014-02-26', 'P.Palani', 'post2palani@gmail.com', NULL, '32-paygopuram,8th street', 'Thiruvannalamalai', '', 'Tamilnadu', 606601, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'NCRACE-2014', 0, 0, 'New', 0, 0),
(122, 'IJERSS-1393391262', 'editor@ijerss.com', 'AN ANALYTICAL  COMPACT MODELING OF GRAPHENE TRANSISTOR BY USING TRAP MODEL', 'Review', 'Conference paper', 'In this paper going to converse about exiciting semi metal Graphene. An analytical   appropriate  model  for graphene FET device is proposed. At initial stage MericÃ¢â‚¬â„¢s compact model had been used by showing trap model where the equivalent circuit is evaluated. We show that traps have an effect on the transconductance  and  proceeds spontaneously the whole design. on an advanced GFET  by having a transit frequency of about 10 GHz the model has been Verified  by comparing to DC and AC measurements versus bias  frequency.  An  LNA has been designed and despite the poor voltage gain of the GFET, the LNA shows interesting performances when input and output matching of the circuit is performed .A power gain of |S21| = 4.2 dB is obtained, the reverse isolation is about |S12| = -10.6 dB, the Rollet stability factor K is 1.25 and the noise figure is 3.9 dB at 800 MHz.', '1393391262_jose.docx', '2014-02-26', 'D.Jose stalin', 'sarastalin10@gmail.com', NULL, '332 church street,eleyaganny village', 'thandrampattu taluk', 'thiruvannamalai', 'Tamilnadu', 606753, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'NCRACE-2014', 0, 0, 'New', 0, 0),
(123, 'IJERSS-1393402274', 'editor@ijerss.com', 'A WIND SOLAR HYBRID SYSTEM USING SOLID STATE TRANSFORMER (SST) FOR REACTIVE POWER COMPENSATION', 'Research', 'Renewable Energy', 'This paper presents a wind Ã¢â‚¬â€œ solar hybrid system using Solid State Transformer (SST) for reactive power compensation. The proposed hybrid system using SST can effectively suppress the voltage fluctuation. This work deals with the holistic modeling approach of a combined Photovoltaic and Wind power system. The controller design has to be done with fuzzy and sliding mode controller along with SST. This approach enables the design and implementation of efficient controllers for Distributed Energy Resource (DER) hybrid systems. The simulation of proposed work is carried out using MATLAB', '1393402274_gopi.doc', '2014-02-26', 'M.GOPINATH1S', 'shadrach.gopi@gmail.com', NULL, 'Department of EEE', 'Arunai Engineering College', 'Tiruvannamalai', 'Tamilnadu', 0, 'IN', 'Pending', NULL, 'NCRACE-2014 Conference', '1394869574_IJERSS1393402274.pdf', 1, 1, 'NCRACE-2014', 0, 0, 'Conference', 1631, 0),
(124, 'IJERSS-1393403129', 'editor@ijerss.com', 'Power Management for Throughput Enhancement in Wireless Ad-Hoc Networks', 'Research', 'PG scholar', 'In this paper we introduce the notion of power management within the context of wireless ad-hoc networks. More specifically, we investigate the effects of using differ- ent transmit powers on the average power consumption and end-to-end network throughput in a wireless ad-hoc envi- ronment. This power management approach would help in reducing the system power consumption and hence pro- longing the battery life of mobile nodes. Furthermore, it improves the end-to-end network throughput as compared to other ad-hoc networks in which all mobile nodes use the same transmit power. The improvement is due to the achievement of a tradeoff between minimizing interference ranges, reduction in the average number of hops to reach a destination, the probability of having isolated clusters, and the average number of transmissions (including retransmis- sions due to collisions). The protocols would first dynami- cally determine an optimal connectivity range wherein they adapt their transmit powers so as to only reach a subset of the nodes in the network. The connectivity range would then be dynamically changed in a distributed manner so as to achieve the near optimal throughput. Minimal power routing is used to further enhance performance. Simula- tion studies are carried out in order to investigate these de- sign approaches. It is seen a network with such a power managed scheme would achieve a better throughput perfor- mance and lower transmit power than a network without such a scheme.', '1393403129_power_management.pdf', '2014-02-26', 'R.Ramya', 'ramyehaece@gmail.com', NULL, 'Arulmigu Meenakshi Amman College of Engineering', 'kanchipuram', 'vellore', 'Tamilnadu', 632001, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'NCRACE-2014', 0, 0, 'New', 0, 0),
(125, 'IJERSS-1393404818', 'editor@ijerss.com', 'Contrast Enhancement Based Forensics in Digital Images', 'Others', 'UG student', 'As a retouching manipulation, contrast enhancement\r\nis typically used to adjust the global brightness and contrast\r\nof digital images. Malicious users may also perform contrast enhancement\r\nlocally for creating a realistic composite image. As\r\nsuch it is significant to detect contrast enhancement blindly for\r\nverifying the originality and authenticity of digital images. In this\r\npaper, we propose two novel algorithms to detect the contrast\r\nenhancement involved manipulations in digital images. First, we\r\nfocus on the detection of global contrast enhancement applied to\r\nthe previously JPEG-compressed images, which are widespread\r\nin real applications. The histogram peak/gap artifacts incurred\r\nby JPEG compression and pixel value mappings are analyzed theoretically,\r\nand distinguished by identifying the zero-height gap\r\nfingerprints. Second, we propose to identify the composite image\r\ncreated by enforcing contrast adjustment on either single or both\r\nsource regions. The positions of detected blockwise peak/gap bins\r\nare clustered for recognizing the contrast enhancement mappings\r\napplied to different source regions. The consistency between\r\nregional artifacts is checked for discovering image forgeries and\r\nlocating the composition boundary. Extensive experiments have\r\nverified the effectiveness and efficacy of the proposed techniques', '1393404818_surya_ug_edited_(2).pdf', '2014-02-26', 'K.Surya', 'suriyabe1993@gmail.com', NULL, 'Ganadipathy Tulsi\\''s Jain Engg College', 'kaniyambadi', 'vellore', 'Tamilnadu', 632102, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'NCRACE-2014', 0, 0, 'New', 0, 0),
(126, 'IJERSS-1393405770', 'editor@ijerss.com', 'Review of Image Restoration Techniques for Remote Sensing Images', 'Research', 'Research scholar', 'In the imaging process of the remote sensing ,there was degradation phenomenon in the acquired images. In order to reduce the image blur caused by the degradation, the remote sensing images were restored to give prominence to the characteristic objects in the images.the images were restored. IMAGE restoration is an important issue in high-level image processing..The purpose of image restoration is to estimate the original image from the degraded data. It is widely used in various fields of applications, such as medical imaging, astronomical imaging, remote sensing, microscopy imaging, photography deblurring, and forensic science, etc. Restoration is beneficial to interpreting and analyzing the remote sensing images. After restoration, the blur phenomenon of the images is reduced. The characters are highlighted, and the visual effect of the images is clearer. In this paper different image restoration techniques like Richardson-Lucy algorithm, Wiener filter, Neural Network,Blind Deconvolution', '1393405770_AMAZE_staff.pdf', '2014-02-26', 'M. Sanjeevi', 'sanjeevisan@gmail.com', NULL, 'Arulmigu Meenakshi Amman College of Engineering', 'Vadamavandal', 'chennai', 'Tamilnadu', 632001, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'NCRACE-2014', 0, 0, 'New', 0, 0),
(128, 'IJERSS-1393411159', 'editor@ijerss.com', 'PROBABILISTIC REBROADCAST BASED ON NEIGHBOR COVERAGE IN MANETS', 'Research', 'ENGINEERING', 'Each node in mobile ad hoc networks (MANETs) is free to move independently in any direction. This movement of nodes leads to path failures and route discoveries. Broadcasting is a well known mechan1sm to discover the route and it causes broadcast storm problem. The broadcast storm problem performs too many rebroadcasting and also increases routing overhead in MANETs. Another problem is sometimes while discovering the route to the destination, the intermediary node losses its energy because of its less battery life time so that the intermediary node cannot forward the route reply on reverse path i.e. the reverse path forwarding of broadcast packets can be lost. This results rebroadcast, less packet delivery ratio and more end to end delay. To overcome the above mentioned problems, a neighbor coverage based probabilistic rebroadcast protocol is used for reducing routing overhead and broadcast storm problem. The Energy Optimal AODV routing protocol is used for reverse path forwarding of broadcast packets without any loss. Our approach reduces the number of retransmission so as to reduce the routing overhead, energy efficiency and can also improve the routing performance.', '1393411159_Monisha_V.docx', '2014-02-26', 'V.MON1SHA,D.DURAI KUMAR', 'moni_shaslv@yahoo.com', NULL, '', '', '', '', 0, 'IN', 'Pending', NULL, 'NCRACE-2014 Conference', '1394869754_IJERSS1393411159.pdf', 1, 1, 'NCRACE-2014', 0, 0, 'Conference', 503, 0),
(129, 'IJERSS-1393429579', 'editor@ijerss.com', 'NEXT GENERATION AUTO THEFT PREVENTION OF A VEHICLE', 'Research', 'real time embedded systems', 'As vehicles become more sophisticated, vehicle security systems must be stronger than ever before. A modern vehicle utilizes remote keyless entry system and immobilizer system as the main weaponry against vehicle theft. Some of the problems we are facing in the existing auto theft prevention systems are there is no protection for the vehicle when the keyfob is stolen. So a smart keyfob sold in the market is not actually smart. Vehicle tracking devices will not be able to locate a vehicle in GPS denied environments such as within buildings, underground and dense city regions, resulting in the vehicle loss. Currently used motion and tilt alarms will alert the owner even for an unintentional touch by a passing person or an accidental hit by a ball from a playing child. There is no central user interface to configure and customize the vehicle security system.\r\nA next generation auto theft prevention system is designed by adding significant enhancements and modernizing the existing security features. The enhancements that are made to the exiting security system are Smart gravitational lock, Cryptographic keyless entry, Touch screen ignition, Adjustable motion alarm sensitivity, Ubiquitous vehicle tracking, Car finder, GPS fencing and Remote fuel cut-off.\r\nThis project proposes the development of two units i.e. a vehicle unit, which will be deployed in the vehicle and will act as a central user interface to the vehicle and a smart keyfob unit, which will be the remote keyless entry to unlock the vehicle. Both the vehicle unit and the smart keyfob unit are designed and implemented using LPC1313, a 32-bit ARM Cortexx-M3 microcontroller, the programming is done in embedded C and LPC Xpresso IDE is used to debug the programmed code and to dump the program into the microcontroller.', '1393429579_paper.doc', '2014-02-26', 'M.K.TARUN', 'krishna.tarun12@gmail.com', NULL, 'no.5, perumal koil street', 'behind S.R.M University, potheri, ', 'chennai', 'tamil nadu', 603203, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'NCRACE-2014', 0, 0, 'New', 0, 0),
(130, 'IJERSS-1393464526', 'editor@ijerss.com', 'LOW FREQUENCY NOISE ANALYSISIN TWIN SILICON NANOWIRE TRANSISTORS ', 'Research', 'ENGINEERING', 'Because of its ability to effectively suppress off-leakage current with its gate-around configuration, the Si nanowire FET is considered to be the ultimate structure for ultra-small CMOS devices to the extent that the devices would be approaching their downsized limits. Recently, several experimental studies of Si nanowire FETs with on-currents much larger than those of planar MOSFETs have been published. Consequently, Si nanowire FETs are now gaining significant attention as the most promising candidate for mainstream CMOS devices in the 2020s. In this paper, the Low-frequency noise (LFN) in n-type silicon nanowire MOSFETs (SNWTs) is investigated for various gate lengths and various material for improving drain current and reducing short channel effects.As a result, design optimizations to reduce the impact of parasitic resistance in SNWTs are necessary for analog/RF applications.', '1393464526_1.LOW_FREQUENCY_NOISE_ANALYSIS_IN_TWIN_SILICON_NANOWIRE_TRANSISTOR.docx', '2014-02-27', 'K.Revathi , P.Anandan , Dr.N.Mohankumar', 'revathi.kece@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(131, 'IJERSS-1393863482', 'editor@ijerss.com', 'THE EFFECT OF ISOLATED AND COMBINED UPHILL, DOWNHILL TRAINING ON MAXIMUM RUNNING SPEED AND MAXIMUM ANAEROBIC POWER OF FOOTBALL PLAYERS', 'Research', 'TRAINING METHODS,HILL TRAINING', 'The purpose of the present study was to determine the effect of isolated and combined uphill, downhill training on selected maximum running speed and maximum anaerobic power among football players. To achieve the purpose of the study, 48 male football players were selected from the Government Higher Secondary School, Thuvarankurichy, Trichy District at randomly. They were randomly assigned in to Uphill training group (n = 12), Downhill Training group (n = 12), combined uphill & downhill group (n = 12), and a control group (n = 12). The sprint training was given to all the three training groups over a period of twelve weeks. The sprint running workout trained three times in a week starting from 55 - 65% extends  to 65 to 75%( effort of their one repetition maximum) at the end of training period and using six different workouts for a session. Each exercise was performed for two sets of six repetitions each with recovery period of either 60 to 90 sec between repetition and 3 to 5 min between sets. No training was given to the control group. Maximum running speed (35 m sprint speed test - best of three trials) & maximum anaerobic power (Running based anaerobic sprint test) were measured before (pre) and after (post) the training program. The collected data from the four groups prior to and immediately after the training programme on selected criterion variables was statistically analyzed with paired sampleÃ¢â‚¬ËœtÃ¢â‚¬â„¢ test was used to find out significant improvement and analysis of covariance (ANCOVA) was used to find out the significant difference among experimental and control groups. Whenever the Ã¢â‚¬ËœFÃ¢â‚¬â„¢ ratio for adjusted post test means was found to be significant, the ScheffeÃ¢â‚¬â„¢s test was applied as post-hoc test to find out paired mean difference was significant. In all the cases 0.05 level of confidence was fixed to test the hypothesis. In conclusion, the result showed a significant difference in maximum running speed and maximum anaerobic power of uphill, downhill, and uphill & downhill groups. While comparing the three training groups on maximum running speed and maximum anaerobic power the combined group is better in maximum running speed and downhill group is better on maximum anaerobic power.\r\nKeywords: sprint workout, maximum running speed, anaerobic power.\r\n', '1393863482_vinoth_paper.docx', '2014-03-03', 'T.VINOTH', 'arachyvinoth@gmail.com', NULL, 'T.VINOYH,S/O S.THANGARAJU, 2/47,ARAICHI PO', 'MUSIRI TK', 'THIRUCHIRAPALLI', 'TAMILNADU ', 621214, 'IN', 'Pending', '', 'HEALTH SCIENCE', '1395054960_IJERSS1393863482THE_EFFECT_OF_ISOLATED_AND_COMBINED_UPHILL,_DOWNHILL_TRAINING_ON_MAXIMUM_RUNNING_SPEED_AND_MAXIMUM_ANAEROBIC_POWER_OF_FOOTBALL_PLAYERS.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 223, 0),
(132, 'IJERSS-1393903195', 'editor@ijerss.com', 'EFFECTS OF MODERATE INTENSITY INTERVAL TRAINING IN RUNNING ON CARDIOVASCULAR EFFICIENCY VARIABLES OF SEDENTARY NIGERIAN MALE ADULTS', 'Research', 'HEALTH SCIENCE', 'This study examined the effects of 12 -week moderate intensity interval training in running on cardiovascular efficiency variables of sedentary Nigerian male adults. The variables included systolic and diastolic Blood Pressure, Mean Arterial Pressure, Resting Pulse Rate and Double Product. A 2 x 3 factorial design was used for this study in which 30 medically certified  healthy sedentary adult men aged, between 20-30 years were selected after obtaining their informed consent and were randomly assigned to experimental and control groups of 15 subjects each..  The experimental group went through the interval training in running as an exercise mode performed at 55-68% of maximum heart rate  done 4 times a week for 12 weeks. During the intervention period,  three tests were conducted on both groups at baseline, midway and immediately after the termination of training at week 12.The data obtained was analysed using the Statistical Package of the Social Sciences (SPSS). The descriptive statistic of the mean and standard deviation were used for data description while the student independent t-test was employed to determine the difference between the experimental and control groups. The comparison of the difference between changes in test periods at zero ,six and twelfth was made using the repeated measures ANOVA.  The results of this study indicated significant decrease in all the cardiovascular efficiency variables examined. In light of these findings, it is recommended that moderate intensity interval training in running can be used to improve cardiovascular efficiency or fitness of sedentary Nigerian male adults.', '1393903195_EFFECTS_OF_MODERATE_INTENSITY_INTERVAL_TRAINING_IN_RUNNING_ON_CARDIOVASCULAR_EFFICIENCY_V', '2014-03-04', 'Dr. RICHARD S. JATAU, PROF. CHARLES E. DIKKI, PROF. K. VENKATESWARLU', 'profvenkatmail@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1397055483_IJERSS1393903195.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue IV, April 2014.', 340, 0),
(133, 'IJERSS-1393905548', 'editor@ijerss.com', 'REGENERATION OF TRADITIONAL MUGHAL ARCHITECTURE AT YAMUNA RIVER FRONT, AGRA', 'Research', 'Architecture', 'India has been the home of many civilizations throughout the centuries and is loaded with substantial cultural and traditional accumulation. Settlements in different regions of India are the most significant indicators of this accumulation. These civilizations developed a strong traditional architectural heritage over a period of time in different parts of India and Mughal Architecture is one of them. This traditional architecture is being seriously threatened by the outpouring of modern ideas and space-age technology. The dilution effects are most visible i.e. the import of modern materials, the dependence on modern technology, / ignorance of traditional architecture and the shrinking number of artisans have all contributed to the deterioration of our traditional building styles and practices. To maintain our sovereign and independent identity one must sense the danger of losing traditional values and culture and right steps to be taken to preserve and promote the distinctive identity. This paper would be \r\nhigh lighting traditional architecture developed along the Yamuna River during Mughal period and the site can be regenerated to preserve the glory of past Mughal traditional architecture.', '1393905548_REGENERATION_OF_TRADITIONAL_MUGHAL_ARCHITECTURE_AT_YAMUNA_RIVER_FRONT.docx', '2014-03-04', 'MOHD KHALID HASAN', 'arch5.khalidhasan@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', '', 'ARCHITECTURE', '1398139151_IJERSS1393905548.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 1084, 1),
(134, 'IJERSS-1393937098', 'editor@ijerss.com', 'Novel Methodology and Analysis of MR Brain images by Modified Texture based Region Growing Segmentation', 'Research', 'Digital Image Processing', 'Abstract Ã¢â‚¬â€œ One of the most common causes of death among people is Brain tumor. Brain tumors are created by an abnormal and uncontrolled cell division, usually in the brain itself, but also in lymphatic tissue, in blood vessels, in the cranial nerves, in the brain envelopes, skull, pituitary gland, or pineal gland. Image segmentation plays an important role in medical image processing. To increase the chances of survival brain tumor has to be detected and classified correctly at its early stage. In medical image analysis one of the challenging methodologies is automated brain disorder diagnosis with MR images. The abnormal tumor portion can be separated from brain using segmentation method. Magnetic resonance (MR) imaging is currently an indispensable diagnostic imaging technique in the study of the human brain. A texture based region growing segmentation method is proposed here because  tumors intensity value varies from neighboring healthy tissues. The results depict that this proposal can considerably increase the performance of brain MR image segmentation.\r\n\r\nKeywords: Brain Tumor, Segmentation, MR Images, Texture.\r\n', '1393937098_SBCAE.docx', '2014-03-04', 'K.G.SATHIYA', 'kgsathiya@gmail.com', NULL, '360F, 5th cross ', 'Nethaji  nagar,  Vengikkal', 'Thiruvannamalai', 'Tamil Nadu', 606604, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'NCRACE-2014', 0, 0, 'New', 0, 0),
(135, 'IJERSS-1393946182', 'editor@ijerss.com', 'EFFECT OF SAQ TRAINING AND CIRCUIT TRAINING ON SPEED AND AGILITY AMONG YOUNG HIGH SCHOOL FOOTBALL PLAYERS', 'Research', 'HEALTH SCIENCE', 'The purpose of the study was to find out the effects of SAQ training and circuit training on speed and agility among young high school football players in order to achieve the purpose of the study forty five inter zonals football players were selected randomly and they were equally divided into three groups of fifteen each as experimental groups and control group undergone normal routine football practices and in addition the experimental group-I underwent SAQ training and experimental group-II underwent circuit trailing for one hour in the morning sessions. The control group was not given any special training.  The period of training was eight weeks in a schedule of weekly three days for alternate days.  The data were collected on the selected dependent variables at before and after the training period.  Analysis of Covariance (ANCOVA) & scheffÃ¢â‚¬â„¢s post hoc test was used to analyze the data.  To test the significance 0.05 level of confidence was fixed.  Based on the results the study it was concluded that the SAQ training and circuit training was significantly improved the speed and agility among young high school football players.', '1393946182_abstract_&_full.docx', '2014-03-04', 'N. POORNA SARACHANDRA', 'poornachandra96@yahoo.com', NULL, '', '', '', '', 0, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1395054886_IJERSS1393946182EFFECT_OF_SAQ_TRAINING_AND_CIRCUIT_TRAINING_ON_SPEED_AND_AGILITY_AMONG_YOUNG_HIGH_SCHOOL_FOOTBALL_PLAYERS.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue III, March 2014.', 783, 0),
(136, 'IJERSS-1393946298', 'editor@ijerss.com', 'ANTHROPOMETRIC DIMENSIONS OF BASKETBALL AND VOLLEYBALL PLAYERS ', 'Research', 'HEALTH SCIENCE', 'Anthropometric dimensions and morphological characteristics play an important role in determining the success of an athlete. Quite naturally, the interest in anthropometric dimensions of sports persons from different competitive sports has been increased tremendously over the last decades. It has been well established that specific anthropometric dimensions indicate whether the player would be suitable for the competition at the highest level in a specific sport. Methodology: To achieve the purpose of the study eighty men intercollegiate players, forty basketball players and forty volley ball players were selected as subjects.  The data in respect of anthropometric dimensions were collected as per the standard procedure. Statistical technique: The collected  data were analyzed by suing Ã¢â‚¬ËœtÃ¢â‚¬â„¢ statistical technique with the help of 19th version of SPSS. Results: There exists significant mean difference between basketball and volleyball players in the selected anthropometric dimensions, viz., height, arm length, chest girth, thigh girth, calf girth, there were no significant difference leg length.', '1393946298_ABSTRACT_&_FULLLENGTH_PAPER.docx', '2014-03-04', 'N. POORNA SARACHANDRA', 'poornachandra96@yahoo.com', NULL, '', '', '', '', 0, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1395054850_IJERSS1393946298ANTHROPOMETRIC_DIMENSIONS_OF_BASKETBALL_AND_VOLLEYBALL_PLAYERS.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue III, March 2014.', 362, 0),
(137, 'IJERSS-1394111907', 'editor@ijerss.com', 'COMPARATIVE ANALYSIS OF  SPEED AND AGILITY AMONG UNIVERSITY PLAYERS OF DIFFERENT DISCIPLINES', 'Research', 'HEALTH SCIENCE', 'The purpose of this study was to compare the speed and agility of university players f different disciplines (football, handball and volleyball games).  The study was conducted on 300 subjects with age ranging 18-25 for the comparison of selected physical fitness variables.  The variables selected for the study were speed (50 Meter Dash) and agility (Semo Agility Test). One-way analysis of variance (ANOVA) was used to find out the significant difference among different disciplines.  The ScheffeÃ¢â‚¬â„¢s post hoc test was used to find the significant difference in paired mean scores.  It was concluded that there was significant difference between football, handball and volleyball players in speed and agility variables.  The handball players have better speed and agility than football and volleyball players. The football and volleyball players must be given good physical conditioning training to enable them to improve the performance in their respective games.', '1394111907_COMPARATIVE_ANALYSIS_OF_SPEED_AND_AGILITY_AMONG_UNIVERSITY_PLAYERS_OF_DIFFERENT_DISCIPLIN', '2014-03-06', 'P. MADHUSUDHANA BABU, DR. M. SIVA SANKAR REDDY', 'pmsbabu1972@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1399735987_IJERSS1394111907.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue III, March 2014.', 683, 0),
(138, 'IJERSS-1394463715', 'editor@ijerss.com', 'COMPARISON OF MENTAL TOUGHNESS VARIABLES AMONG KHO-KHO AND KABADDI PLAYERS IN S.P.S.R.NELLORE DISTRICT', 'Research', 'HEALTH SCIENCE', 'Every player is expected to show his supremacy by challenging others in sports. There are numerous factors like Physiological, Psychological and Technical preparation to build up the athletes for higher level of competitive performance in sports. Competition is involved in outdoor sports without mental preparedness it is difficult for the sportsmen to achieve higher standards and win in various competitions. Kho-Kho and Kabaddi are the indigenous games and both the games require mental toughness as well as other physical abilities in order to exhibit maximum performance.\r\nThe aim of present study is to compare the mental toughness variables of the Kho-Kho and Kabaddi players. Objective of this study is to assess mental toughness variables like self confidence, negative energy, attention control, visualization and imaginary control, motivation, positive energy and attitude control. The selected sample of Kho-Kho and Kabaddi male professional players in S.P.S.R.Nellore District by measuring the variables of mental toughness using standardised questionnaire by James E.Loehr.The results of the data revealed that there was no significant difference between Kho-Kho and Kabaddi players in mental toughness. In the self confidence and attitude control Kho- Kho players were significantly better than Kabaddi players. But in attention control Kabaddi players were better than Kho-Kho players but not up to the statistically significant level .Therefore it is concluded that Kho-Kho players do possess more self confidence and attitude control than Kabaddi players. Whereas Kabaddi players shown better attention control.', '1394463715_pd_main_paper_final.pdf', '2014-03-10', 'P.NARAYANA RAJU', 'narayanaraju2612@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1395054760_IJERSS1394463715COMPARISON_OF_MENTAL_TOUGHNESS_VARIABLES_AMONG_KHOKHO_AND_KABADDI_PLAYERS_IN_S.P.S.R.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue III, March 2014.', 528, 0),
(140, 'IJERSS-1394898857', 'editor@ijerss.com', 'AN EXPERT SYSTEM FOR HEART DISEASE PREDICTION USING DATA MINING TECHNIQUE: NEURAL NETWORK', 'Research', 'Datamining', 'A major challenge facing healthcare organizations (hospitals, medical centers) is provision of quality services at reasonable costs. Quality service implies diagnosing patients correctly and administering treatments that are effective. Poor clinical decisions can lead to disastrous consequences which are therefore unacceptable. Also wants to minimize the cost of clinical tests. They can achieve these results by employing appropriate computer-based information and/or decision support systems. Most hospitals today employ some sort of hospital information systems to manage their healthcare or patient data. These systems are designed to support patient billing, inventory management and generation of simple statistics. Some hospitals use decision support system, but they are largely limited due to their disability of decision making on the existing database. \nClinical decisions are often made based on doctors intuition and experience rather than on the knowledge-rich data hidden in the database. This practice leads to unwanted biases, errors and excessive medical costs which affects the quality of service provided to patients. Advanced data mining techniques can help remedy this situation. The main objective of this research has developed a prototype for Expert Heart Disease Prediction System (EHDPS) using data mining techniques namely, Neural Network [2, 17 18]. It can answer complex queries which traditional decision support systems cannot. Using medical profiles such as age, sex, blood pressure and blood sugar it can predict the possibility of patients getting a heart disease [33]. It enables significant knowledge, e.g. patterns, relationships between medical factors related to heart disease, to be established. It is implemented as web based questionnaire application. Based on the user answers, EHDPS is user-friendly, scalable, reliable and expandable. It is implemented on the PHP.        \n', '1394898857_NT.doc', '2014-03-15', 'S. OYYATHEVAN, DR. A. ASKARUNISA', 'oyyathevan@gmail.com', NULL, 'Ampattiyampatti,Thidiyan-po', 'Usilampatti,Madurai', 'Usilampatti', 'Tamilnadu', 625529, 'IN', 'Pending', NULL, 'COMPUTER SCIENCE', '1397143523_IJERSS1394898857.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue IV, April 2014.', 503, 0),
(143, 'IJERSS-1395381847', 'editor@ijerss.com', 'STUDY OF INJURIES IN BODY CONTACT GAMES WITH A SPECIAL REFERENCE TO KABBADDI', 'Research', 'HEALTH SCIENCE', 'Sports medicine has emerged as an important branch of sport science. It is a multi specialty branch which involves health care professionals, researchers and educators from wide variety of disciplines. The injuries in sports are caused by many factors. They may be from environmental to physiological or psychological.\r\nThe prevalence of injuries in contact games is very high when compared to non contact games and sports. It is more so in a game like kabbaddi which demands agility, muscular co-ordination, quick physical response and a great deal of presence of mind. Hence the chance of injury rate is very high. ', '1395381847_PPT_2.doc', '2014-03-21', 'T.SIVA PRASAD', 'sivaprasadpd@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1397183994_IJERSS1395381847.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue IV, April 2014.', 299, 0),
(144, 'IJERSS-1395515015', 'editor@ijerss.com', 'Acceleration garner from amble', 'Others', 'embedded system', ' This paper has investigated the optimal power that \r\ncan be extracted from human gait over a wide speed range using \r\nelectromechanical vibration conversion from human movement. \r\nDriven by the potential to power small portable electronic devices ', '1395515015_pa1.doc', '2014-03-23', 'p.pavan', 'pavan02690@gmail.com', NULL, 'd no 9/1/193 maraiannvari street', 'kapadiaplem', 'nellore', 'andhrapradesh', 524001, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(167, 'IJERSS-1395975788', 'editor@ijerss.com', 'ADEPT IDENTIFICATION OF SIMILAR VIDEOS FOR WEB-BASED VIDEO SEARCH', 'Research', 'DATA MINING', 'Abstractâ€” Adept identification of similar videos is an important and consequential issue in content-based video retrieval. Video search is done on basis of keywords and mapped to the tags associated to each video, which does not produce expected results. So we propose a video based summarization to improve the video browsing process with more relevant search results from large database. In our method, a stable visual dictionary is built by clustering videos on basis of the rate of disturbance caused in the pixellize, by the object. An efficient two-layered index strategy with background texture classification followed by disturbance rate disposition is made as core mapping methodology.', '1395975788_videofinal_format.docx', '2014-03-28', 'A.PACKIALATHA', 'packiafluffy@gmail.com', NULL, '', '', 'CHENNAI', 'TAMILNADU', 600061, 'IN', 'Pending', '', 'COMPUTER SCIENCE', '1397055856_IJERSS1395975788.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue IV, April 2014.', 433, 0),
(170, 'IJERSS-1396024964', 'editor@ijerss.com', 'IMPLEMENTATION OF GREEN WAVE SYSTEM FOR VEHICLES ', 'Research', 'ENGINEERING', 'Traffic congestion management was recognized as one of the major problems in modern urban area, which has caused much frustration and loss of many hours. During rush, emergency vehicles like Ambulances, Police cars and Fire Brigade trucks get stuck in jams. Due to this, these emergency vehicles are not able to reach their destinations in time, resulting into a loss of human lives. This can be avoided with the help of â€œGREEN WAVE SYSTEMâ€. A â€˜green waveâ€™ is the synchronization of the green phase of traffic signals. With a â€˜green waveâ€™ setup, a vehicle passing through a green signal will continue to receive green signals as it travels down the road. Through this, we can provide a smooth flow for the emergency vehicle and also a theft vehicle is identified. The information regarding the vehicle has to be updated in the system database. So, it is an autonomous 2-tier system which will help in the identification of emergency vehicles or any other desired vehicle', '1396024964_ppt.docx', '2014-03-28', 'V. BALI REDDY , A. SUVARNAMMA', 'balreddy6777@gmail.com', NULL, '', '', '', '', 0, 'IN', 'ACCEPTED', 'Pay Manuscript processing fee', 'ENGINEERING', '1398754408_IJERSS1396024964.pdf', 0, 0, 'IJERSS-2014', 0, 0, 'Volume I - Issue V, May 2014.', 27, 0),
(196, 'IJERSS-1396100580', 'editor@ijerss.com', 'A RESOURCE ALLOCATION SCHEME FOR DECODE AND FORWARD RELAY COGNITIVE NETWORKS', 'Research', 'ENGINEERING', 'Relayed transmission in a Cognitive Radio (CR) environment increases the coverage area and capacity of the communication system.  There are many types of cooperative communications, amplify and forward (AAF) and decode and forward (DAF). Adaptive relaying protocol (ARP) is used here to overcome the disadvantages of AAF and DAF. In this paper we are mainly focusing on the joint power allocation in a cognitive radio system in a cooperative mode that operates ARP in a multi-carrier mode, the multi-carrier scenario is used in an orthogonal frequency division multiplexing (OFDM) mode, and problem is formulated to maximize the end-to-end rate by providing the best power allocation at the transmitters. The simulation results shows that DAF will achieve more capacity than AAF, but if we use ARP in comparison to other relaying techniques we can achieve even more capacity.', '1396100580_ieee_kiran_(1).docx', '2014-03-29', 'M.KiranKumarReddy,M.Aravindhan ', 'mukkamalla786@gmail.com,aravindan.m@ktr.srmuniv.ac.in', NULL, '', '', '', '', 0, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(197, 'IJERSS-1396194932', 'editor@ijerss.com', 'AN EFFICIENT WAY OF AGGLOMERATING ONLINE DOCUMENTS BY A SEMANTIC MODEL', 'Research', 'Knowledge Engineering - Semantic Web', 'Most of the documents clustering techniques are hinge on the concept of single term or phrase-based analysis of the document data set. Document clustering is especially useful in many applications such as automatic categorization of documents, grouping search engine results, building taxonomy of documents, and others. Statistical analysis usually identifies the key terms by means of their frequency within a document. However, more than one term may contain the identical occurrences within the document, however a specific term plays major role towards sentence semantics comparing to the remaining term.  Therefore the fundamental web document clustering method should specify term which identifies meaning of the text. In this case, the semantic-based method identifies expressions that represent the sentence semantics, which are very helpful in determining the documentâ€™s subject. This mining model analyses words or expressions on the individual sentences, documents, and core level. The semantic-based model dramatically distinguishes among insignificant terms against the meaning of the sentences and terms which are more close to the sentence semantics. The proposed method has two phases; the first phase finds similar concepts among documents, with respect to the meaning of their sentences and the second phase is to construct the semantic suffix tree for representing the documents which are sharing the concepts. The similarity between the documents is approximated by a similarity measure which is based on concepts. By using the semantic organization of sentences in the web documents, a considerable improvement in the quality of web document clustering is achieved.', '1396194932_journal.doc', '2014-03-30', 'THILAGAVATHY R, ,SABITHA R', 'thilaga1025@gmail.com,sabitha_ramadoss@yahoo.com', NULL, 'No. 2/241, Anna Street', 'Santhoshapuram', 'Chennai', 'Tamil Nadu', 600073, 'IN', 'Pending', NULL, 'COMPUTER SCIENCE', '1397055926_IJERSS1396194932.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue IV, April 2014.', 778, 0),
(198, 'IJERSS-1396265866', 'editor@ijerss.com', 'LOW-POWER AND HIGH SPEED 128-POINT PIPELINE FFT/IFFT PROCESSOR FOR OFDM APPLICATIONS', 'Research', 'ENGINEERING', 'Digital Signal Processing(DSP) has become a very important in research area.Unfortunately Existing designs are restricted to a low accuracy and a small sample number.In this paper,we present the efficient implementation of a pipeline FFT. The proposed processor not only supports the operation of FFT/ IFFT in 128 points and 64 points but can also provide a high data processing rate by using a four-parallel data-path scheme.Furthermore, the proposed design has a less hardware complexity compared with traditional 128/64-point FFT / IFFT processors. To eliminate the read-only memories  (ROMâ€™s) used to store the twiddle  factors, the proposed architecture applies a reconfigurable complex multiplier and bit-parallel multipliers to achieve a ROM-less FFT processor,thus consuming low power than exsisting works', '1396265866_project_low_power_high_speed_128_point_fft.docx', '2014-03-31', 'K.SAISARVAGNA,S.SUDARVIZHI', 'sarvagna4u@gmail.com,sudarvizhishanmugam@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(199, 'IJERSS-1396269641', 'editor@ijerss.com', 'VEHICLE TRACKING THROUGH RSSI', 'Others', 'Paper publishing', 'The Global Positioning System (GPS) consists of popular localization schemes, but usually fails to function indoors, underground, or in forest areas. This paper is about tracking the object without using GPS this is done by using Received Signal Strength Indicator (RSSI). RSSI could be exploited to gain information on the relative position of those transmitters to pinpoint the receiverâ€™s position. Ranging based localization techniques often produce better localization than range free techniques. This paper is about implementing the real time tracking of the objects like vehicles or boats which are to be tracked continuously in order to keep them in range. If they cross the range or they take a different route they are stopped and guided with a correct route.', '1396269641_MSW_A4_format_(1).doc', '2014-03-31', 'PRANAY REDDY PYREDDY,V.K.DALIYA', 'pranayreddy444@gmail.com,daliyavk@yahoo.com ', NULL, 'Room No. 523, G Block, SRM Hostels, SRM University', 'Kattankulathur, Kancheepuram District', 'Kancheepuram', 'Tamilnadu', 603203, 'IN', 'Pending', NULL, 'ENGINEERING', '1397056006_IJERSS1396269641.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue IV, April 2014.', 351, 0),
(200, 'IJERSS-1396406117', 'editor@ijerss.com', 'HAND POSTURE RECOGNITION USING SVM TECHNIQUES', 'Research', 'ENGINEERING', 'This paper presents a better and accurate way to human computer interaction methods. A real time system is proposed and developed which needs no glove of sensors for the hand, still we can directly interact with system. The implemented system is tested by demonstrating how we can control device using the hand signs. Gesture recognition interfaces can be\r\nused as a natural communication channel between humans and machines and give rise to a plethora of applications such as hardware-free remote controls, sign language interpretation and other human welfare applications.', '1396406117_hand_openCV.doc', '2014-04-02', 'K.PRAVEEN KUMAR,R.BHAKKIYALAKSHMI', 'prawin555@gmail.com', NULL, '', '', '', '', 0, 'IN', 'ACCEPTED', 'Pay Manuscript processing fee', 'ENGINEERING', '1398755773_IJERSS1396406117.pdf', 0, 0, 'IJERSS-2014', 0, 0, 'Volume I - Issue V, May 2014.', 23, 0),
(201, 'IJERSS-1396406497', 'editor@ijerss.com', 'ENACTMENT OF SCADA SYSTEM FOR JUDICIOUS DWELLNG', 'Research', 'ENGINEERING', 'This project is concerned with the design and implementation of an embedded surveillance system with ultra-low alert power which find application in security related areas such as house applications. In this surveillance system, the microcontroller unit consumes less memory space and normally stays in sleep state, and it get activated, when the sensors are enabled. Pyroelectric Infrared sensors (PIR), senses the presence of human in the abandoned area. The presences of obstacle/intruder at a distance sensed by the Ultrasonic sensor. The vibrations that may be created by the intruders detected by the Vibration sensor. When any one or two sensor gets activated, the buzzer automatically alerts the presence of intruder. The embedded surveillance system determines the sensorâ€™s result from the controller, and sends the the information to the owner through SMS(Short Message Service)', '1396406497_TAB_PAPER.doc', '2014-04-02', 'MOHAMMED TABREZ UD DOULA,MRS.G.KALAIMAGAL', 'tabrez.doula2009@gmail.com', NULL, '', '', '', '', 0, 'IN', 'ACCEPTED', 'Pay Manuscript processing fee', 'ENGINEERING', '1398756424_IJERSS1396406497.pdf', 0, 0, 'IJERSS-2014', 0, 0, 'Volume I - Issue V, May 2014.', 30, 0),
(202, 'IJERSS-1396447879', 'editor@ijerss.com', 'VLSI IMPLEMENTATION OF NOISE CANCELLATION IN AUDIO SIGNALS USING LMS AND RLS ALGORITHMS', 'Research', 'VLSI Design', 'In this paper the eminence of the Recursive Least Squares (RLS) algorithm over LMS algorithms is provided. This algorithm is designed to provide similar performance to the LMS algorithm while reducing the computation time.This paper represents the performance analysis and comparison between LMS and RLS adaptive filter. Simulations are performed with these algorithms to compare both the computational burden as well as the performance for adaptive noise cancellation. Simulations show that RLS offers comparable performance with respect to the LMS. Power, Area and time required for both the algorithms are also analysed.', '1396447879_publishing_paper.docx', '2014-04-02', 'K.SINDHU REDDY,P.RADHIKA', 'kalikirisindhu@gmail.com,Gpradhika82@gmail.com', NULL, 'K. Amaranatha Reddy, 15-2-5-4-11', 'R.R.N Colony', 'Madanapalli', 'Andhra pradesh', 517325, 'IN', 'Pending', NULL, 'ENGINEERING', '1397066828_IJERSS1396447879.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue IV, April 2014.', 375, 0);
