(203, 'IJERSS-1396491060', 'editor@ijerss.com', 'GREEN METER MONITORING FOR SMART GRID HOUSEHOLDS WITH RENEWABLE SOURCE', 'Case Study', 'wireless commuincation', 'The automatic meter reading is the common approach for establishing two way communication between the households and grid .once smart grids came into line then every thing changes and a net metering of energy is to be monitored and send the data and energy back to the grid . since  the energy is transferred back to the grid so we need to estimate the power transferring correctly.\r\nproposed paper is based on new monitoring approach for the smart monitoring and here we are transferring the energy back to grid and for this purpose we are going to produce the power using a renewable energy resource wind . .In this way the Net metering is possible and customer can earn benefits\r\n', '1396491060_green_meter_monitoring_for_smart_grid_households_with_renewable_source.doc', '2014-04-03', 'MRS TV ANANTHALAKSHMI,MR P. NAVEENKUMAR', 'ananthalakshmi.tv@ktr.srmuniv.ac.in,naveenkumar_ramana@srmuniv.edu.in', NULL, 'plot 815,B-block,sis safaa apartments', 'guduvanchery', 'chennai', 'tamilnadu', 603203, 'IN', 'Pending', '', 'ENGINEERING', '1397056083_IJERSS1396491060.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 228, 0),
(204, 'IJERSS-1396532843', 'editor@ijerss.com', 'Super Scope All-in-One Electronics Lab Assistant Device with USB Connectivity', 'Research', 'EMBEDDED SYSTEMS-ELECTRONICS', 'Test and measurement instruments such as oscilloscopes and multimeters are the traditional hardware tools, an electronics engineer would have on his bench. Students in engineering curriculum, when exposed to these instruments, often come across a multitude of equipmentâ€™s such as voltmeters, ammeters, oscilloscopes and even simple things like calculator. Even after the touchscreen based smartphone revolution, most of the engineering colleges in India continue the tradition of introducing the students to a decade old instruments. The main objective is to design and develop a portable device called Super-Scope which is ALL-IN-ONE electronics lab equipment that has multiple functionalities needed by a modern day engineering student for his practical experiments in electronics and computer labs that would replace the existing plethora of instruments. The device is a fully operated from touchscreen using touch buttons and menus. The device has a USB-UART bridge circuit that gives USB connectivity for Desktop/Laptop communication for data logging the measured quantities such as current, voltage, speed, voice frequency, frequency, intensity of light and temperature. This process can be fully controlled by the user from the device UI. It also helps to easily upgrade the firmware of the device from a desktop/Laptop. The device is controlled by LPC1313, a powerful 32-bit ARM Cortex-M3 microcontroller from NxP Semiconductors.', '1396532843_kasi_ijerss.docx', '2014-04-03', 'S. Kasi Viswanth Reddy,P. Ponnammal', 'visu.soddala35@gmail.com,ponnammal.p@ktr.srmuniv.ac.in', NULL, 'D.NO. A2 S1, LALITHA PALACE ', '8TH STREET, AMBAL  NAGAR KEELKATTALAI', 'CHENNAI', 'TAMILNADU', 600117, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(205, 'IJERSS-1396533280', 'editor@ijerss.com', 'Microcontroller based Remote Terminal Unit Universal Card in Reactors', 'Research', 'Embedded systems', 'RTU-UNIVERSAL card is a microcontroller based module developed to process Digital inputs, Analog inputs and Relay outputs of any real time data acquisition system used in process industries like nuclear power plants. This AT89C51RD2 based card focuses on the development of diagnostic software in C language to process digital inputs, analog inputs and relay outputs as well as checking the healthiness of RTUâ€“Universal module. It acquires field signals from various sensors like K-type thermocouples, Limit Switches, Transmitters, and Leak Detectors etc. and sends digitalized data packets through Ethernet to the nearest LCC for Distributed Digital Control System (DDCS) display. The module also generates control outputs in the form of potential free contacts to Control Heater, Valves, etc.', '1396533280_IJERSS_baggiee.docx', '2014-04-03', 'S.BHARGAVI,R.MANOHARI', 'bhargavi.saradhi9@gmail.com, manohari.r@ktr.srmuniv.ac.in ', NULL, 'Door No:2-102/7,', 'prashanthi nagar, aganampudi', 'visakhapatnam', 'andhra pradesh', 530046, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(206, 'IJERSS-1396667071', 'editor@ijerss.com', 'Auto theft prevention of a vehicle using a smart keyfob unit and GPS & GSM technologies', 'Research', 'embedded systems', 'The project proposed aims to design an auto theft prevention system by adding significant enhancements and modernizing the existing security features and thus try to overcome the drawbacks in vehicle theft. The list of the modules that are implemented in this project are Smart gravitational lock, Cryptographic keyless entry, Touch screen ignition, Adjustable motion alarm sensitivity, Ubiquitous vehicle tracking, Car finder, GPS fencing, Remote fuel cut-off. All these eight modules have their own importance and play their role in the auto-theft prevention. The owner of the vehicle can switch between these modules based on the requirement and the time beingto sucure the vehicle. This project mainly consists of two units i.e. Vehicle unit and Smart keyfob unit. The vehicle unit is deployed in the vehicle and the smart keyfob unit is deployed in the wireless remote keyless entry system and the communication between both the units is done with the help of IEEE 802.15.4 transceiver. These two units are implemented using LPC1313 microcontroller on an ARM Cortex-M3 microprocessor and are programmed in Embedded-C. LPC Xpresso IDE is used to debug and run the program.', '1396667071_manuscript.doc', '2014-04-05', 'M.K.TARUN,P.RADHIKA', 'krishna.tarun12@gmail.com,vradhiya5@gmail.com', NULL, 'No:5, perumal koil street, behind S.R.M University', 'potheri, kattankulathur', 'chennai', 'tamil nadu', 603203, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(207, 'IJERSS-1396702710', 'editor@ijerss.com', 'AN RF SYSTEM TRACKING IN INDOOR ENVIRONMENTS', 'Others', 'EMBEDDED SYSTEMS & TRACKING IN GPS DENIED ENVIRONMENTS', 'A tracking technique that utilizing the RF (TX & RX) antenna in the HF range for the applications in the GPS-denied (Indoor) environments and urban scenarios is proposed. The prototype model for this tracking system is realized and successfully demonstrated.\r\n\r\nIndex Termsâ€”GPS-denied environments, RF indoor source tracking. \r\n', '1396702710_paper..doc', '2014-04-05', 'CH RAVI TEJA,MRS.G.KALAIMAGAL', 'ch.raviteja488@gmail.com,gkalaimagal@gmail.com ', NULL, 'ROOM NO: 624, PAARI (G) BLOCK,SRM HOSTELS', 'SRM UNIVERSITY,KATTANKULATHUR, KANCHEEPURAM DIST', 'CHENNAI', 'TAMIL NADU', 603203, 'IN', 'Pending', '', 'ENGINEERING', '1397056144_IJERSS1396702710.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 183, 0),
(208, 'IJERSS-1396704968', 'editor@ijerss.com', 'IMPLEMENTATION OF A SHARED MEMORY SWITCH FABRIC', 'Research', 'VLSI& digital', 'Shared memory switch fabric is high speed switches. To implement scalable architecture dynamic address allocation and efficient internal timing management. Here we are using 3D NOC bcz it can reduce area and power. This paper presents the architectural design of a 4*4 shared memory switch fabric which operates at 20Gbps. The architecture uses barrel shifter mechanism to perform parallel writes into different banks of buffers without the need to have multiplexer with higher speed. Broadband networks satisfy to carry integrated traffic involving different types of information such as voice, video and data. Shared memory switch architectures provide access to shared memory for all input ports at the same time. A central controller is managing the read/write operations in/out of shared memory. Although the central controller can be a bottleneck by in heavy loads, but based on management algorithm that is deployed in central controller, shared memory architecture could achieve 100% throughput.', '1396704968_implementation_of_a_shared_memory_switch_fabric.doc', '2014-04-05', 'INDRAJA.M', 'indraja.indu4@gmail.com', NULL, 'm.indraja,room no:305,thamarai hosel,', 'srm university,kattankulathur', 'chennai', 'tamilnadu', 603203, 'IN', 'Pending', '', 'ENGINEERING', '1397148698_IJERSS1396704968.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 219, 0),
(209, 'IJERSS-1396721159', 'editor@ijerss.com', 'AUTOMATIC DOCKING AND RECHARGING SYSTEM FOR AUTONOMOUS SECURITY ROBOT', 'Review', 'Embedded systems', 'This paper represents the development and characterization of a robot with automatic wireless recharging capabilities for security. This system consists of two sections Warfield section and the control room section, in the former section consists of Passive IR motion detectors are usually designed to provide an indication in response to detecting IR that is indicative of motion of the object. Someone enters secured places, immediately it will send an indication to the control room section through wireless communication. ZigBee modules are used for wireless communication in both sections. At the same time camera keep on capturing images at the host place and saved into computer. When the security people in supervisory room, they got an indication to the host section by alarm, they can view all information of the war field section images by PC and they operate the weapons if the enters people were opponent persons. When the on-board battery is too low the people in the control room can operate the robot to reach near the docking station for   wireless recharging.', '1396721159_PAPER.doc', '2014-04-05', 'SHAIK MEHATAZ BEGUM,MR.S.NIVASH', 'mehatazbegum@gmail.com', NULL, 'shaik mehataz begum, room no : 112 , E block , ', 'SRM hostels,potheri,kattankulatur', 'kancheepuram Dt', 'Tamil Nadu', 603203, 'IN', 'Published Online', '', 'ENGINEERING', '1397060067_IJERSS1396721159.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 263, 0),
(210, 'IJERSS-1396750395', 'editor@ijerss.com', 'A HYBRID SIMILARITY MEASURES FOR INTEGRATION IN IMAGE-RICH INFORMATION NETWORKS', 'Research', 'INFORMATION TECHNOLOGY', 'An image-rich information network is a social  media website with billions of images uploaded by users which are associated with information about  owner, consumer, producer, annotations, and comments. In this paper, the problem of information retrieval in an image- rich information network and recommendation in such networks is addressed. We propose a combined approach which measures the similarity based on both link based and Content based. The link similarity depends upon the social network information like tags, groups and human annotation over the images. Content based similarity considers the image content properties color histogram etc., for measuring the similarity. The combined score of these measures is used to integrate the social resources and helps to classify the images in image-rich information networks.', '1396750395_journal_(2).doc', '2014-04-06', 'V.ABINAYA,Mr.A.R.ASHOK KUMAR,Prof.D.DURAI KUMAR', 'abinayavnktsn@gmail.com,ashok2k2008@gmail.com,ithod@gtec.ac.in', NULL, '', '', '', '', 0, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(211, 'IJERSS-1396775169', 'editor@ijerss.com', 'FACE RECOGNITION BASED ON SPECTRUM & SWARM ANALYSIS', 'Others', 'IMAGE PROCESSING', 'Face Recognition (FR) has received significant attention in the recent years due to its wide applications in various fields. FR technology uses image processing algorithms for comparing and verifying the human faces.  This paper proposes a FR system employing a unique combination of Fast Fourier Transform (FFT), Discrete Cosine Transform (DCT) and Particle Swarm Optimization (PSO). FFT & DCT helps in extracting the features efficiently and PSO is an artificial intelligence technique used for feature selection that finds the best solution for a given problem.  The input images used are 2-D images from ORL and Yale B database. The usage of transformation techniques helps in reducing image information redundancy. Experimental results show that there is a notable reduction in the number of features and a considerable increase in the recognition rate. ', '1396775169_FACE_RECOGNTN.docx', '2014-04-06', 'B.Dhivya,E.Evangelin,P.Malin bruntha', 'dhivya1808@gmail.com,evange11edward@gmail.com,malin@karunya.edu', NULL, '439, Dakshina Moorthy Residence, Ladies Hostel', 'Karunya University, Karunya Nagar', 'Coimbatore', 'Tamil Nadu', 641114, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(212, 'IJERSS-1396806195', 'editor@ijerss.com', 'REAL TIME TRACKING AND COMPARATIVE ANALYSIS', 'Research', 'IMAGE PROCESSING', 'Abstractâ€” This paper distinguishes two different approaches for tracking a target object in a real-time video dataset. In equivalence to the still images, video sequences render more information on how objects and their scenarios vary overtime. It is always an ambitious task in order to formulate an efficient appearance model. Imprecise extraction of target object and background in model adaptation causes a serious drift problem which leads in degradation of tracking performance. During Pre-processing stages, challenges like illumination, pose variation, occlusion are to be looked upon. This problem can be overcome by continuous detection approach of the target object in each frame. In first approach we formulate a binary classification with the help of a naive Bayes classifier in a compressed knowledge base(domain). In second approach we formulate a simplified version of Kanade-Lucas-Tomasi (KLT) technique to precisely predict and robustly track facial features of the target object.', '1396806195_DANIEL.docx', '2014-04-06', 'DANIEL JAYAKUMAR S,KOLCHARAM YADHUL,BIPIN BANERJEE D M,THUSNAVIS BELLA MARY I', 'danielchinchin@gmail.com,yadhul.427@gmail.com,mathews.biba7@gmail.com,bellamary@karunya.edu', NULL, 'DANIEL JAYAKUMAR S', 'ROOM NO 235, JVR HOSTEL, KARUNYA UNIVERSITY.', 'COIMBATORE', 'TAMIL NADU', 641114, 'IN', 'Pending', '', 'ENGINEERING', '1397056425_IJERSS1396806195.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 803, 0),
(213, 'IJERSS-1396807134', 'editor@ijerss.com', 'COMPARATIVE STUDY OF CBIR TECHNIQUES IN MEDICAL AND NON-MEDICAL APPLICATIONS ', 'Research', 'IMAGE PROCESSING', 'Image Retrieval system is an effective tool for handling immense image databases. The challenge is in retrieval efficiency in case of having all kind of images as query. This depends on the features it utilizes to execute the similarity measurement. In this paper a content based image retrieval system has been designed as diagnosis assistance in medical applications. This paper outlines features of image that are extracted and used as the fundament for a resemblance match between images. The image retrieval techniques based on color and texture features are compared and assessed based on non-medical images and medical images. In regard to the huge size of database, the system has furnished beneficial outcomes. ', '1396807134_BIPIN.docx', '2014-04-06', 'BIPIN BANERJEE D M,KOLCHARAM YADHUL,DANIEL JAYAKUMAR S', 'mathews.biba7@gmail.com,yadhul.427@gmail.com,danielchinchin@gmail.com', NULL, 'Room.No: 345, JVR', 'KARUNYA NAGAR', 'COIMBATORE', 'TAMILNADU', 641114, 'IN', 'Pending', '', 'ENGINEERING', '1397056538_IJERSS1396807134.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 250, 0),
(214, 'IJERSS-1396808223', 'editor@ijerss.com', 'CONTINUOUS HILL RUNNING IMPROVES VO 2 MAX, SPEED ENDURANCE & STRENGTH IN TEAM SPORT ATHLETES ', 'Research', 'TRAINING METHODS,CONTINUOUS HILL RUNNING', 'The purpose of this study was to examine the effect of continuous hill running on VO 2 max, speed endurance &   elastic leg strength among school football players over the period of 12 weeks. This investigation involved pre test and post test randomized control group design. A total of 24 healthy male high school football players volunteered to participate in this study. They were divided randomly into 1 of 2groups: hill continuous running group (Hill end run; n = 12) and control group (CG; n = 12). Subjects in the experimental group ran hill 2 days a week, for 12 weeks, which involved continuous running training.  Balke VO 2 max Test - VO2max (general endurance) ,Speed endurance - 150 metre Endurance Test,  Leg Strength Test - elastic leg strength were measured pre and post training.   Paired t-test and ANCOVA were used to evaluate the effect of training. In all the cases 0.05 level of confidence was fixed to test the hypothesis. The result of this study indicate that continuous hill running over an 12 week preseason period in high school football players  yielding improvements in VO2max (aerobic capacity), reduced 150mts sprinting speed timing (speed endurance) and lower body elastic leg strength.  This study shows that endurance training program on hill surfaces may result in the most physical and physiological changes in young football players.\r\n\r\nKEY WORDS: Basic Endurance, 150mts Sprinting Speed, Elastic Leg Strength, Continuous Running, Fartlek Run, Hill Surface, Football Players.\r\n', '1396808223_UP_HILL.docx', '2014-04-06', 'T.VINOTH,Dr.A.S.NAGESWARAN ', 'arachyvinoth@gmail.com,asnageswaran@gmail.com', NULL, 'T.VINOYH,S/O S.THANGARAJU, 2/47,ARAICHI PO', 'MUSIRI TK', 'THIRUCHIRAPALLI', 'TAMILNADU', 621214, 'IN', 'Pending', '', 'HEALTH SCIENCE', '1397056598_IJERSS1396808223.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 268, 0),
(216, 'IJERSS-1396836256', 'editor@ijerss.com', 'A BLIND NON-INVASIVE ALGORITHM FOR SEPARATION OF MATERNAL AND FETAL ECG SIGNAL', 'Review', 'Electronics & Communication Engineering', 'In the last decades, many blind source separation algorithms like ICA, JADE, SOBI has been introduced for the extraction of Fetal ECG Signal from Maternal signal. The ECG signals are acquired from maternal thoracic and abdominal signal through a non-invasive multi-channel system. The proposed algorithm extracts the noise from the ECG signal and separate the maternal and fetal ECG signal. The separated maternal and fetal signal can be used for diagnosis of disorders in heart such as tachycardia, bradycardia etc. The proposed algorithm is implemented in TMS320C6416 DSP Processor and the efficiencies of the proposed algorithm are compared based on few criterions like output waveform and Signal-to-Noise Ratio. ', '1396836256_Paper2.doc', '2014-04-07', 'SNEHA MOHAN,D.SUGUMAR', 'ashne1234@gmail.com,sugumarssdd@gmail.com', NULL, 'PR12EC2029, II Mtech Communication Systems,', 'DMR, Room No 223, Karunya Nagar', 'Coimbatore', 'Tamilnadu', 641, 'IN', 'Pending', '', 'ENGINEERING', '1397056653_IJERSS1396836256.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 335, 0),
(217, 'IJERSS-1396857387', 'editor@ijerss.com', 'VIDEO RETRIEVAL BASED ON SELECTED INFORMATION', 'Research', 'ENGINEERING', 'In this paper, an integrated system for video summarization is proposed, browsing and presentation, based on large amount of personal and web video clips. This system automatically collects content-consistent video clips and generates an one-shot presentation using them. It can facilitate family album management and web video categorization. A novel video composition system which generates aesthetically enhanced long-shot videos from short video clips are developed', '1396857387_ieee.doc', '2014-04-07', 'MD.WAHED KHAN,MRS.V.K.DALIYA', 'wahedkhanmd@gmail.com,Daliya.vk@ktr.srmuniv.ac.in', NULL, '', '', '', '', 0, 'IN', 'Pending', '', 'ENGINEERING', '1397056705_IJERSS1396857387.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 631, 0),
(218, 'IJERSS-1396857497', 'editor@ijerss.com', 'CUMULATIVE POWER LOGGER FOR INDUSTRIES', 'Research', 'ENGINEERING', '\r\nVery often in an industrial scenario there is a need to monitor the power consumption patterns of individual units or machines. Some rather minor factors can cause huge amounts of unnecessary power consumption, which often go unnoticed and incur huge expenses for industries. This project aims at providing a system with which the power consumption and energy consumption of individual machines can be monitored and recorded, from a central location. In this project an embedded power monitoring device is attached with the machine where the power consumption is to be recorded. The embedded power monitoring device records the power consumption in the unit and periodically transmits the readings using a Zigbee transmitter.  The readings from all the monitoring devices can be received with a single receiver and the readings are then transferred to a microcontroller which again displays the information on a computer. Hence the power consumption from all the units can be monitored on a single terminal. The readings can also be displayed on a portable display like a LCD.  Apart from the primary purpose of power monitoring this project has extended capability in terms of upper threshold for power consumption. With this feature when a particular unit is consuming very high power or is showing abnormal power consumption, the microcontroller unit automatically disconnects the device, and gives an indication on the computer screen for the users. And it also send a message to the user about the status of the machine by using GSM Module. And for the development of these project we are using an ARM7 Based LPC2148 microcontroller and a keil micro vision 4 for the simulation of the results', '1396857497_praveen_jounral.doc', '2014-04-07', 'P.PRAVEEN KUMAR,A.VINNARASI', 'ppraveenkumar76@gmail.com,vinnarasi.a@ktr.srmuniv.ac.in', NULL, '', '', '', '', 0, 'IN', 'ACCEPTED', 'Pay Manuscript processing fee', 'ENGINEERING', '1398857787_IJERSS1396857497.pdf', 0, 0, 'IJERSS-2014', 0, 0, 'Volume I - Issue V, May 2014.', 24, 0),
(220, 'IJERSS-1396864336', 'editor@ijerss.com', 'research article', 'Research', 'Embedded System', 'GPS radio occultation has proved to be a powerful tool for remotely sensing the Earthâ€™s neutral atmosphere and ionosphere. In this letter, we propose a novel approach to retrieving marine troposphere profiles based on single ground-based GPS occultation observations. A new retrieval method uses the data from a ground based receiver while the GPS satellites rise or set at the local horizon in the direction of the ocean. The GPS L1 amplitude signals with negative elevation angles are used to retrieve the atmospheric refractivity by artificial neutral networks. The subsequent experiment was carried out on the coast of the Yellow Sea from August 2010 to July 2011. It is shown that the inversion profiles are very consistent with the radiosonde observations. The new method outperforms the Hopfield model, particularly at 0.5â€“5-km altitude. These results validate the feasibility of retrieving the lower marine atmospheric refractivity from GPS data collected by a single ground-based receiver near the sea surface.', '1396864336_rakesh.docx', '2014-04-07', 'Ramineni Rakesh,A.Vinnarasi', 'rakeshramineni461@gmail.com,vinnarasi.a@ktr.srmuniv.ac.in', NULL, '2-50a Near ploaramagudi', 'korsipadu mandalam, prakasam(d.t)', 'medarametla', 'Andhra pradesh', 523212, 'IN', 'Pending', NULL, NULL, NULL, 0, 1, 'IJERSS-2014', 0, 0, 'New', 5, 1),
(221, 'IJERSS-1396876274', 'editor@ijerss.com', 'IMPLEMENTATION OF MODULO (2^N)-(2^K)-1 ADDER FOR RESIDUE NUMBER SYSTEM', 'Research', 'VLSI & Digital', 'Modular adder is one of the key components for the application of residue number system (RNS). Moduli set with the form of (2^n)-(2^k)-1(1â‰¤ kâ‰¤ n-2) can offer excellent balance among the RNS channels for multi-channels RNS processing. A novel algorithm and its VLSI implementation structure are proposed for modulo (2^n)-(2^k)-1 adder. Any existing parallel prefix structure can be used in the implemented structure. This can get flexible tradeoff between area and delay with the proposed modulo adder. Compared with same type of modular adder with traditional structures, the proposed  modulo adder offers better performance in delay and area.In this paper the proposed modulo adder is used in the RC5 Cryptography algorithm to increase the Throughput.', '1396876274_MY_PAPER_final.doc', '2014-04-07', 'M.MONIKA REDDY,B.VISWANATHAN', 'mmonikareddy@yahoo.com,viswanathan.b@ktr.srmuniv.ac.in', NULL, 'M.Monika Reddy,Room no:317', 'Thamarai [E-block],SRM Hostels', 'Chennai', 'Tamil Nadu', 603203, 'IN', 'Pending', '', 'ENGINEERING', '1397143162_IJERSS1396876274.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 330, 0),
(222, 'IJERSS-1396894136', 'editor@ijerss.com', '8-BIT UART IMPLEMENTATION IN FPGA WITH BIST TECHNIQUE', 'Research', 'VLSI ', 'Universal Asynchronous Receiver Transmitter (UART)  permits  full  duplex  serial  communication link. It is also used for  the exchange of data between processor and peripherals in the data communication. We should ensure that the data being transferred is Error free . This Paper focuses on  the introduction of Built-in self test (BIST) with  Status register to UART, to overcome the two problems of testability and data integrity. In  This  paper we presented  the  architecture  of  UART  which indicates framing error, parity error, break error and overrun error during the reception of data using status register. The 8-bit UART with status register and BIST module is coded in VHDL and synthesized and simulated using Xilinx XST and ISim version 14.2 and realized on Virtex 4. The results indicate that the Maximum Net Delay can be reduced and also the Size (Number of slices) used can also be reduced which are the two advantages of using this technique.', '1396894136_Y.DANIEL_SUKUMAR.docx', '2014-04-07', 'Y.DANIEL SUKUMAR,J.JAYANTH KUMAR,N.PRASAD REDDY,S.DAVID DHINAKARAN', 'danielsukumar08@gmail.com,jettyjayanth2@gmail.com,prasadreddynusum@gmail. com,Samdavid.dave@gmail.co', NULL, 'Y.DANIEL SUKUMAR', 'ROOM NO:241, JVR HOSTEL, KARUNYA UNIVERSITY', 'COIMBATORE', 'TAMIL NADU', 641114, 'IN', 'Pending', '', 'ENGINEERING', '1397056754_IJERSS1396894136.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 428, 0),
(224, 'IJERSS-1396935328', 'editor@ijerss.com', 'IMPLEMENTATION OF CMOS CAMERA DEVICE DRIVER AND WI-FI TECHNIQUE ON S3C2440 USING LINUX', 'Research', 'EMBEDDED SYSTEMS & LINUX DEVICE DRIVERS', 'with the processing of CMOS technology, the technology of video acquisition based on CMOS is becoming a new trend. However, many CMOS camera chip is not supported by the newest Linux kernel yet. In this paper, the method of designing the  CMOS  camera  driver  based  on  S3C2440 developing  board  with  the  embedded  Linux  environment  is  introduced The system uses SAMSUNG S3C2440 as a microprocessor, the camera equipment is OV9650. SAMSUNG S3C2440 uses 16/32 bit ARM920T RISC technology for the core. ARM9 is continuously monitoring the video by using OV9650 CMOS camera. For the ARM9 board USB based Wi-Fi module is connected and sending video continuously through Wi-Fi. Any smart phone with hotspot enabled one will be used to create a Wi-Fi hotspot which will create the Wi-Fi network. After the Wi-Fi network is created, ARM9 board will connect to that network using its own Wi-Fi module, and all the other clients (computers or laptops or mobiles) with Wi-Fi capability can connect to the same network and will access the ARM9''s IP address on the browser to see the video.', '1396935328_AJAY_jounral_DOC.doc', '2014-04-08', 'A.JOSHUA JAFFERSON , A V SATYANARAYANA AJAY ', 'joshua.j@ktr.srmuniv.ac.in,avsajay490@gmail.com', NULL, 'NO. :1,PERUMAL KOIL STREET', 'BACK SIDE OF RUMALI RESTAURANT, POTHERI', 'KANCHEEPURAM ', 'TAMIL NADU', 603203, 'IN', 'ACCEPTED', 'Pay Manuscript processing fee', 'ENGINEERING', '1398737111_IJERSS1396935328.pdf', 0, 0, 'IJERSS-2014', 0, 0, 'Volume I - Issue V, May 2014.', 60, 0),
(225, 'IJERSS-1396966453', 'editor@ijerss.com', 'A HYBRID NETWORK FOR GREENHOUSE MANAGEMENT USING CAN AND ZIGBEE', 'Research', 'Embedded systems & Automatic greenhouse management', '    \r\n       In this paper the problems of a farm which consists of several greenhouses are proposed. To maintain the optimal conditions of the greenhouse parameters, different sensors and corresponding controlling devices are discussed. The communication between the greenhouses using Controller Area Network protocol (CAN) And  ZIGBEE wireless technology is used for the communication between greenhouse environment and monitoring section.', '1396966453_A_Hybrid_Network_for_Greenhouse_Management_Using_CAN_and_ZIGBEE.doc', '2014-04-08', 'GUDDETI KIRAN KUMAR REDDY,G. KALAIMAGAL', 'kiran.guddeti@gmail.com,kalaimagal.g@ktr.srmuniv.ac.in', NULL, 'C-71', 'Sterling apartment', 'Guduvanchery', 'Tamilnadu', 603202, 'IN', 'Pending', NULL, 'ENGINEERING', '1397056815_IJERSS1396966453.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue IV, April 2014.', 417, 0),
(226, 'IJERSS-1396967791', 'editor@ijerss.com', 'VEHICLE CRASH AVOIDANCE USING ADAPTIVE NEURAL-FUZZY INFERANCE SYSTEM', 'Research', 'M.TECH & VEHICLE CRASH AVOIDANCE USING ADAPTIVE NEURAL-FUZZY INFERANCE SYSTEM', '              Vehicle crashes are consider to be events that are extremely complex to be analyzed from the mathematical point of view.  In order to establish a mathematical model of a vehicle crash, one need to consider various areas of research. For this reason, we simply analysis and improve the modeling process. In this project , a novel adaptive neural fuzzy inference system(ANFIS based) approach is implemented to reconstruct kinematics for colliding vehicles. A typical five-layered ANFIS structure is trained to reproduce kinematics (acceleration, velocity and displacement) of a vehicle involved in an oblique barrier collision. Subsequently, the same ANFIS structure is applied to simulate different types of collisions than the one which was used in the training stage. Finally, the simulation outcomes are compared with the results obtained by applying different modeling techniques. The reliability of the proposed method is evaluated.', '1396967791_viswanath_report.doc', '2014-04-08', 'E V VISWANATH KUMAR,G KALAIMAGAL', 'viswanathkumar033@gmail.com,kalaimagal.g@ktr.srmuniv.ac.in                 ', NULL, 'Sterling little flower apartments,c-71,', 'Guduvenchary', 'Guduvenchary', 'TAMIL NADU', 603202, 'IN', 'Pending', '', 'ENGINEERING', '1398737178_IJERSS1396967791.pdf', 0, 0, 'IJERSS-2014', 0, 0, 'Volume I - Issue V, May 2014.', 28, 0),
(227, 'IJERSS-1396980620', 'editor@ijerss.com', 'DETECTION OF RUNWAY USING NEURAL NETWORKS', 'Research', 'Image processing', 'Abstractâ€” Runways are very important for airplanes to get into the airport. In this, detection of runway is based upon extracting features is proposed because they are the most descriptive element of an airport. By this feature extraction, airport runways are predicted, the neural algorithm the key for all of the features. These features can provide information about characteristics of runways. Thus, neural algorithm can be used as detecting runways and identifying their characteristic. Thus, the possible runways are detected.    ', '1396980620_Naik.docx', '2014-04-08', 'K.SUSHANTH,B.SAI TEJA NAIK', 'sssbunny123@gmail.com,saitejanaik999@gmail.com', NULL, 'd.no-202,jvr hostel,karunya university,', '', 'coimbatore', 'tamilnadu', 641114, 'IN', 'Pending', NULL, 'ENGINEERING', '1397096006_IJERSS1396980620.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue IV, April 2014.', 369, 1),
(228, 'IJERSS-1397011529', 'editor@ijerss.com', 'Advanced Security', 'Research', 'Biometrics', 'Abstractâ€” In the present age, cryptography is being used extensively for protecting information. The process of protecting information by encrypting it into an unreadable format, called cipher text. Only those who possess the secret key can decrypt the encrypted data into plain text. Encrypted messages can be cracked by cryptanalysis, also called code cracking. So to overcome code cracking we are integrating biometrics and cryptography. In this paper we will be discussing the various ways of generating cryptographic keys. The first approach is by using Key generation algorithm. Second is an efficient approach for cryptographic key generation from fingerprint biometrics using Thinning Algorithm.', '1397011529_advanced_security.pdf', '2014-04-09', 'B.Praneeth,T.Mahidhar Reddy,O.S.Rohith Gupta,B.Dileep', 'bommineni.praneeth@gmail. com,mahidharreddy308@gmail.com,rohit.g.309@gmail.com,b.dileep93@gmail.com', NULL, 'Room:204 , JVR Residence ,Karunya University ', 'Karunya Nagar', 'COIMBATORE', 'TAMIL NADU', 641114, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(230, 'IJERSS-1397054650', 'editor@ijerss.com', 'EFFECT OF CONTINUOUS RUNNING FARTLEK AND INTERVAL TRAINING ON SPEED AND COORDINATION AMONG MALE SOCCER PLAYERS', 'Research', 'SPORTS SCIENCE', 'The aim of this study was to finding out the effect of Continuous running Fartlek training and Interval training on Speed and Coordination among male soccer players. To achieve the purpose of the study 60 intercollegiate male  football players were selected as subject at random from in an around the Guntur district of Andhra Pradesh and their age ranged of the subject is between 18 to 23years.The subject was divided into four group namely experimental group A, experimental group B, experimental group C and Control group D. Experimental group A underwent to Continuous running training, experimental group B underwent to Fartlek training, experimental group C underwent to Interval  training and group D act as a control group they did  not participate in any of the training programme other than their regular activates. The data was collected from four groupsâ€™ pre and post of the experimental period. The raw data on speed and coordination was statistically analyzed by using Analysis of Covariance (ANCOVA). Scheffeâ€™s post hoc test was applied to determine the significant differences between the paired adjusted means. In all the cases 0.05 level of significance was fixed. The result of the study showed that there was as significantly improvement was found in speed and Coordination among the experimental group when compared with control group', '1397054650_EFFECT_OF_CONTINUOUS_RUNNING_FARTLEK_AND_INTEVAL_TRAINING_ON_SPEED_AND_COORDINATION_AMONG', '2014-04-09', 'M.SUDHAKAR BABU ,DR.P.P.S.PAUL KUMAR', 'sudhakarbabum48@gmail.com,ppsatyapaulkumar@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1397056850_IJERSS1397054650.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue IV, April 2014.', 327, 1),
(231, 'IJERSS-1397113311', 'editor@ijerss.com', 'Comparison of Routing Protocols and Congestion Controlled Approach in Wireless Mesh Network', 'Research', 'Communication', 'In Multi-Radio, Multi-Channel, wireless Mesh Networks we address the problem of congestion control. This problem is significantly more complex because it requires the channel adjustments and the traffic allocations per channel be jointly optimized. The way in which the congestion is handled may result in longer delay and more packet loss and a significant overhead may occur.  We address these problems by routing technique by using formulation that allows its decomposition in congestion control over a node path. We compare some routing techniques that attains high throughput and increase in packet delivery ratio and reduced end to end delay.', '1397113311_paper2.1.docx', '2014-04-10', 'N.Srinivas,E.Rahul,B.Dixith, MRS JASMINE DAVID', 'neelamsrinivas@karunya.edu.in', NULL, 'room no-202,jvr hostel,karunya university,', '', 'coimbatore', 'tamilnadu', 641114, 'IN', 'Pending', '', 'ENGINEERING', '1398736820_IJERSS1397113311.pdf', 0, 0, 'IJERSS-2014', 0, 0, 'Volume I - Issue V, May 2014.', 39, 0),
(233, 'IJERSS-1397548071', 'editor@ijerss.com', 'REAL-TIME TRACKING DOWN OF ABANDONED OBJECTS IN MASS TRANSIT AREAS', 'Research', 'EMBEDDED SYSTEMS & ENGINEERING', 'In general automated offline video processing systems have been used for post-event analysis. However very little has been achieved regarding real-time object recognition. This paper aims at tracking down of abandoned objects in mass transit areas like airports, bus stations etc. in real-time, which enhances the security of the area being monitored compared to automated offline video processing systems.', '1397548071_realtime_project.doc', '2014-04-15', 'M BOGESWARA RAO,V.K.DALIYA,M.THANUJA', 'bogeshmadhu@yahoo.com,jayanthi.village@gmail.com,bogesh.thanuja@gmail.com', NULL, 'ROOM N O:401,NEW PG (MEDICAL) GENTS HOSTEL, ', 'SRM HOSTELS,SRM UNIVERSITY,KATTANKULATHUR,', 'CHENNAI.', 'TAMILNADU', 603203, 'IN', 'Pending', '', 'ENGINEERING', '1398699277_IJERSS1397548071.pdf', 0, 0, 'IJERSS-2014', 0, 0, 'Volume I - Issue V, May 2014.', 30, 0),
(234, 'IJERSS-1398244861', 'editor@ijerss.com', 'CNT BASED ELECTRODE FOR SOLAR PHOTOVOLTAICS', 'Review', 'NANO TECHNOLOGY', 'This paper presents a literature overview of CNT (Carbon Nano Tube) based electrode for High conversion efficient solar cells. The types of CNT, methodology of preparation of CNT layer for solar cell, methods of coating, temperature conditions, analysis techniques, advantages and their usefulness have been studied so that an efficient solar cell layer can be created.\r\nKeywords: Carbon Nanotubes(CNTs), Manual Spray Coating, Thin Films\r\n', '1398244861_CNT_LITERATURE.docx', '2014-04-23', 'A.Pravin,I.Flavia Princess Nesamani,R.Ranjini', 'pravina@karunya.edu.in,flavia@karunya.edu.in,ranjinir@karunya.edu.in', NULL, 'Room no:359,JVR RESIDENCE,', 'KARUNYA UNIVERSITY,KARUNYA NAGAR,', 'COIMBATORE', 'TAMILNADU', 641114, 'IN', 'Accepted', 'Pay Manuscript processing fee', 'ENGINEERING', '1398698964_IJERSS1398244861.pdf', 0, 0, 'IJERSS-2014', 0, 0, 'Volume I - Issue V, May 2014.', 44, 0),
(235, 'IJERSS-1398403581', 'editor@ijerss.com', 'Implementation of Live Video Cartooning Using Thresholding Technique in YUV Format on TMS320C6416 DSP processor', 'Research', 'Image processing-Video Cartoonisation', 'The paper discussed here deals with inducing cartoon like features to an input video using DSP processor (Texas Instrument product, TMS3206416). The basic process involved is taking input, a color video which is to be converted into a cartoon like video in DSP board can be displayed on VM3224K2 Daughter kit (LCD). VM3224Daughter Kit is embedded with DSK6416 Kit to display the output video. The conversion process is carried out in the YUV colour format. Converting in the YUV format is advantageous because applying thresholding technique to the intensity component (Yâ€™) of the video can render a cartoon like appearance to the video as the YUV colour model is based on human perception. Only the intensity component of the video inYUV format is modified as the YUV colour model allows apparent changes in the colour perception without actually altering the chrominance component of the video. Suitable thresholding techniques; single level or multi level thresholding technique can be used to get the desired effect. YUV colour model has three components namely Y, U and V. â€˜Yâ€™ is the intensity component whereas â€˜Uâ€™ and â€˜Vâ€™ are chrominance components. As this colour model facilitates apparent change in colour by simply varying the intensity component it is a very simple and intuitive technique to convert an input video to a cartoon like video. In order to observe the quality and suppleness of the algorithm various simulations in image level using different techniques has been compared with the proposed algorithm in MATLAB software. The proposed algorithm namely thresholding technique in YUV format were well implemented practically on our hardware (TMS6416 kit). Implementation of algorithm has been carried out in C-programming language using CCstudio v3.1 and various simulations have been carried out in MATLAB.', '1398403581_Paper_Presentation.docx', '2014-04-25', 'Nitin John James,Dan Thomas Jarard,Hudson John', 'nitinjames08@gmail.com,danjl@ymail.com,hudsonjohn93@gmail.com', NULL, 'Electronics and communication department,', 'Karunya University, Karunya Nagar,Siruvani main Rd', 'Coimbatore', 'Tamil Nadu', 641114, 'IN', 'Accepted', 'Please Pay Manuscript Processing fee', 'ENGINEERING', '1398698726_IJERSS1398403581.pdf', 0, 0, 'IJERSS-2014', 0, 0, 'Volume I - Issue V, May 2014.', 43, 0),
(236, 'IJERSS-1399301803', 'editor@ijerss.com', 'Feature Similarity Based Adaptive Unequal Merging for SAR Image Segmentation', 'Research', 'Image Processing', 'An image segmentation method based on feature similarity and unequal merging for SAR  images is presented. This image segmentation method uses superpixels as the operation units instead of pixels. In this work, the input image is first preprocessed by filtering the input image using weighted trimmed median filter. Then superpixels are generated by using simple linear iterative clustering algorithm.  Three rules which were derived from the famous Gestalt laws were used to manage different kinds of features extracted from the SAR images. These features were used to represent the superpixel context. They serve as top-down constraints to guide the superpixel merging. The features such as brightness, texture, edges and spatial information describe the superpixels of SAR images. An unequal merging algorithm is used to merge the superpixels. The unequal merging algorithm consists of two stages 1) coarse merging stage and 2) fine merging stage. The unequal merging algorithm allocates computation resources unequally. It spends less running time for superpixels without ambiguity and more running time for superpixels with ambiguity. The coarse merging stage and fine merging stages can make a balance between computation speed and segmentation accuracy. The feature similarity and unequal merging method can obtain good segmentation results and successfully reduce running time.', '1399301803_journal.doc', '2014-05-05', 'Sonia.M.S,M.Geetha Jenifel', 'mssonia08@gmail.com,jenifel.it@gmail.com', NULL, 'Swarna Bhavan', 'Vattavilai,  North Street, Marthandam', 'Kanyakumari', 'Tamilnadu', 629165, 'IN', 'ACCEPTED', 'Pay Manuscript processing fee', 'ENGINEERING', '1400694990_Please_Pay_Manuscript_Fee_to_view_your_paper_online.pdf', 0, 0, 'IJERSS-2014', 0, 0, 'Volume I - Issue V, May 2014.', 60, 0),
(237, 'IJERSS-1399357412', 'editor@ijerss.com', 'ADAPTIVE ROUTING ALGORITHMS IN DISTRIBUTED NETWORKS', 'Research', 'COMPUTER NETWORKS&ROUTING ALGORITHMS', 'ADAPTIVE ROUTING ALGORITHMS IN DISTRIBUTED NETWORKS\r\nAbstract: \r\nRouting is an important function to run some important operations in the computer networks, it influence both the process of managing the network as the quality of services in world wide networks. The management of transferring the message has to fulfill the requirements volume of traffic to be transmitted as to prevent congestions for reducing the transmission delays. These two requirements in general are contradictory. The most favorable process of sending the messages is a key issue for the quality of the information services. Routing in networks, applying shortest path algorithms widely used in communication protocols in WIDE AREA NETWORK.\r\n', '1399357412_ADAPTIVE_ROUTING_ALGORITHMS_IN_DISTRIBUTED_NETWORKS.docx', '2014-05-06', 'K RANGASWAMY', 'RANGASWAMY19@GMAIL.COM', NULL, '27/388-A,EAST STREET,RAMESWARAM,PRODDATUR', 'KADAPA(DIST)', 'PRODDATUR', 'ANDRAPRADESH', 516360, 'IN', 'ACCEPTED', 'Pay Manuscript processing fee', 'ENGINEERING', '1400694950_Please_Pay_Manuscript_Fee_to_view_your_paper_online.pdf', 0, 0, 'IJERSS-2014', 0, 0, 'Volume I - Issue V, May 2014.', 26, 0),
(238, 'IJERSS-1399392869', 'editor@ijerss.com', 'REVIEW ON WIRELESS SENSOR NETWORKS', 'Review', 'Wireless Sensor Nework', 'In this paper, describes the concepts of Wireless Sensor Networks which has the wide range of applications in sensing field like environmental monitoring. First Components of sensor nodes and various applications of wireless sensor networks and the sensor nodes deployment are explored. The sensor nodes communication architectures and its protocol stacks are outlined. The availability of different kind of sensor nodes and its types are discussed and the power consumption of Eyes sensor nodes are considered for example. The idle listening problems by the traditional MAC protocols for energy consumption and S-MAC protocols are discussed. \r\n\r\n', '1399392869_WSN_Paper.doc', '2014-05-06', 'B.Rajesh,M.Umamaheswari,S.Pratheepa Devapriya,Dr.R.Neduchelian', 'rajeshb859,umamaheswari.m25@gmail.com,pratheepa_sampath@yahoo.co.in,chelian1959@gmail.com', NULL, '#9, Mandapam 1st street,', 'Kilpauk', 'Chennai', 'Tamilnadu', 600010, 'IN', 'ACCEPTED', 'Pay Manuscript processing fee', 'COMPUTER SCIENCE', '1399833726_IJERSS1399392869.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue V, May 2014.', 1972, 1),
(239, 'IJERSS-1399393100', 'editor@ijerss.com', 'THE EFFECT OF REPEATED SPRINT TRAINING AT DOWNHILL SLOPE ON MAXIMUM SPRINTING SPEED ACCELERATION VELOCITY FORCE AND ANAEROBIC POWER IN SCHOOL FOOTBALL PLAYERS', 'Research', 'TRAINING METHODS,REPEATED SPRINT TRAINING (DOWNHILL SLOPE)', 'The purpose of the current study is to find out the effect of 8 weeks of repeated sprint training at downhill slope among school football players. The pre test and post test randomized control group design was used as an experimental design. Subjects for this study were 24 healthy male school football players (age, 14 to 17 years). The selected subjects were randomly assigned in to two equal groups, RST- Repeated Sprint Training Group (n=12) and CG- Control group (n=12).The duration of the training program was 8 weeks,2 sessions/ week and it consisted of repeated sprint training sessions. Maximum Sprinting speed, acceleration, velocity, force and anaerobic power were measured through RAST- running based anaerobic sprint test. Selected criterion variables were statistically analyzed with paired sampleâ€˜tâ€™ test to find out significant improvement between pre and post test means of experimental and control groups and analysis of covariance (ANCOVA) was used to find out significant differences between experimental and control groups. In all the cases 0.05 level of confidence was fixed to test the hypothesis. The repeated sprint training program produced favourable changes in Maximum Sprinting speed, acceleration, velocity, force and anaerobic power due to that effect of 8 weeks of training among school football players. The control group showed no significant change in any. The inclusion of repeated sprint training programs at downhill slopes to normal football training sessions represents an effective means of increasing performance-related physical fitness traits in football players.\r\nKEYWORD: RST, DOWNHILL SLOPE, RAST - TEST, 35mts SPRINT TIMING, FOOTBALL PLAYERS.\r\n', '1399393100_down_hill_final.docx', '2014-05-06', 'T.VINOTH,Dr.A.S.NAGESWARAN,Dr.S.SETHU', 'arachyvinoth@gmail.com,asnageswaran@gmail.com,drsksethu@gmail.com', NULL, 'T.VINOYH,S/O S.THANGARAJU, 2/47,ARAICHI PO', 'THATHIANGARPET, MUSIRI TK', 'THIRUCHIRAPALLI', 'TAMILNADU', 621214, 'IN', 'ACCEPTED', '', 'SPORTS SCIENCE', '1399635594_IJERSS1399393100.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 406, 1),
(240, 'IJERSS-1399443372', 'editor@ijerss.com', 'VANET Routing Protocol-Movement Aware Routing Protocol based on Probability', 'Research', 'VANET-Networking', 'Vehicular Ad Hoc Network (VANET) is a sub class of mobile ad hoc networks. The performance of communication depends on how better the routing takes place in the network. Routing of data depends on the routing protocols being used in network. Position-based routing protocols are considered best for high dynamic network like VANET. In this paper using two position based routing protocol  proposed new routing protocol and measure itâ€™s performance with the no. of nodes, speed of nodes with measured packet delivery ratio.', '1399443372_VANET_Routing_protocolMovement_aware_Routing_based_on_Probability.docx', '2014-05-07', 'Shreya Patel', 'shreyapatel1@yahoo.co.in', NULL, '34, Vasant Vihar Society, ', 'Sahakari Jin Road', 'Himmatnagar', 'Gujarat', 383001, 'IN', 'ACCEPTED', 'Pay Manuscript processing fee', 'COMPUTER SCIENCE', '1400694914_Please_Pay_Manuscript_Fee_to_view_your_paper_online.pdf', 0, 0, 'IJERSS-2014', 0, 0, 'Volume I - Issue V, May 2014.', 35, 0);
INSERT INTO `papers` (`id`, `paper_id`, `paper_referral`, `paper_title`, `paper_type`, `subject_category`, `abstract`, `paper_attachment`, `uploaded_on`, `author`, `email`, `pnumber`, `address_line1`, `address_line2`, `city`, `state`, `pincode`, `country`, `status`, `comments`, `subject`, `pdf`, `active`, `news`, `conference`, `volume`, `issue`, `volume_issue_title`, `downloads`, `blogspot`) VALUES
(241, 'IJERSS-1399473681', 'editor@ijerss.com', 'EFFECTIVE DATA COLLECTION IN WIRELESS SENSOR NETWORKS', 'Research', 'ENGINEERING', 'Wireless Sensor Networks refers to ad-hoc wireless networks consisting of nodes that have sensing capability. The data are collected and processed by a subset of nodes that involves moving data over multiple hops. Hexagonal Wireless sensor network refers to a network topology where a subset of nodes have six peer neighbours.  These nodes forms a backbone for multihop communication.  WSN is a dynamic network where links are volatile between the nodes involved. There are QoS parameters like coverage, packet drop ratio, traffic control, delay, jitter, energy used, quality of nodes and packets, etc. Wireless Sensor Network promises a new domain to interact with our environment through computers and humans. WSN serves large number of time critical applications for saving human life. For example, disaster relief, emergency services etc.The applications based on WSN clearly depend upon the factor â€œSensing + computation + radio operationâ€.Among these factors the energy loss is maximum due to radio operations which must be controlled to get better throughput.', '1399473681_wsndoc1.doc', '2014-05-07', 'A.Gnana Soundari,Dr. V. L. Jyothi', 'soundarivenkat77@gmail.com', NULL, '', '', '', '', 0, 'IN', 'ACCEPTED', '', 'ENGINEERING', '1399649411_IJERSS1399473681.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 116, 1),
(242, 'IJERSS-1399646614', 'editor@ijerss.com', 'DESIGN AND CONTROL OF SELF EXCITED INDUCTION GENERATOR', 'Research', 'ENGINEERING', 'An  induction generator works as a self excited induction generator when a capacitor bank is connected across the stator terminals of the machine. In this paper a self excited induction generator is modeled and the excitation capacitance for self excitation process of induction generator is designed. As the induction generator acts as a sink to reactive power the capacitors should supply the reactive power required by both self excited induction generator and load. If there are any changes in load the generated voltage of the machine starts decreasing which has to be maintained constant. Hence the  voltage of a self excited induction generator is controlled constant by using a Static Var Compensator(SVC). All this proposed work is implemented in MATLAB/SIMULINK', '1399646614_paper.docx', '2014-05-09', 'RAMYA SREE .K,M.NAGA JYOTHI', 'ramyasree.kamma@gmail.com,nagajyothi_mvnrvjiet.in', NULL, '', '', '', '', 0, 'IN', 'ACCEPTED', 'Pay Processing Fee', 'ENGINEERING', '1400694880_Please_Pay_Manuscript_Fee_to_view_your_paper_online.pdf', 0, 0, 'IJERSS-2014', 0, 0, 'Volume I - Issue V, May 2014.', 35, 0),
(243, 'IJERSS-1399649742', 'editor@ijerss.com', 'Load Frequency Control Using Pole Placement Technique', 'Research', 'ENGINEERING', 'Pole placement is a method employed in feedback control system theory to place the closed loop poles of a plant in pre-determined locations in the s-plane Pole placement can be done arbitrarily if and only if the system is controllable Frequency is a key stability criterion in power systems to provide stability. The main objective of pole placement in this project is to reduce the steady state frequency error to zero.', '1399649742_ieee_paper_(1).doc', '2014-05-09', 'S.Bhavyasree,J.Vani Samyukta', 'nagajyothi_m@vnrvjiet.in', NULL, '', '', '', '', 0, 'IN', 'Paper yet to submit again', 'Pay Manuscript processing fee', 'ENGINEERING', NULL, 0, 0, 'IJERSS-2014', 0, 0, 'Volume I - Issue V, May 2014.', 9, 0),
(244, 'IJERSS-1399659456', 'editor@ijerss.com', 'Studies on Preparation and Shelf life of Honey Aonla Squash', 'Research', 'Agriculture Techniques & Technology', 'To investigate the various physico-chemical and organoleptic quality attributes of developed honey aonla squash as affected by storage temperature and storage period at different intervals.\r\n\r\nLarge sized aonla were washed with cold water and after the damaged ones discarded, they were properly cleaned and heated in boiling water for 15 minutes. The pulp was strained and the juice was mixed with honey, citric acid and potassium metabisulphite. The prepared aonla squash was packed in glass bottles and stored at room and refrigerated temperature up to 6 months. The squash was analyzed for various physico-chemical and organoleptic qualities\r\n.\r\nAlmost all the physico-chemical quality attributes of developed honey aonla squash showed an increasing trend except T.S.S and acidity. In all the cases the effect was lower during storage in refrigerated condition as compared to squash stored at room temperature. On 9 point hedonic scale colour, flavor, taste and overall acceptability decreased with increase in storage period. Though refrigerated storage was better in retaining these scores as compared to room temperature storage and showing a significant effect of storage temperature, in all cases the samples even after 180 days storage remained acceptable.\r\n', '1399659456_SQUASH_PAPER.doc', '2014-05-09', 'Anisa M Durrani,Sangeeta Verma', 'anisamd@gmail.com,sangeeta@yahoo.com', NULL, 'Durrani Mansion, house No. 820', 'Iqra colony', 'Aligarh', 'Utter Pradesh', 202001, 'IN', 'ACCEPTED', 'Pay Processing Fee', 'HOME SCIENCE', '1400932375_IJERSS1399659456.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 405, 1),
(245, 'IJERSS-1399736262', 'editor@ijerss.com', 'PRACTICAL APPROACH FOR DETECTION OF FAILURE OF DISTRIBUTION TRANSFORMERS AND THEIR REMIDIES', 'Research', 'ENGINEERING', 'An attempt has been made to analyze the practical causes contributing to the failure of distribution transformers', '1399736262_PRACTICAL_APPROACH_FOR_DETECTION_OF_FAILURE_OF_DISTRIBUTION_TRANSFORMERS_AND_THEIR_REMIDI', '2014-05-10', 'B.Suresh Kumar', 'bskbus@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(246, 'IJERSS-1399918346', 'editor@ijerss.com', 'HISTOGRAM TO HISTOGRAM MATCHING', 'Research', 'Image Processing', 'Histogram Matching (HM) is a common technique for finding a monotonic map between two histograms. However, HM cannot deal with cases where a single mapping is sought between two sets of histograms. This paper presents a novel technique that finds such mapping in an optimal manner under various histograms distance measures. Also we present a method to perform histogram matching between two color images based on the concept of harmonic mapping between Riemannian manifolds. The key idea is to associate the histogram of a color image to a Riemannian manifold. In this context, the energy of the matching between the two images is measured by the Dirichlet energy of the mapping between Riemannian manifolds. Then, we assimilate optimal matching to critical points of the Dirichlet energy. Such points are called harmonic maps.', '1399918346_Histogram_to_Histogram_Matching.doc', '2014-05-12', 'ANINDITA CHATTERJEE,HIMADRI NATH MOULICK,CHANDAN KONER', 'anindita_star24@rediffmail.com', NULL, 'Bapuji Colony,P.O. Ichapur-Nawabganj,24Pgs(North)', '', 'Kolkata', 'West Bengal', 743144, 'IN', 'Published Online', '', 'COMPUTER SCIENCE', '1401386625_IJERSS1399918346.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue VI, June 2014.', 344, 1),
(247, 'IJERSS-1400137700', 'editor@ijerss.com', 'COLLISION AVOIDANCE SYSTEM USING ANDROID DEVICE VIA BLUETOOTH', 'Research', 'COMPUTER SCIENCE', 'Collision Avoidance Systems, this is an alternative step to avoid collision, are one of the great challenges in the area of active safety for road vehicles. In India the total annual deaths due to road accidents has crossed 1.18 lakhs, according to the latest report of National Crime Records Bureau (NCRB). If these deficiencies are not controlled at early stages they might cause huge economical problems affecting the road side networks. The main part of the work was to carry out a feasibility study on vehicle collision avoidance system using wireless sensor networks. The collision avoidance can be done by Ultrasonic ping sensor. Vehicle collision avoidance system can be identified by using Ultrasonic sensor which will be connected to the car at four sides with the LCD and to an Android mobile (via Bluetooth) to show the top view of the car. Initially in our previous part [5] we had our embedded systems where we had shown the collision detection using the Ultra Sonic Sensors [4] and an LCD display', '1400137700_COLLISION_AVOIDANCE_SYSTEM_USING_ANDROID_DEVICE_VIA_BLUETOOTH.docx', '2014-05-15', 'PROF. SANGRAM KESHARI SWAIN,ANUP PATNAIK,ABHIJEET PRADHAN,VINOD KUMAR KURNENI', 'sangram@cutm.ac.in', NULL, '', '', '', '', 0, 'IN', 'Pending', '', 'COMPUTER SCIENCE', '1401386686_IJERSS1400137700.pdf', 0, 0, 'IJERSS-2014', 0, 0, 'Volume I - Issue VI, June 2014.', 28, 0),
(248, 'IJERSS-1400244463', 'editor@ijerss.com', 'PRODUCTIVITY IMPROVEMENT IN U.V ASSEMBELY LINE WITH ADVANCED DESIGN', 'Research', 'Automobile & Productive improvement in Vehicle Assembly', 'Independent Front Suspension (IFS) is most widely used suspension system in utility vehicles in order to damp the road shocks effectively. In IFS each front wheel is independently supported by a coil spring, torsion bar or a leaf spring. Almost all passenger cars now use independent front suspension, in which the coil spring arrangement is the most time consuming process. The main aim of the project is to minimize cost and time consumption in U.V Assembly line. This is done by introducing fixtures in the process. Fixture design is done in CATIA and analysis is done using ANSYS. By doing structural analysis on the fixture and spring, it is helpful to know the force distribution inside the fixture. The principle implemented in this project is to decrease the cost and time taken for coil spring assembly using fixtures.', '1400244463_SRI_PUBLISH_Final.docx', '2014-05-16', 'P.JOHN PAUL, A.CHAITANYA,B.SANDEEP,B.HEMANTH,K.PARTHASARATHY REDDY', 'edithjohnpaul@gmail.com,Chaitanya.aripineti@gmail.com,buchetti_sandeep@rocketmail.com ,b.tillu@gmail', NULL, 'ME 214-A, P. John Paul, Assistant Professor,', 'Dept. of Mech. Engg., K.S.R.M College of Engg.', 'Kadapa', 'Andhra Pradesh', 516003, 'IN', 'Published Online', '', 'MECHANICS', '1401386739_IJERSS1400244463.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue VI, June 2014.', 331, 1),
(249, 'IJERSS-1400350809', 'editor@ijerss.com', 'MULTICLOUD COMPUTING SECURITY', 'Research', 'Cloud Computing', 'With the growing demand industries and academic organizations are moving to Cloud .It provides less cost and most of its services are based on utility computing. If the data is stored in cloud the physical storage of data can be reduced. Security is the major issue in cloud environment .If the data is stored into single cloud it can be lost or can be modified by malicious who reside inside or outside the cloud. Instead of storing the data into a single cloud if the data is stored in to multiple clouds it can be secured. There are so many security algorithms which can be used to provide the security but most of the security algorithms failed. This paper uses AES security algorithm and data is encrypted and is placed into multiple clouds. So a tight security can provided for the data .So until the data is there in the cloud and when it is transferred from single to multiple clouds the data cannot be hacked or modified.', '1400350809_Multi_Cloud_Computing_Securityfinal.docx', '2014-05-17', 'RENUKA KONDABALA,M.ARATHI', 'renukakondabala@gmail.com,arathi.jntu@gmail.com', NULL, 'K.Renuka,Asst.Professor,IT', 'VNRVJIET,Bachupally(via)Nizampet,kukatpally', 'Hyderabad', 'Andhra Pradesh', 500090, 'IN', 'Published Online', '', 'COMPUTER SCIENCE', '1401386805_IJERSS1400350809.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 315, 1),
(250, 'IJERSS-1400556713', 'editor@ijerss.com', 'TWELVE PULSE CONVERTER WITH DIFFERENTIAL DELTA CONNECTED TRANSFORMER ARRANGEMENT WITH REDUCED KVA CAPACITIES FOR LINE SIDE HARMONIC REDUCTION', 'Research', 'Engineering & Electrical', 'Now a days Harmonics is one of the most severe problems in variable frequency drives and in electrical network. Harmonics are generated due to switching action of the power electronics converters, which are known as non-linear loads. Its required to reduce this harmonics up to certain level. In this work differential delta connected transformer with different winding connection to get 30Ëš phase shift with reduced kVA capacities are presented for harmonic current reduction. A twelve-pulse AC to DC rectifier is proposed employing only 0.18P_0 (pu) transformer kVA. The 5^th and 7^th harmonics are absent in the utility line current. For high current application parallel operation of two rectifier bridges with inter-phase transformer is analyzed.\r\n\r\nKey wordsâ€”Delta-connected auto transformer, kilovolt-ampere rating, multi-pulse rectifier, inter-phase transformer.', '1400556713_mittal_paper_for_jouranal_submission.docx', '2014-05-20', 'MITAL PATEL', 'patel.mital474@yahoo.com', NULL, 'Plot No: 968/1,sec 7 c. gandhinagar', '', 'gandhinagar', 'gujarat', 382007, 'IN', 'Pending', '', 'ENGINEERING', '1401386866_IJERSS1400556713.pdf', 0, 0, 'IJERSS-2014', 0, 0, 'Volume I - Issue V, May 2014.', 10, 0),
(251, 'IJERSS-1400602252', 'editor@ijerss.com', 'NOISE IN IMAGE AND ITS REDUCTION TECHNIQUES', 'Research', 'IMAGE PROCESSING , COMPUTER SCIENCE ENGINEERING', 'In the present scenario we deal with different types of noise in image processing, this not only detoriates the quality of an image but also hampers valuable information which an image may contain. To mitigate this problem different techniques and processes are there which can be used for recovering the original image approximately by reducing the noise in them. In these paper we have discussed the promising techniques which gives fruitful results as experimented with the help of matlab.Our aim of this theory is reduction of noise which can be applied for rejuvenating a detiorated image to some extent.', '1400602252_noise_in_image_and_its_reduction_techniques.docx', '2014-05-20', 'INDRANIL KISHORE ROY,HIMADRI NATH MOULICK,DR. CHANDAN KONER', 'himadri80@gmail.com,professional.ikr@gmail.com,chandan.durgapur@gmail.com', NULL, 'SATYARANJAN APT. , 2ND FLOOR', 'A.P.C SARANI , HAIDERPARA', 'SILIGURI', 'WESTBENGAL', 734008, 'IN', 'Published Online', '', 'ENGINEERING', '1401769467_IJERSS1400602252.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 722, 1),
(252, 'IJERSS-1400671917', 'editor@ijerss.com', 'DESIGN OF DATA CENTER', 'Research', 'on design of data center', 'In modern days, we use computers and resources very frequently without considering their harmful effects to our environment. Green computing is a technique by which, we use computers and its resources without harming our ecosystem. Green computing is the way to use computer related work doing with enviornmental. This is new Data Center Design Pattern that includes the architecture of processor and other computer devices. The most important objective in green computing is to design a processor with low consuming power energy, followed by designing of Data Centre of many servers that consumes less energy to prevent harmful effect of our environment.  In this paper, we will discuss what green computing is and the concept and design of a proposed Data Center.', '1400671917_sai_paper.docx', '2014-05-21', 'SAIKUMAR,ZAYED RAIS', 'kunchaparthi.saikumar94@gmail.com,zayedrais@gmail.com', NULL, 'HNO-2-4-115,', 'P.S.R road ', 'khammam', 'Andhra pradesh', 507003, 'IN', 'Pending', '', 'COMPUTER SCIENCE', '1401387032_IJERSS1400671917.pdf', 0, 0, 'IJERSS-2014', 0, 0, 'Volume I - Issue VI, June 2014.', 17, 0),
(253, 'IJERSS-1400764746', 'editor@ijerss.com', 'Network Load-Aware Content Distribution in Overlay Networks', 'Research', 'cse', 'Massive content distribution on overlay networks stresses both the server and the network resources because of the large volumes of data,elatively high bandwidth equirement, and many concurrent clients. While the server limitation can be circumvented by replicating the data at more nodes, the network limitation is far less easy to cope with, due to the difficulty in determining the cause and location of congestion and in provisioning extra resources. In this paper, we present novel schemes for massive content distribution, that assign the clients to appropriate servers, so that the network load is reduced and also well balanced, and the network resource consumption is low. Our schemes allow scaling to very large system because the algorithms are very efficient and do not require network measurement, or topology or routing information. The core problems are formulated as partitioning the clients into disjoint subsets according to the degree of interference criterion, which reflects network resource usage and the interference among the concurrent connections. We prove that these problems are NPcomplete, and present heuristic algorithms for them. Through simulation, we show that the algorithms are simple yet effective in achieving the design goals.\r\n Index Termsâ€”Node Selection, Server Selection, Overlay Networks,Hypercube, Content Distribution Networks, Peer-to-Peer Networks\r\n', '1400764746_Suresh.docx', '2014-05-22', 'g.suresh', 'gundasuresh568@gmail.com', NULL, 'vijay shanthi appartments 2nd tower 4f', '', 'chennai', 'tamilnadu', 602105, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(255, 'IJERSS-1400768047', 'editor@ijerss.com', 'network srcurity using crptography', 'Research', 'network security and crypyography', 'This paper aims to provide a broad review of network security and cryptography, with particular regard to digital signatures. Network security and cryptography is a subject too wide ranging to coverage about how to protect information in digital form and to provide security services. However, a general overview of network security and cryptography is provided and various algorithms are discussed. A detailed review of the subject of network security and cryptography in digital signatures is then presented. The purpose of a digital signature is to provide a means for an entity to bind its identity to a piece of information. The common attacks on digital signature was reviewed. The first method was the RSA signature scheme, which remains today one of the most practical and versatile techniques available. Fiat-Shamir signature schemes, DSA and related signature schemes are two other methods reviewed. Digital signatures have many applications in  \r\n\r\ninformation security, including authentication, data integrity, and non-repudiation was reviewed. The objective of this paper is to provide the reader with an insight into recent\r\ndevelopments in the field of network security and cryptography, with particular regard to digital signatures .cryptography was used as a tool to protect national secrets and strategies. The proliferation of computers and communications systems in the 1960s brought with it a demand from the private sector for means to protect information in digital form and to provide security services.  DES, the Data Encryption Standard, is the most well-known cryptographic mechanism. It remains the standard means for securing electronic commerce for many financial institutions around the world. The most striking development in the history \r\n', '1400768047_ANIL_JOURNAL.doc', '2014-05-22', 'm v v anil kumar', 'anil.mittenti@gmail.com', NULL, '5-103,karempudi,guntur(d.t)', 'ap', 'karempudi', 'andhra pradesh', 522614, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(256, 'IJERSS-1400768986', 'editor@ijerss.com', 'GRID COMPUTING', 'Research', 'computer science engineering', 'These technologies have enabled the cooperative use of a wide variety of geographically distributed resources as a single more powerful computer. This new method of pooling resources for solving large-scale problems is called as grid computing. This paper describes the concepts underlying grid computing.  ', '1400768986_sai_chandu.docx', '2014-05-22', 'G.Saichandu', 'gajavellisaichandu@gmail.com	', NULL, 'tota bazar ', 'karampudi', 'guntur', 'andhra pradesh', 522614, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(257, 'IJERSS-1400872984', 'editor@ijerss.com', 'POWER SYSTEM STABILITY ENHANCEMENT USING THE UNIFIED POWER FLOW CONTROLLER', 'Research', 'ENGINEERING', 'It has been seen that there is rapid increase in power demand in last few decades but expansion of power generation and transmission has is limited due to limited resources and environmental restrictions. As result, many of the transmission lines are heavily loaded and stability of system becomes a limiting factor in the power transfer. Power system steady state control problems are solved by use of Flexible AC transmission systems (FACTS) controllers. FACTS are devices which allow the flexible and dynamic control of power systems. FACTS controllers are used for the dynamic control of voltage, impedance and phase angle of high voltage AC transmission lines. The basic principles of the following FACTS controllers, which are used in the two-area power system under study, are discussed briefly. This paper focus lights towards the advantages of using FACTS devices for the purpose of improving the operation of an electrical power system. Comparison on the basis of performance of different FACTS controllers has been discussed', '1400872984_manoj_ivt_2.doc', '2014-05-24', 'MANOJ CHAUDHRY,MS. NEERAJ', 'ranagoldy1@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', '', 'ENGINEERING', '1401387099_IJERSS1400872984.pdf', 0, 0, 'IJERSS-2014', 0, 0, 'Volume I - Issue VI, June 2014.', 32, 0),
(258, 'IJERSS-1400873073', 'editor@ijerss.com', 'ANALYSIS THE TRANSIENT STABILITY IMPROVEMENT BY OPTIMALLY LOCATED STATCOM', 'Research', 'ENGINEERING', 'This paper presents Analysis the Transient Stability Improvement by Optimally Located STATCOM. The stability of an interconnected power system is its ability to return to normal or stable operation after having been subjected to some form of disturbance. With interconnected systems continually growing in size and extending over vast geographical regions, it is becoming increasingly more difficult to maintain synchronism between various parts of the power system', '1400873073_manoj_ivt_1.doc', '2014-05-24', 'MANOJ CHAUDHRY,MS. NEERAJ', 'ranagoldy1@gmail.com', NULL, '', '', '', '', 0, 'IN', 'Pending', '', 'ENGINEERING', '1401387164_IJERSS1400873073.pdf', 0, 0, 'IJERSS-2014', 0, 0, 'Volume I - Issue VI, June 2014.', 11, 0),
(259, 'IJERSS-1401022776', 'editor@ijerss.com', 'Low Power & High Performance Adaptive FIR Filter based on Distributed arthmetic', 'Research', 'Paper Publish', 'This brief presents a novel pipelined architecture for low-power, high-throughput, and low-area implementation of adaptive filter based on distributed arithmetic (DA). The throughput rate of the proposed design is significantly increased by parallel lookup table (LUT) update and concurrent implementation of filtering and weight-update operations. The conventional adder-based shift accumulation for DA-based inner-product computationis replaced by conditional signed carry-save accumulation in order to reduce the sampling period and area complexity. Reduction of power consumption is achieved in the proposed design by using a fast bit clock for carry-save accumulation buta much slower clock for all other operations. It involves the same number of multiplexors, smaller LUT, and nearly half the number of adders compared to the existing DA-based design. From synthesis results, it is found that the proposed design consumes13% less power and 29% less area-delay product (ADP) overour previous DA-based adaptive filter in average for filter lengthsN = 16 and 32. Compared to the best of other existing designs, our proposed architecture provides 9.5 times less power and 4.6\r\ntimes less ADP.\r\nIndex Termsâ€”Adaptive filter, circuit optimization, distributed arithmetic (DA), least mean square (LMS) algorithm.\r\n', '1401022776_33_LowPowerHighThroughput,_and_LowArea_Adaptive_FIR_Filter_Based_on_Distributed_Arithmeti', '2014-05-25', 'Ch.Narasimhudu.Asst.Prof,Mallesh Gupta,M.Tech', 'lakshmi4104@gmail.com,malleshece90@gmail.com', NULL, 'K.Kesava sarma,Rtd MEO,Saibaba Nagar ', 'AKBS Colony,Near babulreddy building,nandyal', 'KURNOOL', 'ANDHRAPRADESH', 518502, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(261, 'IJERSS-1401193131', 'editor@ijerss.com', 'INFLUENCE OF REGIONAL DISPARITY ON PHYSICAL FITNESS OF URBAN ADOLESCENT GIRLS ', 'Research', 'Health Science and Fitness', 'Physical fitness is an important marker of the health of children and adolescents and also a good predictor of health in later life. It is most essential in the modern society due to the impact of globalization and technological advancements leading to improved lifestyle. Poor dietary habits combined with physical inactivity and other unhealthy lifestyle factors undoubtedly increase cardiovascular and metabolic disease risk among children and adults. The lives of 66 million girls between 13 to 19 years in India are characterized by limited education, lack of knowledge pertaining to social as well as health aspects and also limited influence on decisions affecting their lives. Subjects for the study were high school attending girls studying in eighth and ninth standard within Karnataka state. All together four hundred subjects from various schools representing different divisions of Karnataka viz Gulbarga, Belgaum, Mysore and Bangalore were selected for this study. Random purposive sampling technique was utilised for this purpose. All the subjects selected for this study were tested for physical fitness components by using AAHPERD Youth Fitness test battery. Mean, standard deviations and analysis of variance were used in the present investigation to make inferences. The urban girls belonging to different regions of Karnataka significantly differed in physical fitness. Physical fitness of urban adolescent girls from Bangalore, Mysore and Gulbarga division are significantly better than Belgaum division. The reasons for this disparity are discussed in detail.', '1401193131_Shivkumar,_gajanan_&_prakash.doc', '2014-05-27', 'SHIVAKUMAR S.,GAJANANA PRABHU B.,S. M. PRAKASH', 'sshivakumars5@gmail.com,prabhuji888@gmail.com,yesyempee@gmail.com', NULL, 'Research Scholar, Department of Physical Education', 'Kuvempu University, Shankaraghatta', 'Shimoga', 'Karnataka', 577451, 'IN', 'Published Online', '', 'SPORTS SCIENCE', '1465120098_IJERSS1401193131.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue VI, June 2014.', 285, 1),
(264, 'IJERSS-1401263203', 'editor@ijerss.com', 'ANALYSIS OF OVERALL EQUIPMENT EFFECTIVENESS OF STEEL MELTING SHOP FOR PRODUCTIVITY IMPROVEMENT', 'Research', 'Industrial engineering', 'Productivity is important and utilization of available resources is very important for any industry. Machine and manpower are two factors which are responsible for productivity. In this paper we are concentrate in overall equipment effectiveness of steel melting shop of steel industry. For the analysis of OEE we find out the downtime, production output and effective production of steel melting shop of steel industry in the month of December 2013. We suggested to the industry after calculating the OEE to improve their maintenance procedures and improve the productivity.', '1401263203_Analysis_of_OEE_of_steel_melting_shop_for_productivity_improvement.docx', '2014-05-28', 'JAYANT SINGH,PRADEEP AGRAWAL', 'jayantmech87@gmail.com', NULL, 'Block no. 5, plot no.6, radhika nagar', '', 'Bhilai', 'CHHATTISGARH', 490023, 'IN', 'Published Online', '', 'ENGINEERING', '1401387349_IJERSS1401263203.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 813, 1),
(265, 'IJERSS-1401542691', 'editor@ijerss.com', 'THE SOCIO-ECONOMIC STATUS AND ITS INFLUENCE ON ATTITUDE TOWARD PARTICIPATION IN PHYSICAL EDUCATION AND SPORTS OF NON-RESIDENTIAL HIGH SCHOOL STUDENTS', 'Research', 'Sports Sciene & Physical Education', '"The Socio-Economic Status and Its Influence on Attitude toward Participation in Physical Education and Sports of Non-residential High School Students"\r\n\r\n	Abstract: Swamy Vivekananda a great Indian saint states that â€œbetter to construct a stadium instead of constructing ten hospitalsâ€. Plato a great Greek philosopher states that â€œ Lack of physical activity destroy the good conditions of every human being, while movement and methodical physical exercise save it and preserve itâ€. Hence providing play field along with methodical/scientific physical education and sports programme in the society will be the key to develop strong participation motive in physical education and sports for develop physical fitness and exercise adherence among young brood. This study sought to examine the socio-economic status and its influence on attitude toward participation in physical education and sports of non-residential high school students. The study was carried out in non-residential high schools governed by government of Karnataka State, India. Hundred and twenty (120) high school students were the respondents. Two self-developed questionnaire â€œParticipation in Physical Education and Sports Attitude Scale (PPESAS)â€ and â€œSocio-economic Status Scale (SES)â€ were served as instruments in gathering the data. The study revealed that the students of high socio-economic status had a higher attitude toward participation in physical education and sports than the students of low socio-economic status and the student of average socio-economic status. The study also indicated that students who are from high and average socio-economic status are most significantly influenced. \r\n\r\nKey words: Socio-economic Status, Attitude, Physical Education and Sports\r\n', '1401542691_IEEE_formate_Ananthapadmanabha_Prabhu.doc', '2014-05-31', 'ANANTHAPADMANABHA PRABHU,DR. H NAGALINGAPP', 'sportstodream@gmail.co,nagalingappa@rediffmail.com', '9164586621', 'Ananthapadmanabha Prabhu, S/o Narahari Prabhu', 'Katnapalke House, ,                ', 'Yerlapaddi Post', 'Karnataka', 574503, 'IN', 'Published Online', '', 'SPORTS SCIENCE', '1401817854_IJERSS1401542691.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 666, 1),
(266, 'IJERSS-1401603348', 'editor@ijerss.com', 'MAXIMUM POWER POINT TRACKING (MPPT) FOR PHOTOVOLTAIC POWER SYSTEMS ', 'Case Study', 'Power Systems', 'Maximum Power Point Tracking, referred as MPPT, is an electronic system that operates the Photovoltaic (PV) modules  to produce all the power they are capable of. MPPT is not a mechanical tracking system  to make PV module point more directly to the sun. MPPT is a fully electronic system that varies the electrical operating point of the modules so that the modules are capable to deliver maximum available power. In this paper,it is examined a system to extract maximum obtainable solar power from a PV module and use the energy for a DC/AC application. This paper investigates in detail the concept of Maximum Power Point Tracking (MPPT) which significantly increases the efficiency of the solar photovoltaic system.', '1401603348_IEEE_MPP.docx', '2014-06-01', 'Dinesh Tiwari', 'dtiwari@mes.ac.in', '9594204656', '103/Durvankur Society, Kisan nagar-1', ' wagle estate, near panchparmeshwar mandir', 'Thane -400604', 'Maharashtra', 400604, 'IN', 'Published Online', '', 'ENGINEERING', '1401773806_IJERSS1401603348.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 900, 1),
(268, 'IJERSS-1401695910', 'editor@ijerss.com', 'AN IMPROVED  MRI IMAGE DENOISING USING OPTIMAL THRESHOLDING TECHNIQUE VIA WAVELET', 'Research', 'SIGNAL PROCESSING', 'In Bio-medical image processing, image denoising plays a vital role for the purpose of diagnosis. Medical images are usually corrupted by random noise in its acquisition and Transmission. The main objective of Image denoising techniques is necessary to remove such noises while retaining as much as possible the important signal features. In this paper, a new thresholding technique using wavelet has been presented alongwith the standard thresholding techniques like soft and hard thresholding. Various thresholding techniques have been compared to obtain better denoising technique for MRI Image denoising in the presence of random noise.   Numerical value of PSNR, MSE and MAE shows that Haar (db1) wavelet for all the three level performed well over the other wavelet.', '1401695910_Research_paper.doc', '2014-06-02', 'Manoj Gabhel,Aashish Hiradhar,Ramesh Yadav', 'manoj.gabhel555@gmail.com', '9770590509', 'HNO 222 WARD NO 13 PATTHARRI PARA BALCO ROAD ', 'DHENGUR NALA BESIDE SHASHI LADIES TAILOR', 'KORBA', 'CHHATTISGARH', 495677, 'IN', 'ACCEPTED', '', 'COMPUTER SCIENCE', '1402287061_IJERSS1401695910.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 697, 1),
(277, 'IJERSS-1401876170', 'editor@ijerss.com', 'Enzyme Esterification Route to Prepare Glyceryl Tributyrate', 'Case Study', ' Chemical Engg. & Synthesis ', 'Abstract- In the present work, we investigate how conversion and yield for an unknown process route to prepare tributyrin can be optimized. The experimental optimization has been done by applying the chemometric methods. The yield and conversion are experimentally obtained for various catalyst-solvent pairs. The parameters used in experimental study are molar ratio, stirring speed, catalyst, solvent, reaction temperature and reaction run time. Overall conversion up to 97.46% of ester and 2.53% butyric acid and impurity 0.04 % are detected by GCMS. The significance of water is that the formation of water inhibits the esterification reaction as it favors reversal. Immobilized enzyme lipozymes, Novozyme, Bakers yeast were employed as catalysts for the esterification reaction. Amongst the enzymes tried as options, novozyme was found to be better than the rest two enzymes.', '1401876170_P46.docx', '2014-06-04', 'Patil Ramnath Vishvanath,Satish R. Inamdar', 'ramnath.patil@mitpune.edu.in,satish.inamdar@rediffmail.com', '7276277437', 'C/o N.N.Kher , no.42,  Vasant Baug Society,', 'Bibawewadi , Pune - 411037', 'Pune', 'Maharashtra', 411037, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(279, 'IJERSS-1401888295', 'editor@ijerss.com', 'RELATIONSHIP BETWEEN ANTHROPOMETRIC AND MOTOR ABILITIES WITH PERFORMANCE OF SELECT CRICKET PLAYERS', 'Research', 'Physical Education & Sports', 'Abstract\r\nIn the present study an attempt is made to identify the relationship between anthropometric and motor ability variables with performance of cricket players. A total of 115 cricket players (Batsmen, Bowlers and Wicket keepers) were selected from the universities of Karnataka state Mysore, Bangalore, Mangalore, Kuvempu, Jain and  Karnatak Universities. They were assessed for anthropometric variables like Height, Weight, Arm length, Chest girth, Leg length and Arm span and motor abilities like Arm power, Leg power, Speed, Agility, Abdominal Strength and Endurance adopting standard procedures. Correlation and stepwise multiple regression analysis were applied to find out the mutual relationship between performance and selected anthropometric and motor ability variables. Results revealed that performance was linearly and significantly related to anthropometric variables- Height, Weight, Arm length, Leg length and Arm span. In the case of motor abilities, Performance was linearly and significantly related to Arm Power, Leg Power, Speed, Agility, Abdominal Strength and Endurance. Lastly, it was found that Speed, Leg Power, Weight and Agility were the major predictors of the cricket performance.', '1401888295_Krishna_Sir_Article_10_MAy_2014.docx', '2014-06-04', 'Krishna Kumar H S,Dr. C. Venkatesh', 'hsk.mcm@gmail.com,drcv_uom@yahoo.com', '9448246112', 'Krishna kumar H S, Assistant Director, ', 'Dpt of Physical Education, University of Mysore, ', 'Mysore', 'Karnataka', 570005, 'IN', 'Pending', '', 'SPORTS SCIENCE', '1402281155_IJERSS1401888295.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 974, 1),
(280, 'IJERSS-1401946135', 'editor@ijerss.com', 'RISK FACTORS OF INJURIES IN UNIVERSITY LEVEL MEN FOOTBALL PLAYERS AT KERALA', 'Research', 'PHYSICAL EDUCATION AND SPORTS ', 'ABSTRACT\r\nSTATEMENT OF RISK FACTORS OF INJURIES IN UNIVERSITY MEN KERALA FOOTBALL PLAYERS \r\n*Sreejith Raj ** Dr .A. Praveen\r\nThe purpose of this study is the consensus statement of risk factors for injuries in football. The main objective of this study is to find the dominated and common injuries causes to football players. In order to achieve the purpose of study 90 football players were selected as subjects randomly from the MG University, Calicut and Kannur university of Kerala state. The subjectsâ€™ age ranged from 18 to 25 years. For collecting the data the questionnaire was used by the researcher. Establishing the reliability of the questionnaire competence all data on collected from the authorities of the data or ensured the reliability of data. The data collected from the universities on selected variables were statically examined for significant difference by using the product movement correlation, Independedâ€˜tâ€™ test was used to find the mean difference between the variables and   ANOVA was computed to find the significant difference among the three  university level football players. The results shown that there is a significant differences in the percentage of injuries and the treatment factor in football players.\r\nKey words : Risk factors of injury , Treatment and Football\r\n\r\n*PhD Scholar Department Of Physical Education Sports Pondicherry University **Assistant professor Department of Physical Education Pondicherry University\r\n', '1401946135_ONLINE_JOURNAL_full_paper.docx', '2014-06-05', 'SREEJITH RAJ,Dr. A . PRAVEEN', '65sree.raj@gmail.com,praveencjis@gmail.com', '9488434064', 'DEPARTMENT OF PHYSICAL EDUCATION ADN SPORTS ', 'PONDICHERRY UNIVERSITY', 'KALAPET', 'PUDUCHERRY', 605014, 'IN', 'Pending', '', 'SPORTS SCIENCE', '1402241752_IJERSS1401946135.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 159, 1),
(282, 'IJERSS-1401985018', 'editor@ijerss.com', 'ASPECT ORIENTED DESIGN PATTERNS FOR INFRASTRUCTURE MONITORING', 'Others', 'Software Architecture', 'Most of the organizations are dependent on Information Technology to run their businesses. Organizations also keep continuous efforts to increase their profit margins by reducing costs and IT plays a very important role to achieve the expected results. As the time has progressed, IT infrastructure has shaped up from large scale hardware machines to tiny virtual environments. Virtualization has helped industries to dynamically scale up and down their information technology needs and also helped save their infrastructure costs. Business needs IT and to achieve expected results from IT, the infrastructure should be secured and highly available with cost efficient manner. The IT infrastructure needs to be monitored for high availability. \r\n\r\nHowever the monitoring software design should adhere the software design principles such as modularity, reusability, and maintainability. Various Design Patterns provide a solution to usual problems in software design. Research shows that aspect orientation helps reduce the various design patterns concerns like cross cutting etc. These types of concerns cause issues in reliability, reusability and portability of the software. Here I am attempting to evaluate the significance of Aspect Oriented Programming in software design patterns for the infrastructure monitoring design patterns.\r\n', '1401985018_SIGNIFICANCE_OF_AOP_IN_DESIGN_PATTERNS_FOR_INFRASTRUCTURE_MONITORING.doc', '2014-06-05', 'DEEPALI BHANAGE,MRS. BHAGYASHRI KHODKE,MUKTA KORE,Dr. Emmanuel M', 'deepali.bhanage@gmail.com,bhagyashri.khodke@gmail.com,Muktakore@gmail.com,nhnaik@gmail.com', '919923750728', 'C-701, Pride Green Fields, DP Road', 'Next to Nandgude School, Vishal Nagar,', 'Pimple Nilakh, ', 'Maharashtra', 411027, 'IN', 'ACCEPTED', '', 'COMPUTER SCIENCE', '1402301779_IJERSS1401985018.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue VI, June 2014.', 837, 1),
(283, 'IJERSS-1402040889', 'editor@ijerss.com', 'War Ethics as found in Ancient Tamils', 'Research', 'Arts & Humanities', 'The Hindu warfare has always followed dharma and justice in its course.  As seen and attested by the epics and literature, the ancient Tamils had waged wars in a just and righteous manner.  They were ethical in fighting with their enemies and they followed the principles of dharma, with their own codes and conventions of war. This paper talks about the ethics that were followed in the wars that were fought during the Cankam Tamil period ', '1402040889_Paper_Gurugnanambika.doc', '2014-06-06', 'Dr. S. Gurugnanambiga', 'guruambika@gmail.com', '9042121850', 'Department of Tamil', 'Avinashilingam University for Women, Bharathi Park', 'Coimbatore', 'Tamil Nadu', 641, 'IN', 'Pending', NULL, 'LITERATURE', '1402300247_IJERSS1402040889.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue VI, June 2014.', 689, 1),
(284, 'IJERSS-1402115076', 'editor@ijerss.com', 'AGGRESSION WHAT TO DO ABOUT IT', 'Case Study', 'SPORTS SCIENCE', 'One of the most useful features of this research for teachers is the categories it singles out for identification. For example, it is helpful when thinking about a child who always seems to be flying off the handle to keep track of which kinds of situations make him angry. Does he go to pieces when he is rejected, or does it happen when somebody takes something he is using? Oncethe type of situation is identified, the teacher has a clue about what to work on with him; it might be teaching him skills about how to accept rejection and work through it, for instance, or how to negotiate a mutually satisfactory cooperative sharing situation, or how to defend his rights without hitting back if it conflicts over material things that cause him the most difficulty', '1402115076_Aggression_what_to_do_about_it.docx', '2014-06-07', 'Sushant R.Haldanker', ' hsushant79@rediffmail.com', '9030057655', '', '', '', '', 0, 'IN', 'Pending', '', 'HEALTH SCIENCE', '1402229617_IJERSS1402115076.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue V, May 2014.', 292, 1),
(285, 'IJERSS-1402142846', 'editor@ijerss.com', 'POWER UP SEQUENCE CONTROL FOR MTCOMS DESIGNS', 'Research', 'VLSISD IIYEAR', 'Power gating is effective for reducing standby leakage power as multi-threshold CMOS (MTCMOS) designs have become popular in the industry. However, a large inrush current and dynamic IR drop may occur when a circuit domain is powered up with MTCMOS switches. This could in turn lead to improper circuit operation. We propose a novel framework for generating a proper power-up sequence of the switches to control the inrush current of a power-gated domain while minimizing the power-up time and reducing the dynamic IR drop of the active domains. We also propose a configurable domino-delay circuit for implementing the sequence. Experimental results based on state-of-the-art industrial designs demonstrate the effectiveness of the proposed framework in limiting the inrush current, minimizing the power-up time, and reducing the dynamic IR drop. Results further confirm the efficiency of the framework in handling large-scale designs with more than 80 K power switches and 100 M transistors.', '1402142846_Sreenu_pub_format.docx', '2014-06-07', 'JALADARI SREENIVASULU,Y MALLIKARJUNA RAO', 'sreenivasanth403@gmail.com,mallikyamarthy@live.com', '9052833036', 'H NO 3-93 PEDDAHOTHURU VILLAGE', 'ALUR MANDAL', 'KURNOOL DIST', 'ANDHRA PRADESH', 518395, 'IN', 'Pending', NULL, 'ENGINEERING', '1402310354_IJERSS1402142846.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue VI, June 2014.', 360, 1),
(287, 'IJERSS-1402167694', 'editor@ijerss.com', 'EFFECT OF HIGH INTENSITY PLYOMETRIC TRAINING ON MAXIMUM SPRINTING SPEED VELOCITY AND EXPLOSIVE POWER IN SCHOOL ATHLETES', 'Research', 'TRAINING METHODS,PLYOMETRIC TRAINING', 'The purpose of the current study is to examine the 8 week high-intensity plyometric training program on maximum sprinting speed, velocity, horizontal explosive power and vertical explosive power in school athletes. Subjects for this study were 24 healthy male school athletes (age, 14 to 17 years; height, 163 to 171 cm; mass, 52.5 to 69.5 kg). Twenty four subjects were randomly assigned in to two equal groups, High intensity plyometric training group (HIPT; n = 12) and control group (CG; n = 11). The duration of the training program was 8 weeks, and it consisting of combined plyometrics drills (hops, speed bounds, galloping and both leg jumps) and completed all drills with short sprints. Test involved running based anaerobic sprint test (RAST) for maximum sprinting speed and velocity, standing broad jump and sergeant jump tests. The pre test and post test randomized control group design was used as an experimental design. Selected criterion variables were statistically analyzed with paired sampleâ€˜tâ€™ test to find out significant improvement between pre and post test means of experimental and control groups and analysis of covariance (ANCOVA) was used to find out significant difference between experimental and control groups. In all the cases 0.05 level of confidence was fixed to test the hypothesis. The high intensity plyometric training produced favourable changes in maximum sprinting speed, velocity, horizontal explosive power and vertical explosive power. The control group showed no significant change in any. \r\nKEY WORDS: Hops, speed bounds, galloping, both leg jump, RAST test, horizontal and vertical explosive power.\r\n', '1402167694_plyo_final.docx', '2014-06-08', 'T.VINOTH,Dr.A.S.NAGESWARAN,A.VENKATESAN,F.SHAHUL HAMEED', 'arachyvinoth@gmail.com,asnageswaran@gmail.com,venkatesanped@gmail.com,shahulji@gmail.com', '9600271509', 'T.VINOYH,S/O S.THANGARAJU, 2/47,ARAICHI PO', 'MUSIRI TK', 'THIRUCHIRAPALLI', 'TAMILNADU', 621214, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1402329518_IJERSS1402167694.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue VI, June 2014.', 478, 1),
(288, 'IJERSS-1402248197', 'editor@ijerss.com', 'RFID Based AutoNavigation Robot', 'Research', 'Robotics,Sensor Networks', 'Auto-Navigation robot is smart and helpful for physically disabled and blind people. the robot is used to navigate in in infrastructure and in corporate offices. the robot navigation is mainly decided based on the RF card unique number. The robot provides some of the important features for the safety of the people navigation on it the features are obstacle detection, wireless communication between systems, temperature sensing and line following fro hybrid routes. The navigation of the robot is fast due to indoor localization.', '1402248197_my_paper.pdf', '2014-06-08', 'Chandan Raj S,Dinesh K.Anvekar,Sudhakar KN', 'chandan.raj41@gmail.com,dinesh.anvekar@gmail.com,sudhakar.kn@cmrit.ac.in', 'Chandan Raj', 'B199 Officers qtrs, Beml nagar, ', '', 'KGF', 'karnataka', 563115, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(289, 'IJERSS-1402289176', 'editor@ijerss.com', 'Fatigue analysis of leaf spring by using Ansys workbench', 'Review', 'MECHANICAL & BC', 'ABSTRACT: This paper describes design and fatigue analysis of mono leaf spring. Weight reduction is now the main issue in automobile industries. In the present work, the dimensions of an existing mono steel leaf spring of a Maruti 800 passenger vehicle is taken for modelling and analysis of mono leaf spring with two materials namely, steel and Carbon/Epoxy subjected to the same load. The design constraints were stresses, deflections, damage, and life and safety factor. The two different leaf springs have been modelled by considering uniform cross-section, with unidirectional fibre orientation angle for each lamina of a laminate. Fatigue analysis of a 3-D model has been performed using ANSYS workbench. Keywords: Composite leaf spring (CLS), Fatigue analysis, Steel, Carbon/Epoxy. The fatigue analysis is performed under different repetition loads 250 and 397.27 with different time 10, 20, 30 and 40sec respectively.', '1402289176_Moulali.doc', '2014-06-09', 'MOULALI P', 'moulali_p3@yahoo.co.in', '9492583500', 'SANTHIRAM ENGINEERING COLLEGE', 'NH-18', 'NERAWADA', 'NANDYAL', 518501, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0);
INSERT INTO `papers` (`id`, `paper_id`, `paper_referral`, `paper_title`, `paper_type`, `subject_category`, `abstract`, `paper_attachment`, `uploaded_on`, `author`, `email`, `pnumber`, `address_line1`, `address_line2`, `city`, `state`, `pincode`, `country`, `status`, `comments`, `subject`, `pdf`, `active`, `news`, `conference`, `volume`, `issue`, `volume_issue_title`, `downloads`, `blogspot`) VALUES
(290, 'IJERSS-1402652231', 'editor@ijerss.com', 'FEASIBILITY STUDY OF SET-IBS AND SET-IBOOS PROTOCOLS IN CLUSTER BASED WIRELESS SENSORS NETWORKS WITH ENHANCEMENT IN SECURITY OVERHEAD AND ENERGY CONSUMPTION', 'Research', 'Cluster Based Wireless Sensor Networks and Security Concerns', 'Wireless Sensor Networks (WSN) provides a bridge between the real physical and virtual world which monitors physical and environmental conditions. It contributes a wide range of potential applications to industry, science, health-care, utilities and remote monitoring. Data confidentiality and authentication are the crucial security requirements in Wireless Sensor Networks. In this paper, we represent a clustering method which effectively manages network energy and to apply Aggregation technique in the network .Clustering in Wireless Sensor Networks can greatly contribute to overall system scalability, lifetime and energy efficiency. Securely and efficiently transmitting the data is achieved by using Digital Signature using two different schemes with respect to security and energy consumption. To address the security threats, the proposed two protocols such as SET-IBS and SET-IBOOS which are based on the digital signatures are still more enhanced in terms of energy consumption and security overhead. These two proposed protocols help us to identify various attack scenarios such Content Modification, and No Attack and helps to achieve the maximum secureness. Adding to it, we also introduced Paillier Threshold Encryption which greatly extends for security. We also put forth the idea of Simulation comparison between two protocols which is more efficient than the existing one in terms of Energy consumption and therefore graphical results shows the Feasibility study. The main Principle behind these schemes is such that the Base station generates the Master key and distributes it to all the sensor nodes in the clusters. Each node in the cluster forms their Encryption key with its node Id and the common parameter generated by the Base station. The cluster head aggregates the data from all Sensor nodes and sends it to the destination Sensor nodes. Network Simulation is carried out and thus simulation confirms that the proposed protocols provide the Feasibility with respect to Security and Overhead Transmission of Data.', '1402652231_Seema_Patil_paper.doc', '2014-06-13', 'Seema Patil,Shanthi.M.B', 'patilseema2013@gmail.com,Shanthi.mb@cmrit.ac.in ', '9538619799', 'H.no: 8-9-169,Opp Ganesh Temple', 'Guru Nagar', 'Bidar', 'Karnataka', 585401, 'IN', 'Pending', '', 'COMPUTER SCIENCE', '1404184092_IJERSS1402652231.pdf', 0, 0, 'IJERSS-2014', 0, 0, 'New', 53, 0),
(291, 'IJERSS-1402825873', 'editor@ijerss.com', 'A Comparative Study on Anthropometric Measurements and Selected Motor  Fitness Components among School Gujarat', 'Research', 'A Comparative Study on Anthropometric Measurements and Selected Motor  Fitness Components among Scho', 'Abstract:\r\nThe body need be vigoroudin order to obey the soul: a good servant ought to be robust. The weaker the body, the more it commands, the stronger it is the better it obeys. In order to think, we must exercise our limbs, our senses and our organs, which are the instruments of our intelligence. In order to derive all the possible advantages from these instruments, it fitness is the measure of the bodyâ€™s strength edurance and flexibility. Purpose the purpose of the study was to assess the physical fitness of B.P.Ed an B.ed students. Procedure A total of 100  students, 50 from B.P.Ed Dept. of Physical Education, Gujarat Vidhyapith ,Ahmedabad 50 from B.ed  Dept. of  Education, Gujarat Vidhyapith ,Ahmedabad were randomly selected as subjects for this study for this study from Patan city, Gujarat state, India 2012. The selected physical fitness variables were muscular endurance, flexibility and cardiorespiratory endurance. To measure these components standardized tests were used. The data collected were analyzed with statistical â€˜tâ€™ technique was used. Result the statistical analysis shows that there was a significant difference in all the selected physical fitness components. Conclusion it was concluded that B.ed collage students are significantly differ from B.P.Ed collage students in all the selected physical fitness components.\r\nKey words: muscular endurance, flexibility cardiorespiratory endurance.', '1402825873_Nimesh_Chaudhari_2014.doc', '2014-06-15', 'Mr. Nimesh Chauhdari', 'chaudharinimesh@gmail.com', '9426854903', '(Gujarat Vidyapith, Ahmedabad)', 'M. D. Sharirik Shikshan Mahavidyalaya, At. Sadra', 'Gandhinagar', 'Gujarat', 382320, 'IN', 'ACCEPTED', 'Please Pay Manuscript Processing fee', 'HEALTH SCIENCE', '1404462100_IJERSS1402825873.pdf', 0, 0, 'IJERSS-2014', 0, 0, 'New', 19, 0),
(293, 'IJERSS-1402900949', 'editor@ijerss.com', 'A COMPARATIVE STUDY OF ARM LENGTH OF HIGH AND LOW LEVEL PERFORMANCE OF VOLLEYBALL PLAYERS OF GUJARAT', 'Research', 'Physical Education ', 'A comparative study of arm length of high and low level performance of volleyball players of Gujarat\r\n\r\n\r\nMr.Nimeshkumar D. Chaudhari\r\nAssistant Professor\r\n(Gujarat Vidyapith, Ahmedabad)\r\nMahadev Desai Sharirik Shikshan Mahavidyalaya, Sadra. \r\nDist. Gandhinagar. (Gujarat) India. Pin 382320\r\nEmail:- chaudharinimesh@gmail.com\r\n\r\n\r\nAbstract:\r\n\r\n\r\nThe aim of this study was to compare the length of upper arm, forearm and full arm of high level performance and low level performance of volleyball players. Players participated in west zone inter-university tournament 2012 were considered as high level performance players and players from inter-college volleyball tournament of Gujarat 2012 were treated at low level performance players 50 players (21 to 28 years of age) from each group were randomly selected for this study. Large sample test â€˜zâ€™ was applied to compare the means of length of arm of both the group at 0.05 level of significance. The result of the study shows that there is significant difference between the means of upper arm length, forearm length and full arm length in group of high level performance and low level performance players of volleyball. \r\n\r\nKey worlds: upper arm length, forearm length, full arm length.\r\n', '1402900949_MR_Nimesh_&_MR_Bhavik.doc', '2014-06-16', 'Mr. Nimesh Chauhdari', 'chaudharinimesh@gmail.com', '9426854903', 'GUJARAT VIDYAPITH MAHADEV DESAI SHARIRIK SHIKSHAN ', 'At. Sadra Dist. Gandhanigar', 'Gandhanigar', 'Gujarat', 382320, 'IN', 'ACCEPTED', 'Pay Manuscript processing fee', 'HEALTH SCIENCE', '1404234342_IJERSS1402900949.pdf', 0, 0, 'IJERSS-2014', 0, 0, 'New', 24, 0),
(294, 'IJERSS-1403183769', 'editor@ijerss.com', 'COMMON INJURIES AMONG KABADDI AND KHO-KHO PLAYERS AN EMPIRICAL STUDY', 'Research', 'Sports Sciene & Physical Education', 'Abstractâ€”Kabaddi and Kho â€“ Kho game are involves rapid and forceful movement of the body as a whole with tremendous physical stamina and quick reflexes inevitably cause for common injuries. To date, there are no epidemiological studies on Kabaddi and Kho â€“ Kho that presently reliable data about the incidence of injuries and its cause. Hence the researcher has taken up a study to find out injuries would take place during training and competition time in Kabaddi and Kho â€“ Kho events among the players. Total sixty male players (thirty kabaddi players and thrity Kho-kho players) who represented Mangalore University at South Zone and All India level competition were selected as subjects at random.  The questionnaire will be administered consisting of questions related to common injuries (skin injuries, muscle injuries, bone injuries and joint injuries), causes and successive treatment for injuries. The results of this study indicate that injuries are very common among the kho-kho and kabaddi players. The incidence of injury in kabaddi is highly notable than in Kho-Kho. It may be happen because Kabaddi is most aggressive and heavy contact game, were as Kho-Kho is a semi contact game. Most of the injuries were accrued with contact with the player and contact with the hard/uneven ground. For bone and joint injuries treated immediately after the injuries accrued.  Severity of injuries among Kabaddi players was more when compared to Kho-Kho players. It was concluded that players and coaches should be made more aware of the importance of protective equipment in helping to prevent injury or re-injury and effective emergency care of injuries by using rest, ice, compression and elevation.\r\nIndex Termsâ€”Common Injury, Kabaddi players, Kho-Kho players\r\n', '1403183769_final_app_paper_for_journal.doc', '2014-06-19', 'Ananthapadmanabha Prabhu  ,Dr. Kishore Kumar C K', 'sportstodream@gmail.com,ckkkumar@gmail.com', '09164586621', 'Ananthapadmanabha Prabhu', 'Morarji Desai Residential Schol, Kandali', 'Hassan District', 'Karnataka', 573217, 'IN', 'Pending', '', 'SPORTS SCIENCE', '1404965515_IJERSS1403183769.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue VII, July 2014.', 1080, 1),
(295, 'IJERSS-1403184500', 'editor@ijerss.com', 'INFLUENCE OF PHYSICAL ACTIVITIES AND PSYCHOLOGICAL FACTORS ON SPORTS INJURIES', 'Short Communication', 'Sports Sciene & Physical Education', 'Abstract - Participation in high school sports helps promote a physically active lifestyle.  The benefits of regular exercise are not limited to adults. Participation in physical activity is beneficial to children and adolescents. Regular physical activity contributes to overall health and well-being and reduces the risk of diseases. Youth athletic programs provide opportunities to improve self-esteem, acquire leadership skills and self-discipline, and develop general fitness and motor skills. With the growth of youth sports programs, overuse injuries in young people have become common. Making the diagnosis can be challenging, but often the real hurdles are in identifying the causes of injury. The study of sport injuries within Sport Psychology is one of the areas that has grown most in the last few years. The professionalization of sport practice along with the increase in the number of professional athletes and of participants in non professional physical activities and sports has provoked an increase in the number of injuries with the derived consequences, which are not related health. The purpose of the research was to asses the influence of physical activities and psychological factors on preventing sports injuries. It was concluded that sports and exercise injuries can be relatively common if one can exercise regularly. By applying basic psychological strategies, exercise professionals can make a tremendous difference in the speed and completeness of recovery.\r\n\r\nIndex Terms â€“ Physical activities, psychological, sports injuries.\r\n', '1403184500_Vasanth_paper_for_journal.doc', '2014-06-19', 'VASANTHA KUMAR,DR. KISHORE KUMAR. C. K', 'hnavanku@gmail.com,ckkkumar@yahoo.com', '09448039171', 'Vasantha kumar Research Scholar', 'Depart. of Physical Education, Mangalore Universit', 'Konaje, Mangalo', 'Karnataka', 574199, 'IN', 'Pending', '', 'SPORTS SCIENCE', '1404965395_IJERSS1403184500.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue VII, July 2014.', 301, 1),
(296, 'IJERSS-1403507155', 'editor@ijerss.com', 'NETWORK SECURITY AND CRYPTOGRAPHY', 'Research', 'computer science', 'This paper aims to provide a broad review of network security and cryptography, with particular regard to digital signatures. Network security and cryptography is a subject too wide ranging to coverage about how to protect information in digital form and to provide security services. However, a general overview of network security and cryptography is provided and various algorithms are discussed. A detailed review of the subject of network security and cryptography in digital signatures is then presented. The purpose of a digital signature is to provide a means for an entity to bind its identity to a piece of information. The common attacks on digital signature was reviewed. The first method was the RSA signature scheme, which remains today one of the most practical and versatile techniques available. Fiat-Shamir signature schemes, DSA and related signature schemes are two other methods reviewed. Digital signatures have many applications in  \r\n\r\ninformation security, including authentication, data integrity, and non-repudiation was reviewed. The objective of this paper is to provide the reader with an insight into recent\r\ndevelopments in the field of network security and cryptography, with particular regard to digital signatures .cryptography was used as a tool to protect national secrets and strategies. The proliferation of computers and communications systems in the 1960s brought with it a demand from the private sector for means to protect information in digital form and to provide security services.  DES, the Data Encryption Standard, is the most well-known cryptographic mechanism. It remains the standard means for securing electronic commerce for many financial institutions around the world. The most striking development in the history ', '1403507155_networksecurity2_(1).doc', '2014-06-23', 'M V V ANIL KUMAR', 'gajavellisaichandu@gmail.com', '9573272099', 'gandhi bomma street', 'karempudi', 'guntuer', 'andhra pradesh', 522614, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(297, 'IJERSS-1403588538', 'editor@ijerss.com', 'Implementation of Live Video Cartooning Using Thresholding Technique in YUV Format', 'Case Study', 'Digital Image Processing ', 'The paper discussed here deals with inducing cartoon like features to an input video using DSP processor (Texas Instrument product, TMS3206416). The basic process involved is taking input, a color video which is to be converted into a cartoon like video in DSP board can be displayed on VM3224K2 Daughter kit (LCD). VM3224Daughter Kit is embedded with DSK6416 Kit to display the output video. The conversion process is carried out in the YUV colour format. Converting in the YUV format is advantageous because applying thresholding technique to the intensity component (Yâ€™) of the video can render a cartoon like appearance to the video as the YUV colour model is based on human perception. Only the intensity component of the video inYUV format is modified as the YUV colour model allows apparent changes in the colour perception without actually altering the chrominance component of the video. Suitable thresholding techniques; single level or multi level thresholding technique can be used to get the desired effect. YUV colour model has three components namely Y, U and V. â€˜Yâ€™ is the intensity component whereas â€˜Uâ€™ and â€˜Vâ€™ are chrominance components. As this colour model facilitates apparent change in colour by simply varying the intensity component it is a very simple and intuitive technique to convert an input video to a cartoon like video. In order to observe the quality and suppleness of the algorithm various simulations in image level using different techniques has been compared with the proposed algorithm in MATLAB software. The proposed algorithm namely thresholding technique in YUV format were well implemented practically on our hardware (TMS6416 kit). Implementation of algorithm has been carried out in C-programming language using CCstudio v3.1 and various simulations have been carried out in MATLAB.', '1403588538_final_paper.doc', '2014-06-24', 'Martin Sagayam.K,Nitin John James,Hudson John,Dan Thomas Jarard', 'martinsagayam@karunya.edu,nitinjames08@gmail.com,hudsonjohn93@gmail.com,danjl@ymail.com', '9791435429', '', '', 'Coimbatore', 'Tamilnadu', 641114, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(298, 'IJERSS-1403837183', 'editor@ijerss.com', 'NETWORK-CODING-FOR STORAGE REPAIR IN DISTRIBUTED SYSTEM', 'Research', 'Network Coding', 'Modern distributed storage systems apply redundancy coding techniques to stored data. One form of redundancy is based on regenerating codes, which can minimize the repair bandwidth, i.e., the amount of data transferred when repairing a failed storage node. Existing regenerating codes mainly require surviving storage nodes encode data during repair. In this paper, we study functional minimum storage regenerating (FMSR) codes, which enable uncoded repair without the encoding requirement in surviving nodes, while preserving the minimum repair bandwidth guarantees and also minimizing disk reads. Under double-fault tolerance settings, we formally prove the existence of FMSR codes, and provide a deterministic FMSR code construction that can significantly speed up the repair process. We further implement and evaluate our deterministic FMSR codes to show the benefits. ', '1403837183_CITECH.doc', '2014-06-27', 'H.N.SREE HARSHA,CHANDAN RAJ.S', 'harsha.hns@gmail.com,candan.raj41@gmail.com', '+91 99013500', 'No.132,AECS layoutBangalore 560037', ' IT Park Road ', 'Bangalore', 'Karnataka', 560037, 'IN', 'Pending', NULL, 'COMPUTER SCIENCE', '1404461515_IJERSS1403837183.pdf', 0, 0, 'IJERSS-2014', 0, 0, 'New', 41, 0),
(299, 'IJERSS-1404113174', 'editor@ijerss.com', 'ANTHROPOMETRIC DETERMINANTS OF RUNNING  PERFORMANCE IN ELITE JUNIOR ATHLETES', 'Research', 'Article for publication', 'Abstract\r\nThe purpose of the study was to find out the anthropometrical determinants of running performance in junior elite runners. To achieve the purpose of study 61 elite level Junior Athletes from National Athletics Coaching camp at Sonipat, Haryana were selected as the subjects. Anthropometrical parameters were measured with the help of different tools, Standing height (wall mounted height measure meter), body weight (weighing machine), leg length, trunk length, arm length and hand length (non-stretchable measuring tape), calf girth, thigh girth and upper arm girth (non-stretchable measuring tape) and body compositions biceps skin fold, triceps skin fold sub-scapularis region and supra-iliac region (skin fold callipers). Descriptive statistic and Pearsonâ€™s Product Moment Correlation were employed to analyse the data. Significant positive correlation was found between Standing height and performance (r = .266*, p<0.05), between Leg length and performance (r = .276*, p<0.05),b/w Trunk length and performance (r = .359**, p<0.01) between Calf girth and performance (r = .254*, p<0.05) and between body composition and performance (r = .347**, p<0.01). However significant negative correlation was found between Upper Arm Girth (r = -.501**, p<0.01). Body Weight, Arm length, Hand length and Thigh Girth were found to be not significantly correlated with performance.\r\nKey words: anthropometrical parameters, junior elite runners\r\n', '1404113174_ANTHROPOMETRIC_DETERMINANTS_OF_RUNNING.docx', '2014-06-30', 'WAZIR SINGH PHOGAT, RAVINDERPAL AHLA', 'runwazir@gmail.com,ahlawatravi74@gmail.com', 'wazir singh', 'SAI NRC Joshi Chouhan GT Road Bahalgarh', 'Sonepat', 'Sonepat', 'Haryana', 131021, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1404965337_IJERSS1404113174.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue VII, July 2014.', 329, 1),
(301, 'IJERSS-1404139338', 'editor@ijerss.com', 'Automatic Classification of Phonocardiogram', 'Research', 'electronics and communication', 'This paper presents a novel method of automatic classification of phonocardiogram. The noisy phonocardiogram is segmented to form noisy datasets of one heart cycle. The dataset is created for murmur and normal sounds. The datasets are LMS filtered to produce two new datasets to form the filtered datasets. The test sound which is a noisy phonocardiogram is taken, segmented and each segment of one cycle duration is checked for normal and murmur segments. The test sound is LMS filtered and re-segmented. The segments are checked for normal and murmur sounds and the results are compared with the previously obtained results. ', '1404139338_Automatic_classification_of_Phonocardiogram.docx', '2014-06-30', 'M.Vishwanath Shervegar', 'vishwa@hotmail.co.in', '9886212483', 'M.Vishwanath Shervegar, Asst Prof, E&C dept', 'MIT Kundapura', 'udupi', 'karnataka', 576217, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(302, 'IJERSS-1404199208', 'editor@ijerss.com', 'EFFECT OF CONTINUOUS RUNNING, FARTLEK AND INTEVAL TRAINING ON MUSULAR ENDURANCE AMONG MALE SOCCER PLAYERS', 'Research', 'SPORTS SCIENCE', 'The aim of this study was to finding out the effect of Continuous running Fartlek training and Interval training on Speed and Coordination among male soccer players. To achieve the purpose of the study 60 intercollegiate male  football players were selected as subject at random from in an around the Guntur district of Andhra Pradesh and their age ranged of the subject is between 18 to 23years.The subject was divided into four group namely experimental group A, experimental group B, experimental group C and Control group D. Experimental group A underwent to Continuous running training, experimental group B underwent to Fartlek training, experimental group C underwent to Interval  training and group D act as a control group they did  not participate in any of the training programme other than their regular activates. The data was collected from four groupsâ€™ pre and post of the experimental period. The raw data on speed and coordination was statistically analyzed by using Analysis of Covariance (ANCOVA). Scheffeâ€™s post hoc test was applied to determine the significant differences between the paired adjusted means. In all the cases 0.05 level of significance was fixed. The result of the study showed that there was as significantly improvement was found in Muscular endurance  among the experimental group when compared with control group', '1404199208_hyd_paper.docx', '2014-07-01', 'Sudhakara Babu Mande,Dr.P.P.S.Paul Kumar', 'sudhakarmande7@gmail.com,ppspaulkumar@gmail.com', '9030057655', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1404965220_IJERSS1404199208.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue VII, July 2014.', 330, 1),
(304, 'IJERSS-1404395961', 'editor@ijerss.com', 'ATTITUDE OF HIGH SCHOOL PHYSICAL EDUCATION TEACHERS, STUDENTS AND THEIR PARENTS TOWARDS PHYSICAL EDUCATION SUBJECT IN DAKSHINA KANNADA DISTRICT', 'Short Communication', 'Sports Sciene & Physical Education', 'Abstractâ€” Physical education classes seek to keep the children in the school fit and healthy, however, they also work to promote individualized areas of health, such as developing speed, endurance and strength. Physical Education teacher and parents need to take responsibility for their kids well as those in charge of physical education, when it comes to being and remaining physically active. Recently in Karnataka state Physical Education subject was introduced theoretically and practically in 40:60 ratio. Hence researcher has taken up a study to find out the attitude of high school physical education teachers, students and their parents towards physical education subject in dakshina kannada district. Questionnaire was used to find out the attitude of high school students, physical education teachers and parents toward physical education subjects in high school. Questionnaire was constructed with twelve yes/no questions related to attitude towards physical education subjects in high school. To improve accuracy of despondence equal number of positive and negative questions covered.  After obtained the response it would be tabulated and analyzed. Study result says that implemented Physical education subject will help to gain more knowledge in the various aspects of physical education. Physical education teachers are playing important role in high schools to reach physical education subject to all the students. Implementation of physical education subjects are making parents to participate much and more in school physical activities. Parents are really happy about physical education as a subject.\r\n\r\nIndex Termsâ€”Attitude, Physical Education, High school\r\n', '1404395961_final_app_paper_for_journal_2222222222222.doc', '2014-07-03', 'MANOJ,ANANTHAPADMANABHA PRABHU', 'manubabahai@gamail.com,sportstodream@gmail.com', '09964279510', 'Lecturer, Dept. of Physical Education ', 'Mangalore University, Konaje', 'Mangalore', 'Karnataka', 574199, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1404965177_IJERSS1404395961.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue VII, July 2014.', 321, 1),
(305, 'IJERSS-1404457814', 'editor@ijerss.com', 'SELF HEALTH REGULATION OF AUTONOMOUS ROBOT', 'Research', 'Electronics and Communication', 'This paper aims at Health Regulations of an autonomous robot. As robot is autonomous, it has to find out its energy requirement that is stored in the batteries. It has to self charge to the required level whenever charge left inside the battery is low. Robot has to find out the temperature of the motor drivers and if temperature of the motor driver is above the predetermined value fan should be turned on to cool the motor driver. If inensity of the surrounding light is below the threshold value then LEDs(Light Emitting Diodes) should be turned on. Atmega32 microcontroller is used to control the hardware. AVR studio software is used to write the embedded C Program and Labview is used for image processing.', '1404457814_paper_project.docx', '2014-07-04', 'Raghu S,M Vishwanath Shervegar', 'raghusenc@gmail.com,vishwa@hotmail.co.in', '9972060143', 'ASSISTANT PROFESSOR', 'E and C Department Moodlakatte Institute of Tech.', 'KUNDAPURA', 'Karnataka', 576217, 'IN', 'ACCEPTED', '', 'COMPUTER SCIENCE', '1404471992_IJERSS1404457814.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue VII, July 2014.', 334, 1),
(306, 'IJERSS-1404583189', 'editor@ijerss.com', 'AUTOMATIC SLEEP STAGE DETECTION OF AN EEG SIGNAL USING AN ENSEMBLE METHOD', 'Research', 'Signal Processing', 'Now a days, sleep related problems increases day by day, which become a public health issue, where many people suffering from sleep disorder which affects their normal life. Number of methods has been invented for detection and diagnosis of sleep disorder where sleep stages are used as evidence for diagnosing sleep diseases. According to Rechtschaffen and Kales (R&K) sleep scoring manual, sleep analysis of electroencephalogram (EEG) signals based on 30 seconds long segment called epoch. Previous manual visualization based method was used which divides signal into 30 second epoch and assign stages according to their wave frequencies and characteristics, which is a very time-consuming task; prone to errors. To overcome this problem, automatic sleep stage classification is used which reduce the manual tasks and improve classification accuracy by using ensemble method. Sleep stage classification involved classification of the data into five classes (awake and four sleep stages). Sleep scoring was performed with the help of pattern recognition technique, which involves feature extraction, feature selection, classification and ensemble. For feature extraction of an EEG signals, we have made use of Discrete wavelet packet transform (DWPT), base classifiers like artificial neural networks, k-Nearest Neighbor, SVM applied for classification and then ensemble method was deployed in our approach for getting better accuracy by combining the results of all classifier using majority voting method. ', '1404583189_final_Sleep_EEG_Signal_paper_for_submission.docx', '2014-07-05', 'BHARTI KAMLESH KANOJE,ASHWINI S. SHINGARE', 'bharti.k1406@gmail.com,ashwini.shingare@vit.edu', '9730754874', 'C/o Mr Mohan Jagtap A8/23 chintamani nagar-3 ', 'near pushpam gas godown nahesh society Bibvewadi ', 'pune', 'MH', 411037, 'IN', 'Pending', NULL, 'COMPUTER SCIENCE', '1404750503_IJERSS1404583189.pdf', 0, 0, 'IJERSS-2014', 0, 0, 'New', 42, 0),
(307, 'IJERSS-1404646063', 'editor@ijerss.com', 'ETHNIC INFLUENCES ON ADOLESCENTS MOTIVATION FOR PARTICIPATION IN PHYSICAL ACTIVITY', 'Research', 'Physical activity', 'The purpose of the study was to examine ethnic influences on adolescentâ€™s motivation for participation in physical activity. Subjects for the study were one hundred and thirty nine male high school attending students during 2013-14. The subjects belonged to different ethnic backgrounds viz Siddi (N=33), Tibetan (N=58) and Adi Dravida (N=48). The subjects were mainly from eight high schools of Uttara Kannada and Shimogga Districts of Karnataka state. A translated and modified version of physical activity motivation questionnaire (Iowa Sports School Questionnaire; Gill et al., 1983) was used to collect data about high school attending ethnically differing studentâ€™s sports participatory motivation at their respective schools. ANOVA of physical activity motivation among male high school students belonging to different ethnic background indicates a significant F ratio. On the basis of the results and within the limitations of the study it was concluded that there is significant difference in physical activity motivation among subjects. The findings are discussed in detail.', '1404646063_Shivamurthy,_gajanan_&_anusoori.docx', '2014-07-06', 'Dr. Shivamurthy A.,Dr. Gajanana Prabhu B.,Mr. Anusoori Soloman Raju', 'prabhuji888@gmail.com,prabhuji888@gmail.com,prabhuji888@gmail.com', '9845311458', 'Physical Education Director ', 'Sahyadri Arts & Commerce College', 'Shimoga', 'Karnataka', 577201, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1404964806_IJERSS1404646063.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue VII, July 2014.', 744, 1),
(308, 'IJERSS-1404659874', 'editor@ijerss.com', 'PATH PLANNING OF PARALLEL MANIPULATOR LINKAGE FOR LASER-WELDING PROCESS', 'Short Communication', 'MECHANICAL ENGINEERING', 'This paper presented briefly an application of a parallel manipulator mechanism for the path control in laser welding of light-weight materials. The conventional planar parallel 3-RPR linkage is considered initially for the study and is modified with an equivalent counterpart. The workspace, stiffness and dynamics of the mechanism are explained one by one. For the light-weight materials like magnesium alloys used in automobiles, the non-contact fusion welding operations with laser beams is more common. The remote control laser welding operation requires some pre-designed path along with the proper design of robot manipulator mechanism. By employing redundancy  in the mechanism, the robot can overcome singularities during path tracking', '1404659874_july_paper14.doc', '2014-07-06', 'U.SUDHAKAR,J.SRINIVAS', 'mr.u.sudhakar@gmail.com,srin07@yahoo.co.in', '9494473969', 'Department of Mechanical Engineering', 'GMR-INSTITUTE OF TECHNOLOGY', 'RAJAM', 'AP', 532127, 'IN', 'Pending', '', 'MECHANICAL SCIENCE', '1404995371_IJERSS1404659874.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue VII, July 2014.', 416, 1),
(309, 'IJERSS-1405519642', 'editor@ijerss.com', 'COMPARATIVE ANALYSIS OF VARIOUS IMAGE DENOISING TECHNIQUES: A REVIEW PAPER', 'Review', 'IMAGE DENOSING', 'Removal of noise from the original signal is still a challenging issue for researchers. Image denoising is a applicable issue found in diverse image processing and computer vision problems. The important property of a good image denoising model is that it should completely remove noise as far as possible as well as preserve edges. There are various existing methods to denoise image. Each method has its own advantages, disadvantages and assumptions. This paper presents a review of some significant work in the field of Image Denoising. The brief introduction of some popular approaches is provided and discussed. Insights and potential future trends are also discussed.', '1405519642_Research_paper.doc', '2014-07-16', 'MANOJ GABHEL , MTECH SCHOLAR, DR. C.V. RAMAN UNIVERSITY Bilaspur (C.G) ,AASHISH HIRADHAR     					As', 'manoj.gabhel555@gmail.com', '9770590509', 'HNO 222 WARD NO 13 PATTHARRI PARA BALCO ROAD ', 'DHENGUR NALA BESIDE SHASHI LADIES TAILOR', 'KORBA', 'CHHATTISGARH', 495677, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(310, 'IJERSS-1407177252', 'editor@ijerss.com', 'Spectrum Sensing & Throughput Maximization of OSA Cognitive Radio Networks', 'Case Study', 'Cognitive Radio -Communication Engineering ', 'Cognitive radio (CR) is a technology that is of growing interest internationally. Currently, there is a highly active worldwide community of academic and industrial researchers working in this field.  This is a promising technology which has attracted a lot of attention as an effective method of reducing the spectrum scarcity problem in wireless communications. One of the most promising approaches in cognitive radio is the Opportunistic Spectrum Access (OSA), which enables secondary (unlicensed) users to access licensed frequency bands that are detected to be unused. To support spectrum reuse functionality, the secondary users are required to sense the radio frequency environment, and once the primary users are found to be active, the secondary users are required to vacate the channel within a certain amount of time. Therefore, spectrum sensing is an important aspect in cognitive radio networks (CRNs). Additionally, the spectrum sensing duration and the data transmission duration also have a significant impact on the throughput of the cognitive network. In this paper we study a novel cognitive radio system that exhibits improved throughput and spectrum sensing capabilities compared to the conventional OSA cognitive radio systems studied so far. Results from the simulations are used to compare enhancement in the achievable throughput of the proposed CR system with the respective throughput of the conventional CR systems and to study the effects of the optimal power allocation and target detection probability on the ergodic throughput of the proposed CR system. Simulation environment is generated using MATLAB tool.', '1407177252_Spectrum_Sensing_&_throughput_enhancement_IJERSS.docx', '2014-08-05', 'Mrs. Madhuri S.Wakchaure ,Prof. N.S.Kilarikar', 'madhuri.gunjal@gmail.com', '9920457458', 'D-12, Jai Bhavani CHS,Plot-18, Sector-11', 'Kharghar', 'Navi Mumbai', 'Maharashtra', 410210, 'IN', 'Pending', '', 'ELECTRONICS', '1408081832_IJERSS1407177252.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue VIII, August 2014.', 617, 1),
(311, 'IJERSS-1407221473', 'editor@ijerss.com', 'IMPACT OF FOOD AND NUTRITION SECURITY ON THE SELECTED TEAM GAMES OF HIGH SCHOOL PLAYERS OF   DHARWAD CITY, KARNATAKA', 'Research', 'HEALTH SCIENCE', 'The present study was undertaken to study the impact of food and nutrition security on performance of competitive sports activities among high school players of Dharwad, city, Karnataka. The data was collected under three headings like general background information of the selected sports personnel, baseline information of the selected team games like kabaddi and football for male players, khokho and Volleyball for female players. Players were divided in to three groups as control, experimental 1 and experimental 2. All the groups were assessed for physical measurements, physical performance, nutrient intake, nutrition knowledge and practice before the intervention. Experimental 1 and 2 groups received nutrition education for 12 contact hours. Real match was arranged between control and experimental group to evaluate the field performance. Later only one experimental group was supplemented with carbohydrate rich snack (Carbohydrate-72 g) three days before the competition. On the day of competition experimental group received a carbohydrate (6.75%) electrolyte beverage before, during and after the competition. Physical performance was evaluated using AAHPERD physical fitness test.\r\n	The findings of impact of nutrition education revealed that overall nutrition knowledge level increased significantly by 26% and 22% in male and female players where as practice was improved only 10% and 9% respectively. The knowledge improvement was better that practice. The food consumption pattern and food intake significantly improved and increased due to nutrition intervention. Carbohydrate intake after the nutrition education was above 65% in both the players. This was further improved due to carbohydrate supplementation to 70%, which was significantly more that control group. The physical performance results revealed significant improvement in the selected fitness tests like strength, agility and endurance. There was significant improvement in the game performance as evaluated by coaches in all the experimental groups than in control groups and experimental groups had won the match. Self evaluation by players showed intervention program was useful for their sports performance. The study concluded that nutrition education and carbohydrate supplementation improved the food and nutrition security in turn sports performance of selected team game players\r\n', '1407221473_IJRSSsubmission.doc', '2014-08-05', 'RENUKA METI ,A. G. BUJURKE', 'renukabujurke1@gmail.com,renukabujurke1@gmail.com', '9030057655', '', '', '', '', 0, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1431956660_IJERSS1407221473.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume II - Issue V, May 2015.', 185, 1),
(312, 'IJERSS-1407338542', 'editor@ijerss.com', 'EFFECTIVE DATA COLLECTION IN WIRELESS SENSOR NETWORKS', 'Research', 'COMPUTER SCIENCE', 'Wireless sensor networks refers to ad-hoc wireless networks consisting of nodes that have sensing capability. The data are collected and processed by a subset of nodes that WSN is a dynamic network where links are volatile between the nodes involved. There are QoS parameters like coverage, packet drop ratio, traffic control, delay, jitter, energy used, quality of nodes and packets, etc. Wireless Sensor Network promises a new domain to interact with our environment through computers and humans. WSN serves large number of time critical applications for saving human life. For example, disaster relief, emergency services etc.The applications based on WSN clearly depend upon the factor â€œSensing + computation + radio operationâ€.Among these factors the energy loss is maximum due to radio operations which must be controlled to get better throughput.Usually, sensor networks are deployed for long-term monitoring, likely at the places where the exchange of the power source (battery) might not be possible and/or this replacement is very costly (e.g., underwater monitoring, leakage of harmful chemicals). Therefore, for majority of the WSN applications, data rate and delay are commonly not so important factors in the sensor networks as energy consumption and reliability', '1407338542_durga.docx', '2014-08-06', 'A.GnanaSoundari,Dr. V. L. Jyothi', 'soundarivenkat77@gmail.com,soundarivenkat77@gmail.com', '9030057655', '', '', '', '', 0, 'IN', 'Pending', '', 'COMPUTER SCIENCE', '1407897439_EFFECTIVE_DATA_COLLECTION_IN_WIRELESS_SENSOR_NETWORKS.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue VIII, August 2014.', 346, 1),
(313, 'IJERSS-1407506588', 'editor@ijerss.com', 'Bitcoin Security Issues', 'Research', 'Computer Application', 'Bitcoin is a free open source peer-to-peer electronic cash system. It is completely distributed, without any control of a central server or trusted parties.  Bitcoin has the prospective to transform online payment systems in a way that welfare consumers and businesses. Instead  of using an intermediary such as PayPal  or submitting  credit  card  information to a third  party for verification-both of which often include  transaction fees and other  restrictions-Bitcoin allows  individuals  to  pay  each  other directly  for goods or services.\r\nThe  characteristics  that   make   Bitcoin  so  ground-breaking have  also  made  it  a  target  for  regulators, who  dread  that  the cryptocurrency will aid money laundering, tax evasion and other crimes.  But, unlike cash, Bitcoin transactions are logged in an online journal.\r\nBitcoin  closely  look  like  traditional  cash  than   other   forms of  e-spending,   and  this  ability  to  marry  cash-like  properties with prompt electronic  payments  is highly advertised by Bitcoin buffs as an advantage to various actors,  traders involved. Bitcoin combines the best of both worlds from a feature  viewpoint, from a  security  perspective  this  union  of cash  and  computers  could barely  be inferior.  A currency  which is vulnerable  to large-scale theft can never be widely accepted for everyday acquisitions,  and thus it follows that  if Bitcoin is to become a substitute to current payment  systems, we must  find some way to make  it secure  for the average  user.\r\nThis paper highlights various security issues and attacks on Bitcoin. Finally, it provides some research directions in the area of Bitcoin.\r\n', '1407506588_Bitcoin_Security_ij.doc', '2014-08-08', 'Preeti Sharma,Gulshan Ahuja', 'preetishrm09@gmail.com,gulshanahuja@gmail.com', '8437523807', 'Ashok Sharma', 'Mohalla Dharampura', 'Ferozepur', 'Punjab', 152002, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(314, 'IJERSS-1407559997', 'editor@ijerss.com', 'Announcement Effect of Bonus Issue on Stock Prices: An empirical study of CNX 500 stocks', 'Case Study', 'Management Technology', 'The present study attempts to examine the effect of bonus issue announcement of CNX 500 stocks of NSE on stock prices during January 2006 to December 2013. An event study methodology is adopted in this study to examine the effect surrounding the sixty days of the announcement. AR, AAR and CAAR are calculated and t tests are conducted to test the significance. From the study, it can be inferred that bonus issue announcement had resulted with significant positive impact on stock prices around announcement.', '1407559997_Baba_final_for_IJERSS.doc', '2014-08-09', 'Dr. K. Ramya,D. Bhuvaneshwari', 'krishrum9@gmail.com,14.bhuvi@gmail.com', '9843070208', '', '', '', '', 0, 'IN', 'Pending', '', 'MANAGEMENT SCIENCE', '1407982784_IJERSS1407559997.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue VIII, August 2014.', 471, 1),
(315, 'IJERSS-1407603697', 'editor@ijerss.com', 'ESTABLISHING RELIABILITY OF ANXIETY (CSAI-2D) ON INDIAN ATHLETES', 'Research', 'SPORTS SCIENCE', 'The purpose of the study was to establish the reliability of Anxiety (CSAI-2D) during competition with the help of the thirty eight (38) athletesâ€™. The competitive state anxiety examined on International and National Level Indian athletes from National Athletics Coaching camp at the gap of one weak. The relationship between 3x2 variables at intensity and directional interpretation of anxiety proves that the anxiety can be facilitative and debilitative the performance of athletes. The responses on Competitive state anxiety questionnaire in bilingual (Hindi and English) responded by athletes, which assess sub-scales (Cognitive Anxiety, Somatic Anxiety and Self-confidence). The statistical analysis defines the Reliability of Competitive State Anxiety Inventory-2D (modified version) on Indian population. \r\n\r\nThe Pearsonâ€™s Product Moment Correlation method was used to measure the significant relationship between variables of anxiety during competition which reflects low and high anxiety at intensity interpretation of athletes and the Perception of these anxiety symptoms reflects facilitative and debilitative responses of anxiety on the performance of athletes. These competitive state anxiety measures with Cognitive state anxiety, Somatic state anxiety and Self-confidence\r\n', '1407603697_PAPER___ESTABLISHING_RELIABILITY_OF_ANXIETY_(1).docx', '2014-08-09', 'Jain Shilpi,Dr. Pardeep Kumar,Wazir Singh Phogat', 'john.shilpy1947@gmail.com,pardeepjonti@yahoo.com,runwazir@gmail.com', '9030057655', '', '', '', '', 0, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(316, 'IJERSS-1407865717', 'editor@ijerss.com', 'ANALYSE THE PREDOMINANT MOTOR ABILITY COMPONENTS IN HANDBALL PLAYERS', 'Research', 'SPORTS SCIENCE', 'The purpose of present investigation was a analyse the predominant motor ability components in handball players. There would be positive significant relationship between hand ball playing ability and the chosen motor ability components. Among the chosen motor ability components, few of them alone would very much influence the hand ball playing ability. The results of the investigation will assess the handball playing ability of female players and also assess the ability of motor fitness components of female handball players. The findings of the study will explore the predominance of motor ability components of female handball players. The result of the investigation will be much useful for physical educationists and coaches to identify the most important variables for handball team selections and to frame ideal Training schedule to improve the handball playing ability of female players. The findings of the study will add the quantum of knowledge in the area of Training methods especially for women handball players', '1407865717_ANALYSE_THE_PREDOMINANT_MOTOR_ABILITY_COMPONENTS_IN_HANDBALL_PLAYERS.docx', '2014-08-12', 'K. Aruna Sujatha,Dr.P.P.S.Paul Kumar', 'ppspaulkumar@gmail.com', '9030057655', '', '', '', '', 0, 'IN', 'Published Online', '', 'SPORTS SCIENCE', '1408004930_IJERSS1407865717.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue VIII, August 2014.', 378, 1),
(317, 'IJERSS-1407865858', 'editor@ijerss.com', 'EFFECT OF CONTINUOUS RUNNING FARTLEK TRAINING AND INTERVAL TRAINING ON SELECTED MOTOR ABILITY AND PHYSIOLOGICAL VARIABLES AMONG MALE FOOTBALL PLAYERS', 'Research', 'SPORTS SCIENCE', 'The present study was undertaken to analyze the effect of continuous running fartlek training and interval training on selected motor ability and physiological variables Cardio vascular endurance among male football players. The investigator has selected sixty inter collegiate football men players at random, their age ranged from 18-25 years. The subjects chosen for the study were divided into four equal groups and designated as experimental group â€˜Aâ€™ experimental group â€˜Bâ€™ experimental group â€˜Câ€™ and control group â€˜Dâ€™. Continuous running were given to group â€˜Aâ€™ Fartlek training group â€˜Bâ€™ Interval training given to group â€˜Câ€™ and the control group â€˜Dâ€™ were restricted to participate in any activities. The trainings were given for a period of twelve weeks. The data were collected before and after the training. The obtained dataâ€™s were analyzed by Analysis of Covariance (ANCOVA). The level of significant was fixed at 0.05 levels. Where ever the â€˜Fâ€™ ratio was found significant scheffeâ€™s post test was used for find out the significant differences among the paired mean. The results of the study showed that continuous running, fartlek training and interval training are significantly improved than control group', '1407865858_EFFECT_OF_CONTINUOUS_RUNNING_FARTLEK_TRAINING_AND_INTERVAL_TRAINING_ON_SELECTED_MOTOR_ABI', '2014-08-12', 'Dr.P.P.S.Paul Kumar,Sudhakara Babu Mande', 'ppspaulkumar@gmail.com,sudhakarmande7@gmail.com', '9030057655', '', '', '', '', 0, 'IN', 'Pending', '', 'SPORTS SCIENCE', '1407937264_EFFECT_OF_CONTINUOUS_RUNNING_FARTLEK_TRAINING_AND_INTERVAL_TRAINING_ON_SELECTED_MOTOR_ABILITY_AND_PHYSIOLOGICAL_VARIABLES_AMONG_MALE_FOOTBALL_PLAYERS.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue VIII, August 2014.', 690, 1),
(318, 'IJERSS-1407865929', 'editor@ijerss.com', 'EFFECT OF PLYOMETRIC WITH PILATES EXERCISES ON SELCETD MOTOR ABILITY EXPLOSIVE POWER AMONG VOLLEYBALL PLAYERS', 'Research', 'SPORTS SCIENCE', 'The following   criterion variables muscular strength, explosive power, muscular endurance, coordination, flexibility, cardio respiratory endurance, breath holding time, resting pulse rate, service ability and volleying ability were selected for the purpose of the study. The above criterion variables were assessed by pull-ups, vertical jump, bent knees sit-ups, Scott obstacle race test, sit and reach test, coopers twelve minutes run and walk, nose clip methods, manual methods Russell-Lange volleyball test.Prior to and after the training program, the subjects were tested for all the criterion variables. The collected data were analyzed statistically by using the analysis of variance (ANOVA) to determine the differences, if any among the groups prior to and immediately after the training period on selected criterion variables separately. Analysis of covariance (ANCOVA) was used to determine the differences, if any among the adjusted post test means on selected dependent variables separately. Whenever the F- ratio for adjusted post test means was found to significant, the Scheheffeâ€™s test was applied as post hoc test to find out paired mean differences. In all cases 0.05 level of confidence was concluded', '1407865929_EFFECT_OF_PLYOMETRIC_WITH_PILATES_EXERCISES_ON_SELCETD_MOTOR_ABILITY_EXPLOSIVE_POWER_AMON', '2014-08-12', 'Kota Satish, Dr.P.P.S.Paul Kumar', 'ppspaulkumar@gmail.com', '9030057655', '', '', '', '', 0, 'IN', 'Pending', '', 'SPORTS SCIENCE', '1408001874_IJERSS1407865929.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue VIII, August 2014.', 295, 1);
INSERT INTO `papers` (`id`, `paper_id`, `paper_referral`, `paper_title`, `paper_type`, `subject_category`, `abstract`, `paper_attachment`, `uploaded_on`, `author`, `email`, `pnumber`, `address_line1`, `address_line2`, `city`, `state`, `pincode`, `country`, `status`, `comments`, `subject`, `pdf`, `active`, `news`, `conference`, `volume`, `issue`, `volume_issue_title`, `downloads`, `blogspot`) VALUES
(319, 'IJERSS-1407866002', 'editor@ijerss.com', 'EFFECT OF PLYOMETRIC WITH PILATES EXERCISES ON SELCETD MOTOR ABILITY MUSCLAR STRENGTH AMONG VOLLEYBALL PLAYERS', 'Research', 'SPORTS SCIENCE', 'The objective of this study was to find out the effect of Plyometric training with Pilates exercise on selected motor ability physiological and skill related performance variables among volleyball players. To achieve this purpose, sixty male intercollegiate volley ball players were selected at random from in an round the Warangal district, Telanagana. Their age ranged between 18 to 22 years. The selected subjects were randomly divided into two experimental and one control group, each group consist of  twenty (n=20) subjects, namely experimental group â€˜Aâ€™, experimental group â€˜Bâ€™ and control group â€˜Câ€™ respectively. 	During the training period, the two experimental groups underwent their respective training programme, four days per week on alternate days for twelve weeks in addition to the regular physical activities. Group â€˜Aâ€™ underwent Plyometric training, Group â€˜Bâ€™ underwent Plyometric with Pilates exercise. Every day the work out lasted for about 45-60 minutes including warm-up and warm down exercises .Group â€˜Câ€™ acted as control group who did not participate in any specific training. However, they involved in their regular physical activities', '1407866002_EFFECT_OF_PLYOMETRIC_WITH_PILATES_EXERCISES_ON_SELCETD_MOTOR_ABILITY_MUSCLAR_STRENGTH_AMO', '2014-08-12', 'Kota Satish, Dr.P.P.S.Paul Kumar', 'ppspaulkumar@gmail.com', '9030057655', '', '', '', '', 0, 'IN', 'Pending', '', 'SPORTS SCIENCE', '1410166825_IJERSS1407866002.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue VIII, August 2014.', 309, 1),
(320, 'IJERSS-1407866071', 'editor@ijerss.com', 'EFFECT OF STRUCTURED RESISTANCE TRAINING AND VARIED INTENSITIES OF WEIGHT TRAINING ON SELECTED MOTOR FITNESS RESTING PULSE RATE AND BREATH HOLDING TIME AMONG ATHLETES', 'Research', 'SPORTS SCIENCE', 'The Aim of the study was to find out the effect of structured resistance training and varied intensities of weight training on selected motor fitness Resting pulse Rate and Breathing Holding time among athletes .The selection of subjects, selection of variables, research design, orientation of the subjects, selection of tests, testers reliability, training schedule, test administration, and the statistical technique used. To find out the effects of structured resistance training and varied intensities of weight training on selected motor fitness Resting pulse Rate and Breathing Holding time among  athletes, the investigator randomly selected 60 sprinters, who competed at inter collegiate level sports meets representing different colleges in Hyd. They were divided into three groups at random again consisting twenty subjects in each group and they were randomly assigned as experimental group I (SRT â€“Structured Resistance Training) and Experimental group II (VWT â€“ varied weight training).  And control group. The requirements of the experimental procedures, testing as well as exercise schedules were explained to them so as to avoid any ambiguity of the effort required on their part and prior to the administration of the study, the investigator got the individual consent from each subject. Effect of Structured Resistance Training and Varied Intensities of Weight Training on Selected Motor Fitness Resting pulse Rate and Breath holding Time among Athletes', '1407866071_EFFECT_OF_STRUCTURED_RESISTANCE_TRAINING_AND_VARIED_INTENSITIES_OF_WEIGHT_TRAINING_ON_SEL', '2014-08-12', 'S.Raju, Dr.P.P.S.Paul Kumar', 'ppspaulkumar@gmail.com', '9030057655', '', '', '', '', 0, 'IN', 'Pending', '', 'SPORTS SCIENCE', '1408443843_IJERSS1407866071.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue VIII, August 2014.', 785, 1),
(321, 'IJERSS-1407866127', 'editor@ijerss.com', 'EFFECT OF STRUCTURED RESISTANCE TRAINING AND VARIED INTENSITIES OF WEIGHT TRAINING ON SELECTED MOTOR FITNESS SPEED AND AGILITY AMONG ATHLETES', 'Research', 'SPORTS SCIENCE', 'The Aim of the study was to find out the effect of structured resistance training and varied intensities of weight training on selected motor fitness Speed and Agility among Athletes. The selection of subjects, selection of variables, research design, orientation of the subjects, selection of tests, testers reliability, training schedule, test administration, and the statistical technique used. To find out the effects of structured resistance training and varied intensities of weight training on selected motor fitness  speed and agility among  athletes, the investigator randomly selected 60 sprinters, who competed at inter collegiate level sports meets representing different colleges in Hyd.  They were divided into three groups at random again consisting twenty subjects in each group and they were randomly assigned as experimental group I (SRT â€“Structured Resistance Training) and Experimental group II (VWT â€“ varied weight training).  And control group. The requirements of the experimental procedures, testing as well as exercise schedules were explained to them so as to avoid any ambiguity of the effort required on their part and prior to the administration of the study, the investigator got the individual consent from each subject. Effect of Structured Resistance Training and Varied Intensities of Weight Training On Selected Motor Fitness Speed and Agility among Athletes', '1407866127_EFFECT_OF_STRUCTURED_RESISTANCE_TRAINING_AND_VARIED_INTENSITIES_OF_WEIGHT_TRAINING_ON_SEL', '2014-08-12', 'S.Raju, Dr.P.P.S.Paul Kumar', 'ppspaulkumar@gmail.com', '9030057655', '', '', '', '', 0, 'IN', 'Published Online', '', 'SPORTS SCIENCE', '1408443965_IJERSS1407866127.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue VIII, August 2014.', 278, 1),
(322, 'IJERSS-1407939781', 'editor@ijerss.com', 'A Study on Relation ship Between Arm Length on Discus Throw Performance on B.P.Ed Students', 'Research', 'SPORTS SCIENCE', 'All the field events have always been considered the more technical branch of Athletics. Field event especially throwing events need a powerful physique. The purpose of the study was to find out the relationship between arm length on discus throw performance 20 bachelor of Physical Education male Students of Acharya Nagarjuna University were randomly selected as Subject and their age ranged between 21 & 23 years the length of the arm of the subjects was measured by a Steel tape and recorded in Centimeters arm, length taken from the acromin process above the shoulder joint to the tip of the middle finger of throwing hand before attempting  the throw the subject were asked to have warm up exercises their choice the subject were asked to get into the subject the discus of 2kg weight was used each subject was allowed to get into the circle with the discuss in hand throw the maximum possible distance with standing throw three trails were allowed and best performance were taken into consideration all the measurement were recorded at the end of  each throw in centimeters.\r\n The result relived the highest score in arm length gain more distance and lowest score of arm length gain less distance. \r\n', '1407939781_madhu_sir_paper_1.docx', '2014-08-13', 'Y.Madhusudhana Rao, Prof.Y.Kishore', 'ppspaulkumar@gmail.com,ppspaulkumar@gmail.com', '9030057655', '', '', '', '', 0, 'IN', 'Pending', '', 'SPORTS SCIENCE', '1407940234_IJERSS1407939781.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue VIII, August 2014.', 309, 1),
(323, 'IJERSS-1408340635', 'editor@ijerss.com', 'Effect of Dividend Announcements on Share Prices with special reference to CNX Nifty Stocks of NSE', 'Research', 'FINANCE', 'Abstract -- Several theories have been advanced to explain why companies go for cash dividends. Informed investorsâ€™ market wealth is influenced to a greater extent around the dividend announcement. It is observed that a stock price movement is an area of research that attracted the attention of various researchers. Therefore, the present study attempts to contribute to the understanding of the behavior of Indian share prices in relation to dividend announcement. A standard event study methodology is adopted in this study to examine the impact and price reactions of CNX Nifty stocks to dividend announcement. Further the impact of dividend announcement on manufacturing and service sectors is studied. Abnormal returns are calculated and t-tests are conducted to test the significance. The results of the study shows that the investors are able gain returns from dividends announcements in manufacturing sector than from the services sector.\r\n\r\nIndex Terms -- Abnormal Returns, CNX Nifty, Corporate Announcements, Dividend, Event Study Methodology\r\n', '1408340635_Dividend_Announcements.docx', '2014-08-18', 'Sharmila R,Dr. Nanjundaraj Prem Anand,', 'rsharmila08@gmail.com,principal@djacademy.ac.in', '9994670099', '5/249 A MALARVIZHI NAGAR, M.K.PATTI POST', 'POLLACHI', 'COIMBATORE', 'TAMILNADU', 642003, 'IN', 'ACCEPTED', '', 'MANAGEMENT SCIENCE', '1410190013_IJERSS1408340635.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue IX, September 2014.', 369, 1),
(324, 'IJERSS-1409120771', 'editor@ijerss.com', 'Enhanced Principal Component Classifier Based Anomaly Detection System for Wireless Sensor Networks', 'Research', 'Network Security & Wireless Sensor Networks', 'Abstractâ€”Wireless Sensor Networks (WSN) are increasingly used as an important platform for collecting and monitoring data from unattended environments. The constrained sensor resources in terms of storage, processing, bandwidth and energy are vulnerable to different possible anomalies. Intrusion detection system gathers and analyzes information from various areas within a computer or a network to identify security breaches. Existing intrusion detection methods have limitations, in detecting the novel attacks. Therefore, anomaly detection approaches on the simulated data are modeled to identify the deviations. In order to solve the detection approaches that rely on human intervention, machine-learning based anomaly detections are proposed. This paper describes the classification of anomaly-based machine learning algorithms in wireless sensor networks,  where, Candid Covariance-free Incremental Principal Component Analysis (CCIPCA) approach is used for dimensionality reduction of simulated data set and Principal Component Classifier (PCC) is enhanced for efficient classification. The proposed Enhanced Principal Component Classifier (EPCC) detection results are compared with various machine learning algorithms such as AdaBoost, PCA, PCA with SVM and PSO, Soft Margin PCA and TWSVM. It is observed that the proposed EPCC gives desirable results in terms of Detection Rate (DR), False Alarm Rate (FAR), Throughput, Packet Loss Ratio, Precision and Recall when compared to the other methods.\r\n\r\nKeywordsâ€”Anomaly Detection, Machine learning algorithm, Principal Component Classifier, CCIPCA.\r\n', '1409120771_EPCC_Paper.doc', '2014-08-27', 'J.Saranya,Dr.G.Padmavathi', 'jsaranyam.philcs@gmail.com,ganapathi.padmavathi@gmail.com', '9047785366', 'Venkateshwar Motors , 58-AB, LNRM Compound', 'Near Periyar Colony, Avinashi Road,', ' Tiruppur', 'TAMIL NADU', 641652, 'IN', 'Accepted', '', 'COMPUTER SCIENCE', '1412946582_IJERSS1409120771.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 214, 1),
(325, 'IJERSS-1409564438', 'editor@ijerss.com', 'ANALYSIS OF SPORTS COMPETITON ANXIETY BETWEEN INTER COLLEGE TOURNAMENTS BOYS HANDBALL & VOLLEYBALL PLAYERS', 'Research', 'Sports Sciene & Physical Education', ' The purpose of the investigation was to find out the comparison of sports competition Anxiety of inter-college Tournaments Boyâ€™s Handball and Volleyball Players. The study Conducted on 60 boys inter-college tournaments players, 30 from Handball players and 30 from Volleyball, who were Selected randomly from different college of Veer Narmad South Gujarat University, Surat. (Gujarat) India, Anxiety levels were obtained by Administering Sports Competition Anxiety (SCAT) questionnaire of renier Martens, a day before they were to play their matches. The finding revealed that the significant difference between Handball and Volleyball Inter Moral Tournaments Boys Players, the â€˜T â€“ Testâ€™ was applied and it shows that, there is significant difference between these two groups.\r\nKEY WORDS: - SPORTS COMPETITION ANXIETY, T- TEST, FINDINGS,                                                                                            \r\n	                 MATCHES, ETC.', '1409564438_Dr._Ashok_kumar_phy.edu.doc', '2014-09-01', 'Dr. Ashokkumar Saha', 'drsaha13@gmail.com', '09374275618', 'S.P.B. English Medium College of Commerce', 'Athwa Linesh, Nr. Lal Bunglow', 'Surat', 'Gujarat', 395001, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(326, 'IJERSS-1409657661', 'editor@ijerss.com', 'Study the characteristics of self compacting concrete', 'Research', 'structure engineering', 'Basic requirements for self-compacting concrete are those in the fresh state: flowability, viscosity (measure of the speed of flow), passing ability (flow without blocking) and segregation resistance. A concrete mix can only be classified as SCC if the requirements for all characteristics are fulfilled. In this study focus has been made on the above properties of SCC by varying the proportion of the constituents to enable the construction agencies to produce and use self-compacting concrete without many efforts on laboratory test on the mix design proportion. For that purpose the different trials by changing the different value of Water cement ratio from 0.35 to 0.42, different value of proportion of fly ash from 22% to 51%. Slump flow diameter and slump flow time, V-Funnel time have been conducted for flowability, passing ability and resistance to segregation. The flowabilty and passing ability are greatly influenced by w\\c ratio. The strength decreases with increase in volume of fly ash and increase in w/c ratio. The desired strength of M40 has been obtained with the G53 Grade of Cement, 0.83% of superplasticzer, w\\c ratio 0.42.', '1409657661_my_paper.docx', '2014-09-02', 'Puja rajhans,C r sharma', 'pujarajhans@gmail.com', '9939158657', 'bompass town', 'devsangha,navdurga', 'deoghar', 'jharkhand', 814114, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(327, 'IJERSS-1409919651', 'editor@ijerss.com', 'RELATIONSHIP BETWEEN BODY COMPOSITION AND MUSCLE STRENGTH OF MID-AGE MALE', 'Research', 'Physical Education', 'Relationship Between Body Composition and Muscle Strength of Mid-Age Males\r\nSujoy Birbanshi\r\n Research Scholar \r\nDepartment of Physical Education, Visva-Bharati, Santiniketan\r\n \r\nBackground: Aging is often associated with sarcopenia, a gradual reduction of skeletal muscle mass and a subsequent loss in strength (Baumgartner RN et al 1998). Muscle strength is defined as the ability of a muscle to exert force (Wilmore JH. 2004). Body composition changes with age, with increases in fat mass and visceral fat and declines in skeletal muscle mass. Age-related changes in body composition and fat distribution may be associated with the pulmonary impairment observed in the middle aged ( Doherty TJ et al. 1993 & Porter MM. et al. 1995). Different types of exercise affect muscle strength in different ways. Resistance trained muscles exert much more force because of both increased muscle size and increased muscle fibre recruitment (Kannus P. et al. 1992). Body composition has been shown to change dramatically with increasing age (Villareal DT. Et al. 2005 & Lynch NA. et al. 1999 ).Objective: In this study evaluated that relationship between body composition (Percentage of fat) and muscular strength of middle-age men. Design: 299 middle aged men was used.  The age of subjects will be ranging between 36 to 45 years. Body composition was evaluated by using skinfold calliper. Muscular strength was evaluated by using hand grip dynamometer. Results & Conclusion: A significant and positive correlation was found between body composition and muscular strength.  \r\n\r\nKeywords: Muscle strength, Grip Strength, Middle age, Body Composition\r\n', '1409919651_Relationship_Between_Body_Composition_and_Muscle_Strength_of_MidAge_Males..1.doc', '2014-09-05', 'Sujoy Birbanshi', 'sujoybappa@gmail.com', '+ 91 9732103609', 'Bolpur,Makrampur,Bhangapool Bus Stand', '', 'Birbhum', 'West Bengal', 731204, 'IN', 'ACCEPTED', '', 'HEALTH SCIENCE', '1410333171_IJERSS1409919651.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue IX, September 2014.', 285, 1),
(328, 'IJERSS-1409930370', 'editor@ijerss.com', 'CONSTRUCTION OF PHYSICAL FITNESS NORMS FOR GRASS ROUT LEVEL TRACK AND FIELD PROBABLES OF DAKSHINA KANNADA DISTRICT', 'Research', 'physical education and sports', 'Abstract: Purpose of the study is to develop Physical fitness norms grass root level track and field probableâ€™s of Dakshina Kannada District. Study was delimited to male students of grass root level track and field probableâ€™s and also delimited to  12-14 year age groups. Study was also delimited to 30mts sprint, Standing broad jump and 800mts race. Since the test was not conducted on the same days and during same hours of the day, the variations might have had an effect on the performance of the subjects, which was considered as the limitation of this study. To achieve meaningful conclusions statistical analysis has been done in two parts.  Firstly, norms have been prepared for all the three selected fitness variables. Secondary, the scores have been classified into five categories i.e. very-good, good, average, poor, very-poor on the basis of the results of the present scores. It was concluded that normative scales constructed in this study may be used to evaluate the physical fitness of grass rout level track and field probables of Dakshina Kannada District. This will be norms will used to identify the track and field athletes at grass rout level for specific events such as sprints, Jumping and middle distance races etc. ', '1409930370_h_navanku.doc', '2014-09-05', 'Dr. Kishore Kumar,Mr. Vasanth ', ', ckkkumar@rediffmail.com,hnavanku@gmail.com', '9164586621', 'Dept. of Physical Education', 'Mangalore University, Mangalagangothri', 'Mangalore', 'Karnataka', 574199, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1410407416_IJERSS1409930370.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue IX, September 2014.', 204, 1),
(329, 'IJERSS-1410000127', 'editor@ijerss.com', 'THE EFFECT OF TWELVE WEEK PRACTICE OF NADISHUDDI PRANAYAMA ON MUSCULAR ENDURANCE AMONG 14-16 YEARS HIGH SCHOOL BOYS AND GIRLS', 'Research', 'Sports Sciene & Physical Education', 'Abstractâ€” Purpose of the study is to find out the effect of nadishuddi pranayama on muscular endurance among high school boys and girls. In the present study high school students were studying in 8th, 9th and 10th standard, 30 in number (15 boys and 15 girls) participated voluntarily. Their age ranged between 14 to 16 years. They all were informed regarding the nature of the study and written consent was obtained. The data was collected which included name, age, sex, height and weight of the subject. Mean height of the boys â€“ 140 cm and girls is 135 cm, Mean Weight of the male â€“ 45 kg and female is 31 kg..  Sit-ups Test was used to assess the muscular endurance. The subjects performed the Pranayama Practice in the evening for 30 minutes, six days in a week, for 12 weeks under Researcher observation. Pre and Post test were conducted and recorded the score separately in sit â€“ up test performance of 14 to 16 years boys and girls. For analysis mean, standard deviation and t- test was used. Study says that there was found significance improvement in muscular endurance among both girls and boys of 14-16 years. Study also says that Nadishuddi Pranayama should increases sit-up performance more in women than the men. So we can say that Nadshuddi Pranayama is improves muscular endurance among 14-16 year high school boys and girls.\r\nIndex Termsâ€”Nadishuddi pranayama, muscular endurance, high school boys and girls', '1410000127_Ijerss_september_2014_app_1.doc', '2014-09-06', 'Mr. Ananthapadmanabha Prabhu,Mr. Manjunath L J', 'sportstodream@gmail.com,manjugirijaya@gmail.com', '9164586621', 'Physical Education Teacher - Grade 1, ', 'Morarji Desai Residential School, Kandali, Hassan', 'Hassan', 'Karnataka', 573217, 'IN', 'ACCEPTED', '', 'HEALTH SCIENCE', '1410190074_IJERSS1410000127.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue IX, September 2014.', 239, 1),
(330, 'IJERSS-1410106771', 'editor@ijerss.com', 'EFFECT OF PLYOMETRIC WITH PILATES EXERCISES ON SELCETD MOTOR ABILITY PHYSIOLOGICAL AND SKILL RELATED PERFORMANCE VARIABLES AMONG VOLLEYBALL PLAYERS', 'Research', 'SPORTS SCIENCE', 'The purpose of the study was to find out the Effect of Plyometric training and Plyometric with Pilates exercises on selected motor ability physiological and skill related performance variables among volleyball players. To achieve the purpose of this study, 60 inter collegiate male volleyball player were selected randomly from in an around Warangal district, Telangana, their age ranged from 18-23 years. They were divided into three equal groups and each group consists of 20 subjects. Group A underwent Plyometric training; Group B underwent Plyometric with Pilates exercise for three days per week for 12 weeks on alternative days and Group C acted as a control who did not involve any special training apart from the regular curricular activities. The collected data were analyzed statistically by using the analysis of variance (ANOVA) to determine the differences, Analysis of covariance (ANCOVA) was used to determine the differences, and the Scheheffeâ€™s test was applied as post hoc test to find out paired mean differences. In all cases 0.05 level of confidence was selected to test the hypotheses', '1410106771_EFFECT_OF_PLYOMETRIC_WITH_PILATES_EXERCISES_ON_SELCETD_MOTOR_ABILITY_PHYSIOLOGICAL_AND_SK', '2014-09-07', 'Kota Satish,Dr.P.P.S.Paul Kumar', 'ppspaulkumar@gmail.com,ppspaulkumar@gmail.com', '9843070208', '', '', '', '', 0, 'IN', 'ACCEPTED', '', 'HEALTH SCIENCE', '1410281002_IJERSS1410106771.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue IX, September 2014.', 238, 1),
(331, 'IJERSS-1410106858', 'editor@ijerss.com', 'EFFECT OF DIFFERENT PACKAGES OF YOGIC PRACTICES ON SELECTED MOTOR SURYA NAMASKAR FITNESS COMPONENTS AND PSYCHOLOGICAL VARIABLES AMONG ADOLESCENT BOYS', 'Research', 'SPORTS SCIENCE', 'The study was the effects of different packages of yogic practices on selected motor fitness components, and psychological variables among adolescent boys.  Formulated as a true random group design, consisting of a pre test and post test.  The randomly selected subjects (n=90) adolescent boys from different schools in Andhra Pradesh were randomly assigned to three equal groups of thirty each.  The groups were assigned as Experimental Groups I, II and control group respectively.  Pre tests were conducted for all the subjects on selected motor fitness, and psychological variables such as flexibility, agility and muscular strength, anxiety, aggression and self confidence.  The experimental groups participated in their respective yogic practices simplified kundalini yoga and suryanamaskar respectively for a period of twelve weeks. The obtained data were subjected to statistical treatment to find out the significance in the means using ANCOVA.  In all cases 0.05 level was fixed to test the hypothesis set for this study.', '1410106858_Effect_of_Different_Packages_of_Yogic_Practices_on_Selected_Motor_SURYA_NAMASKAR_Fitness_', '2014-09-07', 'Md.Azamith,Dr.P.P.S.Paul Kumar', 'ppspaulkumar@gmail.com,ppspaulkumar@gmail.com', '9843070208', '', '', '', '', 0, 'IN', 'ACCEPTED', '', 'HEALTH SCIENCE', '1410281044_IJERSS1410106858.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue IX, September 2014.', 260, 1),
(332, 'IJERSS-1410106942', 'editor@ijerss.com', 'EFFECT OF DIFFERENT PACKAGES OF YOGIC PRACTICES ON SELECTED MOTOR FITNESS COMPONENTS AND PSYCHOLOGICAL VARIABLES AMONG ADOLESCENT BOYS', 'Research', 'SPORTS SCIENCE', 'The study was the effects of different packages of yogic practices on selected motor fitness components, and psychological variables among adolescent boys.  Formulated as a true random group design, consisting of a pre test and post test.  The randomly selected subjects (n=90) adolescent boys from different schools in Andhra Pradesh were randomly assigned to three equal groups of thirty each.  The groups were assigned as Experimental Groups I, II and control group respectively.  Pre tests were conducted for all the subjects on selected motor fitness, and psychological variables such as flexibility, agility and muscular strength, anxiety, aggression and self confidence.  The experimental groups participated in their respective yogic practices simplified kundalini yoga and suryanamaskar respectively for a period of twelve weeks. The obtained data were subjected to statistical treatment to find out the significance in the means using ANCOVA.  In all cases 0.05 level was fixed to test the hypothesis set for this study.', '1410106942_Effect_of_Different_Packages_of_Yogic_Practices_on_Selected_Motor_Fitness_Components_and_', '2014-09-07', 'Md.Azamith,Dr.P.P.S.Paul Kumar', 'ppspaulkumar@gmail.com,ppspaulkumar@gmail.com', '9843070208', '', '', '', '', 0, 'IN', 'ACCEPTED', '', 'HEALTH SCIENCE', '1410281078_IJERSS1410106942.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue IX, September 2014.', 211, 1),
(333, 'IJERSS-1410107020', 'editor@ijerss.com', 'EFFECT OF CONTINUOUS RUNNING FARTLEK TRAINING AND INTERVAL TRAINING ON SELECTED MOTOR ABILITY AND PHYSIOLOGICAL VARIABLES AMONG MALE FOOTBALL PLAYERS', 'Research', 'SPORTS SCIENCE', 'The present study was undertaken to analyze the effect of continuous running fartlek training and interval training on selected motor ability and physiological variables among male football players. The investigator has selected sixty inter collegiate football men players at random, their age ranged from 18-25 years. The subjects chosen for the study were divided into four equal groups and designated as experimental group â€˜Aâ€™ experimental group â€˜Bâ€™ experimental group â€˜Câ€™ and control group â€˜Dâ€™. Continuous running were given to group â€˜Aâ€™ Fartlek training group â€˜Bâ€™ Interval training given to group â€˜Câ€™ and the control group â€˜Dâ€™ were restricted to participate in any activities. The trainings were given for a period of twelve weeks. The data were collected before and after the training. The obtained dataâ€™s were analyzed by Analysis of Covariance (ANCOVA). The level of significant was fixed at 0.05 levels. Where ever the â€˜Fâ€™ ratio was found significant scheffeâ€™s post test was used for find out the significant differences among the paired mean. The results of the study showed that continuous running, fartlek training and interval training are significantly improved than control group.', '1410107020_EFFECT_OF_CONTINUOUS_RUNNING_FARTLEK_TRAINING_AND_INTERVAL_TRAINING_ON_SELECTED_MOTOR_ABI', '2014-09-07', 'Sudhakara Babu Mande,Dr.P.P.S.Paul Kumar', 'sudhakarmande7@gmail.com,ppspaulkumar@gmail.com', '9843070208', '', '', '', '', 0, 'IN', 'ACCEPTED', '', 'HEALTH SCIENCE', '1410281116_IJERSS1410107020.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue IX, September 2014.', 229, 1),
(334, 'IJERSS-1410278637', 'editor@ijerss.com', 'EFFECT OF AEROBIC AND ANAEROBIC INTERVAL TRAINING COMBINED WITH YOGIC PRACTICES ON SELECTED PHYSICAL AND PHYSIOLOGICAL VARIABLE (BREATH HOLDING TIME) OF HIGH SCHOOL MALE KABADDI PLAYERS', 'Research', 'SPORTS SCIENCE', 'The purpose of the study was to find out selected physical and physiological variables as a result of aerobic and anaerobic interval training combined with yogic practices. Ninety high school kabaddi players, who had represented their schools in the inter-school competitions, were selected as subjects for this study at random. The school boys were from different school in Andhra Pradesh and their age group was between 14 and 16 years with Â± 1.24 years. The selected subjects were randomly divided into three groups and each groups contain thirty subjects. Group one acted as experimental group-one and group-two acted as experimental group-two and group-three acted as control group. The differences between the initial and final scores on selected dependent variables were considered as the effect of selected experimental treatments.  To test the statistical significance, the obtained data were subjected to statistical treatment using ANCOVA.  In all cases 0.05 level was fixed to test the hypothesis.', '1410278637_1Effect_of_Aerobic_and_Anaerobic_Interval_Training_Combined_With_Yogic_Practices_on_Selec', '2014-09-09', 'Y. Satya narayana', 'ppspaulkumar@gmail.com', '9030057655', '', '', '', '', 0, 'IN', 'ACCEPTED', '', 'SPORTS SCIENCE', '1410279142_IJERSS1410278637.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue IX, September 2014.', 270, 1),
(335, 'IJERSS-1410279357', 'editor@ijerss.com', 'EFFECT OF AEROBIC AND ANAEROBIC INTERVAL TRAINING COMBINED WITH YOGIC PRACTICES ON SELECTED PHYSICAL AND PHYSIOLOGICAL VARIABLE (FLEXIBILITY) OF HIGH SCHOOL MALE KABADDI PLAYERS', 'Research', 'SPORTS SCIENCE', 'The purpose of the study was to find out selected physical and physiological variables as a result of aerobic and anaerobic interval training combined with yogic practices. Ninety high school kabaddi players, who had represented their schools in the inter-school competitions, were selected as subjects for this study at random. The school boys were from different school in Andhra Pradesh and their age group was between 14 and 16 years with Â± 1.24 years. The selected subjects were randomly divided into three groups and each groups contain thirty subjects. Group one acted as experimental group-one and group-two acted as experimental group-two and group-three acted as control group. The differences between the initial and final scores on selected dependent variables were considered as the effect of selected experimental treatments.  To test the statistical significance, the obtained data were subjected to statistical treatment using ANCOVA.  In all cases 0.05 level was fixed to test the hypothesis.', '1410279357_2Effect_of_Aerobic_and_Anaerobic_Interval_Training_Combined_With_Yogic_Practices_on_Selec', '2014-09-09', 'Y. Satya Narayana,Dr.P.P.S.Paul Kumar', 'ppspaulkumar@gmail.com,ppspaulkumar@gmail.com', '9843070208', '', '', '', '', 0, 'IN', 'ACCEPTED', '', 'SPORTS SCIENCE', '1410279753_IJERSS1410279357.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue IX, September 2014.', 210, 1),
(336, 'IJERSS-1410280075', 'editor@ijerss.com', 'A STUDY OF EMOTIONAL, COMPETENCE, ACHIVEMENT MOTIVATION AND SOCIO ECONOMIC STATUS OF INTER UNIVERSITY SPORTS PARTICIPENTS', 'Research', 'HEALTH SCIENCE', 'The Present study A Study on Emotional Competence, Achievement Motivation and Socio Economic Status of Inter University Sports Participants. Generally players are in a state of â€œsocial phobiaâ€ which is chronic in the modern society, which results in emotional competence. Players are both emotional and more sensitive to win the competitions might feel emotion in new situations like competing with different teams with different backgrounds. Many players have both inward and out ward signs of emotional competence. However some players can act confident with more achievement motivation and face different situations. Players competing at inter university level competitions have to compete with players of different regions with different socio economic backgrounds. The obtained data were analyze using appropriate statistical techniques, mean, standard deviation, â€˜tâ€™ scale; ANOVA and post hoc analysis. In all cases 0.05 levels was fixed to test the hypothesis of the study.', '1410280075_1A_STUDY_OF_EMOTIONAL,_COMPETENCE,_ACHIVEMENT_MOTIVATION_AND_SOCIO_ECONOMIC_STATUS_OF_INT', '2014-09-09', 'Y.Madhusudhana Rao,Prof.Y.Kishore', 'ppspaulkumar@gmail.com,ppspaulkumar@gmail.com', '9030057655', '', '', '', '', 0, 'IN', 'ACCEPTED', '', 'HEALTH SCIENCE', '1410280478_IJERSS1410280075.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue IX, September 2014.', 233, 1),
(337, 'IJERSS-1410280559', 'editor@ijerss.com', 'A STUDY OF EMOTIONAL, COMPETENCE, ACHIVEMENT MOTIVATION OF INTER UNIVERSITY SPORTS PARTICIPENTS', 'Research', 'HEALTH SCIENCE', 'The Present study A Study on Emotional Competence, Achievement Motivation and Socio Economic Status of Inter University Sports Participants. Generally players are in a state of â€œsocial phobiaâ€ which is chronic in the modern society, which results in emotional competence. Players are both emotional and more sensitive to win the competitions might feel emotion in new situations like competing with different teams with different backgrounds. Many players have both inward and out ward signs of emotional competence. However some players can act confident with more achievement motivation and face different situations. Players competing at inter university level competitions have to compete with players of different regions with different socio economic backgrounds. The obtained data were analyze using appropriate statistical techniques, mean, standard deviation, â€˜tâ€™ scale; ANOVA and post hoc analysis. In all cases 0.05 levels was fixed to test the hypothesis of the study.', '1410280559_A_STUDY_OF_EMOTIONAL,_COMPETENCE,_ACHIVEMENT_MOTIVATION_OF_INTER_UNIVERSITY_SPORTS_PARTIC', '2014-09-09', '*Y.Madhusudhana Rao ,Prof.Y.Kishore', 'ppspaulkumar@gmail.com,ppspaulkumar@gmail.com', '9030057655', '', '', '', '', 0, 'IN', 'ACCEPTED', '', 'HEALTH SCIENCE', '1410280911_IJERSS1410280559.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue IX, September 2014.', 215, 1),
(338, 'IJERSS-1410428785', 'editor@ijerss.com', 'EFFECTIVENESS OF BIOFEEDBACK AND AUTOGENIC TRAINING ON REACTION AND CO-ORDINATION TIME OF VOLLEYBALL AND Handball PLAYER', 'Research', 'Physical Education ', 'Abstract:\r\nThe purpose of this study was to examine the effect of combination of biofeedback and autogenic training for Reaction and co-ordinations time of Volleyball  and Handball player.  The biofeedback involves the combination of body, mind and apparatus or machine. At the other hand autogenic training is a technique of self hypnosis which would help in developing relaxation. 40 male players 17 to 24 years of age of Volleyball and Handball Mahadev Desai Sharirik Shikshan Mahavidyalaya, Sadra. Dist. Gandhinagar. of Gujarat Vidyapeeth were selected as the subject of the study. Audio-visual reaction timer, eye-hand coordination apparatus and GSR biofeedback were used to test reaction ability, and coordination. Paired t-test and applied for analyzing pre test and post test data of training of eight (8) week. It was observed that biofeedback training combined with autogenic training helped to improve reaction ability and coordination whereas reduce of experimental groups of Volleyball and Handball players.\r\n\r\nKey worlds: Reaction ability, coordination, Volleyball  and Handball.', '1410428785_Dr.Nimesh_&_Dr._Ashokkumar.doc', '2014-09-11', 'MR. Nimeshkumar Chaudhari,Dr. Ashokkumar Saha', 'chaudharinimesh@gmail.com,drsaha13@gmail.com', '9426854903', ' Gujarat Vidyapith, Ahmedabad', 'M. D. Sharirik Shikshan Mahavidyalaya, At. Sadra', 'GANDHINAGER', 'Gujarat', 382320, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(339, 'IJERSS-1410778139', 'editor@ijerss.com', 'BASKETBALL AND TECHNOLOGY:  AN APPLIED APPROACH TO UNDERSTAND THE SKILL CAPTURING IN BASKETBALL', 'Research', 'Sports Biomechanical Analysis', 'The purpose of this paper is to investigate the methods of biomechanically analyze the skills in basketball and to suggest the possible approaches of movement analysis in Basketball.  In modern scientific age, research studies are undertaken in various sports sciences and also in various sports disciplines all over the world. The world of games and sports has crossed many mile stones through sustained scientific research and application of the research finding to various sports disciplines and human performance. Scientific equipments and facilities are in vogue for the progress of games and sports, the â€˜Movement Analysis Techniquesâ€™ are also one of the demanding approaches now a day. The learning, correction and clearance of fast skills through the methods of Movement Analysis Technology are the prime source of development of Basketball. Motion pro, SIMI Motion analyzer, Qualisis and many such software are engaged in the approaches. This paper provides an overview about the methods of video cam placements, videography, utilization and the common variables to be analyzed in Basketball.\r\n', '1410778139_Dr.Mandeep_J&K.doc', '2014-09-15', 'Dr. Mandeep Singh Nathial', 'bawarayman@yahoo.co.in', '9906365952', 'H.No:520(A)', 'Street No:01, Digiana', 'Jammu', 'J&K', 180010, 'IN', 'Accepted', '', 'SPORTS SCIENCE', '1412644636_IJERSS1410778139.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 173, 1),
(340, 'IJERSS-1410933557', 'editor@ijerss.com', 'NETWORK ON CHIP FOR DATA PACKET EXCHANGE', 'Others', 'chip design for network interconnection between IP and PE elements ', 'Abstractâ€” Making Network on Chip is carried out here, we introduce another system on-chip (Noc) that handles exact limitations of the flawed parts of the Noc. The proposed Noc is focused around new slip location components suitable for element Nocs, where the number and position of processor components or defective squares differ amid runtime. The Noc medium performs an abnormal state of modularity, adaptability, and throughput. A Noc includes switches and interconnections permitting correspondence between the PEs and/or Ips. The Noc depends on information parcel trade. The way for an information parcel between a source and a terminus through the switches is characterized by the steering calculation. Subsequently, the way that an information bundle is permitted to take in the system depends chiefly on the addictiveness allowed by the routing algorithm,  which is connected provincially in every switch being crossed and to every information parcel..', '1410933557_network_on_chip_for_data_packets.doc', '2014-09-17', 'M.VAMSI KRISHNA  ,D.AJITHA', 'vamsi.reddy050689@gmail.com,ajithavijay1@gmail.com', '9676976201', 'doorno:13-7-915/b', 'korlagunta main road', 'tirupati', 'andhra pradesh', 517501, 'IN', 'Pending', '', 'COMPUTER SCIENCE', '1412449466_IJERSS1410933557.pdf', 0, 0, 'IJERSS-2014', 0, 0, 'New', 40, 0),
(341, 'IJERSS-1411143919', 'editor@ijerss.com', 'MEASUREMENT OF FOREST AND SETTELMENT CHANGES IN TRIBAL VILLAGE OF BILASPUR DISTRICT THROUGH R.S. AND GIS', 'Research', 'Remote Sensing', ' Identification of land cover establishes the baseline from which monitoring activities (change detection) can be performed, and provides the ground cover information for baseline thematic maps. Land use refers to the purpose of land reserves, for example, recreation, wildlife habitat, or agriculture etc. Remote sensing techniques are important in acquiring useful data of the earth or its surface by mean of sensors. These remotely collected data will be analysed to obtain information about the objects, areas or phenomena being investigated. The objective of the present study was analysed the settlement change, change related to rural sprawl and status of agricultural field and water bodies in the village. The present study is based on following objectives like to determine the change related to rural sprawl, agricultural field and water bodies of Shivtarai village of Kota block, Bilaspur district (C.G.) through Remote sensing and G.I.S. in between 2001 to 2013. During the last twelve year, the forest area of the study village was decreases up to 20 percent. The area increase in settlement shows that the population increase in the village Shivtarai.', '1411143919_forest_&_settlement.docx', '2014-09-19', 'Tiwari Nomesh,Singh P.R.', 'tiwarinomesh31@gmail.com,contactprsingh@gmail.com', '09406433396', 'Pushpraj Singh, 117-Shanti Nagar', 'Ameri Road, Mangla ', 'Bilaspur', 'Chhattisgarh', 495001, 'IN', 'Accepted', '', 'SOCIAL SCIENCE', '1413129624_IJERSS1411143919.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 147, 1),
(342, 'IJERSS-1411956238', 'editor@ijerss.com', 'EFFECT OF RESISTANCE AND ENDURANCE TRAINING ON  STRENGTH ENDURANCE AND CARDIO-RESPIRATORY ENDURANCE', 'Research', 'YOGA & TRAINING METHODS', 'The purpose of the present study was to find the effect of resistance and endurance trainings on strength endurance and cardio-respiratory endurance.  For this purpose, forty five female players from the Department of Physical Education and Sports Sciences, Annamalai University representing in various games and sports in the age group of 18 â€“ 25 years were selected.  They were divided into three equal groups, each group consisted of fifteen subjects, in which group â€“ I underwent resistance training,           group â€“ II underwent endurance training and group â€“ III acted as control group who did not participate in any special training and underwent their regular respective training sessions.  The training period for this study was three days in a week for twelve weeks.  Prior to and after the training period the subjects were tested for strength endurance and cardio-respiratory endurance.  Strength endurance was assessed by using dynamometer and cardio-respiratory endurance was assessed by administering Cooperâ€™s 12 minutes run/walk test.  The result of the study has shown that the resistance training group has significantly improved the strength endurance but not in cardio-respiratory endurance and endurance training group has significantly improved their cardio-respiratory endurance and also in strength endurance after twelve weeks of training when compared with the control group.  Moreover, there was a significant difference has occurred between the training groups on strength endurance in favor of resistance training.', '1411956238_chidambara_raja.doc', '2014-09-29', 'Dr. S. CHIDAMBARA RAJA', 'rajadi42@gmail.com', '094435 40215', 'ASSOCIATE PROFESSOR, DEPARTMENT OF PHYSICAL ', 'EDUCATION AND SPORTS SCIENCES, ANNAMALAI UNIVERSIT', 'ANNAMALAINAGAR,', 'TAMILNADU', 608002, 'IN', 'Accepted', '', 'SPORTS SCIENCE', '1412447342_IJERSS1411956238.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 115, 1),
(343, 'IJERSS-1412332945', 'editor@ijerss.com', 'ROLE OF SCIENCE IN GAMES & SPORT TOWARDS SPORTS  EXCELLENCE', 'Research', 'PHYSICAL EDUCATION', 'ROLE OF SCIENCE  IN GAMES AND SPORT TOWARDS SPORTS EXECELLENCE\r\nINTRODUCTION :-\r\nThe word â€œscience , probably brings to mind many different pictures: a fat textbook , white lab coats and microscope , an astronomer  peering  through a telescope, a naturalist in the rainforest , Einsteinâ€™s equations scribbled on a chalkboard. All of those images reflect some aspect of science , but none of them provides a full picture because science  has so many facets. Science is a global human endeavor. Sports is and activity involving physical exertion and skill that is governed by a set of rules or customs and often undertaken competitively.\r\nAPPLICATION OF  SCIENCE IN SPORT AS  SCIENTIFIC  STUDY :-\r\nSports (or exercise) science is an emerging discipline which applies scientific principle to understand factors associated with sporting performance or health and well-being .The contribution of sports science towards developing athlete to their maximum potential to prolong their competitive sporting carrier is significance .Sport science is the application of scientific principle to help improve sport performance .This branch of science has grown dramatically in last 20 years and has resulted in a greater understanding of demands of elite sport . Some of the information obtained from the systematic study of sport has been including in coaching material and coaching  qualification ,however many coachs and athletes have specific questions or individual problems. The  qualified sports scientist is potentially ,a useful resource that the coach and athlete can use to help address issues that analysis of the athlete in the laboratory setting.\r\n', '1412332945_ROLE_OF_SCIENCE_IN_GAMES_AND_SPORT_TOWARDS_SPORTS_EXECELLENCE_(1).doc', '2014-10-03', 'SATYENDRA KUMAR VERMA', 'skvermaf9@gmail.com', '09795023764', 'SATYENDRA KUMAR VERMA S/O  KAILASH NARAYAN VERMA', 'ward no.-1 indira nagar kalla road bypass', 'POKHRAYAN KANPU', 'UTTAR PRADESH', 209111, 'IN', 'Pending', '', 'SPORTS SCIENCE', '1412445969_IJERSS1412332945.pdf', 0, 0, 'IJERSS-2014', 0, 0, 'New', 28, 0),
(344, 'IJERSS-1412336153', 'editor@ijerss.com', 'EFFECT OF LOW IMPACT AEROBIC DANCE EXERCISE ON SELECTED BIOCHEMICAL VARIABLES OF SEDENTARY MEN OF KERALA', 'Research', 'PHYSICAL EDUCATION AND SPORTS SCIENCE', 'ABSTRACT: The present study investigated the effect of twenty four weeks of low-impact aerobic dance exercise on Biochemical variables namely Fasting Blood Sugar (FBS), high Density Lipo Protein (HDL-C), Low Density Lipo Protein (LDL-C) and Triglycerides (TGD) among sedentary working men of Kannur district of Kerala state. Sedentary participants (age range = 30 â€“ 40 years; N = 40) were randomly selected and assigned to two groups: experimental and control group. Training was administered to the experimental group for 50 minutes, 3 days per week, for 24 weeks.  Paired t- Test revealed statistically significant effects for FBS, HDL-C, LDL-C, TG of sedentary men. Further, In order to eliminate the covariate factor Analysis of Covariance (ANCOVA) for the criterion variables were also found only to reveal the same significant difference in FBS, HDL-C, LDL-C and TGD in the experimental group compared to the control group. Subjects of the experimental group, â€œaerobic dancing groupâ€ experienced the most benefits. \r\nKEYWORDS: Fasting Blood Sugar(FBS),High Density Lipoprotein (HDL-C), Low Density Lipoprotein (LDL-C), Triglycerides (TGD), Low Impact Aerobic Dance\r\n', '1412336153_RESEARCH_PAPER_ON_SPORTS_SCIENCE.docx', '2014-10-03', 'Dr.K.P.PRASHOBHITH', 'kpprashobhith@gmail.com', '09400583148', 'DHANYASREE', 'KAYALODE', 'MAMBARAM-POST', 'KERALA', 670741, 'IN', 'Accepted', '', 'SPORTS SCIENCE', '1412421921_IJERSS1412336153.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 121, 1),
(345, 'IJERSS-1412406009', 'editor@ijerss.com', 'Probabilistic Routing Technique to Minimize Routing Overhead in MANET', 'Research', 'COMPUTER SCIENCE', 'Mobile Ad-hoc network (MANET) is collection of wireless mobile nodes forming temporary network dynamically without the help of any fixed infrastructure. Routing in MANET differs from conventional routing in fixed networks in various ways. These differences lead to different issues with routing techniques in MANET. The idea behind Probabilistic Routing is to select a route based on a probability. These probabilities will be assigned to possible paths considering the local information available at each node. By selecting good links with high probability gives more reliable routing. The technique gives more probability to the best route in order to not compromise the reliability of the network. This technique is useful to overcome the various issues in routing within MANET. For minimizing routing overhead in MANET we can use this technique. For probability calculation we are using Monte Carlo probability theory. Simulation results show that this technique shows less routing load, total broadcast send and number of dropped packets.\r\n', '1412406009_Probabilistic_Routing_Technique_to_Minimise_Routing_Overhead_in_MANET.doc', '2014-10-04', 'Prachi Kushirea,Vijay S Paritba', 'vsparit@tkietwarana.org,vsparit@tkietwarana.org', '9420240389', '', '', '', '', 0, 'IN', 'Pending', '', 'COMPUTER SCIENCE', '1412420135_IJERSS1412406009.pdf', 0, 0, 'IJERSS-2014', 0, 0, 'New', 31, 0);
INSERT INTO `papers` (`id`, `paper_id`, `paper_referral`, `paper_title`, `paper_type`, `subject_category`, `abstract`, `paper_attachment`, `uploaded_on`, `author`, `email`, `pnumber`, `address_line1`, `address_line2`, `city`, `state`, `pincode`, `country`, `status`, `comments`, `subject`, `pdf`, `active`, `news`, `conference`, `volume`, `issue`, `volume_issue_title`, `downloads`, `blogspot`) VALUES
(346, 'IJERSS-1412670060', 'editor@ijerss.com', 'EFFECT OF ISOLATED AND COMBINED TRAINING OF WEIGHT AND PLYOMETRIC TRAINING ON SELECTED PHYSICAL AND PHYSIOLOGICAL VARIABLES AMONG COLLEGE MEN', 'Research', 'SPORTS SCIENCE', 'Performance is the combined result of the coordinated exertion and integration of a variety of functions.  Genetic factors probably play a major role in a personâ€™s performance capacity.  It appears that upon 70 per cent of an individualâ€™s maximal force, power or capacity is a matter of genetically factors. The environment and geographic location also have a considerable role over the performance.  Adding to this, the performance of an individual depends upon the physical and motor fitness qualities in which a definite improvement can be achieved by appropriate training. Sportsâ€™ is a popular spectacle and a mass social movement of contemporary times. In the process of historical development sports has occupied a prominent place both in the moral culture of a society.  Its social significance continues to soar. In the modern days â€˜sports for allâ€™ become a very popular slogan. Participation in sports will yield optimum physical fitness and positive health for all.  In the hurry scenario of \r\nmodern life people need more exercise to keep their body and mind fit to execute the day-to-day activities effectively', '1412670060_David_sir.docx', '2014-10-07', 'N.David', 'ppspaulkumar@gmail.com', '9420240389', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1413091049_IJERSS1412670060.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue X, October 2014.', 188, 1),
(347, 'IJERSS-1412670280', 'editor@ijerss.com', 'EFFECT OF CONTINUOUS RUNNING FARTLEK TRAINING AND INTERVAL TRAINING ON SELECTED MOTOR ABILITY AND PHYSIOLOGICAL VARIABLES AMONG MALE FOOTBALL PLAYERS', 'Research', 'SPORTS SCIENCE', 'The present study was undertaken to analyze the effect of continuous running fartlek training and interval training on selected motor ability and physiological variables among male football players. The investigator has selected sixty inter collegiate football men players at random, their age ranged from 18-25 years. The subjects chosen for the study were divided into four equal groups and designated as experimental group â€˜Aâ€™ experimental group â€˜Bâ€™ experimental group â€˜Câ€™ and control group â€˜Dâ€™. Continuous running were given to group â€˜Aâ€™ Fartlek training group â€˜Bâ€™ Interval training given to group â€˜Câ€™ and the control group â€˜Dâ€™ were restricted to participate in any activities. The trainings were given for a period of twelve weeks. The data were collected before and after the training. The obtained dataâ€™s were analyzed by Analysis of Covariance (ANCOVA). The level of significant was fixed at 0.05 levels. Where ever the â€˜Fâ€™ ratio was found significant scheffeâ€™s post test was used for find out the significant differences among the paired mean. The results of the study showed that continuous running, fartlek training and interval training are significantly improved than control group', '1412670280_Venu_gopal_sir.docx', '2014-10-07', 'Sudhakara Babu Mande', 'sudhakar.mande7@gmail.com ', '9420240389', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1413089544_IJERSS1412670280.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue X, October 2014.', 238, 1),
(348, 'IJERSS-1412670373', 'editor@ijerss.com', 'Effect of Different Packages of Yogic Practices on Selected Motor Fitness Components and Psychological Variables among Adolescent Boys.', 'Research', 'SPORTS SCIENCE', 'The study was the effects of different packages of yogic practices on selected motor fitness components, and psychological variables among adolescent boys.  Formulated as a true random group design, consisting of a pre test and post test.  The randomly selected subjects (n=90) adolescent boys from different schools in Andhra Pradesh were randomly assigned to three equal groups of thirty each.  The groups were assigned as Experimental Groups I, II and control group respectively.  Pre tests were conducted for all the subjects on selected motor fitness, and psychological variables such as flexibility, agility and muscular strength, anxiety, aggression and self confidence.  The experimental groups participated in their respective yogic practices simplified kundalini yoga and suryanamaskar respectively for a period of twelve weeks. The obtained data were subjected to statistical treatment to find out the significance in the means using ANCOVA.  In all cases 0.05 level was fixed to test the hypothesis set for this study', '1412670373_paper_Azamit.docx', '2014-10-07', 'Md.Azamith,Dr.P.P.S.Paul Kumar', 'ppspaulkumar@gmail.com,ppspaulkumar@gmail.com', '9420240389', '', '', '', '', 0, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1413057143_IJERSS1412670373.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue X, October 2014.', 273, 1),
(349, 'IJERSS-1412670469', 'editor@ijerss.com', 'EFFECT OF PLYOMETRIC WITH PILATES EXERCISES ON SELCETD MOTOR ABILITY PHYSIOLOGICAL AND SKILL RELATED PERFORMANCE VARIABLES AMONG VOLLEYBALL PLAYERS', 'Research', 'SPORTS SCIENCE', 'Sports in the narrow sense can be defined as competitive activity, an active factor in physical education, which has taken shape mainly in the field of physical culture of a society, as a special sphere of identifying and comparing between potentials in a united form. Sports is worldwide phenomenon today, it has occupied a prominent place both in the physical as well as in the moral culture of a society. Sports allows the sportsmen to below off tension and to forget the problems for a while and also to go out and have good time no matter whatever pressures they may be under in their life (Jannes & Dobbins, 1984).\r\nPhysical education and sports being an integral part of education experience the impact of scientific advancements. Now sports men are able to reveal outstanding performance because of involvement of new scientifically substantiated training methods and means of execution of sports exercises such as sports techniques and tactics improvement of sports gear and equipment as well as other components and condition of system of sports training (Matveyev, 1981)', '1412670469_SATISH.docx', '2014-10-07', 'Kota Satish,Dr.P.P.S.Paul Kumar', 'ppspaulkumar@gmail.com,ppspaulkumar@gmail.com', '9420240389', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1413056091_IJERSS1412670469.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue X, October 2014.', 290, 1),
(350, 'IJERSS-1412670588', 'editor@ijerss.com', 'Effect of Aerobic and Anaerobic Interval Training Combined With Yogic Practices on Selected Physical and Physiological Variables of High School Male Kabaddi Players', 'Research', 'SPORTS SCIENCE', 'The purpose of the study was to find out selected physical and physiological variables as a result of aerobic and anaerobic interval training combined with yogic practices. Ninety high school kabaddi players, who had represented their schools in the inter-school competitions, were selected as subjects for this study at random. The school boys were from different school in Andhra Pradesh and their age group was between 14 and 16 years with Â± 1.24 years. The selected subjects were randomly divided into three groups and each groups contain thirty subjects. Group one acted as experimental group-one and group-two acted as experimental group-two and group-three acted as control group. The differences between the initial and final scores on selected dependent variables were considered as the effect of selected experimental treatments.  To test the statistical significance, the obtained data were subjected to statistical treatment using ANCOVA.  In all cases 0.05 level was fixed to test the hypothesis.', '1412670588_satya.docx', '2014-10-07', 'Y.Satyanarayana,Dr.P.P.S.Paul Kumar', 'ppspaulkumar@gmail.com,ppspaulkumar@gmail.com', '9420240389', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1413054762_IJERSS1412670588.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue X, October 2014.', 238, 1),
(351, 'IJERSS-1412670910', 'editor@ijerss.com', 'MANAGEMENT EDUCATION IN INDIA AND ANDHRA PRADESH', 'Research', 'SPORTS SCIENCE', 'Management education in India formally began in 1953 at the Indian Institute of Social Welfare and Business Management (IISWBM) â€“the first B-School established by Government of West Bengal and Kolkata University. However, a few institutions like Tata Institute of Social Sciences (1936) and Xavier Labour Research Institute (1949) had already started training programmes for managers in personnel function well before the formal launch of first MBA programme at IISWBM. IISWBM experiment of offering two-year, full-time MBA programme was followed by Delhi University (1955), Madras University (1955), Bombay University (1955) and Andhra University (1957). A few other institutions like Administrative Staff College of India Hyderabad (1956), All India Management Association (1957), and National Productivity Council (1958) were established to promote excellence in management practices, research and education.\r\nThe Government of India launched Indian Institutes of Management (IIMs) as centres of excellence in Management education in early 1960s. The first Indian Institute of Management was set up in Kolkata in 1961 and second in Ahmedabad in 1962. Elite club of IIMs added new members in 1973 (Bangalore), 1984 (Lucknow) and 1997-98 (Khozhikode and Indore). Currently there are 12 IIMs in the country. Over the years, IIMs have evolved as great brand in Management education across the globe and an enviable benchmark for other institutions in terms of quality of faculty, students, curriculum and placement. \r\nResponding to huge demand for managers, many universities started MBA programmes in 1960s and 1970s. Notable entrants in the Management education were Cochin University of Science and Technology (1964), Osmania University (1964), Allahabad University (1965), Punjab University (1968), Banaras Hindu University (1968), University of Pune (1971), Kurukshetra University (1976) etc. By 1980, several state universities across the country started offering MBA programmes. Initially, MBA programmes were part of the Commerce Departments. However, most of the universities have now created Faculty of Management Studies, thus giving due credence to Management education', '1412670910_Venu_gopal_sir.docx', '2014-10-07', 'Ch.Venu Gopal Rao, Prof. K. Viyyanna Rao', 'ppspaulkumar@gmail.com,ppspaulkumar@gmail.com', '9420240389', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SOCIAL SCIENCE', '1413053715_IJERSS1412670910.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue X, October 2014.', 265, 1),
(352, 'IJERSS-1412760538', 'editor@ijerss.com', 'THE ROLE OF TECHNICAL COLLEGES IN PROMOTING SPORTS ETHOS', 'Research', 'SPORT SCIENCE', 'Technical colleges refers to professional colleges imparting technical education such as engineering colleges. These colleges play an important role in creating future engineers and professionals to lead industrial growth in the country. Similarly many of these technical colleges offer seats under sports scholarships and spend a significant amount of money towards organising sports events. Many of the excellent sportspersons also contribute to the development of their colleges and sports in general by carrying over their sports skills to the sports events conducted by these colleges. Obviously the researcher since employed in a technical institution himself ventured to make a study on the role of these colleges in developing and promoting sports.The aim of the study was to pinpoint the areas of sports promotional measures in the technical colleges and to propose steps to change the sports administrative set up or to overhaul the sports policies thereby add more bite to the professional development of sports in these institutions.The reserch did a survey study, using the tools of study such as questionnaire, personal interviews and observations and examining documental evidences. The study was delimited to the districts of Dakshina Kannada and Udupi. The collected data was analysed descriptively and presented in the form of tables and charts. The areas covered included Financial Management, Human Resource Management, Programme planning and Infrastructure and facilities.Some of the findings include Financially most of the institutions functioned soundly, Spending adequately towards sports events in the colleges. Infrastructure was excellent in a few of the institutions whereas many of them were still in the process of sports facilities development and many of them suffered from lack of space for sports programmes. Sports personnel in the department was found wanting as there were very few in relation to the number of students in the college. Further sports was not considered for higher level of participation as such appointment of coaches took a backseat and Sports programmes were mainly restricted to within the college competitions and participation in inter technical college competitions. It is an obvious fact that the main aim of technical colleges is to promote academic excellence in technical field. Still while dealing with the youth it is the bound duty of any educational institution to inculcate sports ethos and promote the benefits of sports participation such as developing health, social interaction, psychological balance, emotional well being and thereby a fit citizen of the country. The results indicate that these technical institutions fulfil these purposes to a significant extent. \r\nKeywords: Sports Management, Infrastructural development and Promotions of the sports.\r\n', '1412760538_Full_Paper.docx', '2014-10-08', 'NITHIN , GERALD SANTHOSH DSOUZA', 'snithin10@gmail.com,gsandsouza@gmail.com', '9964281718', 'Nithin, Physical Director', 'ALVA''S INSTITUTE OF ENGINEERING AND TECHNOLGY,', 'MIJAR,MOODBIDRI', 'Karnataka', 574225, 'IN', 'Accepted', '', 'SPORTS SCIENCE', '1418141136_IJERSS1412760538.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue XI, November 2014.', 196, 1),
(353, 'IJERSS-1412918815', 'editor@ijerss.com', 'A COMPARATIVE STUDY OF KIN-ANTHROPOMETRIC  MEASUREMENTS OF BOXING AND JUDO PLAYERS', 'Research', 'Physical Education', 'The main purpose of the study was to compare the kin- anthropometric variables of height, weight, arm length, lean body mass and body fat of boxing and judo players of Haryana. The data were collected from the boxing and judo centers from Jind, Hissar, Sirsa, Rohtak and Bhiwani. The researcher had selected 40 male (20 boxers + 20 judokas) subjects for this study. The subjects were randomly selected for the purpose of the study. In this study the equipment which was used for data collection were stadiometer, weighing machine, anthropometric rod and skinfold caliper. The â€˜tâ€™ test was used to analyzed the data. The findings of the study revealed that (i) The Boxer have more height than judokas; (ii) There was no significant difference in body weight between boxer and judo players; (iii)  Boxer have more arm length than judokas; (iv) There was no significant difference in body fat between boxer and judo players; (v) Boxer have more lean body mass than judokas', '1412918815_Dr._Ravinder_Paper_Kinanthropy.doc', '2014-10-10', 'Dr. Ravinder Pal Ahlawat ,Tarshem Sharma', 'ahlawatravi74@gmail.com,sharmatarshem@gmail.com', '+91-9253471110', 'Associate Professor, Dept. of Physical Education, ', 'Chaudhary Devi Lal University', 'Sirsa', 'Haryana', 125055, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1415769611_IJERSS1412918815.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue XI, November 2014.', 208, 1),
(354, 'IJERSS-1413091306', 'editor@ijerss.com', 'EFFECTS OF VARIED FREQUENCIES OF PLYOMETRIC TRAINING ON SELECTED STRENGTH PARAMETERS OF ENGINEERING COLLEGE MEN', 'Research', 'sports science', 'The purpose of the study designed to find out the effects of varied frequencies of plyometric training on selected strength related components of Engineering College men.  For this purpose, forty five men students studying Bachelorâ€™s degree n Engineering at Andhra University College of Engineering, Visakhapatnam, Andhra Pradesh, India were selected as subjects at random and they were divided randomly into three Experimental groups of fifteen each, Group â€“ I underwent plyometric training two day per week group, Group â€“II underwent plyometric training three day per week group and Group â€“ III underwent plyometric training four day per week group.  The training period was limited to eight weeks.  The dependent variables selected for this study were Arm Strength, Leg Strength and Explosive strength.  All the subjects were tested prior to and immediately after the experimental period on the selected dependent variables. The data obtained from the Experimental groups before and after the experimental period were statistically analyzed with Analysis of covariance (ANCOVA).  Whenever the â€˜Fâ€™ ratio for adjusted posttest means was found to be significant, the Scheffeâ€™s test was applied as post-hoc test to determine the paired mean differences.  The level of confidence was fixed at         0.05 level for all the cases.  The results of the study showed that there was a significant difference was found among all the experimental groups on the selected variables', '1413091306_Journal_Nagarjuna_University.docx', '2014-10-12', 'Prof. M.Syam Babu, Dr. N.Vijay Mohan, Dr. A.Pallavi, Dr. R.Satish Varma', 'ppspaulkumar@gmail.com,sudhakarbabum48@gmail.com', '9030057655', '', '', '', '', 0, 'IN', 'Pending', '', 'SPORTS SCIENCE', '1413092032_IJERSS1413091306.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue X, October 2014.', 172, 1),
(355, 'IJERSS-1413888022', 'editor@ijerss.com', '             IMPORTANCE OF MEDITATION AND YOGA IN STUDENTS LIFE', 'Research', 'YOGA', 'IMPORTANCE OF MEDITATION AND YOGA IN STUDENTS LIFE\r\n Drs.G.Sarah Sarojini,  \r\n Assistant Directress,\r\n Dept.of Physical Education,\r\n Sri Padmavathi Mahila   Visvavidyalayam, Tirupati.\r\nINTRODUCTION:\r\nWhat is Yoga \r\n  Yoga  is an ancient form of exercise that focuses on strength, flexibility and breathing to boost physical and mental wellbeing. Yoga literally means â€œunionâ€ and refers to the union of mind and body. Yoga is a holistic practice which emphasizes mind â€“ body connectedness and involves postures, breathing, and meditation. Yoga is a 5000 year old practice that began in ancient India.  \r\n Patanjali is a great enlightened master, great inner scientist of the inner world and founder of the system of yoga.  Patanjali is credited with the compilation of the great book the Yoga Sutra. He is known as the ''Father of Yoga'' because every yoga system, in the thousands of systems that are available today all over the world have their roots in Patanjali''s teachings. Yoga is a preventative and cost-effective approach to overall well-being.                  \r\n', '1413888022_IMPORTANCE_OF_MEDITATION_AND_YOGA_IN_STUDENTS_LIFE.docx', '2014-10-21', 'Drs.G.Sarah Sarojini,  ', 'sarahsarojini@gmail.com', '8897907806', 'HEAD.', 'Department of Physical Education SPMVV TIRUPATI', 'TIRUPATI', 'ANDRA PRADESH', 0, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(356, 'IJERSS-1414160306', 'editor@ijerss.com', 'A  Novel Approach to  Moving  Object Detection and Tracking  for Surveillance System', 'Research', 'Surveillance System and Moving  Object Detection and Tracking ', '  In present scenario, to recognize and monitor threats, to prevent criminal activity, to maintain social control surveillance systems are very useful to government and law enforcement. For any video surveillance system moving object detection is preliminary. Tracking is required to locate the moving object in any surveillance systems. Tracking of human beings is a complex issue because of non-rigid nature. Many techniques were proposed in the literature yet there is a need for further research to meet the challenges of real world. Simple back ground subtraction, Eigen background subtraction, kernel based tracking and blob tracking are some of the existing methods, have their own limitations in case of occlusions, merge and split targets etc. The proposed method presents the tracking of objects based on centroid Modified overlap tracking is applied for better tracking capability under occlusions.', '1414160306_paper_for_journal.doc', '2014-10-24', 'Jayampu .Manohar ,Dr.K.V. Ramanaiah', 'manoharjayampu@gmail.com,ramanaiahkota@gmail.com', '9652795424', 'Jayamapu Manohar, Andhrapradesh', 'S/O J.Badraiah, Rettapalli(vi), Budanam(po) ', 'Chillakur (md),', 'Nellore (dt),', 524410, 'IN', 'Pending', NULL, 'ELECTRONICS', '1415770417_IJERSS1414160306.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue XI, November 2014.', 197, 1),
(357, 'IJERSS-1414215832', 'editor@ijerss.com', 'EFFECTS OF VARIED FREQUENCIES OF PLYOMETRIC TRAINING ON SELECTED STRENGTH PARAMETERS OF ENGINEERING COLLEGE MEN', 'Research', 'SPORTS SCIENCE', 'The purpose of the study designed to find out the effects of varied frequencies of plyometric training on selected strength related components of Engineering College men.  For this purpose, forty five men students studying Bachelorâ€™s degree n Engineering at Andhra University College of Engineering, Visakhapatnam, Andhra Pradesh, India were selected as subjects at random and they were divided randomly into three Experimental groups of fifteen each, Group â€“ I underwent plyometric training two day per week group, Group â€“II underwent plyometric training three day per week group and Group â€“ III underwent plyometric training four day per week group.  The training period was limited to eight weeks.  The dependent variables selected for this study were Arm Strength, Leg Strength and Explosive strength.  All the subjects were tested prior to and immediately after the experimental period on the selected dependent variables. The data obtained from the Experimental groups before and after the experimental period were statistically analyzed with Analysis of covariance (ANCOVA).  Whenever the â€˜Fâ€™ ratio for adjusted posttest means was found to be significant, the Scheffeâ€™s test was applied as post-hoc test to determine the paired mean differences.  The level of confidence was fixed at         0.05 level for all the cases.  The results of the study showed that there was a significant difference was found among all the experimental groups on the selected variables.', '1414215832_Journal_Nagarjuna_University.docx', '2014-10-25', 'Prof. M.Syam Babu,Dr. N.Vijay Mohan,Dr. A.Pallavi,Dr. R.Satish Varma', 'ppspaulkumar@gmail.com,sudhakar.mande7@gmail.com,rayapativarma@gmail.com,rayapativarma@gmail.com', '9030057655', '', '', '', '', 0, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(358, 'IJERSS-1414473314', 'editor@ijerss.com', 'LUNG TUMOR DETECTION IN THORACIC IMAGES USING BEAGLE BOARD', 'Research', 'HEALTH SCIENCE', 'Lung is a vital organ in our body which performs its function in both respiratory system and circulatory system. Computer Tomography (CT) provides powerful and unique means in detecting and diagnosing Tumor. Visual inspection of images is a tedious and error prone task and in many clinics tumor cells are not examined properly by missing an important source of information in CT image. We are developing a computer aided diagnosis software prototype that simultaneously detects tumors in the lung region. This system applies optimal thresholding and multiple gray-level thresholding to extract the lungs image and to detect tumor. A neural network algorithm concept is done using Python programming language, and the dataâ€™s are processed in Beagle board to detect tumors and the results projected in LCD projector', '1414473314_lung_tumor_detection.docx', '2014-10-28', 'ANANDPUSHPARAJ.J,ANITHA MARY. X', 'anandpushparajj@karunya.edu.in,anithajohnson2003@gmail.com', '9420240389', '', '', '', '', 0, 'IN', 'Accepted', '', 'ELECTRONICS', '1415902092_IJERSS1414473314.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue XI, November 2014.', 322, 1),
(359, 'IJERSS-1415086759', 'editor@ijerss.com', 'INTERUNIVERSITY MEN''S HANDBALL VOLLEYBALL BASKETBALL AND FOOTBALL PLAYERS AMONG THE SUPERSTITIOUS RITUALS AN ANALYSIS STUDY', 'Research', 'PHYSICAL EDUCATION AND SPORTS', 'The purpose of the study was to find out the Superstitious rituals of inter university Men Handball, Volleyball, Basketball and Football players. In the present study, 120 Interuniversity level men Basketball, Handball ,Volleyball and Football players were  randomly selected and equally divided in to three groups consisting of 30 interuniversity players each in Basketball, Handball ,Volleyball and Football. The age groups of the selected subject were ranged from 18 to 25 years. The administration of psychological factor questionnaire method of collecting data was used Superstitious ritual was measured through standard questionnaire collected from the journal of Sports Behavior,No1The collected data were subjected to statistical analysis of variance (ANOVA) and followed by L.S.D post hoc test to find out the paired means of the significant difference at 0.05 level of confidence. ', '1415086759_delhi_abstract.docx', '2014-11-04', 'Dr. A. PRAVEEN , SREEJITH RAJ', '65sree.raj@gmail.com', '9488434064', 'VARAPPILLY HOUSE , PO THALORE', 'PANAYAMPADAM ', 'THRISSUR', 'KERALA ', 680306, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1418226054_IJERSS1415086759.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue XII, December 2014.', 721, 1),
(360, 'IJERSS-1415443428', 'editor@ijerss.com', 'CONSTRUCTION OF NORMS FOR SELECTION OF VOLLEYBALL PLAYERS', 'Research', 'SPORTS SCIENCE', 'As a team sport, volleyball has a hoary past. Today it is played with systematic rules and regulations and many national and international levels of competitions are being organized for this game. 	Volleyball is also interestingly being played in inter-university competitions in India. Varsity players whose age are 25 years and below can only participate in such competition. The Jawaharlal Nehru Technological University, participates in many inter-university competitions in different games since its inceptions. This University also sends Volleyball team for such competitions after a thorough screening of good players followed by a systematic coaching. 	However, even though the athletes receive scientific training and coaching, they get defeat since the selection procedure of a player is not proper. We, generally select these players on the basis of some efficiency showed in volleyball skills during trial game situation. Moreover, very few of selection committee considers the fitness level of the players. Thus, the performance exhibited by them in one situation may not be always consistent and reliable mostly in other situation. The other disadvantage of this type of conventional selection method is that these players take more time to improve required fitness level as well as to develop their advance skill abilities and team spirit. Since the period of University education is limited and as there is limited scope for fast improvement in fitness and skill, there must be some standard criteria or norms for selecting the players to form an efficient Volleyball team to exhibit more consistent and reliable performance', '1415443428_CONSTRUCTION_OF_NORMS_FOR_SELECTION_OF.docx', '2014-11-08', 'M. Srinivasa Reddy,Dr. Y. Gopi Krishna', 'sudhakarmande7@gmail.com,ppspaulkumar@gmail.com', '9030057655', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1415770523_CONSTRUCTION_OF_NORMS_FOR_SELECTION_OF.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue XI, November 2014.', 240, 1),
(361, 'IJERSS-1415768917', 'editor@ijerss.com', 'EFFECT OF YOGIC TRAINING AND BRISK WALKING ON SELECTED PHYSIOLOGICAL AND BIOCHEMICAL VARIABLES AMONG DIABETIC PATIENTS', 'Research', 'Health Science', 'Yoga means the experience of oneness or unity with inner being.  This unity comes after dissolving the duality of mind and matter into supreme reality.  It is a science by which the individual approaches truth.  The aim of all yoga practice is to achieve truth where the individual soul identifies itself with the supreme soul or God.  Yoga has the surest remedies for manâ€™s physical as well as psychological ailments.  It makes the organs of the body active in their functioning and has good effect on internal functioning of the human body.  Yoga is a re-education of oneâ€™s mental process, along with the physical', '1415768917_copy.docx', '2014-11-12', 'T.Susilamma', 'ppspaulkumar@gmail.com', '9030057655', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1415770581_IJERSS1415768917.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue XI, November 2014.', 300, 1),
(362, 'IJERSS-1416029840', 'editor@ijerss.com', 'Friction Stir Welding, AA6063 T-6, Forward & Reverse Welding, Tensile Strength, Hardness', 'Research', 'mechanical', 'Abstract: The aim of this research is to study the behaviour of AA6063 â€“ T4 weldments obtained by Friction Stir Welding (FSW) process. The complex behaviour of the material after friction stir welding by forward and reverse welding methods was assessed by hardness and tensile tests. Substantial softening is found in forward welding and improved hardness is observed in reverse welding process at minimum rotational speed of the tool. Reverse welding shows superior tensile strength whereas a drop in strength efficiency is observed in forward welding. Graphs were also plotted for the weld cycle time and weld bead width against the rotational speed of the tool during forward and reverse welding', '1416029840_J_Paper.doc', '2014-11-15', 'moulali', 'moulali_p3@gmail.com', '9492583500', 'santhiram engineering college', 'nandyal', '', '', 518501, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(363, 'IJERSS-1416079018', 'editor@ijerss.com', 'EMPLOYMENT AND EMPLOYABILITY OF TRAINEES IN SELECTED SKILL DEVELOPMENT PROGRAMMES IN ANDHRA PRADESH', 'Case Study', 'ECONOMICS', 'This paper relates to theme entitled demographic dividend Challenges of Employment and Employability.  It contains 4 parts.  Part-I deals with Introduction, Need and Importance of the Study, Part-II presents Objectives, Methodology and a Review of Literature, while Part-III illustrates the employment and employability of the trainees placed in various sectors, Part-IV indicates Suggestions', '1416079018_Sarath_Economic.doc', '2014-11-16', 'Mr. N. SARATH BABU', 'ppspaulkumar@gmail.com', '9420240389', '', '', '', '', 0, 'IN', 'Pending', NULL, 'ECONOMICS', '1416119459_IJERSS1416079018.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue XI, November 2014.', 182, 1),
(364, 'IJERSS-1416129650', 'editor@ijerss.com', 'EFFECT OF VARIED AEROBIC TRAINING ON SELECTED PHYSICAL FITNESS, PHYSIOLOGICAL, BIOCHEMICAL AND PSYCHOLOGICAL VARIABLES OBESE ENGINEERING COLLEGE STUDENTS', 'Research', 'SPORTS SCIENCE', 'Life will not be life without physical activities.  Through physical activities alone people were able to survive in this world.  The story of evolution throws some light on the nature and types of activities which are an essential part of modern physical activities which are to be fit for day-to-day existence and to meet the occasional emergencies that arise.  Whatever may the emergency that trust itself on individuals the human beings have to readjust and carry on', '1416129650_phani.docx', '2014-11-16', 'V.VM.U.Phaneendra', 'ppspaulkumar@gmail.com', '9420240389', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1416130994_IJERSS1416129650.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue XI, November 2014.', 223, 1),
(365, 'IJERSS-1416131838', 'editor@ijerss.com', 'EFFECT OF STAIR CLIMBING AND SAND DUNE RUNNING ON SELECTED STRENGTH AND ENDURANCE VARIABLES OF SCHOOL BOYS', 'Research', 'SPORTS SCIENCE', 'The ancient philosopher Aristotle of Greece proclaimed the quality of people, quoted by Bucher as follows: â€œThe body is the temple of the soul and to reach harmony of body, mind and spirit, the body must be physically fitâ€.  The efficiency of the human body depends upon many factors.  With the enhanced status of sports in society the provision of sports training has become very important although the need for competent training has long been recognized.', '1416131838_madhu.docx', '2014-11-16', 'P.Madhu', 'ppspaulkumar@gmail.com', '9420240389', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1416133624_IJERSS1416131838.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue XI, November 2014.', 187, 1),
(366, 'IJERSS-1416133859', 'editor@ijerss.com', 'CONSTRUCTION OF NORMS FOR SELECTION OF VOLLEYBALL PLAYERS', 'Research', 'SPORTS SCIENCE', 'As a team sport, volleyball has a hoary past. Today it is played with systematic rules and regulations and many national and international levels of competitions are being organized for this game.\r\n\r\n	Volleyball is also interestingly being played in inter-university competitions in India. Varsity players whose age are 25 years and below can only participate in such competition.\r\n\r\n	The Jawaharlal Nehru Technological University, participates in many inter-university competitions in different games since its inceptions. This University also sends Volleyball team for such competitions after a thorough screening of good players followed by a systematic coaching.\r\n\r\n	However, even though the athletes receive scientific training and coaching, they get defeat since the selection procedure of a player is not proper. We, generally select these players on the basis of some efficiency showed in volleyball skills during trial game situation. Moreover, very few of selection committee considers the fitness level of the players. Thus, the performance exhibited by them in one situation may not be always consistent and reliable mostly in other situation. The other disadvantage of this type of conventional selection method is that these players take more time to improve required fitness level as well as to develop their advance skill abilities and team spirit. Since the period of University education is limited and as there is limited scope for fast improvement in fitness and skill, there must be some standard criteria or norms for selecting the players to form an efficient Volleyball team to exhibit more consistent and reliable performance.\r\n', '1416133859_M._Srinivasa_Reddy1.docx', '2014-11-16', 'M. Srinivasa Reddy,Dr. Y. Gopi Krishna', 'ppspaulkumar@gmail.com,ppspaulkumar@gmail.com', '9420240389', '', '', '', '', 0, 'IN', 'Pending', '', 'SPORTS SCIENCE', '1416134571_IJERSS1416133859.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 5, 1),
(367, 'IJERSS-1416156608', 'editor@ijerss.com', 'ANALYSIS OF WOMEN, SELECTED HEALTH RELATED PROBLEMS AND ITS REMEDIES UNDER THE PERSPECTIVE OF PSYCHOLOGICAL HEALTH EDUCATION AND WITH AN EXPERIMENTAL STUDY -WITH MARTIAL ART TRAINING', 'Research', ' SPORTS SCIENCE        PHYSICAL EDUCATION', 'To find out the Effect of martial Exercises on Mental health, emotional intelligence of women. Using the variables of emotional intelligence and mental health variable. Study describes how the study has been carried out-through health education and an experimental study are done through imparting education on   Psychological levels, and Exp â€“study-The effect of selected martial training on mental health, emotional intelligence of women. The purpose of the study was to find out the effect of martial training on female to know the changes in mental health, emotional intelligence shown by both the groups. And in-order to serve this purpose 120 sedentary youth females who were selected from participating in one month martial training programme from Govt college kasaragod. The importance of the study was explained to the subjects before getting their consent for the study.  They were divided into two groups of 60 female each. Group â€œA â€œunderwent Training and Groupâ€ B â€œacted as Control Group. Data analyzed by variableâ€™s data were first analyzed through Anova, then Ancova analysis included. Level of Significance chosen was 0.05 for Anova and Ancova. Health education and the martial exercises showed significant improvement in the emotional intelligence and mental health variable from pre to post test of experimental group compared to control group.', '1416156608_publication_1.docx', '2014-11-16', 'Dr.KUNJIKANNAN.R', 'kunjikannanr@gmail.com', '09497270408', 'Dr.KUNJIKANNAN.R', 'SITHARA,TC7/200,ULLOOR,MEDICAL COLLEGE PO', 'TRIVANDRUM', 'Kerala', 695011, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1418235072_IJERSS1416156608.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue XII, December 2014.', 245, 1),
(368, 'IJERSS-1416548596', 'editor@ijerss.com', 'EFFECTS OF DIFFERENT MODES OF YOGA PRACTICE ON PERCENTAGE OF BODY FAT AND BIOCHEMICAL VARIABLES', 'Research', 'YOGA & TRAINING METHODS', 'The purpose of the present study was to find out the effect of different modes of yoga practice on percentage of body fat and bio-chemical variables among middle aged men. For this purpose, forty five middle aged men residing around Kumbakonam town, Thanjavur district, Tamilnadu, were selected as subjects. The age of the subjects were ranged from 40 to 45 years. They were divided into three equal groups, each group consisted of fifteen subjects, in which experimental group - I underwent Bihar School of yoga practice, experimental group - II underwent B.K.S. Iyengar yoga practice and group - III acted as control that did not participate in any special activities apart from their regular curricular activities.  The training period for the study was six days (Monday to Saturday) in a week for twelve weeks.  Prior and after the experimental period, the subjects were tested on percentage of body fat, high density lipoprotein and triglycerides. Percentage of body fat was assessed by applying the Deurenberg et al formula. High density lipoprotein and triglycerides were tested after taking 5 ml of blood samples by venous puncture method, by using Boehringer Mannheim Kit Method. The Analysis of Covariance (ANCOVA) was applied to find out any significant difference between the experimental groups and control group on selected criterion variables.  The result of the study shows that the Bihar School of Yoga practice group and B.K.S. Iyengar Yoga practice group were decreased the triglycerides, percentage of body fat and increased the high density lipoprotein significantly.  It was concluded from the results of the study that Bihar School of Yoga practice and B.K.S. Iyengar Yoga practice has bring positive changes in percentage of body fat, high density lipoprotein and triglycerides as compare to the control group. Moreover it was also concluded that there was no significant difference was found between the experimental groups in all criterion variables.  ', '1416548596_chidambararaja.doc', '2014-11-21', 'Dr. S. CHIDAMBARA RAJA', 'rajadi42@gmail.com', '09443540215', 'Dr. S. CHIDAMBARA RAJA, ASSOCIATE PROFESSOR,', 'DEPT. PHYSICAL EDUCATION, ANNAMALAI UNIVERSITY, ', 'CHIDAMBARAM, ', 'TAMILNADU', 608002, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1418235164_IJERSS1416548596.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue XII, December 2014.', 265, 1),
(369, 'IJERSS-1416978435', 'editor@ijerss.com', 'PROBABILISTIC ROUTING TECHNIQUE IN MANET', 'Research', 'Mobile and Wireless Networks', 'Mobile Ad-hoc network (MANET) is collection of wireless mobile nodes forming temporary network dynamically without the help of any fixed infrastructure. Routing in MANET differs from conventional routing in fixed networks in various ways. These differences lead to different issues with routing techniques in MANET. The idea behind Probabilistic Routing is to select a route based on a probability. These probabilities will be assigned to possible paths considering the local information available at each node. By selecting good links with high probability gives more reliable routing. The technique gives more probability to the best route in order to not compromise the reliability of the network. This technique is useful to overcome the various issues in routing within MANET. For minimizing routing overhead in MANET we can use this technique. For probability calculation we are using Monte Carlo probability theory. Simulation results show that this technique shows less routing load, total broadcast send and number of dropped packets.', '1416978435_Probabilistic_Routing_Technique_in_MANET.doc', '2014-11-26', 'vijay s parit, Prof C.M.Jadhav ,Prachi Kushire', 'vsparit@tkietwarana.org', '9420240389', 'Mr -Vijay  Sarjerao Parit  AT post- kololi  ', 'Tal-Panhala Dist-kolhapur pin-416230', 'kolhapur', 'maharashtra', 416230, 'IN', 'Pending', NULL, 'COMPUTER SCIENCE', '1418267492_IJERSS1416978435.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue XII, December 2014.', 272, 1),
(370, 'IJERSS-1417012730', 'editor@ijerss.com', 'PREDICTION OF VOLLEYBALL PLAYING ABILITY FROM SELECTED ANTHROPOMETRIC MEASUREMENTS', 'Research', 'Physical Education', 'The purpose of the study was to predict the volleyball playing ability from selected anthropometric measurements. To achieve the purpose of the study, a total of fifteen college female volleyball players who had the credit of played interuniversity competitions were selected as subjects from various colleges of Tirunelveli District, Tamil Nadu. The age of the subjects were ranged between 21 to 25 years. The anthropometric variables such as  weight, height, leg length, arm length, circumference of shoulder, chest, arm, wrist and waist, breadth of biceps and triceps and body mass were selected as independent variables and volleyball playing ability was selected as dependent variable for this study. The selected independent variables were tested by using standardized test items such as height measured by stadiometer, weight measured by weighing machine, and all other variables were tested by using measuring tape and volleyball playing ability was tested with subjective measurement. To determine the relationship between dependent variable and independent variable Pearson product moment, multiple correlations and multiple regressions was used. In multiple regressions, we are predicting a criterion variable from a set of predictors. Forward selection method of multiple regressions was used in this study to find out the predictor variable that has the highest correlation with the criterion variables is entered into the equation first. The rest variables are entered into the equation depending on the contribution of each predictor. The results of the present study indicate that height, arm length, weight and leg length are playing an important role for volleyball performance, whereas other selected variables do not have much significant role in the performance. Hence it is recommended that, the coaches may use the anthropometric data for assessing the physical development of each player, as well as of the whole team, for comparison with other teams and for correlating them with the teamâ€™s achievements at competitions. \r\nKeywords: Playing ability, Anthropometric factor and Volleyball performance', '1417012730_Dr.SS_Journal_Paper.doc', '2014-11-26', 'Dr.S.Sethu', 'drsksethu@gmail.com', '9443461487', 'Door.No:1280-D, Plot.No:108', 'Arunachalapuram A Colony, KTC Nagar', 'Tirunelveli', 'Tamilnadu', 627011, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1418267569_IJERSS1417012730.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue XII, December 2014.', 276, 1),
(371, 'IJERSS-1417089298', 'editor@ijerss.com', 'MANAGAGING STATE ANXIETY WITH YOGA PRACTICES', 'Research', 'Physical Education', 'The Purpose of the study was to find out, the intervened effect of yoga on State\r\nAnxiety among University students. The subjects chosen for the study were 30 students of different genres from Chaudhary Devi Lal University, Sirsa. Their age ranged between 20 and 25 years.\r\nThey were randomly divided into two groups of 15 each, one being the experimental group and the\r\nOther control group. The experimental group underwent a scheduled yoga practice for a period of 8\r\nweeks, 6 days/week as the control group was on daily regular routine. The status of State Anxiety\r\nwas measured before (Pre-test) and after (Post-test) the experimental period using Manual of State-\r\ntrait Inventory developed by Spielberger (1970). The data were analyzed statistically for significant\r\ndifferences. Later applying analysis of variance and analysis of co-variance (in case of\r\ninsignificance), significance in variance is shown, and further Scheffe.s test was applied. The result\r\nproves that the yogic scheduled practices have made a significant impact on the State Anxiety of the\r\nexperimental group compared to the control group\r\n', '1417089298_Managaging_State_Anxiety_with_Yoga_Practices.docx', '2014-11-27', 'Sandeep Dhull,Shamsher Kasnia,RavinderPal Ahlawat', 'sandeepdhull123@gmail.com,kasnia09@yahoo.com,ahlawatravi74@gmail.com', '+91-9416186235', 'Department of Physical Education', 'Chaudhary Devi Lal University', 'Sirsa', 'Haryana', 125055, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1418383273_IJERSS1417089298.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue XII, December 2014.', 235, 1),
(372, 'IJERSS-1417171986', 'editor@ijerss.com', 'FUZZY Based Design of Parallel Park Assist System Control Strategy ', 'Research', 'Control System', 'The automatic parking is one of the growing topics that claim to enhance the comfort and safety of driving. It can help drivers automatically drive the vehicle in constrained environments where much attention and experience is required. The parking strategy is completed by means of coordinated control of the steering angle and taking into account the actual situation in the environment to ensure collision-free motion within the available space. This paper presents a fuzzy logic controller designed for automatic parallel parking system. The proposed system receives information about the parking environment from ultrasonic distance sensor HC-SR04 and then generates the velocity and steering angle for parking. The servomotor are used for steering angle control of the model car. In order to ensure the performance of proposed system a prototype of four wheel robot, equipped with Arduino Uno R3 board has been developed. The control law is designed in Simulink and executed in real time using the dSPACE DS1104 DSP board.', '1417171986_paper3.docx', '2014-11-28', 'Mr.Ganesh Shetty,Mr. Deepak Salian,Mr. Naveen B M,Mr.Raghu S', 'ganeshshetty27@gmail.com,deepaksalian1987@gmail.com,surya.naveenbm@gmail.com,raghusenc@gmail.com', '9663831083', 'Moodlakatte Institute of Technology,Depart. of E&C', 'Kundapura 576217', 'kundapur', 'karnataka', 576217, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0);
