(373, 'IJERSS-1417363758', 'editor@ijerss.com', 'COMPARISON OF MODERATE INTENSITY PHYSICAL TRAINING WITH AND WITHOUT THE ASSISTANCE OF PRANAYAMA PRACTISES IN A GROUP OF        SCHOOL FEMALE ATHLETES', 'Research', 'TRAINING METHODS,MODERATE INTENSITY PHYSICAL TRAINING WITH AND WITHOUT THE ASSISTANCE OF PRANAYAMA', 'ABSTRACT\r\nThe purpose of this present study is to compare the effect of moderate-intensity physical training followed by pranayama practice against moderate-intensity physical training alone in a group of female athletes. Sixty female school children involved in endurance sport volunteered to participate in this study and they were randomly assigned in to three equal groups, Moderate intensity physical training alone (MIPT; n = 20) Moderate intensity training followed by pranayama practice (Prana+ MIPT; n=20) and control group (CG; n=20) The duration of the training program was 12 weeks, VO 2 max, Leg strength, and Resting heart rate were measured through Balke VO 2Max test, Leg Strength Test and Manual palpating the radial artery for full 1 minute. The pre test and post test randomized control group design was used as an experimental design. Selected criterion variables were statistically analyzed with paired sampleâ€˜tâ€™ test to find out significant improvement between pre and post test means of experimental and control groups, analysis of covariance (ANCOVA) was used to find out significant difference between experimental and control groups and Scheffeâ€˜s test were used to evaluate the effect of training. In all the cases 0.05 level of confidence was fixed to test the hypothesis. The result reveals that, both training programs with and without pranayama was better for the development of VO 2Max, elastic leg strength and resting heart rate for the school female endurance sport/game athletes. While comparing the two training protocols, (Pranayama+MIPT) was better improved on VO 2Max and resting heart rate and there was no significant differences were found on elastic leg strength between experimental groups. \r\n\r\nKEYWORDS: ENDURANCE SPORT/GAME ATHLETES, VO 2MAX, ELASTIC LEG STRENGTH, RESTING HEART RATE.\r\n', '1417363758_MODERATE_INTENSITY_PHYSICAL_TRAINING_WITH_AND_WITHOUT_THE_ASSISTANCE_OF_PRANAYAMA.docx', '2014-11-30', 'T.VINOTH, Dr.A.S.NAGESWARAN', 'arachyvinoth@gmail.com,asnageswaran@gmail.com', '9600271509', 'T.VINOYH,S/O S.THANGARAJU, 2/47,ARAICHI PO', 'THATHIANGAR PET  (Via),  MUSIRI TK', 'THIRUCHIRAPALLI', 'TAMILNADU', 621214, 'IN', 'Pending', '', 'SPORTS SCIENCE', '1418285874_IJERSS1417363758.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue XII, December 2014.', 260, 1),
(374, 'IJERSS-1417434583', 'editor@ijerss.com', 'ANALYSIS OF MENTAL IMAGERY AMONG BASKETBALL, KABADDI, KHOKHO AND VOLLEYBALL PLAYERS', 'Research', 'Sports Science', 'The purpose of the study was to analyze the mental imagery among Basketball, Kabaddi, Kho-Kho and Volleyball players. To achieve the purpose of the study, a total of sixty men players were selected as subjects at random from the affiliated colleges of Manonmaniam Sundaranar University, Tirunelveli. The age of the subjects were ranged from 20 to 25 years. The selected subjects were divided into four groups of fifteen students each such as Basketball, Kabaddi, Kho-kho and Volleyball. Mental imagery was selected as the dependent variable. Basketball, Kabaddi, Kho-Kho, and Volleyball were selected as Independent variables for this study. The selected dependent variable is tested by standardized Questionnaire called Sport Imagery Questionnaire (S.Q) which was developed by Mr. Munroeeral (1998). The data were collected from the selected subjects during the academic year 2013-2014 on the selected variables. The static group comparison design was used for this study. The data pertaining to the variables in this study were examined by using analysis of variance (ANOVA) in order to determine the differences if any, among the means. Whenever â€˜Fâ€™ ratio was found to be significant the Scheffeâ€™s test was used as post-hoc test to determine the cell mean differences. The level of significance was fixed at .05 level of confidence for all the cases. The result of the study shows that there was significant difference among Basketball, Kabaddi, Kho-Kho and Volleyball players on mental imagery. It was found that Volleyball players were showed better performance in mental imagery when compared to other players.', '1417434583_Dr.SS_IJERSS_Dec_2014(2).doc', '2014-12-01', 'Dr.S.Sethu', 'drsksethu@gmail.com', '9443461487', 'Asst.Professor, Dept.of Sports, M.S.University', '', 'Tirunelveli', 'Tamil Nadu', 627012, 'IN', 'Pending', '', 'SPORTS SCIENCE', '1418267715_IJERSS1417434583.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue XII, December 2014.', 317, 1),
(375, 'IJERSS-1417633922', 'editor@ijerss.com', 'Removal of Noise from EEG Signals using Cascaded filter - Wavelet Transforms Method', 'Research', 'Signal processing', 'EEG, or Electroencephalogram is a device used to analyse the activities of the brain when it is performing any task. EEG signal helps us to know about the brain functions and its activities and hence are helpful in the diagnosis of   the neurobiological disorders in it. EEG signals have very low amplitude and are measured from peak to peak having normally vary from 0.5 to 100 ÂµV in amplitude, which is about 100 times lower than ECG signals and so various types of noise can easily effect it. EEG signals play an important role in detecting brain related diseases so it is important to denoise these signals for correct analysis and diagnosis. Wavelet Transforms are helpful in denoising these signals and making them noise free. In this work a filter is used along with Wavelet Transform for Denoising the EEG signals. Performance analysis of these methods for noise removal is done by measuring parameters like MSE and PSNR.', '1417633922_priyanka_khatwani.docx', '2014-12-04', 'Priyanka Khatwani,Mrs. Archana Tiwari', 'priyankakhatwani@csitdurg.in', '9584059204', ' C/O AD Manik, Deepak Nagar , Street no 3', 'Near railway station , in front of sub post office', 'Durg', 'Chhattisgarh', 491001, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(376, 'IJERSS-1417757086', 'editor@ijerss.com', 'A DYNAMIC LOAD BALANCING SCHEME FOR ENERGY EFFICIENT RESOURCE UTILIZATION IN CLOUD COMPUTING', 'Research', 'CLOUD COMPUTING', 'Cloud computing is an internet based use of computer applications. It mainly used to share hardware and software resources over the network rather than the remote server. Load balancing techniques used to share the workload to the individual nodes of the system to improve both resource utilization and job response time while also avoiding a situation where some of the nodes are always busy while other nodes are idle or doing lower priority work. Load balancing problem can be balanced using the Load strategy method and create a multiple instances. Using the optimum scheduling algorithm, it schedule the task based on the deadline and cost based constraints which gives the minimum turn around time of the system. Load Strategy method use dynamic scheduling and to balancing the load and also reduce the   execution time. And also consider the concept of Green computing that are used to reduce the energy consumption. Task consolidation is a method used to increase resource utilization and reduces energy consumption which can lead to freeing up of resources that can sit idling yet still drawing power. ', '1417757086_A_Dynamic_Load_Balancing_Scheme_for_Energy_Efficient_Resource_Utilization_in_Cloud_Comput', '2014-12-05', 'A.SUNITHA,V.B.VINITHA', 'sunipandian@gmail.com,vinithagceb@gmail.com', '9688046049', '', '', '', '', 0, 'IN', 'Pending', NULL, 'COMPUTER SCIENCE', '1418267782_IJERSS1417757086.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue XII, December 2014.', 240, 1),
(377, 'IJERSS-1417761444', 'editor@ijerss.com', 'A STUDY ON AGGRESSION OF FOOTBALL AND HOCKEY PLAYERS OF UNIVERSITY AND PRE-UNIVERSITY LEVEL PLAYERS', 'Others', 'PHYSICAL EDUCAITON ', 'The study was formulated based on the simple random sampling. The samples were selected from the 80 football and 80 hockey players of university and pre-university Players of Bagalkot district, aged of the subject between 16 and 25 years were selected. The aggression questionnaire inventory developed by Anand kumar and Prem Shankar for Statistical analysisâ€˜tâ€™ test were used. The results of the study found that The University level players have significant higher aggression as compared to Pre-University level players. The University level Football players have significant higher aggression as compared to Pre-University level Football players. The University level Hockey players have significant higher aggression as compared to Pre-University level Hockey players. The Football players of both University and pre-University level have higher aggression scores as compared to Hockey players.  ', '1417761444_RSH_Article1.doc', '2014-12-05', 'Sri Rajashekhar S. Hiremath.', ' hiremathrsh@gmail.com', '09448184868', 'ASST .PROFESSO OF PHYSICAL EDUCATION ', 'KRC COLLEGE OF HORTICULTURE, ARABHAVI, TQ-GOKAK', 'ARABHAVI', 'KARNATAKA', 591218, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1418267834_IJERSS1417761444.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue XII, December 2014.', 239, 1),
(378, 'IJERSS-1417934157', 'editor@ijerss.com', 'EFFECT OF SPORTS CULTURE ON PHYSIOLOGICAL VARIABLES', 'Research', 'SPORTS SCIENCE', 'The internal organic functions and their efficiency are very important for our potential living. The social culture with regular physical activity contributes the potential developmental status with optimum health and better quality of livelihood. Exercises comprise with movement and different games have some positive benefits to the different physiological variables. The purpose of the study was to find out the influence of a 09-week sports culture programme on Physiological functioning, which wereheart rate, blood pressure and blood glucose level of middle-aged women. Sample: 20 women age ranged between 25-40yrs. of Kapasdanga, Hooghly in West Bengal were considered as the subjects for the study. Method: There was single group design as no control groups were there. The subjects underwent training thrice a week for 09 weeks. The pre and post-tests were conducted on the subjects to collect the data on the variables of the study. Analysis of data: The data were analyzed by appropriate statistical procedure to determine the significance of improvements. Findings and Conclusion: Significant (p < .005) differences were found in case of all the physiological variables in rest and after peak exercise except the diastolic blood pressure after exercise as the effect of sports culture. It was concluded that the sports culture comprises with regular physical exercises, playing different sports and some theoretical informative classes has positive beneficial effects upon internal organic function to the middle aged females', '1417934157_Physiological.docx', '2014-12-07', 'Dr. Asish Paul', 'asp_f2000@yahoo.com', '9831710942', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1418310545_IJERSS1417934157.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue XII, December 2014.', 261, 1),
(381, 'IJERSS-1418221056', 'editor@ijerss.com', 'VIRTUAL REALITY - THE HOPE OF A NEW FUTURE', 'Research', 'COMPUTER SCIENCE', 'Virtual Reality (VR), sometimes called Virtual Environments (VE) has drawn much attention in the last few years. Extensive media coverage causes this interest to grow rapidly. Very few people, however, really know what VR is, what its basic principles and its open problems are. In this paper a historical overview of virtual reality is presented, basic terminology and classes of VR systems are listed, followed by applications of this technology in science, work, and entertainment areas. An insightful study of typical VR systems is done. All components of VR\r\napplication and interrelations between them are thoroughly examined: input devices, output devices and software. Additionally human factors and their implication on the design issues of VE are discussed. Finally, the future of VR is considered in two aspects: technological and social. New research directions, technological frontiers and potential applications are pointed out. The possible positive and negative influence of VR on life of average people is speculated', '1418221056_Virtual_Reality_3.docx', '2014-12-10', 'DR.(MRS) KIRANDEEP KAUR,MRS.SHIVANI', 'kiranmtsm@rediffmail.com,kiranmtsm@rediffmail.com', '9000770880', '', '', '', '', 0, 'IN', 'Accepted', '', 'COMPUTER SCIENCE', '1420997166_modified_manuscript.pdf', 1, 1, 'IJERSS-2014', 2, 1, 'Volume II - Issue I, January 2015.', 256, 1),
(382, 'IJERSS-1418378283', 'editor@ijerss.com', 'THE EFFECTS OF FATIGUE ON THE COORDINATION OF LOWER EXTREMITY ON BADMINTON PLAYERS', 'Research', ' 	Sports Sciene & Physical Education', 'The aim of this study is to do a research about the effects of fatigue on the coordination of lower extremity after being weighed down on elite badminton players.\r\n18 elite men badminton adult national team players whose average age are 22.83 Â± 3,02, average weight are 75.77 Â± 10,25 kg and average height are 179.54 Â± 5,15 cm participated in this study. For maximal and submaximal loadings, a modified shuttle run test was put into effect. In this test''s protocol, after warm-ups, at a constant 0 degrees treadmill, running tracks of 3 minutes starting from 8 km/h till 17 km/h with 1 minute of break were carried out. At the beginning, during and at the end of the running tracks their heart beating rates were saved by polar watches and lactate levels were calculated. After the loading on the treadmill, the players'' coordination of lower extremity were measured by the coordination machine right next to them. Their coordination measurements by done by Functional Squat System (Monitored Rehab System). At a lying position, by using their feet and creating eccentric and concentric contractions, they tried to hold the dot on the monitor on the line. The deviations that occurred on the line (cm) gave us informations about the leg coordination of the player. Before and after maximal and submaximal loadings, a test was applied on both of the legs. Due to the fact that the datas didn''t show a normal range, Wilcoxon, which is a nonparametric test, was used for analysing. \r\nAs a result of obtained datas, it is seen that maximal and submaximal loadings are not a cause for the expected decline in elite badminton players'' coordination of lower extremity (p>0.05). \r\nThe reason why there wasn''t an expected decline in players'' coordination can be explained by them being elite players and due to this fact their physical fitness level being high. Therefore, it can be said that fatigue doesn''t cause a significant loss in coordination on elite badminton players. \r\n', '1418378283_The_Effects_of_Fatigue_on_the_Coordination_of_Lower_Extremity_on_Badminton_Players.docx', '2014-12-12', 'MERT AYDOGMUS,ERKAL ARSLANOGLU,OMER SENEL', 'aydogmus1978mert@gmail.com,erkaloglu@gazi.edu.tr,osenel@gazi.edu.tr', '+90 5427218804', 'Kafkas University SarÄ±kamÄ±s Beden EÄŸitimi Spor ', 'YÃ¼ksekokulu, SarÄ±kamÄ±ÅŸ', 'KARS', 'TURKEY', 0, 'TR', 'Accepted', '', 'SPORTS SCIENCE', '1420532238_IJERSS1418378283.pdf', 1, 1, 'IJERSS-2014', 2, 1, 'Volume II - Issue I, January 2015.', 269, 1),
(383, 'IJERSS-1418444541', 'editor@ijerss.com', 'EFFECT OF POLYMETRIC TRAINING WITH AND WITHOUT MENTAL PRACTICES ON MOTOR FITNESS PHYSIOLOGICAL AND PERFORMANCE OF LONG JUMPERS', 'Research', 'SPORTS SCIENCE', 'The present study Effect of Polymetric training with and without mental practices on motor fitness physiological. Randomly selected intercollegiate level long jumpers (N=45) would be divided into three groups consisting of 15 in each. Group I would be trained Plyometric with mental training; Group II would be training Plyometric without any mental training and Group III would be serving as control group. The training period would be for 12 weeks.  Pre and post test scores would be collected on selected motor fitness, physiological and long jump performance of the subjects. The difference between initial and final scores would be effect of respective training.  To test statistical significance, ANCOVA would be used. Based on the results obtained, discussions would be made and conclusions drawn.The study is significant in suggesting a exercise protocols combining the Plyometric and mental training, which would enable to improve the motor fitness, physiological and long performance of the long jumpers', '1418444541_G.RAJU.doc', '2014-12-13', 'C.Salmon Sudheer,G.Raju', 'ppspaulkumar@gmail.com,ppspaulkumar@gmail.com', '9080706050', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1418485470_IJERSS1418444541.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue XII, December 2014.', 242, 1),
(384, 'IJERSS-1418444711', 'editor@ijerss.com', 'SOCIAL STATUS OF WOMEN IN MODERN INDIA- A VIEW', 'Research', 'SOCIAL', 'The origin of the Indian idea of appropriate female behavior can be traced to Manu in 200 BC: â€œby a young girl, by a young woman, or even by an aged one, nothing must be done independent, even in her own houseâ€. Any assessment of the status of women has to start from the social framework, social structures, cultural norms and value systems that influence social expectations regarding the behavior of both men and women and determine womanâ€™s role and their position in society. One of several factors that justify the greatness of India''s ancient culture is the honorable place granted to women. Women were considered inferior to men in practical life. But in scriptures they were given high position. Thus in past, the status of women in India was not clear. It was theoretically high but practically low. Women were prohibited to take part in domestic as well as in external matter. They were under the influence of their parents before marriage and their husbands after marriage. The Muslim influence on India caused considerable deterioration in the status of women. They were deprived of their rights of equality with men. Raja Ram Mohan Roy started a movement against this inequality and subjugation. The situation began to change when many national figures started a struggle for India''s freedom. Mahatma Gandhi openly invited the help from women. Many women came forward. The contact of Indian culture with that of the British also brought improvement in the status of women. But in spite of this amelioration in the status of women, the evils of illiteracy, dowry, ignorance, and economic slavery would have to be fully removed in order to give them their rightful place in Indian society.', '1418444711_kiran.doc', '2014-12-13', 'B. Chaitanya Kiran Kumar,Gurram Suresh ', 'ppspaulkumar@gmail.com,ppspaulkumar@gmail.com', '9080607050', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SOCIAL', '1418496568_IJERSS1418444711.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue XII, December 2014.', 240, 1),
(385, 'IJERSS-1418444820', 'editor@ijerss.com', 'Effect of Stair Climbing and Sand Dune Running on Selected Strength and Endurance Variables of School boys', 'Research', 'HEALTH SCIENCE', 'The ancient philosopher Aristotle of Greece proclaimed the quality of people, quoted by Bucher as follows: â€œThe body is the temple of the soul and to reach harmony of body, mind and spirit, the body must be physically fitâ€.  The efficiency of the human body depends upon many factors.  With the enhanced status of sports in society the provision of sports training has become very important although the need for competent training has long been recognized.', '1418444820_p.Madhu.docx', '2014-12-13', 'P.Madhu', 'ppspaulkumar@gmail.com', '9070809060', '', '', '', '', 0, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1418496516_IJERSS1418444820.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue XII, December 2014.', 217, 1),
(386, 'IJERSS-1418444932', 'editor@ijerss.com', 'Effect of Varied Aerobic Exercises on Selected Fitness, Physiological, Biochemical and Psychological Variables of Obese Engineering College Men students', 'Research', 'SPORTS SCIENCE', 'The purpose of the study was to find out the effect of varied aerobic exercises on selected fitness, physiological, biochemical and psychological variables of obese engineering college men students. Sixty obese men were selected from different engineering colleges in A.P.  The subjects were selected at random. They were in the age group of 20 â€“ 25 years. The study was formulated as a true random group design consisting of a pre-test and post test.  The subjects (N=60) were randomly assigned to three equal groups of twenty male adults each.  The groups were assigned as experimental group I â€“ (step aerobic exercises), Experimental Group II (floor aerobic exercises) and control group respectively.  Pre tests were conducted for all the 60 subjects on selected fitness, physiological, biochemical and psychological variables.  After the experimental period of twelve weeks post test were conducted and the scores were recorded', '1418444932_phani.docx', '2014-12-13', 'V.V.M.U.Phaneendra', 'ppspaulkumar@gmail.com', '9080507060', '', '', '', '', 0, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1418496471_IJERSS1418444932.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue XII, December 2014.', 257, 1),
(387, 'IJERSS-1418445065', 'editor@ijerss.com', 'STRATEGIES TO MANAGE STRESS RELATED TO VISUALLY IMPAIRED STUDENTS IN THE CLASS ROOM', 'Research', 'SOCIAL', 'In this article Stress the perception of a threat to oneâ€™s well being and the apprehension that one is unable to cope with the perceived threat, is brought about by the continual adjustments and demands that individuals place upon themselves as they react to given stimuli. As the individual is called upon to adjust to changing situations, the greater the stress which is acquired. Stress is a combination of factors that affects each individual differently. That which is stressful to one person, may not be so to another, and reactions to stressors vary among individuals. â€œStressâ€ according to one expert, â€œis a non-specific response of the body to a demandâ€ (Kopolow, 1987). For students with learning disabilities, this transition, coupled with the negative effects of stress, can be especially troubling. The various settings for the education of visual impairment children offer different advantages and disadvantages. The regular class in the regular school offers higher academic standards, extra-curricular activities social opportunities with sighted children, and real world experience. It can be difficult, however, to get specialized materials on time and to get adequate instruction time from a teacher of the visual impairment. However, academic opportunities may not be on par with public schools. The setting also inherently limits experience in getting along in the sighted world. In order to attend, some children have to live away from home. For all these reasons, placement decisions are made on an individual basis', '1418445065_PR.docx', '2014-12-13', 'Jalli Pothuraju ,Dr.G.Yashoda', 'ppspaulkumar@gmail.com,ppspaulkumar@gmail.com', '9080706050', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SOCIAL SCIENCE', '1418496421_IJERSS1418445065.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue XII, December 2014.', 235, 1),
(388, 'IJERSS-1418445211', 'editor@ijerss.com', 'EFFECTS OF PNF STRETCHING AND OWN BODY EXCERCIES ON SELECTED BIO MOTOR ABILITIES AND CARDIORESPIRATORY FITNESS OF SOFTBALL PLAYERS', 'Research', 'HEALTH SCIENCE', 'The present study was undertaken to analyze Effect of PNF Stretching and own body exercise on motor abilities and cardiorespiratiry fitness of softball players. Randomly selected high school softball players (N=45) would be divided into three groups consisting of 15 in each. Group I would be trained PNF stretching exercises; Group II would be trained in own body weight exercises and Group III would be serving as control group. The training period would be for 12 weeks.  Pre and post test scores would be collected on selected bio motor abilities like, balance, coordination, flexibility and strength and cardio respiratory variables such as, cardio vascular endurance, forced vital capacity and breath holding time of the subjects. The difference between initial and final scores would be effect of respective training.  To test statistical significance, ANCOVA would be used. Based on the results obtained, discussions would be made and conclusions drawn. The study is significant in suggesting suitable PNF stretching and own body exercise training, which would enable to improve the bio motor and cardio respiratory variables of softball players', '1418445211_suresh.doc', '2014-12-13', 'V.Balakrishna, D.Suresh', 'ppspaulkumar@gmail.com,ppspaulkumar@gmail.com', '9080706050', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1418495281_IJERSS1418445211.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue XII, December 2014.', 266, 1),
(389, 'IJERSS-1418445270', 'editor@ijerss.com', 'Effect of yogic training and brisk walking on selected physiological and biochemical variables among diabetic patients.', 'Research', 'HEALTH SCIENCE', 'Yoga means the experience of oneness or unity with inner being.  This unity comes after dissolving the duality of mind and matter into supreme reality.  It is a science by which the individual approaches truth.  The aim of all yoga practice is to achieve truth where the individual soul identifies itself with the supreme soul or God.  Yoga has the surest remedies for manâ€™s physical as well as psychological ailments.  It makes the organs of the body active in their functioning and has good effect on internal functioning of the human body.  Yoga is a re-education of oneâ€™s mental process, along with the physical', '1418445270_Susilamma.docx', '2014-12-13', 'T.Susilamma', 'ppspaulkumar@gmail.com', '9070809060', '', '', '', '', 0, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1418496353_IJERSS1418445270.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume I - Issue XII, December 2014.', 226, 1),
(390, 'IJERSS-1418903078', 'editor@ijerss.com', 'EFFECTIVENESS OF BIOFEEDBACK AND AUTOGENIC TRAINING ON REACTION AND CO-ORDINATION TIME OF VOLLEYBALL AND HANDBALL PLAYER', 'Research', 'Physical Education', 'The purpose of this study was to examine the effect of combination of biofeedback and autogenic training for Reaction and co-ordinations time of Volleyball and Handball player.  The biofeedback involves the combination of body, mind and apparatus or machine. At the other hand autogenic training is a technique of self-hypnosis which would help in developing relaxation. 40 male players 17 to 24 years of age of Volleyball and Handball Mahadev Desai Sharirik Shikshan Mahavidyalaya, Sadra. Dist. Gandhinagar. Of Gujarat Vidyapeeth were selected as the subject of the study. Audio-visual reaction timer, eye-hand coordination apparatus and GSR biofeedback were used to test reaction ability, and coordination. Paired t-test and applied for analysing pre-test and post test data of training of eight (8) week. It was observed that biofeedback training combined with autogenic training helped to improve reaction ability and coordination whereas reduce of experimental groups of Volleyball and Handball players.\r\n\r\n', '1418903078_Dr.Nimesh_Res._Paper_2014.doc', '2014-12-18', 'Dr. Nimeshkumar D Chaudhari', 'chaudharinimesh@gmail.com', '09426854903', 'Gujarat Vidyapith, Ahmedabad ', 'M. D. Sharirik Shikshan Mahavidyalaya, At. Sadra', 'Dist. Gandhinag', 'Gujrata', 382320, 'IN', 'Paper available online', '', 'SPORTS SCIENCE', '1423579552_IJERSS1418903078.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue II, February 2015.', 157, 1),
(391, 'IJERSS-1418970463', 'editor@ijerss.com', 'COMPARISON OF SELECTED CARDIO RESPIRATORY FUNCTION BETWEEN INTER COLLEGE AND INTER UNIVERSITY PLAYERS', 'Research', 'HEALTH SCIENCE', ' The main objective of the study was to find out the Cardio Respiratory function between   inter-collegiate and inter university players of Faizabad University of Uttar Pradesh State. For the study three physiological test had been selected, Resting Heart Rate: Measure of Resting Heart Rate by Pulpatory Method, Vital Capacity: Measure of Vital Capacity by using Wet Spirometer and Aerobic Capacity:  Cooperâ€™s 12 Minutes Run-Walk Test. The test had been taken from 80 players were selected as the subject 40+40 for each inter collegiate and inter-university players. To find out the significant different comparativeâ€˜tâ€™ test was implemented.\r\nInter- Universityâ€™s Football Players was found significantly higher Resting Heart Rate than the Inter- Collegiate Football Players. For Vital capacity there was no significant difference found between Inter- Collegiate Football Players Groups and Inter- University Football Players Groups at 0.05 level of significant. In Aerobic capacity Inter- University Football Players was significantly higher in Aerobic Capacity in comparison Inter- Collegiate Football Players at 0.05 level of significance.', '1418970463_Mamta_Paper.docx', '2014-12-19', 'Mamta Singh Rathour,Ashwani Kumar', 'mamtasinghrathour@gmail.com,mamtasinghrathour@gmail.com', '9030057655', '', '', '', '', 0, 'IN', 'Fee Pending', '', 'SPORTS ', '1421173770_IJERSS1418970463.pdf', 1, 1, 'IJERSS-2015', 2, 1, 'Volume II - Issue I, January 2015.', 193, 1),
(392, 'IJERSS-1419052159', 'editor@ijerss.com', 'EFFECT OF WHEAT HUSK ASH -AS A POZZOLANIC MATERIAL ON MORTAR', 'Research', 'Research Paper & Civil Engineering ', 'Abstractâ€”Global warming and environmental demolition have become manifest problems in recent years, enhance concern about global environmental issues, and a vary over from the mass-production, mass-consumption, mass-waste the world of the past to a zero-emission society is now viewed as important. prevent the fatigue of natural resources and enhancing the usage of waste materials has become a significant problem of the modern world.Experimental investigation on the effect of Wheat Husk Ash on mechanical Properties and durability. Including compressive strength, water absorption Consistency is reported in this project. The test results indicate that the mechanical properties of Wheat Husk Ash modified mortar are improved to a great extent. Whereas the water absorption is reduced of modified mortar as compared to that of plain mortar. it is Also interesting  to note that partial replacement of cement by 12.5%, 25%, 37.5% of Wheat Husk Ash improve both mechanical and durability of modified mortar. The Wheat Husk Ash is varied from 0 to 37.5% by weight of cement. \r\nKeywords- Wheat Husk Ash, fly ash, silica fume, rice husk ash, compressive strength, Consistency.', '1419052159_wha_paper_final(6)_13122014.docx', '2014-12-20', 'Amardeep B. Dehane,Prof. S. G. Makarande,Prof.  Nilesh P. Shende', 'amar.dhn98@gmail.com,amar.dhn98@gmail.com,amar.dhn98@gmail.com', '9860298409', 'SWASTIK NAGAR WARUD ROAD SEVAGRAM WARDHA', '', '', 'MAHARASHATRA', 442102, 'IN', 'Fee Pending', '', 'CIVIL ENGINEERING', '1423617801_IJERSS1419052159.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue II, February 2015.', 232, 1),
(394, 'IJERSS-1419098801', 'editor@ijerss.com', 'SUPERSTITIOUS RITUALS AMONG INTERUNIVERSITY FOOTBALL HOCKEY AND CRICKET PLAYERS - AN ANALYSIS STUDY', 'Research', 'SPORTS SCIENCE', 'The purpose of the study was to find out Superstitious rituals among interuniversity level menâ€™s Football, Cricket and Hockey players. To achieve the purpose of the study 90 Interuniversity level Menâ€™s Football, Cricket and Hockey players were  randomly selected and equally divided in to three groups consisting of 30 interuniversity players each in Football, Cricket and Hockey. The age groups of the selected subject were ranged from 18 to 27 years. The Superstitious questionnaire was used for the collection of data which is developed by Bleak and Frederic (1998). The collected data were subjected to statistical analysis of variance (ANOVA) and followed by Scheffeâ€™s post hoc test to find out the paired means of the significant difference at 0.05 level of confidence. It is concluded that there is no significant differences in interuniversity level menâ€™s Football, Cricket and Hockey players.', '1419098801_pApr.docx', '2014-12-20', 'Yadu chand,Rajesh Raja', 'yaduiverson23@gmail.com', '9030607080', '', '', '', '', 0, 'IN', 'paper published online', '', 'HEALTH SCIENCE', '1423653525_IJERSS1419098801.pdf', 1, 1, 'IJERSS-2015', 2, 2, 'Volume II - Issue II, February 2015.', 139, 1),
(395, 'IJERSS-1419173036', 'editor@ijerss.com', 'IMPLEMENTATION OF SCHEDULING STRATEGIES OF OPERATING SYSTEMS USING FPGA', 'Research', 'ELECTRONICS', 'FPGA-based hardware implementation of multitasking strategies provide high-performance computing that rival ASICs for performance yet provide programmability and ease of development closer to traditional software systems.  Because of their usefulness, such systems are high in demand and have limited availability. Multitasking can be used to increase the utilization of reconfigurable FPGAs. In this proposed system a flexible and up-gradable architecture is provided for using the commercially available reconfigurable FPGAâ€™S. In this system different Multi Tasking Strategies are implemented using VHDL on FPGA. Because it can take advantage of an application parallelism, by using methods to context switch reconfigurable computing resources, multitasking reconfigurable computing systems can be constructed that provide most of the features available in traditional reconfigurable computers. This report describes methods to context switch the resources of a reconfigurable computers, as well as a prototype multitasking reconfigurable FPGA that has been created', '1419173036_sdb_paper.doc', '2014-12-21', 'Mr.Sagar.D,Prof.A.S..Mali', 'bhopalesagar11@gmail.com,asmali@tkietwarana.org', '9420240389', '', '', '', '', 0, 'IN', 'Fee Pending', '', '', '1420532606_Copyright_Form_Ijerss.pdf', 1, 0, 'IJERSS-2015', 2, 1, 'Volume II - Issue I, January 2015.', 0, 0),
(396, 'IJERSS-1419239397', 'editor@ijerss.com', 'A STUDY ON SOMATIC SYMPTOMS, SOCIAL DYSFUNCTION, SEVERE DEPRESSION, ANXIETY AND INSOMNIA AMONG FEMALE POST GRADUATE STUDENTS OF ARTS, SCIENCE, COMMERCE AND LANGUAGE DEPARTMENT OF BANGALORE UNIVERSITY', 'Research', 'Physical Education', '\r\n', '1419239397_Abstract.docx', '2014-12-22', 'B.S. Tilak Kumar', 'tilakpedir@gmail.com', '+91-9844393965', '#466, Kaanishka maharaja Road, 2nd main,', 'K.G. Nagar, ', 'Bangalore', 'Karnataka', 560019, 'IN', 'Fee Pending', '', 'SOCIAL SCIENCE', '1423654009_IJERSS1419239397.pdf', 1, 1, 'IJERSS-2015', 2, 2, 'Volume II - Issue II, February 2015.', 135, 1),
(397, 'IJERSS-1419243099', 'editor@ijerss.com', 'HORSE POWER OF VOLLEYBALL AND BASKETBALL PLAYERS A COMPARATIVE STUDY', 'Research', 'Physical Education and sports sciences', '     Abstract: The concept of power is extremely important in the study of human movement because it combines all three of the fundamental qualities of motion-force displacement and time. In this regard the present study is an effort to find the individual horse power or explosive muscle power with the help of vertical power jump test. Test was conducted on university level players and study was restricted only to male players. Independent t- test (t) was used to find out the mean significance difference on test score of volleyball and basketball player was used. The result indicates that as jumping efficiency is required more for volleyball players than basketball players. This is in agreement with the hypothesis of the researcher. The dispersion extent is wider in volleyball than basketball suggesting a bit of hectogeneous dispersion as only few spikers jump to a higher level than other players.\r\n     Key words: horse power, volleyball player, basketball player\r\n', '1419243099_Research_article_by_ckk[1].doc', '2014-12-22', 'Dr. Kishore Kumar CK ', 'ckkkit@rediffmail.com', '944817802', 'Deputy Director of Physical Education ', 'Dept. of PG Studies and Research in Physical Educa', 'Mangalore Unive', 'Karnataka', 574199, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1420890917_IJERSS1419243099.pdf', 1, 1, 'IJERSS-2015', 2, 1, 'Volume II - Issue I, January 2015.', 200, 1),
(398, 'IJERSS-1419243476', 'editor@ijerss.com', 'EFFECT OF MULTI ACTIVITY INSTRUCTIONAL PROGRAM ON PHYSICAL FITNESS OF B.P.ED. STUDENTS OF MANGALORE UNIVERSITY', 'Review', 'Physical Education and sports sciences', '     Abstract: Study sought to determine the effect of Multi activity instructional program on the physical fitness components such as speed, strength and endurance of Male and Female B.P.Ed students of the Dept. of PG Studies and Research in Physical Education and Sports Sciences, Mangalore University. These physical fitness components were measured through 100 meter sprint, Standing Broad jump, Shot - put throw and 12/9 km run/walk. It consisted of information pertaining to the pre- and post test measures of the physical fitness of the 34 men and 11 women students. There were significant changes, i.e. improvement in the physical fitness level of male and female students in terms of speed, explosive strength, power and endurance after the multi activity instructional program.\r\n    Key words: Multi activity instructional program, Physical fitness, BPEd students\r\n', '1419243476_ananth_paper910.doc', '2014-12-22', 'ANANTHAPADMANABHA PRABHU', 'sportstodream@gmail.com', '09164586621', 'Ananthapadmanabha Prabhu, P E Teacher-Grade 1', 'Morarji Desai Residential School, ', 'Kandalai Hassan', 'Karnataka', 273217, 'IN', 'Accepted', '', 'SPORTS SCIENCE', '1420532140_IJERSS1419243476.pdf', 1, 1, 'IJERSS-2015', 2, 1, 'Volume II - Issue I, January 2015.', 211, 1),
(399, 'IJERSS-1419336009', 'editor@ijerss.com', 'EFFECT OF YOGA AND DIET ON SELECTED CLINICAL VARIABLE AMONG CARDIOVASCULAR PATIENTS', 'Research', 'yoga ', 'The purpose of the random group experimental study was to find out the effect of Yoga and Diet on selected clinical variable among cardiovascular patients. 60 Cardiovascular patients, aged between 45-60 years, attending Cardiac care centers in Chennai, Tamil Nadu, were randomly selected and categorized into 4 groups, with 15 subjects in each group. Along with their routine clinical cardiac care, Group I were given training in Yoga, Group II were gives in Diet, Group III were given training in both Yoga and Diet, and Group IV was the control group who did not receive any Yoga or Diet. The training was given to the subjects for a period of 8 weeks. Details on Bio-chemical variable namely, Total Cholesterol levels were collected from all the 4 groups both at baseline and at the end of eight weeks from their hospital records. It was proved that practice of Yoga and Diet had a significant positive effect on the Bio-chemical variables among the subjects in groups I, II, and III, and the effect was more prominent in group III who practiced both Yoga and Diet and thus the hypothesis was accepted at 0.05 level of confidence.', '1419336009_Paper.docx', '2014-12-23', 'S.Sumathi, Dr.R.Elangovan', 'yogsumathi@yahoo.co.on, relangovantnpesu@yahoo.co.in                                    ', '9941321919', 'No:15 / 58, Kailash Sector, Chenna MettuPalayam, ', 'Kaladipet, Thiruvottiyur', 'Chennai', 'TamilNadu', 600019, 'IN', 'Fee Pending', '', 'SOCIAL SCIENCE', '1420890852_IJERSS1419336009.pdf', 1, 1, 'IJERSS-2015', 2, 1, 'Volume II - Issue I, January 2015.', 205, 1),
(400, 'IJERSS-1419416829', 'editor@ijerss.com', 'HORSE POWER OF VOLLEYBALL AND BASKETBALL PLAYERS - A COMPARATIVE STUDY', 'Research', 'Physical Education and sports sciences', '     Abstract: The concept of power is extremely important in the study of human movement because it combines all three of the fundamental qualities of motion-force displacement and time. In this regard the present study is an effort to find the individual horse power or explosive muscle power with the help of vertical power jump test. Test was conducted on university level players and study was restricted only to male players. Independent t- test (t) was used to find out the mean significance difference on test score of volleyball and basketball player was used. The result indicates that as jumping efficiency is required more for volleyball players than basketball players. This is in agreement with the hypothesis of the researcher. The dispersion extent is wider in volleyball than basketball suggesting a bit of hectogeneous dispersion as only few spikers jump to a higher level than other players.\r\nKey words: horse power, volleyball player, basketball player\r\n', '1419416829_Research_article_by_ckk[1].doc', '2014-12-24', 'Dr. Kishore Kumar CK ', 'ckkkumar@yahoo.com', '09448178402', 'Dr. Kishore Kumar C K', 'Director of Physical Education ', 'Mangalore Unive', 'Karnataka', 0, 'IN', 'Pending', '', '', NULL, 0, 0, 'IJERSS-2015', 0, 0, 'New', 0, 0),
(401, 'IJERSS-1419437449', 'editor@ijerss.com', 'Human automation collaboration of multiple UV based on single operator using RESCHU', 'Others', 'HUMAN COMPUTER INTERFACES/ROBOTICS', 'There has recently been a significant amount of activity in developing supervisory control algorithms for multiple unmanned aerial vehicle operation by a single operator. While previous work has demonstrated the favorable impacts that arise in the introduction of increasingly sophisticated autonomy algorithms, little work has performed an explicit comparison of different types of multiple unmanned vehicle control architectures on operator performance and workload. This paper compares a vehicle-based paradigm (in this method a single operator assigns tasks to unmanned vehicle) to a task-based paradigm (in this method the operator generates a task list, which is then given to the group of vehicles that determine how to best divide the tasks among themselves.) The results demonstrate significant advantages in using a task-based paradigm for both overall performance and robustness to increased workload. The proposed framework incorporates sensor constraints, such as processing and travel time. These results have analyzed and implications for the design of future human-UV systems, as well as more general multiple tasks supervisory control models.', '1419437449_PRIYA_JOUR.docx', '2014-12-24', 'R.MOHANA PRIYA,A.SYED MUSTHABA', 'priyarangaraj18@gmail.com', '7418335681', '', '', '', '', 0, 'IN', 'Fee Pending', '', '', '1420532783_Copyright_Form_Ijerss.pdf', 1, 0, 'IJERSS-2015', 2, 1, 'Volume II - Issue I, January 2015.', 0, 0),
(403, 'IJERSS-1419620632', 'editor@ijerss.com', 'Improving UPGrowth Algorithm using TOP-K Itemset mining High Utility', 'Research', 'COMPUTER SCIENCE', 'Discovering useful patterns hidden in a database plays an essential role in several data mining tasks, Mining high utility itemsets from databases is an emerging topic in data mining, which refers to the discovery of itemsets with utilities higher than a user-specified minimum utility threshold min_util. Although several studies have been carried out on this topic, setting an appropriate minimum utility threshold is a difficult problem for users because the existing high utility mining algorithm generates large number of candidate itemsets, which takes much time to find utility value of all candidate itemsets, especially for dense datasets.. If min_util is set too low, too many high utility itemsets will be generated, which may cause the mining algorithms to become inefficient or even run out of memory. On the other hand, if min_util is set too high, no high utility itemset will be found. Setting appropriate minimum utility thresholds by trial and error is a tedious process for users. Conventional frequent pattern mining algorithms require some user-specified minimum support, and then mine frequent patterns with support values that are higher than the minimum support. As it is difficult to predict how many frequent patterns will be mined with a specified minimum support, the Top-k mining concept has been proposed. The Top-k Mining concept is based on an algorithm for mining frequent patterns without a minimum support, but with the number of most k frequent patterns ordered according to their support values. However, the Top-k mining concept still requires a threshold k. Therefore, users must decide the value of k before initiating mining. we address this problem by proposing a new framework named top-k high utility itemset mining, where k is the desired number of high utility itemsets to be mined. An efficient algorithm named Top-K Utility itemsets mining  is proposed for mining such itemsets without setting min_util.', '1419620632_Paper.docx', '2014-12-27', 'Ramkrishna H. Patil,Sandip S. Patil', 'ramu@gmail.com,sspatiljalgaon@gmail.com', '9420240389', '', '', '', '', 0, 'IN', 'Fee Pending', '', '', '1420532807_Copyright_Form_Ijerss.pdf', 1, 0, 'IJERSS-2015', 2, 1, 'Volume II - Issue I, January 2015.', 0, 0),
(404, 'IJERSS-1419953444', 'editor@ijerss.com', 'ANALYSING THE EFFICACY OF SOME COMMON MICROBES IN THE BIOREMEDIATION OF INDUSTRIAL WASTE WATER', 'Research', 'Environmental biology', '		Bioremediation uses various microorganisms to detoxify or degrade various harmful substances in the nature, particularly soil and water. In the proposed work, four species of micro-organisms were used to analyse their impact on various physico-chemical parameters of industrial waste water. In the first attempt the actual physico-chemical parameters of the collected sample water were noted down (Fresh sample parameters). Following this, the sample water was treated with selected micro-organisms (one at a time). The growth of the microbes was observed carefully over a period of 96 hours after inoculation. The physico-chemical parameters were recorded again and were compared with the fresh sample parameters. The results were analysed for any change and on this basis, an impact factor was developed to analyse the extent of remediation effect.\r\n		The study reveals that the selected microbes have a tremendous capacity of detoxifying pollutants and improving water quality.\r\n', '1419953444_Manuscript1.docx', '2014-12-30', 'Praveen Kumar Agrawal ,Sangeet Prabha', 'dragrawalpk@gmail.com,dragrawalpk@gmail.com', '09359518799', '69 - A Govind Nagar', 'Mathura', 'Mathura', 'Uttar Pradesh', 281003, 'IN', 'a', '', 'ZOOLOGY', '1420531677_IJERSS1419953444.pdf', 1, 1, 'IJERSS-2015', 2, 1, 'Volume II - Issue I, January 2015.', 222, 1),
(405, 'IJERSS-1420623067', 'editor@ijerss.com', 'QUANTUM NOISES & REDUCTION TECHNIQUE WITH MEDIAN FILTER', 'Research', 'COMPUTER SCIENCE', 'The main purpose of this paper is a brief study about the cause of the noise in the image and the removal technique of the noise from the noisy image. Images are often degraded by the noises. We have solve noise by one method but the filter method are many .In the field of noise reduction several linear and non-linear techniques are proposed. Non-Linear filtering technique has no disadvantage because it is not able to effectively eliminate impulse noise as they have a tendency to blur the edges of the image. In non-linear techniques are effectively able to handle the impulse noise.   ', '1420623067_Quantum_Noises___Reduction_Technique_with_Median_Filter_(1).doc', '2015-01-07', 'Anindita Chatterjee,Himadri Nath Moulick,Dr. Poulami Das', 'anindita_star24@rediffmail.com,anindita_star24@rediffmail.com,anindita_star24@rediffmail.com', '9420240389', '', '', '', '', 0, 'IN', 'Pending', NULL, 'ENGINEERING', '1421172994_IJERSS1420623067.pdf', 1, 1, 'IJERSS-2015', 2, 1, 'Volume II - Issue I, January 2015.', 227, 1);
