(406, 'IJERSS-1420883743', 'editor@ijerss.com', 'A STUDY ON MORAL VALUES IN HIGHER EDUCATORS WITH REFERENCE TO ICSSR RESEARCH METHODOLOGY WORKSHOP PARTICIPANTS IN VIJAYAWADA', 'Research', 'SOCIAL SCIENCE', 'In this paper the moral values in higher education are part of a broader issue of the function of the university as such. The university as an institution is part of the life of the community and the degree to which it promotes moral values and moral norms closely reflects the promotion of values and norms in the community as a whole. So we must ask ourselves whether the university plays any special role in the promotion of moral values and if it does what are the characteristics of this role that differentiate the university from the rest of the community and from other institutions. The degree to which people acknowledge each other and the level of awareness with which they do so, have undergone essential changes in the history of mankind with respect to social, cultural, political, economic and religious factors. It has been argued by many that the present level of self and other awareness in western culture reflects the growth of individualism in the last two or three hundred years. Historians of human self consciousness have maintained that subjective self-awareness as we know it today has appeared relatively recently in human history. The nature of the university has changed it never was the ideal community of scholars but now it has become an instrument of production not producing educated persons but better qualified workers to fill the places in an ever growing knowledge economy. The values of the university are now counted in terms of wealth and production not people and the pursuit of truth', '1420883743_kiran.doc', '2015-01-10', 'B.CHAITANYA KIRAN KUMAR,GURRAM SURESH ,HEMALATHA ANCHIPAKULA', 'baddelachaitanyakk@gmail.com,sudhakarmande7@gmail.com,sudhakarmande7@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SOCIAL SCIENCE', '1421304382_IJERSS1420883743.pdf', 1, 1, 'IJERSS-2015', 2, 1, 'Volume II - Issue I, January 2015.', 197, 1),
(408, 'IJERSS-1420884248', 'editor@ijerss.com', 'MGNREGS AND PARTICIPATION OF WOMEN AGRICULTURAL LABOURERS IN ANDHRA PRADESH-REGIONAL ANALYSIS', 'Research', 'ECONOMICS', 'The issue of employment has always assumed critical significance as employment generation in rural India has been a recurring problem in our development plans. Provision of employment opportunities has became a constant pre-occupation with policy makers in our country addressing social exclusion and provision of employment opportunities was considered as an effective strategy for the development of disadvantaged groups living in rural areas, as a result, a variety'' of employment generation programmes aiming at\r\nremoval of unemployment and poverty alleviation have been implemented even from the fifth five Year plan. The seventies, eighties and nineties, saw the emergence of special schemes in the rural development sector such as IRDP, NREP, RLEGP, JRY etc., to tackle the problems of rural unemployment and poverty through expanding livelihood opportunities and creation of durable assets in rural areas. Consequently, the seventies and eighties witnessed a steady increase in employment generation. During the Xth plan the employment strategies primarily focused on the labour-intensive sectors of the economy. The employment generation strategy followed by the XI th Five Year plan has also envisaged reduction in rural underemployment and a movement of surplus low wage labour in agricultural sector to higher wage and more gainful employment in the non-Agricultural sectors\r\n', '1420884248_sarath.docx', '2015-01-10', 'BAPUJI DAVU', 'sudhakarmande7@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'ECONOMICS', '1420890639_IJERSS1420884248.pdf', 1, 1, 'IJERSS-2015', 2, 1, 'Volume II - Issue I, January 2015.', 224, 1),
(409, 'IJERSS-1420891100', 'editor@ijerss.com', 'EFFECT OF COMPLEX TRAINGING WITH YOGIC PRACTICES ON SELECTED MOTAR FITNESS VARIBALES AND PLAYING ABILITY AMONG THE KABADDI MEN PLAYERS', 'Research', 'sports science', 'â€œSportsâ€ is a popular spectacle and a mass social movement of contemporary times.  In the process of historical development sports has occupied a prominent place both in the moral culture of a society.  Its social significance continues to soar.  In the modern days â€˜sports for allâ€™ become a very popular slogan.  Participation in sports will yield optimum physical fitness and positive health for all.  In the hurry scenario of modern life people need more exercise to keep their body and mind fit to execute the day-to-day activities effectively. In the modern days, sports and game have got much more relevance in the context of men and women getting physical exercise and thereby keeping oneself fit and occupying the leisure time in a fruitful manner.  Therefore, it shall be an Endeavour for agencies in the society to strive optimally to make available adequate facilities and sound programme of sports and games at every premise like schools and college, factories and business establishments, companies and departs corporations and agencies in rural and urban areas.  So people of all ages choose some games or sports events for participation.', '1420891100_Sample1_2.docx', '2015-01-10', 'SUDHAKAR BABU MANDE,Dr.P.P.S.PAUL KUMAR', 'ppspaulkumar@gmail.com,ppspaulkumar@gmail.com', '9030057655', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1420891199_IJERSS1420891100.pdf', 1, 1, 'IJERSS-2015', 2, 1, 'Volume II - Issue I, January 2015.', 227, 1),
(410, 'IJERSS-1421608594', 'editor@ijerss.com', 'A HYBRID APPROACH FOR PRESSURE ULCER   EVALUATION BY WOUND TISSUE CLASSIFICATION', 'Research', 'COMPUTER SCIENCE', 'A pressure ulcer is a lesion caused by unrelieved pressure resulting in damage of underlying skin tissue when the body stays in one position for too long without shifting the weight. The treatment of pressure ulcer is very costly for healthy services. The accurate diagnosis and the appropriate treatment are crucial because starting the treatment too late may lead to the development of more severe lesions that may be life-threatening. The computer vision approaches presently available do not provide a precise solution for the pressure ulcer problem. So this paper uses a hybrid approach based on Neural Network and Probability Classifier for automatic tissue identification in wound images.  Color and texture features are extracted after Region Segmentation is done using the mean shift procedure and region growing strategy. The Neural Network is trained with these extracted features as inputs.To this end, probability committee machine is formed by training a probability classifier to combine the classifications of the k neural networks', '1421608594_journal_new_97_(1).doc', '2015-01-19', 'M.MAHALAKSHMI,V.SHINY', 'mahabe.raja@gmail.com,mahabe.raja@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', '', 'COMPUTER SCIENCE', '1428923778_IJERSS1421608594.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue IV, April 2015.', 153, 1),
(411, 'IJERSS-1422529948', 'editor@ijerss.com', 'A MHR TREE APPROACH TO STRING TRANSFORMATION', 'Research', 'Journal Publication', 'String transformation is an important problem in many applications; it must be\r\naccurate and efficient. String transformation is a task as follows. Given an input string,\r\nthe system generates the k most likely output strings corresponding to the input string.\r\nThis paper proposes a tree approach to string transformation and to retrieve the data,\r\nwhich is both accurate and efficient. The approach includes the use of a log linear\r\nmodel, a method for training the model, and an algorithm for generating the top k\r\ncandidates, whether there is or is not a predefined dictionary. The log linear model is\r\ndefined as a conditional probability distribution of an output string and a rule set for\r\nthe transformation conditioned on an input string. The learning method employs\r\nmaximum likelihood estimation for parameter estimation. The string generation\r\nalgorithm based on pruning is guaranteed to generate the optimal top k candidates.\r\nThe proposed method is applied to correction of spelling errors in queries as\r\nwell as reformulation of queries in web search. Experimental results on large scale data\r\nshow that the proposed approach is very accurate and efficient improving upon existing\r\nmethods in terms of accuracy and efficiency in different settings. And the proposed\r\nsystem uses MHR-Tree for string matching process. In existing AC-Tree have related\r\nresults only, but in MHR-Tree have accurate result of userâ€™s query. The MHR-Tree\r\nhas a root and multiple leaves. The string matching process based on this root and\r\nleaves. So finally, user can get expected and accurate result and it provides good\r\nperformance than existing. ', '1422529948_MHR.doc', '2015-01-29', 'Vinothini R', 'vinothini.rajen@gmail.com', '9600709909', '2/3D', 'Veerashanmugam Illam', 'Madurai', 'Tamil Nadu', 625003, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2015', 0, 0, 'New', 0, 0),
(412, 'IJERSS-1422669403', 'editor@ijerss.com', 'HUMAN AUTOMATION COLLABORATION OF MULTIPLE UV BASED ON SINGLE OPERATOR USING RESCHU', 'Research', 'ELECTRONICS', 'There has recently been a significant amount of activity in developing supervisory control algorithms for multiple unmanned aerial vehicle operation by a single operator. While previous work has demonstrated the favorable impacts that arise in the introduction of increasingly sophisticated autonomy algorithms, little work has performed an explicit comparison of different types of multiple unmanned vehicle control architectures on operator performance and workload. This paper compares a vehicle-based paradigm (in this method a single operator assigns tasks to unmanned vehicle) to a task-based paradigm (in this method the operator generates a task list, which is then given to the group of vehicles that determine how to best divide the tasks among themselves.) The results demonstrate significant advantages in using a task-based paradigm for both overall performance and robustness to increased workload. The proposed framework incorporates sensor constraints, such as processing and travel time. These results have analyzed and implications for the design of future human-UV systems, as well as more general multiple tasks supervisory control models', '1422669403_PRIYA_JOUR.docx', '2015-01-31', 'Mr.A.Syed Musthaba,Mr.R.Mohana priya', 'syed.aneefa@gmail.com,priyarangaraj18@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'ELECTRONICS', '1423655432_IJERSS1422669403.pdf', 1, 1, 'IJERSS-2015', 2, 2, 'Volume II - Issue II, February 2015.', 240, 1),
(413, 'IJERSS-1422794809', 'editor@ijerss.com', 'AN INVESTIGATION ON THE CORRELATIONSHIP AMONG DIFFERENT ELEMENTS OF AAHPERD PHYSICAL FITNESS TEST', 'Research', 'Sports Science & Physical Education', 'Abstract: \r\nThe fitness of an individual, a society, a civilization and a government is very important in the life of the Nation. If a Nation is to remain strong physically, mentally, spiritually, and socially, education for Physical Fitness must be undertaken. It is self-evident that the fit citizens are nationâ€™s best assets and weak ones are liabilities. The wealth of the nation resides in the health and vitality of its people. \r\nOne of the main objectives of physical activities is to improve physical fitness in people. Different organizations and people have prepared some tests for physical fitness. With the assistance and help of the experts in the field of Physical Fitness, Physical Education, Sports and previous researches on these areas a comprehensive and suitable AAHPERED Physical Fitness Test was select for the study. The aim of this study is to investigate the correlationship among the six- items in AAHPERD Physical Fitness Test. The procedure of this study has been semi-experimental and the tests have been carried out in almost equal conditions.\r\n The subjects of this statistical research were 480 male college students were randomly selected from twenty one academic colleges of Hemchandracharya North Gujarat University. Statistical method for data analysis is with respect to the type of study and the scales for it. In this research study, pearson''s correlation coefficient was used for the investigation of correlationship among six physical fitness tests by use of SPSS Software. Then based on the use of SPSS Software, significant and no significant were considered with the (p < %5). \r\nKey words: elements, correlation, components, AAHPERD Physical Fitness Test\r\n', '1422794809_P.F.Coorelationship.docx', '2015-02-01', 'Dr.Ramesh Arjanbhai Faldu', 'rameshfaldu@gmail.com', '9724348750', 'Chandrapuri Society', 'Bhavnath Road', 'Bhiloda ', 'Gujarat', 383245, 'IN', 'Pending', NULL, '', '1423760029_Document_2.pdf', 1, 0, 'IJERSS-2015', 2, 2, 'Volume II - Issue II, February 2015.', 0, 0),
(414, 'IJERSS-1422938222', 'editor@ijerss.com', 'BIG DATA REVOLUTIONS AND PRIVACY CONSIDERATIONS', 'Research', 'Big data', 'Big Data concerns large-volume, complex, growing data sets with multiple, autonomous sources. With the fast development of networking, data storage, and the data collection capacity, Big Data is now rapidly expanding in all science and engineering domains, including physical, biological and bio-medical sciences. This data-driven model involves demand-driven aggregation of information sources, mining and analysis, user interest modeling, and security and privacy considerations. Challenging issues in the data-driven model and also in the Big Data revolution are analyzed.', '1422938222_Sunil_Technical_Paper_SNIST_Feb_2015.doc', '2015-02-03', 'C.Sunil Kumar, Akshay Srirangam', 'ccharupalli@gmail.com, sunilkumarc@sreenidhi.edu.in', '09030764651', 'C.Sunil Kumar, Flat.No.103, Plot.No. 12 & 13', 'SLN Arcade - I, Haripuri Colony, Saroornagar', 'Hyderabad', 'Telangana', 500035, 'IN', 'paper published online', '', 'COMPUTER SCIENCE', '1423914102_IJERSS1422938222.pdf', 1, 1, 'IJERSS-2015', 2, 2, 'Volume II - Issue II, February 2015.', 210, 1),
(415, 'IJERSS-1422967447', 'editor@ijerss.com', 'YOUTH AND SPORTS - NATIONAL YOUTH POLICIES, BENEFITS AND OPPORTUNITIES IN INDIA  ', 'Review', 'Physical Education & Sports', 'Abstractâ€”Youth contribution is of vital importance in all countries for its development particularity in a country like India were the proportion of the youth in the countryâ€™s overall social and demographic profile is continuously increasing. Sports are vital to the development of young people, fostering their physical, social and emotional health. The benefits of sports reach beyond the impact on physical well-being and the value of the educational benefits of sports should not be underestimated. This study is focused on the national youth policies related to sports, Benefits of sports participation, Opportunities in sports field & star values in sportsperson etc. Researcher thought that this paper may change the attitude of youth towards sports positively and there by contribute strong and healthy youths to the country as youth are the back bone of our country. \r\nIndex Termsâ€”Youth, Sports, National policies, Benefits, Opportunities, star values. \r\n', '1422967447_MANOJ_&_ANANTHAPADMANABHA.doc', '2015-02-03', 'Manoj,Ananthapadmanabha Prabhu', 'manubabahai@gmail.com,sportstodream@gmail.com', '09964279510', 'Manoj', 'Lecturer of Physical Education,Mangaore Univeristy', 'Mangalore', 'Karnataka', 574199, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1423656912_IJERSS1422967447.pdf', 1, 1, 'IJERSS-2015', 2, 2, 'Volume II - Issue II, February 2015.', 164, 1),
(417, 'IJERSS-1423050512', 'editor@ijerss.com', 'A Novel Approach to Reduce BER in MIMO System', 'Research', 'Wireless Communication', 'Multi-input Multi-output (MIMO) systems are today regarded as one of the most promising research areas in wireless communications. MIMO System comes with improved spectral efficiency (Multiplexing gain), link reliability (diversity gain), coverage (diversity, array gain), BER reduction, high data rate, beam forming etc. In this paper, we will present certain methods of reduction of BER in MIMO system with higher data rates in the AWGN channel. This increased data rate can be achieved without the need of additional bandwidth or transmit power, provided that sufficient multipath diversity is present. Here we are using two different equalization technique to reduce BER. A Synthesis scheme is investigated in order to find a BER which allows reaching good performance in term of error probability with a reasonable complexity. This task is achievable using MMSE equalization technique.', '1423050512_paper.docx', '2015-02-04', 'Prabhat Kumar,Chandni Tiwari', 'prabhat.bcet@gmail.com,chandnisai21@gmail.com', '7409627196', 'Prabhat Kumar, Assistant Professor', 'GEHU, 600, Bell Road, Clement town', 'Dehradun', 'Uttarakhand', 248001, 'IN', 'Pending', NULL, 'ELECTRONICS', '1424587245_IJERSS1423050512.pdf', 1, 1, 'IJERSS-2015', 2, 2, 'Volume II - Issue II, February 2015.', 149, 1),
(418, 'IJERSS-1423125368', 'editor@ijerss.com', 'CYBER CRIME AND CYBER SECURITY', 'Review', 'Technical article', 'Cyber crime is a term used for fraudulent activities done using the channel of computers, the Internet, cyber world and the websites. It is an illegal act wherein computer is being used either as a weapon or as a target or both. Cyber crime can involve criminal activity like theft, fraud, deformation and mischief. The misuse of computer has given birth to new level crimes that are introduced by the Information Act, 2000.The Significant success of internet has become possible because of its relative openness and minimum security constraints to entry for those who operate it with vicious intentions. Cyber crimes are rising speedily with incurring more cost and taking longer to resolve. The 2014 global study of U.S.-based companies, which spanned seven countries, revealed that over the course of a year the average cost of cyber crime jumped by more than 9% to $12.7 million for companies in the United States, up from 11.6 million in the 2013 study.', '1423125368_cyber_crime.doc', '2015-02-05', 'Nirmal kaur  ', 'kaurnirmal88@gmail.com', '9463203309', 'Punjabi University campus, Maur Mandi(Bathinda)', 'Punjab', 'Maur Mandi', 'Punjab', 151509, 'IN', 'Pending', NULL, 'INFORMATION SECURITY', '1424099995_IJERSS1423125368.pdf', 1, 1, 'IJERSS-2015', 2, 2, 'Volume II - Issue II, February 2015.', 166, 1),
(419, 'IJERSS-1423388138', 'editor@ijerss.com', 'INFLUENCE OF VARIED PACKAGES OF YOGIC PRACTICES ON  CARDIO VASCULAR ENDURANCE AMONG  COLLEGE MEN STUDENTS', 'Research', 'HEALTH SCIENCE', 'The purpose of the present investigation is to find out the influence of varied packages of yogic practices on Cardio Vascular Endurance among college men students. To achieve these purpose 90 men subjects were selected at random from Rajapalayam Rajuâ€™s College, Rajapalayam, Tamilnadu as subjects. Their age ranged from 18 to 25 years. They were divided into three equal groups of 30 subjects each and assigned to experimental group-I, experimental group-II and control group. In a week the experimental group I underwent Swami Satyananda Saraswati yogic practices, experimental group II underwent Swami Vishnudevananda yogic practices and Control Group was not given any specific training. All the subjects underwent one area of test namely Cardio Vascular Endurance. They assessed before and after the training period of 12 weeks. The analysis of covariance was used to analyze the data. The study revealed that the above said criterion platelets count were significantly improved due to the influence of varied packages of yogic practices on Cardio Vascular Endurance among college men students. ', '1423388138_Dr._P._YOGA.doc', '2015-02-08', 'Dr. P. YOGA', 'yogayoji@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1423892287_IJERSS1423388138.pdf', 1, 1, 'IJERSS-2015', 2, 2, 'Volume II - Issue II, February 2015.', 161, 1),
(420, 'IJERSS-1423388358', 'editor@ijerss.com', 'PROVISION OF JUSTICE THROUGH EFFECTIVE REDRESSAL OF INDUSTRIALDISPUTES AND GRIEVANCE HANDLING', 'Research', 'SOCIAL SCIENCE', 'The paper is organised in four parts.  The first part contains Introduction in which the research problem is presented along with its importance and need for the study.  The second one focuses on objectives and methodology.  The third part analyses the data related to settlement of industrial disputes, while the fourth deals with findings of the study and offers suggestions', '1423388358_SARTH.doc', '2015-02-08', 'Mr. BAPUJI.D,Mr. N. SARATH BABU', 'sudhakarmande7@gmail.com,sudhakarmande7@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'ECONOMICS', '1423893566_IJERSS1423388358.pdf', 1, 1, 'IJERSS-2015', 2, 2, 'Volume II - Issue II, February 2015.', 153, 1),
(421, 'IJERSS-1423388497', 'editor@ijerss.com', 'EFFECT OF YOGIC PRACTICES ON SELECTED PHYSIOLOGICAL VARIABLES AMONG OBESE WOMEN', 'Research', 'HEALTH SCIENCE', 'The Random group experimental study was designed to find out the effect of  Yogic practices on selected Physiological Variables among Obese Women. It was hypothesized  that there would be significant difference on selected Physiological variables such as Body Mass Index (BMI) and Resting Pulse Rate among Obese Women  due to the influence of Yogic practices than the control group.  To achieve the purpose of the study, 30 Obese (BMI of  30to35) women from Chennai aged between 40 to 50 years were selected randomly. The subjects were divided into one experimental group and a control group of 15 subjects each in a group. Experimental group underwent Yogic practices for the period of 12 weeks six days per week of an hour basically, then slightly increased between 1.15 hours and 1.30 hours. The Control group was not exposed to any specific training but in active rest. The pre-test and post-test were conducted before and after the training for all the groups. The Body Mass Index (BMI) was measured by Weighing machine and Meter Sale and Resting Pulse Rate was measured by BP Monitor machine. The data collected from the subjects were treated statistically through using Analysis of Co-variance (ANCOVA) to determine the significant difference among the groups.  The Hypotheses were tested at 0.05 level of confidence. The results and the conclusions of the study showed that Yogic practices were effective in decreasing significantly Body Mass Index (BMI) and Resting Pulse Rate among Obese Women than the control group.', '1423388497_V._Saraswathy,_TNPESU.docx', '2015-02-08', 'V. Saraswathy,Dr. R. Elangovan', 'satchugane@gmail.com,relangovantnpesu@yahoo.co.in', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1424100485_IJERSS1423388497.pdf', 1, 1, 'IJERSS-2015', 2, 2, 'Volume II - Issue II, February 2015.', 156, 1),
(422, 'IJERSS-1423388641', 'editor@ijerss.com', 'BEVARGE INTAKE AMONG PRE SCHOOL CHILDREN AND ITS EFFECT ON WEIGHT ', 'Research', 'SOCIAL SCIENCE', 'The obesity epidemic in the United States continues to increase. Because obesity tends to track over time, the increase in overweight among young children is of significant concern. A number of eating patterns have been associated with overweight among preschool-aged children. Recently, 100% fruit juice and sweetened fruit drinks have received considerable attention as potential sources of high-energy beverages that could be related to the prevalence of obesity among young children. Our aim was to evaluate the beverage intake among preschool children who participated in the National Health and Nutrition Examination Survey 1999-2002 and investigate associations between types and amounts of beverages consumed and weight status in preschool-aged children', '1423388641_varma.docx', '2015-02-08', 'DR.R.SATISH VARMA,M.KIVITHA,Dr.R.V.L.N Ratnakar Rao', 'sudhakarmande7@gmail.com,sudhakarmande7@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'paper published online', '', 'SOCIAL SCIENCE', '1423895390_IJERSS1423388641.pdf', 1, 1, 'IJERSS-2015', 2, 2, 'Volume II - Issue II, February 2015.', 140, 1),
(423, 'IJERSS-1423482188', 'editor@ijerss.com', 'REJUVENATING THE LIFE FORCE AND MIND', 'Research', 'HEALTH SCIENCE', 'Man lives in consonance with self, society and nature. Humans have body, life-force and mind. Till the life force is active and functional, mind functions. When the life-force gets separated from the body, death occurs and mind ceases to exist.\r\nWe have already learnt about the physical body and its functions. We shall learn more about the â€˜life forceâ€™ and the â€˜mindâ€™.\r\nYoga is preserving harmony between body and life-force; between life-force and mind; between self and society and between self and nature. To preserve harmony between body and life-force blood circulation, heat circulation and air circulation need to function in a pattern with precision. There are simple exercises which can be learnt from a guru to preserve the harmony between body and life-force.\r\nThe next important factor is to learn exercises to rejuvenate the life-force and preserve harmony between the life-force and mind. Letâ€™s learn them and live long.\r\nLife-force particles is also called as fundamental energy particles. When these particles rotate in a whirling speed, waves get formed and they spread in the form of bio magnetic waves. These waves give the required energy to the body. The bio magnetic waves are called mind. These waves rotate in whirling motion. Only when we control the whirling waves mind becomes peaceful. Penance and meditation are required to control the mind\r\n', '1423482188_Rejuvenating_life_force.docx', '2015-02-09', 'Dr. P. Bhasker,Mr. Nagarjuna Sangem', 'nagarjunasangem@gmail.com,nagarjunasangem@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2015', 0, 0, 'New', 0, 0),
(424, 'IJERSS-1423899938', 'editor@ijerss.com', 'EFFECT OF YOGIC PRACTICES ON SELECTED BIO-CHEMICAL VARIABLES AMONG DIABETIC MEN', 'Research', 'HEALTH SCIENCE', 'The present study was designed to find out the effect of Yogic Practices on selected Bio-chemicalvariables among Diabetic Men.It was hypothesized that there would be significant differences in fasting blood sugarand post prandial blood sugar among diabetic men due to the influences of Yogic Practices. To achieve the purpose of the study, 40Diabetic men from Chennai city aged between 30 to 45 years were selected randomly and divided into two groups,one experimental group and one control group of 20 each. Experimental group (A) underwent yogicpractices for the period of 8 weeks, six days per week for the maximum of an hour.The control group was not exposed to any specific training but in active rest. The pre and post-test were conducted before and after the training for the above two groups.Fasting and post prandial blood sugar tested through lab tests. The data pertaining to the variables collected from the two groups before and after the training periods were statistically analyzed by using Analysis of Covariance (ANCOVA) to determine the significant difference and tested at 0.05 level of significance. The results of the study showed thatfasting blood sugar and post prandial blood sugar were significantly reduced due to the influence of eight week training of Yogic Practices than the control group amongdiabetic men. The hypothesis was accepted at 0.05 level of confidence. Yogic group showed significant difference thanthe control groupin reducing fasting blood sugar and post prandial blood sugar amongdiabetic men. Theconclusion is that yogic practices could be beneficial in reducing fasting blood sugar and post prandial blood sugar among Diabetic men', '1423899938_G.RAMAKRISHNAN.docx', '2015-02-14', 'G.Ramakrishnan,DR.R.Elangovan', 'sudhakarmande7@gmail.com,sudhakarmande7@gmail.com', '9030057655', '', '', '', '', 0, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1423900897_IJERSS1423899938.pdf', 1, 1, 'IJERSS-2015', 2, 2, 'Volume II - Issue II, February 2015.', 153, 1),
(427, 'IJERSS-1424413500', 'editor@ijerss.com', 'EFFECT OF YOGIC PRACTICES ON STRESS AND SELF-CONFIDENCE AMONG WOMEN AT MENOPAUSE STAGE', 'Research', 'YOGA & MENOPAUSE', 'EFFECT OF YOGIC PRACTICES ON STRESS AND SELF-CONFIDENCE AMONG WOMEN AT MENOPAUSE STAGE\r\nK.Shabina Yasmin, M.Phil Scholar, Department of Yoga, Tamil Nadu Physical Education and Sports University, Chennai - 600127, Tamil Nadu, India. shabinayasmink@gmail.com Mobile: 9500109189\r\nand\r\nDr.R.Elangovan, Professor & Head, Department of Yoga, Tamil Nadu Physical Education and Sports University, Melakottaiyur. (P.O), Chennai - 600127, Tamil Nadu, India. relangovantnpesu@yahoo.co.in\r\nABSTRACT\r\nINTRODUCTION\r\nâ€˜A regular practice of Yoga and Meditation can help bring back both physical and spiritual balance to women of all stages in life but, especially the per menopausal, menopausal and post-menopausal womanâ€™ ~ subtleyogacharlotte.com\r\nMenopause is an important event in the life of a woman when reproductive capacity ceases. Women at Menopause stage facing many challenges and impediments in life. While some menopausal women experience slight discomfort, majority display severe and multiple symptoms. During this period of climacteric, a variety of symptoms may be experienced, which cause varying amounts of distress. The most common of these are hot flushes, night sweats, vaginal dryness, insomnia, anxiety, depression, fatigue, aches, pains, headache, palpitations, genital, urinary problems, lower in self-confidence and many other impacts that may weaken their personal, social connections and reduce the overall quality of life.\r\nYoga helps promote a balanced development of physical, mental and spiritual being. Yoga reduces the effect certain Psychological fluctuations of menopausal women by balancing the body, mind and soul, and helps to minimize the impact of symptoms that can be unsettling during this time.\r\nPURPOSE OF THE STUDY\r\nï‚§	The purpose of the study was to find out the effect of Yogic practices on selected Stress and Self-Confidence among women at Menopause stage.\r\nHYPOTHESIS\r\nï‚§	It was hypothesized that there would be significant difference due to Yogic practices on Stress and Self-Confidence among women at Menopause stage than the control group.\r\nMETHODOLOGY\r\nï‚§	30 Menopause women were selected randomly from Chennai, between the age group of 40 to 55 years and they were divided into two groups A and B having 15 subjects in each group. Preliminary test was taken for these two Groups (A and B) on the selected dependent variables before the start of the training program. Group A was undergone Yogic practices for daily 1 hour for 5 days per week for a total period of 8 weeks.\r\nï‚§	Group B (Control Group) was permitted to undergo their normal lifestyle during the course of experiment. They didnâ€™t receive any specific Yogic practices training.\r\nï‚§	After the experimental period of 8 weeks, the two Groups (A and B) were retested again on the same selected dependent variables.\r\nï‚§	Stress and Self-Confidence were measured using standard Questionnaire.\r\nï‚§	Analysis of co-variance (ANCOVA) was used to find out the significant difference between experimental group and the control group. The test of significance was fixed at 0.05 level of confidence.\r\nRESULTS AND DISCUSSIONS\r\nï‚§	The results of the study on the selected variables showed that for the Group A, Stress was significantly reduced and Self-Confidence was improved due to the influences of Yogic practices. Hence, the hypothesis was accepted at 0.05 level of confidence. \r\nï‚§	The above findings can also be substantiated by the observations made by renowned experts such as Afonso, Rui Ferreira, et.al., (2012), Movaseghi S, Dadgostar H (2012), Ray, et.al. (2001) and Gupta N (2006).\r\nCONCLUSIONS\r\nï‚§	It was concluded that Stress was significantly reduced and Self-Confidence was improved due to the influences of Yogic practices (Group A) than the control group (B) among Menopausal women.\r\nREFERENCES\r\nï‚§	Lyttleton et.,al (1990), Management of Menopause, Australian J of Yogic practices, PP 5-10\r\nï‚§	Georjana Shames, et. al., (2010), Yogic practices for Menopause Can Help, Shames Health, PP 2\r\nï‚§	Dr. Gigi Shames, et. al., (2014), Ease in to Menopause with Yogic practices, Shames Health, PP 2\r\nï‚§	lyengar B.K.S, et. Al., (2004), â€˜Light on Yogaâ€™, Haper Collins Publishers, India, PP - 488. \r\nï‚§	Geeta S. Iyengar. et. Al., (1998), â€˜Yoga A Gem for Womenâ€™, Allied Publishers, India, PP 42 - 57.\r\nï‚§	Gayathry Nayak, et.al., (2012), â€˜Effect of Yoga Therapy on Physical, Psychological, Biochemical and Other Quality of Life Parameters in Perimenopausal Womenâ€™, PP 1-72\r\nWEBSITES	\r\nï‚§	http://www.menopause.org/\r\nï‚§	http://www.activeYogic practices.com/menopause.aspx\r\nï‚§	www.menopausematters.co.uk\r\nï‚§	http://www.healthline.com/health-slideshow/best-menopause-blogs\r\nï‚§	http://menopausechitchat.com/\r\nï‚§	http://www.menopause.org/\r\nï‚§	http://www.thebms.org.uk/\r\n', '1424413500_FULL_PAPER.docx', '2015-02-20', 'K.Shabina Yasmin,Dr.R.Elangovan', 'K.Shabina Yasmin,Dr.R.Elangovan', '9500109189', 'A1, EDENGARDEN,PROFESSORS COLONY,AIR FORCE ROAD,', 'EAST TAMBARAM, OPP TO SOS VILLAGE,', 'Chennai -59', 'TAMILNADU', 600059, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2015', 0, 0, 'New', 0, 0),
(428, 'IJERSS-1425532556', 'editor@ijerss.com', 'COMPUTER INTERFACED PROGRAM FOR THERMAL CONDUCTIVITY MEASUREMENT OF SOLID CRYSTALS', 'Research', 'PHYSICS', 'A computerized data collection system has been presented for thermal sensing equipment using thermal sensors. The thermal sensors can sense the temperature and can be used to measure thermal conductivity. The designed data collection system does perfect management of data received from different sensors used to find the temperature at different distances. Here the thermal sensing equipment is used to find the thermal conductivity using divided bar method. This system based on data logger system contains microcontroller and ADC(PIC16F882), which communicates with the designed computer interfaced program using RS-232 serial port communication and generates Microsoft Excel CSV file containing all reading of temperature for calculating thermal conductivity', '1425532556_ijerss_Re_paper_1.doc', '2015-03-05', 'S.S.Patil,Dr.P.V.Dalal,Dr.A.S.Zadgaonkar', 'suchit.alpha@gmail.com,suchit.alpha@gmail.com,suchit.alpha@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'COMPUTER SCIENCE', '1426664079_2556.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue III, March 2015.', 230, 1),
(429, 'IJERSS-1425542085', 'editor@ijerss.com', 'COMBINED EFFECTS OF EURYCOMA LONGIFOLIA JACK SUPPLEMENTATION AND A CIRCUIT TRAINING PROGRAMME ON BONE METABOLISM MARKERS, MUSCULAR STRENGTH AND POWER, AND IMMUNE FUNCTIONS IN ADULT MEN', 'Research', 'Sports Science', 'Although combination of physical activity with supplementation has being investigated on its effects in maintaining and enhancing bone health, muscular strength and immune functions, little is known about the effectiveness of combination of Eurycoma longifolia Jack supplementation and a circuit training programme on bone metabolism markers, muscular strength and power, and immune functions in adult men. This study investigated the combined effects of 8 weeks Eurycoma longifolia Jack supplementation and circuit training programme on bone metabolism markers, muscular strength and power, and immune functions in adult men. Forty adult male subjects (mean age:46.80Â±5.52 years), were age matched and subsequently assigned into four groups with n=10 per group: Control group with placebo supplementation (C), Eurycoma longifolia Jack supplementation group (ElJ), circuit training programme group with placebo (Ex), and combined circuit training programme with Eurycoma longifolia Jack group (ElJEx). Circuit training programme consisted of 2 circuits of exercise, with 10 different exercise stations per circuit, three times per week for a total of 8 weeks. Subjects in C and Ex group consumed placebo, subjects in ElJ and ElJEx groups consumed Eurycoma longifolia Jack, 7 days/week for 8 weeks. Before and after 8 weeks of experimental period, subjectsâ€™ anthropometry, muscular strength and power were measured. Blood samples were taken to determine bone metabolism markers and immune functions. ElJEx could increase knee extension peak torque at 60o.s-1, shoulder flexion average power at 300o.s-1 and shoulder extension average power at 300o.s-1. Meanwhile, Ex alone could only increase shoulder extension average power at 300o.s-1. These results suggested that combination of circuit training with Eurycoma longifolia Jack (ElJEx) elicited more beneficial effect on muscular strength and power than circuit training alone (Ex). Regarding bone metabolism markers and immune function parameters, ElJEx, Ex and ElJ did not elicit positive effects on these measured parameters after 8 weeks of experimental period. Combined Eurycoma longifolia Jack supplementation with circuit training programme has potential to be proposed for formulating guidelines in planning exercise and nutritional promotion programmes for the enhancement of muscular strength and power in adult men.', '1425542085_Ooi_et_al_ELJ_and_Exercise_(IJERSS)5.3.2015(Latest_for_submission).doc', '2015-03-05', 'Foong Kiew Ooi, Mohamed Husna Afifah, Chee Keong Chen, Asari Mohd Asnizam', 'fkooi@usm.my,husnadeq@yahoo.com,ckchen@usm.my,asnizam@usm.my', '+609-7676931', 'Sports Science Unit, School of Medical Sciences,', 'Universiti Sains Malaysia', 'Kubang Kerian', 'Kelantan', 16150, 'MY', 'Pending', NULL, 'SPORTS SCIENCE', '1426424104_IJERSS1425542085.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue III, March 2015.', 302, 1),
(430, 'IJERSS-1425578234', 'editor@ijerss.com', 'A COMPARATIVE STUDY OF PHYSIOLOGICAL PARAMETERS OF SPORTS PERSON AND NON-SPORTS PERSONS STUDYING IN SENIOR SECONDARY SCHOOLS OF UTTAR PRADESH STATE IN INDIA', 'Research', 'SPORTS SCIENCE', 'The main purpose of this study was to study the Anthropometric Measurements of Sports Persons and Non-Sports Persons studying in Senior Secondary Schools of Uttar Pradesh State. It was hypothesized that there would be significant difference in the Physiological Parameters of Sports and Non-Sports Students of Secondary School of Uttar Pradesh State. The total number of Sports and Non-sports Students were 3120 i.e. 1560 Sports and 1560 Non-sports students were selected for study. The researcher was used valid and difference types of tools to measure the Physiological Parameters of Sports Person and Non-Sports Persons. The data for the present study will was collected on the score sheets to be prepared for this purpose. After collection the data was treated by appropriate statistical techniques. From the table & Figure it is seen that the Physiological Level of sports persons of Haryana Schools are more than the Non-Sports persons. There were significant differences for this group. There was significant \r\ndifference for the group. There was significance difference in the Physiological Parameters of Sports Person and Non-Sports Persons.', '1425578234_Ashwani_Research_IJERSS.doc', '2015-03-05', 'Ashwani Kumar,Satyendra Kumar Singh,Vimal Singh', 'ashwani28.2010@rediffmail.com,ashwani28.2010@rediffmail.com,ashwani28.2010@rediffmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2015', 0, 0, 'New', 0, 0),
(431, 'IJERSS-1425716567', 'editor@ijerss.com', 'PERFORMANCE IMPROVEMENTS OF UPGROWTH ALGORITHM USING TOP-K HIGH UTILITY ITEMSET MINING', 'Research', 'Data Mining', '', '1425716567_Performance_Improvements_of_UPGrowth_Algorithm_using_TOP.docx', '2015-03-07', 'Patil Ramkrishna Hari,Sandip S. Patil', 'rama.patil2006@gmail.com,sspatiljalgaon@gmail.com', '9890813065', '360, Patil-Badhe wada, Hingone', 'Taluka:- Yawal, Dist:- Jalgaon', 'Hingone', 'Maharashtra', 425503, 'IN', 'Pending', NULL, 'COMPUTER SCIENCE', '1427126227_3Performance_Improvements_of_UPGrowth_Algorithm_using_TOP.pdf', 1, 1, 'IJERSS-2015', 2, 3, 'Volume II - Issue III, March 2015.', 208, 1),
(432, 'IJERSS-1425886924', 'editor@ijerss.com', 'GREEN MARKETING TANGLED IN OBSCURITY', 'Research', 'Green Marketing Tangled in Obscurity', 'Temptation to go green has many roadblocks. Urge for saving environment seems to be good idea but it is hard to convert it into sales. There is no clear idea regarding behaviour of green consumers. Recent failures in green marketing realm have alarmed marketers and now they are hesitating in implementing green marketing. Most of the green marketing techniques which have been developed for the western markets have failed. Simple customization is not the solution. Innovation in green marketing for Indian consumers is the need for hour. There is need for extensive research on Indian consumersâ€™ green behavior. Green Marketing in India is still at the infancy stage. Development of Green Marketing in India requires development in consumer behavior research. The attitude of the green consumers, towards green products and services need to be understood. Preparing marketing campaign on the assumption that people who are worried about the environment will purchase the product may result into a disaster. Even western consumers have disappointed green marketers. There is lot of talk about green marketing going around but everything is in obscurity. There is no obvious formula to convert the concern of the consumers into marketing success. It is less expensive and more beneficial to have marketing programme consistent with attitudes. The better understanding of consumer will lead to formulation of green marketing techniques which are relevant to Indian context.\r\n', '1425886924_Green_Marketing_Tangled_in_Obscurity.docx', '2015-03-09', 'Priykant Hiralal Raval', 'rpriykant@gmail.com', '7600909406', 'AT. PO. TALUKA VIJAYNAGAR', 'DISTRICT : SABARKANTHA', 'VIJAYNAGAR', 'GUJARAT', 383460, 'IN', 'Pending', NULL, 'ENVIRONMENT SCIENCE', '1426425153_IJERSS1425886924.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue III, March 2015.', 190, 1),
(433, 'IJERSS-1425951778', 'editor@ijerss.com', 'EFFECT OF YOGASANA ON SELECTED PHYSICAL FITNESS VARIABLES ', 'Research', 'HEALTH SCIENCE', 'The purpose of the study was to find out the effect of yogasana on selected physical fitness variables such as strength endurance and flexibility. To achieve this purpose of the study 30 men students studying in the Department of Physical Education were randomly selected as subjects.  They were divided into two equal groups.  Each group consisted of the fifteen subjects.  Group I underwent yogasana for three days per week for twelve weeks.  Group II acted as control that did not undergo any special training programme apart from their regular physical education programme. The following variables namely strength endurance and flexibility were selected as criterion variables.  All the subjects of two groups were tested on selected dependent variables at prior to and immediately after the training programme. The Analysis of Covariance was used to analyze the significant difference, if any among the groups. The .05 level of confidence was fixed as the level of significance to test the â€˜Fâ€™ ratio obtained by the analysis of covariance, which was considered as an appropriate. The results of the study showed that there was a significant difference yogasana group and control group on selected criterion variables such as strength endurance and flexibility. And also it was found that there was a significant improvement on selected criterion variables due to yogasana. ', '1425951778_Dr_Gulne.doc', '2015-03-10', 'Dr. Vivek P Gulane,Sanoj Kumar Sharma', 'ashwani28.2010@rediffmail.com,ashwani28.2010@rediffmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2015', 0, 0, 'New', 0, 0),
(434, 'IJERSS-1426007901', 'editor@ijerss.com', 'BIOSYNTHESIS OF SILVER NANOPARTICLES USING ASPERGILLUS FLAVUS', 'Research', 'Physics ', 'Silver Nanoparticles preparation and its X-ray diffraction studies are reported in this paper. Biosynthesis in using of fungus Aspergillus flavus is simple eco-friendly and cheapest process for its preparation. Silver Nanoparticles have been prepared from aqueous silver nitrate solution.  Biosynthesis of silver nanoparticles in aerobic conditions by yeast, fungus Aspergillus flavus is reported in the present study. An absorption peak at 420 nm in UV-visible spectrum corresponds to the Plasmon resonance of silver nanoparticles. The samples have been characterized by X-ray diffraction. The results confirmed silver nanoparticles with size below 50 nm. \r\n\r\n', '1426007901_X.docx', '2015-03-10', 'H. B. Patil', 'h.patil7@gmail.com', '09421524805', '23. vidyavihar colony shirpur', '', 'Shirpur', 'maharashtra', 425405, 'IN', 'Paper available online', '', 'PHYSICS', '1426401701_IJERSS1426007901.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue III, March 2015.', 272, 1),
(435, 'IJERSS-1426681325', 'editor@ijerss.com', 'EFFECTS OF SELECTED YOGASANA AND PRANAYAMA PRACTICE ON PHYSICAL CAPABILITIES OF MALE ADOLESCENTS', 'Research', 'Health and Fitness', 'The purpose of the present investigation was to elicit the effects of Yogasana and Pranayama practice on physical and physiological parameters of male adolescents. The Subjects for the study were adolescent boys studying between 13 to 16 years. Total 80 Subjects studying at a private school were selected through simple random sampling technique for the present investigation. 40 subjects each were placed in treatment as well as control group. All the subjects selected for this study were tested twice prior to treatment (pre-test) and at the conclusion of treatment (post-test) with a time gap of 24 weeks. Selected physical capability parameters and testing tools were used in the present investigation. Treatment in the form of selected yogic asana along with pranayama was given to selected subjects in the specified treatment group. Twenty four weeks of training included systematic yogasana and pranayama training for six days in a week. In order to examine the hypothesis of the study analysis of variance (ANOVA) statistical technique was used. There were significant differences in pre and post test scores of experimental group and such a difference was not found in control group. In case of relative shoulder strength, abdominal strength, normal chest circumference and expanded chest circumference although there were significant differences in pre and post test scores of experimental group, significant differences were also observed in control group results. On the basis of the results obtained from the present investigation it is concluded that twenty four week yogasana training improves physical capabilities including leg strength and flexibility in adolescent boys. Hence, yoga should be practiced regularly to improve physical dimension of the health.', '1426681325_FINAL_Ramesh,_Madialagan,_Gajanan,_Manjula.doc', '2015-03-18', 'Mr. Ramesh H Kittur,Dr. Madialagan,Dr. Gajanana Prabhu B.,Dr.Manjula B Karlwad', 'ramyogish@gmail.com,madhialaganshanmugam@gmail.com,prabhuiji888@gmail.com,manjula-karlwad@yahoo.com', '9483289262', 'Ramesh H Kittur, Research Scholar', 'DOS in Physical Education, University of Mysore,', 'Mysore', 'Karnataka', 570005, 'IN', 'Pending', NULL, 'PHYSICAL SCIENCE', '1429433743_IJERSS1426681325.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue IV, April 2015.', 169, 1),
(436, 'IJERSS-1426686421', 'editor@ijerss.com', 'COMPARISON OF THE SKILL RELATED PHYSICAL FITNESS SELECTIVE VARIBLES IN STATE LEVEL WRESTLERS AND JUDO PLAYERS', 'Research', 'Sports', 'The purpose of the study was to find out the selected physical fitness among wrestlers and judo players. Fifteen students were selected from the state level wrestlers and state level judo players from Kerala region were selected as subjects. Standardized testing procedure was applied to measure speed, explosive power. Speed was measured by 50 yard dash test recorded in seconds; explosive strength was measured by vertical jump recorded in centimeters. â€˜tâ€™ test was applied. Wrestlers have better performance than the judo players on speed and explosive power', '1426686421_paper_2.docx', '2015-03-18', 'Yadu chand. s,Dr. A. Praveen', 'yaduiverson23@gmail.com,praveencjis@gmail.com', '07598142659,  ', 'Room no : 34, ilango adigal hostel, ', 'Pondicherruy university, Pondicherry', 'Pondicherry', 'Pondicherry', 605014, 'IN', 'Pending', '', 'SPORTS SCIENCE', '1428926412_IJERSS1426686421.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue IV, April 2015.', 134, 1);
