(437, 'IJERSS-1426808019', 'editor@ijerss.com', 'EFFECTS OF YOGIC PRACTICES ON BODY MASS INDEX AND BODY FAT AMONG OBESE WOMEN', 'Research', 'HEALTH SCIENCE', 'The purpose of the random experimental study was to find out the effect of yogic practices on body mass index (BMI) and percentage of body fat among obese women. It was hypothesized that yogic practices would significantly decrease BMI and percentage of body fat among obese women in comparison to the control group. In this study, forty (40) subjects of obese women were randomly selected from Mogappair (Chennai). Subjects were divided into two groups as yoga and control group, twenty (20) in each group. The yogic intervention consisted of 50-60 min/day, six days in a week for twelve weeks. BMI and percentage of body fat testing were done on the both group at zero time and after twelve weeks of yogic intervention in yoga group and control group which was in active rest. The data was subjected to the dependent â€˜tâ€™ test. In present study, BMI (p<0.05) and percentage of body fat (p<0.05) were significantly decreased in yoga group than the control group. Regular yogic practices resulted beneficial health improvement in obese women by decreasing BMI and percentage of body fat. ', '1426808019_malarvizhi_manuscript_IJERSS_20315.doc', '2015-03-20', 'Malarvizhi. V,Dr. R. Elangovan ', 'malarvizhiyoga@gmail.com  ,relangovantnpesu@yahoo.in ', '91-9443121920 ', 'Malarvizhi.V, C/O V. Muthamizhchelvan', '146, KH Road, Ayanavaram, cell: 91-9791008822', 'Chennai', 'Tamil Nadu', 600023, 'IN', 'Pending', '', 'PHYSICAL SCIENCE', '1428994461_Corrected_IJERSS1426808019.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue IV, April 2015.', 172, 1),
(438, 'IJERSS-1427095457', 'editor@ijerss.com', 'A COMPARATIVE STUDY OF PHYSIOLOGICAL PARAMETERS OF SPORTS PERSON AND NON-SPORTS PERSONS STUDYING IN SENIOR SECONDARY SCHOOLS OF UTTAR PRADESH STATE IN INDIA', 'Research', 'SPORTS SCIENCE', '   The main purpose of this study was to study the Anthropometric Measurements of Sports Persons and Non-Sports Persons studying in Senior Secondary Schools of Uttar Pradesh State. It was hypothesized that there would be significant difference in the Physiological Parameters of Sports and Non-Sports Students of Secondary School of Uttar Pradesh State. The total number of Sports and Non-sports Students were 3120 i.e. 1560 Sports and 1560 Non-sports students were selected for study. The researcher was used valid and difference types of tools to measure the Physiological Parameters of Sports Person and Non-Sports Persons. The data for the present study will was collected on the score sheets to be prepared for this purpose. After collection the data was treated by appropriate statistical techniques. From the table & Figure it is seen that the Physiological Level of sports persons of Haryana Schools are more than the Non-Sports persons. There were significant differences for this group. There was significant difference for the group. There was significance difference in the Physiological Parameters of Sports Person and Non-Sports Persons.', '1427095457_Ashwani_Research_IJERSS.doc', '2015-03-23', 'Ashwani Kumar,Satyendra Kumar Singh,Vimal Singh', 'ashwani28.2010@rediffmail.com,ashwani28.2010@rediffmail.com,ashwani28.2010@rediffmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'PHYSICAL SCIENCE', '1428975870_IJERSS1427095457.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue IV, April 2015.', 178, 1),
(439, 'IJERSS-1427266715', 'editor@ijerss.com', 'A COMPARATIVE STUDY OF SKIN FOLD MEASUREMENT OF BOXING AND JUDO FEMALE PLAYERS OF SIRSA DISTRICT ', 'Research', 'RESEARCH PAPER/COMPARATIVE STUDY', 'Abstract\r\nIn the present study, an attempt has been made to compare the Kinathropometric measurements of Boxing and Judo female players. The study was carried out on 50 players (25 Boxing and 25 Judo female players). The age of the selected subjects ranged from 18 to 27 years. Only Sirsa district was selected for the study. To compare the skinfold measurements such as lean body mass and Body fat weight was selected for the study. The, â€œLange skin fold caliper was used to measure various skin folds. The data was used to analyze by t-test.\r\nKeywords: Boxing, Judo, Anthropometry, lean body mass, Body Fat Weight, Female, abdominal, Triceps, Sirsa District.\r\n', '1427266715_for_ijerrs.docx', '2015-03-25', 'tarshem sharma,naveen kumar', 'sharmatarshem@gmail.com', '9813068106', 'TARSHEM SHARMA S/O SHRI SATYANARAYAN', 'h.no-158/19,gali no-4b hanuman nagar, narwana', 'NARWANA', 'haryana', 126116, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1428929178_IJERSS1427266715.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue IV, April 2015.', 160, 1),
(440, 'IJERSS-1427479407', 'editor@ijerss.com', 'AUTOMATIC DOCKING SYSTEM FOR RECHARGING DEFENCE AND SURVEILLANCE ROBOTS', 'Research', 'Automatic Docking System For Recharging Defence And surveillance Robots', 'This project is the development and characterization of a surveillance robot with automatic docking and recharging capabilities for home security. In this system consists of two sections Warfield section and the control room section. the former section consists of Passive IR motion detectors are usually designed to provide an indication\r\nto an alarm panel in response to detecting IR that is indicative of motion of the object. The alarm panel is responsive to receipt of the breach indication to cause an alarm condition to occur. When a person or motor Vehicle enters a monitored area, PIR motion detectors are commonly used in conjunction with different parts of the war field. When someone enters secured place, immediately it will send an indication to the control room section through wireless communication. This is indicated to the control room through an alarm. Therefore alert is given to the host section. At the same time camera will capture images at the host place and save into the computer. When the security personnel in the supervisory room gets an alarm indication in the host section, he can view all the\r\ninformation of the Warfield section(including images) by PC\r\nthrough wireless LAN. Thus they can combat opponents. The\r\nrobot can return to the docking station for recharging\r\noperations when the on-board battery is too low.', '1427479407_Automatic_Docking_System_For_Recharging_Defence_And_surveillance_Robots.pdf', '2015-03-27', 'KUMBAM HARSHA VARDHAN REDDY,MRS.S.HANNAH PAULINE', 'harish09450@gmail.com,hannahpauline.s.@ktr.srmuniv.ac,teja.senapathi@gmail.com', '8050468310', 'Plot No.G-4,C-Block, Anand Apartments', ' Near Urappakkam Railway Station, Urappakkam', 'chennai', 'Tamil Nadu', 603203, 'IN', 'Pending', NULL, 'ELECTRONICS', '1428929685_Automatic_Docking_System_For_Recharging_Defence_And_surveillance_Robots.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue IV, April 2015.', 178, 1),
(443, 'IJERSS-1427536133', 'editor@ijerss.com', 'IMPLEMENTATION OF PROCESS SCHEDULING STRATEGIES OF OPERATING SYSTEMS USING FPGA', 'Research', 'ELECTRONICS', 'FPGA-based hardware implementation of multitasking strategies provide high-performance computing that rival ASICs for performance yet provide programmability and ease of development closer to traditional software systems.  Because of their usefulness, such systems are high in demand and have limited availability. Multitasking can be used to increase the utilization of reconfigurable FPGAs. In this proposed system a flexible and up-gradable architecture is provided for using the commercially available reconfigurable FPGAâ€™S. In this system different Multi Tasking Strategies are implemented using VHDL on FPGA. Because it can take advantage of an application parallelism, by using methods to context switch reconfigurable computing resources, multitasking reconfigurable computing systems can be constructed that provide most of the features available in traditional reconfigurable computers. This report describes methods to context switch the resources of a reconfigurable computers, as well as a prototype multitasking reconfigurable FPGA that has been created', '1427536133_sagar_paper.doc', '2015-03-28', 'Mr.Sagar.D,Prof.A.S.Mali', 'bhopalesagar11@gmail.com,asmali@tkietwarana.org', '9090909090', '', '', '', '', 0, 'IN', 'Payment pending', '', '', NULL, 1, 0, 'IJERSS-2015', 0, 0, 'Volume II - Issue IV, April 2015.', 0, 1),
(444, 'IJERSS-1427733352', 'editor@ijerss.com', 'Smart Illumination Cum Communication via Li-Fi with Power-line Cables using  Raspberry Pi', 'Research', 'LIGHT FIDELITY & EMBEDDED SYSTEMS', 'This paper presents an application to transfer information from one system to another system through LED. This design of system is accomplished using a raspberry pi microcontroller as a system of on chip, along with a Li-Fi transmitter, Li-Fi receiver and LED panel can be used as a communication source by modulating the LED light with the data signal. In order to transfer information from one system to another system we use LED to transmit signals and photo detector to receive signals. The main purpose of design of this particular system is to transmit information under security basis. The light waves cannot penetrate walls which makes a much shorter range, though more secure from hacking, relative to Wi-Fi.', '1427733352_Smart_Illumination_Cum_Communication_via_LiFi_with_Powerline_Cables_using_Raspberry_Pi.do', '2015-03-30', 'GOTTAM HEMANTH REDDY,R.MANOHARI', 'hemanthg2012@gmail.com,manohari.r@ktr.srmuniv.ac.in', '8122181521', 'MIG-1,H.NO-29', '9TH PHASE, K.P.H.B COLONY, KUKATPALLY', 'HYDERABAD', 'TELANGANA', 500072, 'IN', 'Payment pending', '', '', NULL, 1, 0, 'IJERSS-2015', 0, 0, 'Volume II - Issue IV, April 2015.', 0, 0),
(445, 'IJERSS-1427796228', 'kpprashobhith@gmail.com', 'A STUDY ON EMOTIONAL MATURITY BETWEEN SPORTSPERSONS AND NON SPORTSPERSONS OF KANNUR UNIVERSITY', 'Research', 'SPORTS SCIENCE', '                                                                                          \r\n                                                                                              Abstract\r\n\r\nThe purpose of the study was to compare the different dimensions of emotional maturity between sports persons and non-sportspersons of Kannur University. The study was delimited to 30 Sports persons and 30 nonsportspersons from different colleges of Kannur University. Emotional maturity was assessed by Emotional Maturity Scale (EMS) by Yashvir Singh and Mahesh Bhargava Sample. Thirty male sportspersons and 30 male non-sportspersons were selected for the study. Statistical technique used was t-test and the Emotional Maturity Dimensions were Emotional Instability, Emotional Regression, Social Maladjustment, Personality Disintegration and Lack of independence.\r\n\r\nKey Words- Emotional Instability (EI), Emotional Regression(ER), Social Maladjustment(SM), Personality Disintegration (PD) and Lack of Independence (LI)', '1427796228_RESEARCH_PAPER_BY_JINO_SEBASTIAN.docx', '2015-03-31', 'JINO SEBASTIAN', 'jinobrennen@gmail.com', '09447462945', 'KUMPLAMTHANATHU(H)', 'NEAR VELLOZHUKKU', 'PALAYAD POST', 'KERALA', 670661, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1432179126_IJERSS1427796228.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue V, May 2015.', 186, 1),
(446, 'IJERSS-1427809258', 'editor@ijerss.com', 'SIMULATION OF SPWM CONTROLLED CONVERTER', 'Research', 'Electrical engineering power electronics', 'Abstract â€“ Voltage source converter based power systems have the ability to rapidly control the transmitted active power and also to independently exchange reactive power with transmission system. Thus, VSC with suitable control scheme can offer an alternative means to enhance transient stability, to improve power oscillation damping ,and to provide voltage support. The proposed voltage sourced converter (VSC) with pulse width modulation (PWM) provides a faster control that is required in power system. VSCs are one of the most used power converters in distributed generator application as such it can operate either as inverter or as rectifier. The study of VSC and related principles as well as PWM method for controlling the power switches is carried out. MOSFET/IGBT can be invariably used as switches. The simulation of VSC is carried out in MATLAB/SIMULINK and PROTEUS. The results of which shows improvement in performance of transmission lines.', '1427809258_SPWM_CONTROLLED_CONVERTER.docx', '2015-03-31', 'Swapnil Shah,Siddharth Shah,Dharmnedra chauhan', 'shahswapnil9033@gmail.com,siddharth.shah1113@gmail.com,dharmendra_bhagatsingh@yahoo.in', '9033256738', 'G-33 Pritam nagar society', 'Waghodia road', 'Vadodara', 'Gujarat', 390019, 'IN', 'Payment pending', '', '', NULL, 1, 0, 'IJERSS-2015', 0, 0, 'Volume II - Issue IV, April 2015.', 0, 0),
(447, 'IJERSS-1427905897', 'editor@ijerss.com', 'DATA PLACEMENT STRATEGY FOR UNBALANCED NODE WORKLOAD PROBLEM IN HADOOP', 'Research', 'DATA PLACEMENT STRATEGY FOR UNBALANCED NODE WORKLOAD PROBLEM IN HADOOP', 'Hadoop is an open source implementation of\r\nthe MapReduce model, and is usually used for dataintensive\r\napplications such as data mining and web\r\nindexing. The current Hadoop implementation assumes\r\nthat every node in a cluster has the same computing\r\ncapacity and that the tasks are data local, which may\r\nincrease extra overhead and reduce MapReduce\r\nperformance. This paper proposes a data placement\r\nalgorithm to resolve the unbalanced node workload\r\nproblem. The proposed method can dynamically adapt\r\nand balance data stored in each node based on the\r\ncomputing capacity of each node in a heterogeneous\r\nHadoop cluster. The proposed method can reduce data\r\ntransfer time to achieve improved Hadoop performance.', '1427905897_final.docx', '2015-04-01', 'KASALA BALAJI TEJ KUMAR,NIMALA.K', 'balaji.643@gmail.com,padmasudha2@gmail.com', '7416874872', 'urapakam', 'chennai', 'chennai', 'Tamil Nadu', 603203, 'IN', 'Pending', NULL, 'INFORMATION TECHNOLOGY', '1429118705_IJERSS1427905897.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue IV, April 2015.', 436, 1),
(448, 'IJERSS-1428081449', 'editor@ijerss.com', 'Raspbery Pi Vehicle with Stereo Vision', 'Review', 'Embedded Sytems with Image processing', 'This Project presents an approach to stereovision applied to vehicles. By using a small low cost computer and inexpensive off the shelf components, we were able to develop an autonomous driving system capable of following other vehicle and moving along paths delimited by colored blobs. Pair of webcams was used and are able to implement a basic frontal obstacle avoidance system. With the help of the stereoscopic system, we inferred the position of specific objects that serve as references to the Vehicle. The final system is capable of identifying and following targets in a distance of over 5 meters. Stereo vision deals with two images. The two images captured with a distance between the two cameras called Disparity. Disparity means Difference. Disparity map is a measurement of difference between two things (Images).\r\nThe Model B Raspberry PI is a 3.5W, computer with a 700 MHz ARM1176JZF-S processor and multiple I/O interfaces. The two webcams mounted in this assembly use the two available USB ports and the motors are connected to the General Purpose Input/output pins. We use Open CV Libraries to process Images. \r\n', '1428081449_ijerss.doc', '2015-04-03', 'Senapathi Teja,R Manohari', 'teja.senapathi@gmail.com,manohari.r@ktr.srmuniv.ac.in', '8939145383', 'S2, A-Block, Anand Apartments', 'Urrapakkam', 'Chennai', 'Tamil Nadu', 603211, 'IN', 'Payment pending', '', '', NULL, 1, 0, 'IJERSS-2015', 0, 0, 'Volume II - Issue IV, April 2015.', 0, 0),
(449, 'IJERSS-1428157247', 'editor@ijerss.com', 'PERFORMANCE ENHANCEMENT FOR ACCESSING SMALL-FILES IN HADOOP', 'Research', 'Big Data (Hadoop)', 'Abstract: Nowadays, the use of internet grows, so user wish to store data on cloud computing platform. Mostly the  userâ€™s data are small files .The Hadoop Distributed File System (HDFS) is an open source system which is designed to run on commodity hardware and is suitable for applications that have large data sets (terabytes). As HDFS architecture based on single master (NameNode) to handle metadata management for multiple slaves (DataNode), NameNode often becomes bottleneck, especially storing and managing a large number of small files as  result huge burden comes on the NameNode while handling large number of small files . To maximize efficiency, NameNode stores the entire metadata of HDFS in its main memory. With too many small files, NameNode can be running out of memory. In this paper, we propose a mechanism based on Hadoop Archive(HAR),called New Hadoop Archive (NHAR),to improve the memory utilization for metadata and enhance the efficiency of accessing small files in HDFS. In addition, we also extend HAR capabilities to allow additional files to be inserted into the existing archive files.', '1428157247_varun.pdf', '2015-04-04', 'varunpal,Mrs. D.Hemavathi', ' palvarun4@gmail.com,varunpal_krishnan@srmuniv.edu.in', '9418528590', 'flat no-43, Narshima Nagar', 'Near thialavaram', 'Chennai', 'Timal Nadu', 603203, 'IN', 'Pending', NULL, 'INFORMATION TECHNOLOGY', '1429120093_IJERSS1428157247.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue IV, April 2015.', 246, 1),
(450, 'IJERSS-1428158101', 'editor@ijerss.com', 'DESIGN AND IMPLEMENTATION FOR MONITORING AND FAULT DIAGNOSIS IN WIND TURBINE USING ARM CONTROLLER AND CAN BUS SYSTEM', 'Research', 'To prevent the Wind turbine from certain criteria', 'This paper is a CAN based architecture designed for the purpose of monitoring and fault diagnosis of wind turbine. In this project we declare the system with ARM and CAN protocol to monitor and diagnose the problems in the wind turbine application. The project deals with the data transmission between two units in the exact time without any disturbance. The data transmission time is increased with the CAN protocol. ARM core1 runs with CAN and LPC2148 as wind turbine unit to which sensors are connected and ARM core2 as Fault diagnose and monitoring section. A discussion about weather condition (WC) monitoring and generation voltage (GV) display is also added in this design. Data acquisition node collects the sensor data through CAN protocol. The basic view of this technique is to reduce the possibility of fault diagnosis and increase the monitoring of wind turbine.', '1428158101_DESIGN_AND_IMPLEMENTATION_FOR_MONITORING_AND_FAULT_DIAGNOSIS_IN_WIND_TURBINE_USING_ARM_CO', '2015-04-04', 'DINESH T', 'dineshtnathan323@hotmail.com', '9790650908', '79,Chinna durai st,', 'periyar Nagar', 'Kanchipuram', 'Tamil Nadu', 631501, 'IN', 'Payment pending', '', '', NULL, 1, 0, 'IJERSS-2015', 0, 0, 'Volume II - Issue IV, April 2015.', 0, 0),
(451, 'IJERSS-1428209037', 'editor@ijerss.com', 'EFFECTS OF 12-WEEK ON-FIELD COMBINED STRENGTH AND POWER TRAINING ON PHYSICAL PERFORMANCE AMONG U-14 VOLLEYBALL PLAYERS', 'Research', 'TRAINING METHODS,ON-FIELD COMBINED STRENGTH AND POWER TRAINING ', 'The current research is designed to find out the 12 week on field combined (strength & power) training applied among school level volleyball players. Study focused on speed, power (Horizontal & vertical), abdominal and Shoulder Muscular Endurance. Twenty four young Un- 14 school volleyball players ([mean Â± SD] age: 13 Â± 0.8 years, weight 47.4 Â± 4.6 kg, height 155.5 Â± 11.1 cm) volunteered to participate in this study. After the 1-week familiarization phase, the subjects were divided into 2 groups: Combined Strength and Plyometric Training Group (CSPT, n=12) and Control Group (CG, n=12).   The pre test and post test randomized control group design was used as an experimental design. Selected criterion variables were statistically analyzed with paired sampleâ€˜tâ€™ test to find out significant improvement between pre and post test means of experimental and control groups and analysis of covariance (ANCOVA) was used to find out significant difference between experimental and control groups. In all the cases 0.05 level of confidence was fixed to test the hypothesis. The results of this study illustrates that the field style (own body) combined strength and power training program increases 50 mts speed, explosive power both vertical and horizontal jumping, abdominal strength and shoulder muscular endurance production is significantly more. It is propose that combined strength and power training will be an important training tool to increasing performance in volleyball and other field sports.\r\nKEYWORD: Combined Training (Strength & Power), field type work out, speed, power, strength and endurance, school volleyball players.\r\n', '1428209037_FINAL.docx', '2015-04-05', 'T.VINOTH,Dr.A.S.NAGESWARAN', 'arachyvinoth@gmail.com,asnageswaran@gmail.com', '9600271509', 'T.VINOYH,S/O S.THANGARAJU, 2/47,ARAICHI PO', 'THATHIANGAR PET  (Via),  MUSIRI TK', 'THIRUCHIRAPALLI', 'TAMILNADU', 621214, 'IN', 'Pending', NULL, 'PHYSICAL SCIENCE', '1428932093_IJERSS1428209037.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue IV, April 2015.', 227, 1),
(452, 'IJERSS-1428258385', 'editor@ijerss.com', 'ENVIRONMENT MONITORING SYSTEM BASED ON WIRELESS SENSOR NETWORKS USING OPEN SOURCE HARDWARE', 'Others', 'wireless sensor networks', 'Now-a-days air pollution is increasing rapidly due to growing cities, industrialization and higher levels of energy consumption leading to global warming and acid rains. To avoid such affects an efficient environment monitoring system is necessary. In this paper, we implement an online environment monitoring system based on wireless sensor network using X-bee and open source hardware platforms, arduino and Raspberry pi.', '1428258385_Updated.doc', '2015-04-05', 'Venkatesh Neelapala, Dr. S. Malarvizhi', 'neelapalavenkatesh@gmail.com', '9840966900', 's2, a-block, anand apartments, ', 'near urapakkam railway station, urapakkam', 'chennai', 'tamil nadu', 603210, 'IN', 'Paper available online', '', 'ELECTRONICS', '1429680528_IJERSS1428258385.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue IV, April 2015.', 344, 1),
(453, 'IJERSS-1428382125', 'editor@ijerss.com', 'CONSTRUCTION OF NORMS FOR SPEED FOR 10 TO 12 YEARS BOYS AND GIRLS PROBABLES ', 'Research', 'Physical Education and Sports Sciences', 'ABSTRACT\r\n	The purpose of the study was to construct norms for speed for 10 to 12 years boys and girls of Track and Field Probables. A sample of 3075 students was taken during coaching camp. Totally 3075 probables 2287 boys and 788 girls served as subjects. The speed performance data of subjects in athletics was collected. Norms were constructed for speed with three normative scales such as percentile, Hull, Sigma and T scale and standard for evaluation of probables also established under normal distribution.\r\nKeywords: Construction, Norms, Speed, Probables  \r\n', '1428382125_ARTICLE_VASANTHKUMAR2.doc', '2015-04-07', 'Vasantha Kumar, Dr. Kishore Kumar C.K', 'hnavanku@gmail.com,ckkkumar@yahoo.com ', '9448039171', 'Vasanth Kumar, Research Scholar', 'Dept. of Physical Education, Mangalore Univeristy', 'Konaje Mangalor', 'Kannataka', 574199, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1429434463_IJERSS1428382125.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue IV, April 2015.', 149, 1),
(454, 'IJERSS-1428388963', 'editor@ijerss.com', 'EFFECT OF YOGIC PRACTICES ON SELECTED PHYSIOLOGICAL VARIABLES AMONG MIDDLE AGED DIABETIC MEN', 'Research', 'HEALTH SCIENCE', 'The purpose of this Random group experimental study was to find out the effect of yogic practices on selected physiological variables among middle aged diabetic men. It was hypothesized that there would be significant differences on selected physiological variables such as heart rate and blood pressure among middle aged diabetic men due to the influence of yogic practices than the control group. To achieve the purpose of the study, 40 diabetic men were selected at random from Chennai as subjects and their age was ranged between 40 to 50 years. The subjects were divided into two groups. Yogic practice group had 20 members and Control group had 20 members. The subjects of the control group were kept in active rest. In this random group experimental design, the subjects of yogic practice group were given experimentation for the period of twelve weeks, six days a week, an hour approximately daily. The control group was not exposed to any specific training. After the experimental period of twelve weeks, post test scores were obtained from the two groups. The data collected from the subjects both from post and pre tests were treated statistically through using Analysis of Co-variance (ANCOVA) to determine the significant difference. The hypothesis was tested at 0.05 level of confidence. The results and conclusions of the study showed that heart rate and blood pressure were significantly decreased due to the influence of yogic practices than control group among diabetic men.', '1428388963_K.Annamalai,_M.Sc,M.phil.docx', '2015-04-07', 'K.Annamalai,Dr.R.Elangovan', 'yogiannamalai@yahoo.com,relangovantnpesu@yahoo.co.in', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2015', 0, 0, 'New', 0, 0),
(455, 'IJERSS-1428389138', 'editor@ijerss.com', 'EFFECT OF SELECTED FLOOR AEROBICS AND STEP AEROBIC EXERCISES ON SELECTED', 'Research', 'SPORTS SCIENCE', 'From time immemorial Indians have laid emphasis on physical exercises not only to keep the body fit but to prevent the ailments. Physical exercises have been considered as an essential part of human life.  The survival of man is physical and movement or the activity is the foremost important thing one learns soon after birth.  The literate meaning of â€˜physicalâ€™ is â€˜bodyâ€™ which strictly relates to physique, health, strength, endurance, speed, agility, flexibility, and physical performance on the sports ground (Uppal, 2000) . A well planned and regular lifetime programme of exercise will help us feel better, look better and enable us to enjoy a much comfortable life than we may have been leading until now.  Exercise means treating our body with new respect, working with it instead of against it.  And all this should be fun.  It is therefore important to select a method that suits us and to develop the personality. (Carpenter, 1984)  ', '1428389138_paper1_Gouri.docx', '2015-04-07', 'P.Gouri Sankar,Dr.P.P.S.Paul Kumar', 'ppspaulkumar@gmail.com,ppspaulkumar@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'PHYSICAL SCIENCE', '1429435507_IJERSS1428389138.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue IV, April 2015.', 144, 1),
(456, 'IJERSS-1428389234', 'editor@ijerss.com', 'THE RELATIONSHIP BETWEEN SELECTED PHYSIOLOGICAL PARAMETERS VARIABLES WITH PLAYING ABILITY OF SOFTBALL PLAYERS', 'Research', 'SPORTS SCIENCE', 'Sports are no longer just sports and games. They are business all over the world. The boom in prize money and the practice of internationally renowned sportsman signing on the dotted line to endorse the products has made sports, big business. Sports lovers all over the world are happy that reputed sportsmen are no longer obliged to follow a regime of high thinking and low living.', '1428389234_Paper2_Subbu.docx', '2015-04-07', 'K.SubbaRao,Dr.P.P.S.Paul Kumar', 'ppspaulkumar@gmail.com,ppspaulkumar@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1429548781_IJERSS1428389234.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue IV, April 2015.', 158, 1),
(457, 'IJERSS-1428389330', 'editor@ijerss.com', 'COMPARATIVE STUDY ON SELECTED ANTHROPOMETRIC VARIABLE (Height) AMONG UNIVERSITY MEN SPRINTERS, THROWERS, JUMPERS AND LONG DISTANCE RUNNERS', 'Research', 'SPORTS SCIENCE', 'The human body is a machine of wondrous complexity capable of strong and violent movements.  This machine is made up of slightly more than two hundred bones to which are attached better than six hundred musclesâ€ (Eston, R., and Reilly, T. 2008).\r\n	There are numerous factors, which are influencing performance of sportsman of the physical including shape, size, weight and height.  Each and every nation wants to show their supremacy in any sports and games.  The Olympic motto itself shows â€œFaster, higher and strongerâ€.  The challenges inspire the entire nation to exhibit greater performance in sports through application of research in modern science any technology\r\n', '1428389330_paper2_Bala.docx', '2015-04-07', 'D.Bala Krishna,Dr.P.P.S.Paul Kumar', 'ppspaulkumar@gmail.com,ppspaulkumar@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1429549991_IJERSS1428389330.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue IV, April 2015.', 169, 1),
(458, 'IJERSS-1428389422', 'editor@ijerss.com', 'THE INFLUENCE OF SOCIO-CULTURAL, POLITICAL AND RELIGIOUS FACTORS ON SPORTS IN INDIAN SOCIETY', 'Research', 'SPORTS SCIENCE', 'Sport is a universal language that can bring people together no matter what their origin, background, religious belief or economic statusâ€. Kofi Annan â€“ former U.N.O Gen.Secy. A sports field is considered a laboratory where sports activities groom the individuals physically, mentally and morally with the important values of life face the world confidently. Parents, teachers and students had a flair for sports during 1970â€™s and 1980â€™s. Students have enough leisure time and they regularly participated in sports activities. The unnecessary political involvements and less priority to the sports than that of religious activities is a major curse to Indian sports. No priority to sports by institutions, parents, teachers and students. There is unhealthy emphasis on acquisition of marks and credits by dumping of academic information and neglecting the overall development of students. Now in modern era many women were emerged in sports in India like P.T.Usha, Karanam Malleswari and other great personalities and they also laid a path for young and upcoming women participants. But still there is a need to develop the Sports Culture among our Indian Society rather than political and religious cultures', '1428389422_S._Ramakrishna,_Ph.D_Scholar,.docx', '2015-04-07', 'S. Ramakrishna,Dr.M.V.Srinivasan', 'ppspaulkumar@gmail.com,ppspaulkumar@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1429436262_IJERSS1428389422.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue IV, April 2015.', 143, 1),
(459, 'IJERSS-1428413270', 'editor@ijerss.com', 'CONSTRUCTION OF NORMS FOR SPEED FOR 10 TO 12 YEARS BOYS AND GIRLS PROBABLES', 'Research', 'Physcial Education and Sports Sciences', 'ABSTRACT\r\n	The purpose of the study was to construct norms for speed for 10 to 12 years boys and girls of Track and Field Probableâ€™s. A sample of 3075 students was taken during coaching camp. Totally 3075 probableâ€™s 2287 boys and 788 girls served as subjects. The speed performance data of subjects in athletics was collected. Norms were constructed for speed with three normative scales such as percentile, Hull, Sigma and T scale and standard for evaluation of probableâ€™s also established under normal distribution.\r\nKeywords: Construction, Norms, Speed, Probableâ€™s  \r\n', '1428413270_ARTICLE_VASANTHKUMAR2.doc', '2015-04-07', 'VASANTHA KUMAR,Dr. KISHORE KUMAR C.K', 'hnavanku@gmail.com,ckkkumar@yahoo.com', '09448039171', 'Vasantha Kumar, Research Scholar,', 'Dept. of Physical Education, Mangalore University,', 'Konaje,Mangalor', 'Karnataka', 574199, 'IN', 'Payment pending', '', 'SPORTS SCIENCE', '1461386784_IJERSS1428413270.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume III - Issue IV, April 2016.', 34, 1),
(460, 'IJERSS-1428471912', 'IJERSS-1427733352', 'SMART ILLUMINATION CUM COMMUNICATION VIA LI-FI WITH POWER-LINE CABLES USING  RASPBERRY PI', 'Research', 'EMBEDDED SYSTEMS', 'This paper presents an application to transfer information from one system to another system through LED. This design of system is accomplished using a raspberry pi microcontroller as a system of on chip, along with a Li-Fi transmitter, Li-Fi receiver and LED panel can be used as a communication source by modulating the LED light with the data signal. In order to transfer information from one system to another system we use LED to transmit signals and photo detector to receive signals. The main purpose of design of this particular system is to transmit information under security basis. The light waves cannot penetrate walls which makes a much shorter range, though more secure from hacking, relative to Wi-Fi.\r\n\r\nIndex Termsâ€” LED (Light Emitting Diode), Wi-Fi (Wireless Fidelity), Li-Fi (Light Fidelity), VLC (Visible Light Communication), RF (Radio Frequency).\r\n', '1428471912_Smart_Illumination_Cum_Communication_via_LiFi_with_Powerline_Cables_using_Raspberry_Pi.do', '2015-04-08', ' Mr. G. HEMANTH REDDY,Mrs. R.MANOHARI', 'hemanthg2012@gmail.com,manohari.r@ktr.srmuniv.ac.in', '8122181521', 'MIG-1,H.NO-29', '9TH PHASE,KUKATPALLY', 'HYDERABAD', 'TELANGANA', 500072, 'IN', 'Payment pending', '', '', NULL, 1, 0, 'IJERSS-2015', 0, 0, 'Volume II - Issue IV, April 2015.', 0, 0),
(461, 'IJERSS-1428493845', 'editor@ijerss.com', 'Online Monitoring of Green House gases Storage and Leakage Using Wireless Sensor Network', 'Others', 'WIRELESS SENSOR NETWORKS', 'Nowadays air pollution is increasing rapidly due to Human activities. These activities have altered the chemical composition of the earthâ€™s atmosphere through the buildup of greenhouse gases â€“ primarily carbon dioxide, methane, and carbon monoxide. To avoid such affects an efficient green house gases monitoring system is necessary. In this paper, an online green house gases monitoring system based on wireless sensor network is implemented using X-bee Digi modules and open source hardware platform arduino. This system consists of three nodes. Each node is equipped with arduino micro controller and x-bee zigbee seris2 mesh net module and a battery source. Sensors are interfaced to each node which senses the data and then the collected   information   is   sent   to   the   central monitoring unit which acts as a sink node, which is always attached to personal computer to update the data .Data are continuously transmitted from zigbee sensor nodes to zigbee coordinator node. Co-ordination is present between sensor nodes and base station for monitoring and detection of leakage. This system can be used anywhere in the atmosphere and especially usefull in industries and some places such as CO2 Capture and Storage (CCS) region. At the sink node arduino Ethernet shield is interfaced. Webserver is created using Ethernet shield which is used to make the entire system online. The sensed data can be accessible to user anywhere in the world using World Wide Web.', '1428493845_PROJECT.doc', '2015-04-08', 'MALLAKALVA ANEELKUMAR REDDY,V.Natarajan', 'aneelkumar.mallakalva@gmail.com,vy.natarajan@gmail.com', '9500037712', 'FLATNO:S2; A-BLOCK;ANANDH APARTMENTS;SWAMY NAGAR;', 'URAPAKKAM WEST', 'KANCHEEPURAM', 'TAMILNADU', 603211, 'IN', 'Payment pending', '', '', NULL, 1, 0, 'IJERSS-2015', 0, 0, 'Volume II - Issue IV, April 2015.', 0, 0),
(462, 'IJERSS-1428494018', 'editor@ijerss.com', 'Online Monitoring of Green House gases Storage and Leakage Using Wireless Sensor Network', 'Others', 'WIRELESS SENSOR NETWORKS', 'Nowadays air pollution is increasing rapidly due to Human activities. These activities have altered the chemical composition of the earthâ€™s atmosphere through the buildup of greenhouse gases â€“ primarily carbon dioxide, methane, and carbon monoxide. To avoid such affects an efficient green house gases monitoring system is necessary. In this paper, an online green house gases monitoring system based on wireless sensor network is implemented using X-bee Digi modules and open source hardware platform arduino. This system consists of three nodes. Each node is equipped with arduino micro controller and x-bee zigbee seris2 mesh net module and a battery source. Sensors are interfaced to each node which senses the data and then the collected   information   is   sent   to   the   central monitoring unit which acts as a sink node, which is always attached to personal computer to update the data .Data are continuously transmitted from zigbee sensor nodes to zigbee coordinator node. Co-ordination is present between sensor nodes and base station for monitoring and detection of leakage. This system can be used anywhere in the atmosphere and especially usefull in industries and some places such as CO2 Capture and Storage (CCS) region. At the sink node arduino Ethernet shield is interfaced. Webserver is created using Ethernet shield which is used to make the entire system online. The sensed data can be accessible to user anywhere in the world using World Wide Web.', '1428494018_PROJECT.doc', '2015-04-08', 'MALLAKALVA ANEELKUMAR REDDY,V.Natarajan', 'aneelkumar.mallakalva@gmail.com,vy.natarajan@gmail.com', '9500037712', 'FLATNO:S2; A-BLOCK;ANANDH APARTMENTS;SWAMY NAGAR;', 'URAPAKKAM WEST', 'KANCHEEPURAM', 'TAMILNADU', 603211, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2015', 0, 0, 'New', 0, 0),
(463, 'IJERSS-1428520323', 'editor@ijerss.com', 'DIGIT-SLICING  ARCHITECTURE OF RADIX 22 SDF FAST FOURIER TRANSFORM', 'Research', 'ELECTRONICS', 'High speed processing of signals has led to the requirement of very high speed conversion of signals from the time domain to the frequency domain. Recent years there has been increasing demand for low power designs in the field of digital signal processing. Power consumption is the most important aspect while considering the system performance.  In order to achieve high performance Fast Fourier Transforms (FFT), design and realization of its efficient internal structure is required. In this paper we discuss the implementation of a power and area efficient FFT architecture based on digit slicing multiplier less architecture. The digit slicing multiplier uses low power adders to decrease the butterfly area and achieve low power consumption. Experimental results shows that by using the proposed FFT structure, the power consumption is reduced to almost half compared to existing. The proposed design has been coded in Verilog HDL and synthesized using Cadence Virtuso. The proposed pipeline Radix 22 DIF SDF FFT processor based on digit-slicing multiplier-less is capable of solving the problems that affect the capabilities of most high speed wireless communication systems in FFT and possesses huge potential for future research.', '1428520323_fft.docx', '2015-04-09', 'Femi Mathew,V.Sarada	', 'femimathew2007@gmail.com,saradasaran@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Payment pending', '', '', NULL, 1, 0, 'IJERSS-2015', 0, 0, 'Volume II - Issue IV, April 2015.', 0, 0),
(464, 'IJERSS-1428919037', 'editor@ijerss.com', 'QUERY DEPENDENCE IN THE PROCESSING OF DISTRIBUTED DATABASE MANAGEMENT SYSTEM', 'Research', 'Query Dependence in the processing of Distributed Database Management System', 'In this paper the focus is given to Query Dependence in the processing of Distributed Database Management System. The primary focus is joins and semi joins in distributed database system. There performance of computing and analyzing is discussed and analyzed. Database is defined as collection of files or table, where as DBMS stands for Database Management System which is collection of unified programs used to manage overall activities of the database. The two dominant approaches used for storing and managing database are centralized database management system and distributed database management system in which data is placed at central location and distributed over several locations respectively. Independent of the database approach used, one of the foremost issue in the database is the retrieval of data by using multiple table from central repository in centralized database and from number of sites in distributed database. Joins and semi joins are primitive operations used to extract required information from one, two or multiple tables. The various metrics that will be considered while analyzing performance of join and semi join in distributed database system are Query Cost, Memory used, CPU Cost, Input Output Cost, Sort Operations, Data Transmission, Total Time and Response Time. In short the intention of this study is analyze the performance and behavior of join and semi-join approach in distributed database system.', '1428919037_Full_paper.doc', '2015-04-13', 'Sudan Jha,Bikram Keshari Ratha', 'jhasudan@hotmail.com,vkramus@yahoo.com', '+919937383933', 'C/o Sudan Jha, S. N. 103/1029-24, Ward No. 12', 'Gokarneswar Municipality, Narayantar,', 'Kathmandu', 'Bagmati', 44806, 'NP', 'Published online', '', 'COMPUTER SCIENCE', '1431779450_IJERSS1428919037.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue V, May 2015.', 265, 1),
(465, 'IJERSS-1429327591', 'editor@ijerss.com', 'EFFECT OF YOGIC PRACTICES ON SELECTED PHYSIOLOGICAL VARIABLES AMONG MIDDLE AGED DIABETIC MEN', 'Research', 'PHYSICAL SCIENCE', 'The purpose of this Random group experimental study was to find out the effect of yogic practices on selected physiological variables among middle aged diabetic men. It was hypothesized that there would be significant differences on selected physiological variables such as heart rate and blood pressure among middle aged diabetic men due to the influence of yogic practices than the control group. To achieve the purpose of the study, 40 diabetic men were selected at random from Chennai as subjects and their age was ranged between 40 to 50 years. The subjects were divided into two groups. Yogic practice group had 20 members and Control group had 20 members. The subjects of the control group were kept in active rest. In this random group experimental design, the subjects of yogic practice group were given experimentation for the period of twelve weeks, six days a week, an hour approximately daily. The control group was not exposed to any specific training. After the experimental period of twelve weeks, post test scores were obtained from the two groups. The data collected from the subjects both from post and pre tests were treated statistically through using Analysis of Co-variance (ANCOVA) to determine the significant difference. The hypothesis was tested at 0.05 level of confidence. The results and conclusions of the study showed that heart rate and blood pressure were significantly decreased due to the influence of yogic practices than control group among diabetic men.', '1429327591_K.Annamalai,_M.Sc,M.phil.docx', '2015-04-18', 'K.Annamalai,Dr.R.Elangovan', 'yogiannamalai@yahoo.com,relangovantnpesu@yahoo.co.in', '9030057655', '', '', '', '', 0, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2015', 0, 0, 'New', 0, 0),
(466, 'IJERSS-1429346329', 'editor@ijerss.com', 'PARTICIPATION  MOTIVATION IN SPORTS AMONG INDIAN TAEKWONDO PLAYERS', 'Research', 'Sport Psychology', 'Sports psychologists have in recent years, shown increased interest in assessing the motives of young people involved in sports. Infect determining the reason that motives children to participate in sports has been recognized as one of the most critical areas of youth sports result. The purpose of the  present study was to investigate the reasons of participation in sports among Taekwondo Players of India.  One hundred and Twenty (90 male and 30 female)  Taekwondo  athletes of national level representing their state teams. in  Senior National Taekwondo Championships held at Bilaspur (Chhattisgarh) To find out the reasons for participation motives in sports, the  Participation Motivation Questionnaire prepared by Gill, Gross and Huddleston (1983) containing 30 items  was used . To assess the eight factors of participation motivation for both sex Taekwondo players, means,  standard deviations  and ANOVA  with all the subjects were computed. Mean ranking were used to rank the reasons for male and female to identify general categories of motives for participation in Taekwondo. Results of the present investigation revealed that male  and female  Taekwondo players of national level had different preferences for reason of participation in sports.  Male  Taekwondo players  preferred more of skill development  followed by achievement status, fitness, team work, others, energy release,  friendship and fun from most important to least important rank order. Female  Taekwondo players preferred more of achievement status  followed by team work, skill development,  others,  fitness, energy release,  friendship and fun from most important to least important rank order. \r\nKeywords: Taekwondo, Participation Motives, National level, Rank order\r\n', '1429346329_Paper_1.doc', '2015-04-18', 'Dr. Rajkumar Sharma', 'sharmagym59@yahoo.co.in', '09229144090', '284/1, In Front of Main I.T.I. Gate,', ' Near- Evergreen Nursary, Centre Koni', 'Bilaspur', 'Chhattisgarh', 495009, 'IN', 'Pending', '', 'SPORTS SCIENCE', '1431781473_IJERSS1429346329.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue V, May 2015.', 196, 1),
(467, 'IJERSS-1429514998', 'editor@ijerss.com', 'A Recent Survey on Comparison of Cluster based Routing Protocols in Homogeneous Wireless Sensor Network', 'Research', 'Networks', 'In recent years, the applications of Wireless Sensor Networks (WSNs) have grown enormously. In WSNs there is one mechanism used to enlarge the lifespan of network and provide more efficient functioning procedures that is clustering. Clustering is a process to subdivide the sensing field of sensor network into number of clusters. Each cluster selects a leader called cluster head. A cluster head may be elected by the sensor node in the cluster or pre assigned by the network designer. Optimized Clustering can save lot of energy in the network. In our paper we have surveyed various clustering protocols for wireless sensor networks and compared on various parameters like cluster count, cluster size, cluster density, message count, node deployment, heterogeneity of nodes, location awareness and cluster head selection process etc.', '1429514998_A_Recent_Survey_on_Comparison_of_Cluster_based_Routing_Protocols_in_Homogeneous_Wireless_', '2015-04-20', 'Mahendran,muruganandam', 'maheplus.t@gmail.com,infomahe@gmail.com', '8608537368', 'seven star mansion,room no:10,near disco chettined', 'chengalpat', 'chengalpat', 'Tamil Nadu', 603203, 'IN', 'Payment pending', '', '', NULL, 1, 0, 'IJERSS-2015', 0, 0, 'Volume II - Issue V, May 2015.', 0, 0),
(468, 'IJERSS-1429723887', 'editor@ijerss.com', 'MERCHANT ACQUIRING', 'Research', 'Merchant Acquiring', ' In Todayâ€™s World, Merchant Acquiring is a outstanding business. Customers can easily do shopping using their debit card, credit card or ATM etc. Customer account is debit on the real time but the merchant account will credit after one or two days which is really unsound. This paper focuses on the challenge faced by Merchant in Merchant Acquiring Business. This Paper presents an Architecture that provide a platform independent design for enhancing the Merchant Acquiring business.', '1429723887_InternationalPaperOnMerchantAcquiring.docx', '2015-04-22', 'Milan Patil,Sachin Magar,Piyush Patil', 'milanmh29@gmail.com,sac.magar@gmail.com,patilpiyushcsn@gmail.com', '9730696856', 'Flat No-202, Shivaditya Building,', 'ChinchPada,', 'Pen', 'Maharashtra', 402107, 'IN', 'Published online', '', 'COMPUTER SCIENCE', '1431782795_IJERSS1429723887.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue V, May 2015.', 168, 1),
(469, 'IJERSS-1429752664', 'editor@ijerss.com', 'PUBLIC AUDITING FOR SECURE CLOUD STORAGE SYSTEM USING THIRD PARTY AUDITOR', 'Research', 'INFORMATION TECHOLOGY', 'In this paper, we propose a secure cloud storage system supporting privacy-preserving public auditing. We further extend our result to enable the Third Party Auditor (TPA) to perform audits for multiple users simultaneously and efficiently with RC5 Encryption Algorithm. This shows the proposed scheme is highly efficient and data modification attack, and even server colluding attacks.- Cloud computing is an internet based computing which enables sharing of services. Cloud computing allows users to use applications without installation any application and access their personal files and application at any computer with internet or intranet access. Many users place their data in the cloud, so correctness of data and security is a prime concern. Cloud Computing is technology for next generation Information and Software enabled work that is capable of changing the software working environment. It is interconnecting the large-scale computing resources to effectively integrate, and to computing resources as a service to users. To ensure the correctness of data, we consider the task of allowing a TPA, on behalf of the cloud client, to verify the integrity of the data stored in the cloud. The auditing process should bring in no new vulnerabilities towards user data privacy, and introduce no additional online burden to user. ', '1429752664_aamer_Conf_Paper_Final_Reviewed.docx', '2015-04-23', 'Aamer Ghazalee.M.A,K. Navin', 'aamerghazalee@gmail.com,aamerghazalee@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Payment pending', '', '', NULL, 1, 0, 'IJERSS-2015', 0, 0, 'Volume II - Issue V, May 2015.', 0, 0);
