(470, 'IJERSS-1430284696', 'editor@ijerss.com', 'A COMPARATIVE STUDY OF SOUTH GUJARAT URBAN AND RURAL SECONDARY SCHOOLS STUDENTSÃ¢â‚¬â„¢ANTHROPOMETRY,  MENTAL HEALTH AND IQ', 'Research', 'Physical Education', '\r\nThe purpose of the study was to compare anthropometry, Mental Health and IQ of secondary school students of south Gujarat urban and rural area, thus 2160 boys student were randomly selected below the age of 15 years. From the city schools 1077 boys and from rural schools 1083 boys were randomly selected. In the anthropometric variables data was collected by conducting test. Where as to collect the data related to mental health Questionnaire prepared by Dr. D.J.Bhatt and Geeda was used and to examine the IQ Questionnaire prepared by Desai Verbal-Nonverbal Questionnaire was used.\r\nKey Words: anthropometry, Mental Health and IQ.', '1430284696_ankur_papaper_phd_teshis.doc', '2015-04-29', 'Mr. Ankur D. Chaudhari,Dr. C. B. Kagathara', 'physicalinstructor@nau.i', '09913361704', 'Agricultural University, Navsari', 'N.M. College of Navsari,', 'Navsari', 'Gujarat', 396450, 'IN', 'Payment pending', '', '', NULL, 1, 0, 'IJERSS-2015', 0, 0, 'Volume II - Issue V, May 2015.', 0, 0),
(471, 'IJERSS-1430309515', 'editor@ijerss.com', 'Comparison of Anthropometric  and Motor-fitness components  between Sprinters and Throwers', 'Research', 'Physical Education', 'Abstract:\r\nThe aimed to find out a comparative assessment of the selected anthropometric variables and motor fitness components between elite sprinters and throwers. The research was conducted on North indian male university and national level 30 sprinters and 30 Throwers of their age ranges 17-25 years. Thirty two ananthropometric measurements as independent variables and seven motor fitness components as dependents variables from AAHPER youth fitness test(1966) battery were evaluated of each subject. SPSS (11.5) computer software was used to analyze the data and it explored that the weight and Linear measurements i.e. height, arm length, hand breadth, body diameters i.e. shoulder and knee diameters, girth measurements i.e. chest, hip and thigh girth, skin fold measurements i.e. triceps, subscapular skin folds, body composition variables i.e. body density, percent fat, fat weight and lean body mass and motor fitness components i.e.  50Yard Dash, Standing Broad Jump, Straight Knee Sit-ups, Shuttle Run, Softball throw for distance and 600-Yard Run & Walk have been found highly significant difference between sprinters and throwers at one percent level. \r\n', '1430309515_Mangea_ram_paper_RP.docx', '2015-04-29', 'Mange Ram,Dr. Ravinderpal Ahlawat', 'ramkhevariamange1484@gmail.com,ahlawatravi74@gmail.com', '09253471110', 'Dr. Ravinderpal Ahlawat, Chairperson ', 'Deptt. of Phy. Edu. CDLU', 'Sirsa', 'Haryana', 125055, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2015', 0, 0, 'New', 0, 0),
(472, 'IJERSS-1430543168', 'kasundrapm@gmail.com', 'EFFECT OF PLYOMETRIC AND YOGASANA TRAINING ON SELECTED VARIABLES OF MOTOR FITNESS', 'Research', 'Physical Education', 'ABSTRACT:\r\n	The purpose of this study was to determine the purpose of Effect of Plyometric and Yogasana Training on Selected Variables of Motor Fitness. For this study total 60 students were randomly selected as subjects from the For this study, students of Gyandhara Shikshan Tirth school, Sadara, Gandhinagar, Guajrat. will be selected as the subjects. Further three groups of 20 students in each group were made randomly for experimental design.\r\nThe selected subjects (N = 60) were divided into three groups equally of which experimental Group A underwent Plyometric Training, Group B underwent Yogasana Training and Group C Control Group underwent traditional regular training. All the three groups were treated with their particular training for one hour per session for three days a week for a period of Nine weeks. Training schedule for two experimental groups is given in following tables. The total training duration for each day was one hour. Group A was given plyometric training. Group B was given resistance training. Load progression was adapted as per training principles. The detailed training schedule for each group is mentioned by indicating the intensity repetitions, set, rest and duration. Both of the experimental groups were treated with their respective training for three days per a week for a period of 9 weeks. Finally, to compare pre-test and post-test means of plyometric training group, resistance training group and control group â€˜Fâ€™ test was applied at the significant level of 0.05.\r\nKey Words:Plyometric and Yogasana Training,  North Carolina Motor Fitness Battery.', '1430543168_Dr.P.M_Kasundra_may_2015.doc', '2015-05-02', 'Dr. Prabhulal M. Kasundra', 'kasundrapm@gmail.com', '09429021910', 'Mahadev Desai Sharirik Shikshan Mahavidyalaya,  ', ' At. Sadra.', 'Gandhinagar', 'Gujarat', 396450, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1431956448_IJERSS1430543168.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue V, May 2015.', 158, 1),
(473, 'IJERSS-1430655970', 'editor@ijerss.com', 'CAMERA SHAKE REMOVAL USING PROBABILISTIC MOTION DENSITY FUNCTION WITH TSMF', 'Research', 'ELECTRONICS', 'The paper is to clear image from single motion\r\ndeblurred image in digital imaging. The blurred image can be\r\nobtained from the camera shakes, so we focus on to recover that\r\nimage. Proposed Probabilistic Motion Density Function(PMDF)\r\nand Temporal Sampling Motion Function(TSMF) to recover that\r\nimage. To describe the probability distribution of camera poses\r\nduring exposure using PMDF algorithm and apply it as a unified\r\nconstraint to guide the convergence of the iterative deblurring\r\nalgorithm. The experiments shows that our algorithm can\r\neffectively remove complex motion blurring from natural images\r\nwithout requiring any prior information of the motion-blur\r\nkernal.', '1430655970_Camera_Shake_Removal_using_Probabilistic_Motion_Density_Function_with_TSMF.pdf', '2015-05-03', 'KR.Meyyathal,Mr.R.Manoharan', 'meyyathalks@gmail.com,magann1968@yahoo.co.in', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'ELECTRONICS', '1431788180_Camera_Shake_Removal_using_Probabilistic_Motion_Density_Function_with_TSMF.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue V, May 2015.', 173, 1),
(474, 'IJERSS-1430728916', 'editor@ijerss.com', 'COMPARATIVE STUDY ON SELECTED PSYCHOLOGICAL VARIABLES (anxiety) AMONG UNIVERSITY MEN SPRINTERS, THROWERS, JUMPERS AND LONG DISTANCE RUNNERS', 'Research', 'SPORTS SCIENCE', 'There are numerous factors, which are influencing performance of sportsman of the physical including shape, size, weight and height.  Each and every nation wants to show their supremacy in any sports and games.  The Olympic motto itself shows â€œFaster, higher and strongerâ€.  The challenges inspire the entire nation to exhibit greater performance in sports through application of research in modern science any technology.', '1430728916_Papers3_Bala_IJERSS.docx', '2015-05-04', 'D.Bala Krishna,M.Sudhakara Babu,Dr.P.P.S.Paul Kumar', 'balakrishna327@gmail.com,sudhakarmande7@gmail.com,ppspaulkumar@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1432178226_IJERSS1430728916.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue V, May 2015.', 173, 1),
(475, 'IJERSS-1430729271', 'editor@ijerss.com', 'EFFECT OF SELECTED FLOOR AEROBICS AND STEP AEROBIC EXERCISES ON SELECTED BIO-MOTOR, VARIABLE (STATIC BALANCE) AMONG ANDHRA STATE VOLLEYBALL PLAYERS', 'Research', 'SPORTS SCIENCE', 'The objective of this study was to find out the effect of floor aerobics consisting of walking, jogging and rhythmic exercises and step aerobics exercises consisting of different modulations has any effect on selected bio motor, variable (Static Balance) among state level volleyball players of Andhra Pradesh.  In doing so, the study was to find out which of the two treatments were significantly influencing among volleyball playersâ€™ selected variables.', '1430729271_paper2_Gouri.docx', '2015-05-04', 'P.Gouri Sankar,M.Sudhakara Babu,Dr.P.P.S.Paul Kumar', 'ppspaulkumar@gmail.com,sudhakarmande7@gmail.com,ppspaulkumar@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1432178148_IJERSS1430729271.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue V, May 2015.', 136, 1),
(476, 'IJERSS-1431148124', '1430309515', 'COMPARISON OF ANTHROPOMETRIC AND MOTORS-FITNESS COMPONENTS BETWEEN SPRINTERS AND THROWERS ', 'Research', 'PHYSICAL EDUCATION', 'Comparison of Anthropometric  and Motor-fitness components  between Sprinters and Throwers\r\nMange Ram \r\nAsstt. Prof. of Physical Education\r\nGovt. College for Women, Rohtak\r\nDr. Ravinder Pal Ahlawat \r\nAssociate Professor \r\nDeptt. Of  Physical Education \r\nCDLU Sirsa (Haryana) \r\n\r\nAbstract:\r\nThe aimed to find out a comparative assessment of the selected anthropometric variables and motor fitness components between elite sprinters and throwers. The research was conducted on North indian male university and national level 30 sprinters and 30 Throwers of their age ranges 17-25 years. Thirty two ananthropometric measurements as independent variables and seven motor fitness components as dependents variables from AAHPER youth fitness test(1966) battery were evaluated of each subject. SPSS (11.5) computer software was used to analyze the data and it explored that the weight and Linear measurements i.e. height, arm length, hand breadth, body diameters i.e. shoulder and knee diameters, girth measurements i.e. chest, hip and thigh girth, skin fold measurements i.e. triceps, subscapular skin folds, body composition variables i.e. body density, percent fat, fat weight and lean body mass and motor fitness components i.e.  50Yard Dash, Standing Broad Jump, Straight Knee Sit-ups, Shuttle Run, Softball throw for distance and 600-Yard Run & Walk have been found highly significant difference between sprinters and throwers at one percent level. \r\nKey words: Anthropometry, body composition, motor fitness, sprinters and throwers. \r\n', '1431148124_paper.docx', '2015-05-09', 'MANGE RAM ,DR. RAVINDER PAL AHLAWAT', 'ramkhevariamange1484@gmail.com,ahlawatravi1974@gmail.com', '08295833166', 'H.NO.1484 ', 'SECTOR-2 ', 'ROHTAK', 'HARYANA', 124001, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2015', 0, 0, 'New', 0, 0),
(477, 'IJERSS-1432533952', '1430309515', ' Comperision of Anthropometric Motor Fitness Components between sprinters and throwers', 'Research', 'sports science', 'Comparison of Anthropometric  and Motor-fitness components  between Sprinters and Throwers\r\nMange Ram \r\nAsstt. Prof. of Physical Education\r\nGovt. College for Women, Rohtak\r\nDr. Ravinder Pal Ahlawat \r\nAssociate Professor \r\nDeptt. Of  Physical Education \r\nCDLU Sirsa (Haryana) \r\n\r\nAbstract:\r\nThe aimed to find out a comparative assessment of the selected anthropometric variables and motor fitness components between elite sprinters and throwers. The research was conducted on North indian male university and national level 30 sprinters and 30 Throwers of their age ranges 17-25 years. Thirty two ananthropometric measurements as independent variables and seven motor fitness components as dependents variables from AAHPER youth fitness test(1966) battery were evaluated of each subject. SPSS (11.5) computer software was used to analyze the data and it explored that the weight and Linear measurements i.e. height, arm length, hand breadth, body diameters i.e. shoulder and knee diameters, girth measurements i.e. chest, hip and thigh girth, skin fold measurements i.e. triceps, subscapular skin folds, body composition variables i.e. body density, percent fat, fat weight and lean body mass and motor fitness components i.e.  50Yard Dash, Standing Broad Jump, Straight Knee Sit-ups, Shuttle Run, Softball throw for distance and 600-Yard Run & Walk have been found highly significant difference between sprinters and throwers at one percent level. \r\nKey words: Anthropometry, body composition, motor fitness, sprinters and throwers. \r\n\r\n', '1432533952_123.docx', '2015-05-25', 'mange ram,dr. ravinder pal ahlawat ', 'ramkhevariamange1484@gmail.com,ahlawatravi1974@gmail.com', '08295833166', 'h.no-1484', 'sec-2', 'ROHTAK', 'HARYANA', 124001, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2015', 0, 0, 'New', 0, 0),
(478, 'IJERSS-1432880786', 'editor@ijerss.com', 'CONSTRUCTION OF PHYSICAL FITNESS NORMS FOR ADOLESCENT GIRLS', 'Research', 'Sports Science and Fitness', 'The physical education teacher can somehow drag the attention of adolescent girls towards physical activity by making understand its innumerable benefits. But, assessment plays an important role in monitoring the improvement. Comparing their scores with standard norms is the next issue after assessment. Therefore, it is essential to have norms for keeping track of personal improvement. The purpose of the present study is to construct physical fitness norms for adolescent girls of Karnataka state. Subjects for the study were eight hundred secondary school attending girls studying in eighth and ninth grade of Bangalore academic division. Their age ranged between 13- 15 years. Random purposive sampling technique was observed for the present investigation to give equal opportunity for students representing different of districts of Bangalore academic division like- Shivamogga, Bangalore, Hassan, Kolar. Equal importance was also given to students belonging to rural as well as urban regions. All the subjects selected for this study were tested for selected physical fitness variables. It included Flexed Arm Hang, Shuttle Run, Flexed Leg Sit Ups, Standing Broad Jump, 50 yard dash and 600 yard run. Percentile Scale was considered as appropriate scale. Tenth percentile was located at the lowest score in the data, from which the percentile table was constructed and hundredth percentile was placed at the highest score. Construction of physical fitness norms for adolescent girls is an important part in the evaluation of physical fitness. Such norms are essential to understand the present fitness levels and monitor improvement is physical fitness. ', '1432880786_R_Ramchandra_&_Gasti.docx', '2015-05-29', 'Rashmi Ramachandra,Appanna M Gasti', 'appannamg2008@rediffmail.com,appannamg2008@rediffmail.com', '9449757038', 'Appanna M Gasti, Deputy Director', 'DOS in Physical Education, Kuvempu University,', 'Shimoga', 'KARNATAKA', 577451, 'IN', 'Pending', NULL, 'PHYSICAL SCIENCE', '1437284047_IJERSS1432880786.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue VII, July 2015.', 237, 1),
(479, 'IJERSS-1434868596', 'editor@ijerss.com', 'RELATIONSHIP OF NECK CIRCUMFERENCE, BODY MASS INDEX, WAIST HIP RATIO AND BLOOD PRESSURE IN SCHOOL CHILDREN AGED BETWEEN 10-12 YEARS', 'Research', 'physical education ', 'The Purpose Of The Present Study Was To Find out Relationship of Neck Circumference, Body Mass Index, Waist Hip Ratio and Blood Pressure in School Children aged between 10-12 years The Objective Of The Present Study Was To assess the relationship of neck circumference with body mass index, waist hip ratio, and blood pressure of the subjects aged 10-12 years.Programme Being Run In The Schools Located In Yavatmal City The Researcher Hypothesized That there will be a significant relationship of neck circumference with body mass index, waist hip ratio, and blood pressure of the subjects aged 10-12 years.The Present  Source Of The Data was 100 male students aged between 10 to 12 years were randomly selected from various schools of yavatmal city for the purpose of the study. The requirement of the study was explained to the entire subject prior to testing.The Researcher measured  Neck circumference with the help of a steel tape, at the centre (midway) of the neck.Body Mass Index measured by dividing the body weight in (Kg) by square of the body height in (mts).Waist Hip Ratio measured by taking the waist circumference and hip circumference and dividing the waist circumference by hip circumference to get the waist to hip circumference ratio.Resting blood pressure recorded in mmHg with the help of sphygmomanometer and stethoscope. The Results Of The Study Revealed That there is significant relationship of neck circumference with body mass index, waist hip ratio, and blood pressure of the subjects aged 10-12 years ', '1434868596_m.phil_r_jar.docx', '2015-06-21', 'KIRAN G.PAWAR', 'Kiran7pawar@gmail.com ', '09922661127', '47 adarsh nagar jamb road wadgaon yavatmal', '', 'yavatmal', 'maharashtra', 445001, 'IN', 'Pending', '', 'PHYSICAL SCIENCE', '1437665899_IJERSS1434868596.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue VII, July 2015.', 196, 1),
(480, 'IJERSS-1434964616', 'editor@ijerss.com', 'ISSUES AND CHALLENGES IN THE DEVELOPMENT OF UNIVERSITY SPORTS IN INDIA', 'Research', 'PHYSICAL EDUCATION & ISSUES OF SPORTS IN UNIVERSITIES', 'the basic mechanism of the fitness â€“ such as desirable health habits, good attitude, mental & emotional and social well being are necessary. Sports activity is important to the all round development of the human personality. Achievements in sports have a significant bearing on the national reputation and morale. The ultimate sports meet the standards of approved sports principles and serve the educational needs of the society. The sports education curriculum functions mainly in developing the fundamentals of diverse sports and knowledge and of appreciations and desires in association with them. The physical and mental fitness of students improve through contribution in sports.', '1434964616_Ravi_Research_Paper_2015.doc', '2015-06-22', 'T. Ravi Kumar', 'ravinetha71@gmail.com', '09030764651', 'SNIST, YAMNAMPET, GHATKESAR', 'R.R DIST', 'Hyderabad', 'TELANGANA', 501301, 'IN', 'Pending', '', 'PHYSICAL SCIENCE', '1436698098_IJERSS1434964616.pdf', 1, 0, 'IJERSS-2015', 0, 0, 'Volume II - Issue VII, July 2015.', 0, 0),
(481, 'IJERSS-1436679848', 'editor@ijerss.com', 'EFFECT OF YOGIC PRACTICES ON SELECTED PHYSIOLOGICAL VARIABLES AMONG MIDDLE AGED DIABETIC MEN', 'Research', 'HEALTH SCIENCE', 'The purpose of this Random group experimental study was to find out the effect of yogic practices on selected physiological variables\r\namong middle aged diabetic men. It was hypothesized that there would be significant differences on selected physiological variables\r\nsuch as heart rate and blood pressure among middle aged diabetic men due to the influence of yogic practices than the control group.\r\nTo achieve the purpose of the study, 40 diabetic men were selected at random from Chennai as subjects and their age was ranged\r\nbetween 40 to 50 years. The subjects were divided into two groups. Yogic practice group had 20 members and Control group had 20\r\nmembers. The subjects of the control group were kept in active rest. In this random group experimental design, the subjects of yogic\r\npractice group were given experimentation for the period of twelve weeks, six days a week, an hour approximately daily. The control\r\ngroup was not exposed to any specific training. After the experimental period of twelve weeks, post test scores were obtained from the\r\ntwo groups. The data collected from the subjects both from post and pre tests were treated statistically through using Analysis of Covariance\r\n(ANCOVA) to determine the significant difference. The hypothesis was tested at 0.05 level of confidence. The results and\r\nconclusions of the study showed that heart rate and blood pressure were significantly decreased due to the influence of yogic practices\r\nthan control group among diabetic men.', '1436679848_1.pdf', '2015-07-12', 'K.Annamalai,Dr.R.Elangovan', 'yogiannamalai@yahoo.com,relangovantnpesu@yahoo.co.in', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1436697826_1.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue VII, July 2015.', 204, 1),
(482, 'IJERSS-1436687427', 'editor@ijerss.com', 'EFFECT OF RESISTANCE TRAINING AND ENDURANCE TRAINING IN SERIES ON SPEED AND EXPLOSIVE POWER', 'Research', 'SPORTS SCIENCE', 'The aim of this study was to determine the Effect of Resistance training and Endurance training in series on Speed and Explosive\r\nPower. To achieve this purpose, thirty (N=30) Degree College women students were randomly selected as subjects from\r\nK.V.R.College, Nandigama, Krishna Dist, Andhra Pradesh, India. They were divide into two equal groups of fifteen (n=15) each.\r\nGroup I- underwent resistance and endurance training in series and Group II-control group. For both the groups, Speed and Explosive\r\nPower were measured by using a 50 metre course and measure the explosive power in terms of horizontal. The training group\r\nunderwent 12-week ( 6 week resistance training and 6 week endurance training) in series and no specific training was given to the\r\ncontrol group. Prior to, and after training researcher has concluded that Speed and Explosive Power are significantly improved among\r\nhealthy untrained women.', '1436687427_2.pdf', '2015-07-12', 'T V Bala Krishna Reddy,Dr.K.Rama Subba Reddy', 'sudhakarmande7@gmail.com,sudhakarmande7@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1436697785_2.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue VII, July 2015.', 146, 1),
(483, 'IJERSS-1436688016', 'editor@ijerss.com', 'EFFECT OF STRUCTURED RESISTANCE TRAINING AND VARIED INTENSITIES OF WEIGHT TRAINING ON AGILITY AND RESTING PULSE RATE AMONG ATHLETES', 'Research', 'SPORTS SCIENCE', 'The Aim of the study was to find out the effect of structured resistance training and varied intensities of weight training on Agility and\r\nResting Pulse Rate among athletes .The selection of subjects, selection of variables, research design, orientation of the subjects,\r\nselection of tests, testers reliability, training schedule, test administration, and the statistical technique used. To find out the effects of\r\nstructured resistance training and varied intensities of weight training on Agility and Resting Pulse among athletes, the investigator\r\nrandomly selected 60 sprinters, who competed at inter collegiate level sports meets representing different colleges in A.P. They were\r\ndivided into three groups at random again consisting twenty subjects in each group and they were randomly assigned as experimental\r\ngroup I (SRT â€“Structured Resistance Training) and Experimental group II (VWT â€“ varied weight training). And control group. The\r\nrequirements of the experimental procedures, testing as well as exercise schedules were explained to them so as to avoid any\r\nambiguity of the effort required on their part and prior to the administration of the study, the investigator got the individual consent\r\nfrom each subject.\r\n__________________________________________________________________________________________________________', '1436688016_3.pdf', '2015-07-12', 'Dr.Raju.Sathuluri,Dr.P.P.S.Paul Kumar', 'sudhakarmande7@gmail.com,ppspaulkumar@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1436697740_3.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue VII, July 2015.', 197, 1),
(484, 'IJERSS-1436688382', 'editor@ijerss.com', 'EFFECT OF SELECTED FLOOR AEROBICS AND STEP AEROBIC EXERCISES ON SELECTED HEMATOLOGICAL VARIABLE AMONG ANDHRA STATE VOLLEYBALL PLAYERS', 'Research', 'SPORTS SCIENCE', 'This study was designed to find out the effects of 12 weeks of floor aerobics and step aerobics training on selected Hematological\r\n(Hemoglobin ) variable of Andhra State volleyball players this study 90 volleyball players, who participated at Andhra State level\r\ncompetitions were selected on random basis as subjects from the probableâ€™s who underwent volleyball coaching camps. The players\r\nwere healthy, and their age ranged between 19 to 23 years. The selected subjects were divided into three groups namely, control, floor\r\naerobics and step aerobics groups by random assignment. Initial data were collected on the selected dependent variable and the final\r\ndata were collected after 12 weeks treatment. The third group was control group and no training was given. The design of the study,\r\nselection of subjects, selection of variable (Hemoglobin ) selection of tests, testers reliability, reliability of instruments, testers\r\ncompetency, orientation of subjects, collection of data and the statistical techniques employed have been described. Data were\r\ncollected on the selected variables before and after the training period of twelve weeks. The differences between the initial and final\r\nscores in selected were subjected to statistical treatment using Analysis of Covariance (ANCOVA).', '1436688382_4.pdf', '2015-07-12', 'B.CH.SangithaRao,Dr.P.P.S.Paul Kumar', 'sudhakarmande7@gmail.com,ppspaulkumar@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1436697697_4.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue VII, July 2015.', 179, 1),
(485, 'IJERSS-1436688699', 'editor@ijerss.com', 'EFFECT OF SELECTED FLOOR AEROBICS AND STEP AEROBIC EXERCISES ON SELECTED BIOMOTOR, VARIABLES AMONG ANDHRA STATE VOLLEYBALL PLAYERS', 'Research', 'SPORTS SCIENCE', 'This study was designed to find out the effects of 12 weeks of floor aerobics and step aerobics training on selected motor,( Dynamic\r\nBalance)variable of Andhra State volleyball players this study 90 volleyball players, who participated at Andhra State level\r\ncompetitions were selected on random basis as subjects from the probableâ€™s who underwent volleyball coaching camps. The players\r\nwere healthy, and their age ranged between 19 to 23 years. The selected subjects were divided into three groups namely, control, floor\r\naerobics and step aerobics groups by random assignment. Initial data were collected on the selected dependent variable and the final\r\ndata were collected after 12 weeks treatment. The third group was control group and no training was given. The design of the study,\r\nselection of subjects, selection of variable (Dynamic Balance) selection of tests, testers reliability, reliability of instruments, testers\r\ncompetency, orientation of subjects, collection of data and the statistical techniques employed have been described. Data were\r\ncollected on the selected variables before and after the training period of twelve weeks. The differences between the initial and final\r\nscores in selected were subjected to statistical treatment using Analysis of Covariance (ANCOVA).', '1436688699_5.pdf', '2015-07-12', 'B.CH.SangithaRao,Dr.P.P.S.Paul Kumar', 'sudhakarmande7@gmail.com,ppspaulkumar@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1436697579_5.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue VII, July 2015.', 182, 1),
(486, 'IJERSS-1436763046', 'editor@ijerss.com', 'CONSTRUCTION OF HEALTH RELATED PHYSICAL FITNESS FOR COLLEGE MEN STUDENTS', 'Research', 'Physical Education; Physical fitness Norms', 'The purpose of the study was to constructing health related physical fitness for 16 to 18 years pre university college men students. A sample of 2020 pre university men students was taken for the present study. The muscular strength measured by chin-ups,  flexibility measured by bridge up test, body composition by skinfold tests, general physical fitness factor by measuring body weight and cardio-respiratory endurance measured by 1500 meters run/walk tests were conducted for data collection. The Health related physical fitness components extracted â€˜Muscular Strengthâ€™, â€˜Flexibilityâ€™, â€˜Body Compositionâ€™, â€˜General Physical Fitness factorâ€™ and â€˜Cardio-respiratory Enduranceâ€™.', '1436763046_ARTICLE2_MANOJ.doc', '2015-07-13', 'Manoj Kumar M.,Dr. C. Venkatesh', 'manojkumar7760@gmail.com,venkateshphyedn@gmail.com', '9480265575', 'Ambika Sadana, Sulkery post and village', 'Belthangady Taluq', 'Mangalore', 'Karnataka', 574109, 'IN', 'Pending', NULL, 'PHYSICAL SCIENCE', '1439794342_IJERSS1436763046.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue VIII, August 2015.', 130, 1),
(487, 'IJERSS-1436863545', 'editor@ijerss.com', 'NUTRITIONAL AWARENESS VS EATING HABITS OF INTER UNIVERSITY WOMEN PLAYERS OF ANDHRA PRADESH ', 'Research', 'HEALTH SCIENCE', 'The foremost aim of physical education has been to inculcate a healthy mind in a healthy body.  Our body is indeed an instrument satisfying all our needs.  Its maintenance and upkeep has always been a serious concern of formal education.  It finds expression as health education and organization of games and sports. Players always tend to improve their performance through vigorous physical activities and training and do not give more attention for their nutritional food habits.  Women players were found to be more conservative than men players in taking nutritional food. ', '1436863545_uma_paper.docx', '2015-07-14', 'Ms. Uma Maheswari,Dr. N.S. Dilip', 'umab2004@yahoo.in,umab2004@yahoo.in', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1439795193_IJERSS1436863545.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue VIII, August 2015.', 125, 1),
(488, 'IJERSS-1437284266', 'editor@ijerss.com', 'DESIGN OF PAYLOAD DATA STORAGE BLOCK OF WI-FI MAC TRANSMITTER WITH VHDL', 'Research', 'COMPUTER SCIENCE', 'IEEE 802.11 is one standard for the wireless communication in radio frequency range.This 802.11b defines the Medium Access Control Layer [MAC] for wireless local area networks. Now a days  wireless local area network, WLAN isused more people so that is the main reason for doing research on this project.today most of the projects going on simulation because of its effective cost.The main core of the IEEE 802.11b standard is the CSMA\\CA, Physical and MAC layers. But here we are giving only MAC layer for transmitter using the VHDL. VHDL is language it is used of designs and implementing a n electronic modules. VHDLstands for Very High Speed Hardware Description LANguage.It  is defined in IEEE as a tool of creation of electronics system because it supports the development verification synthesis and testing of hardware design, the communication of hardware design data and the maintenance, modification and procurement of hardware. The main purpose of the IEEE 802.11 standard is to provide wireless connectivity to devices that require a faster installation. MAC procedures are defined here for accessing the physical medium, which can be infrared or radio frequency. Here Wi-Fi MAC Transmitter module is divided in to 5 blocks i.e. Data Unit Interface block, Controller block, Pay Load Data Storage block, MAC Header Register block, Data Processing block. In this paper, we are considering only Payload Data Storage block.\r\nKeywords: Wi-Fi, Technology, payload data storage, serializer, HEC, CRC', '1437284266_DESIGN_OF_PAYLOAD_DATA_STORAGE_BLOCK_OF_WIFI_MAC_TRANSMITTER_WITH_VHDL.docx', '2015-07-19', 'V.SUDHARANI,G RAMANJANEYAREDDY', 'rangaswamy19@gmail.com,rangaswamy19@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2015', 0, 0, 'New', 0, 0),
(489, 'IJERSS-1437472777', 'editor@ijerss.com', 'Design & analysis of oval shape flange for chiller', 'Research', 'Design & Analysis', 'Flange joints are very common in pressure vessel and piping systems. Flanges are primarily used where a connecting or dismantling joint is needed. These joints may include joining pipe to fittings, valves, equipment, or any other integral component within the piping system. The performance of joint is characterized mainly by its strength and sealing capability. However, recommended design procedures for bolted flange joints are available in international codes and standards. In this paper, bolted flange connections are analyzed by implementing the design method of ASME Boiler and Pressure Vessel Code. The results of a parametric study of the behavior of flanges and stresses in bolts are analyzed by varying the flange thickness, bolt preload and number of bolts, at the same time maintaining other flange dimensions constant. Theoretical results obtained using ASME design approach is compared.', '1437472777_OSF.doc', '2015-07-21', 'Dinesh M. Ugle,Dr.MOHD JUBIN SHEIKH', 'dinesh_ugle2009@rediffmail.com,mjsheikh1971@gmail.com', '7387700380', 'Mechanical Engineering Dept', 'B.D. COLLEGE OF ENGINEERING', 'sevagram,Wardha', 'Maharastra', 442102, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2015', 0, 0, 'New', 0, 0),
(490, 'IJERSS-1437474120', 'editor@ijerss.com', 'COMPARISON OF SELECTED ANTHROPOMETRICAL, PHYSIOLOGICAL AND PSYCHOLOGICAL VARIABLES AMONG DIFFERENT CATEGORIES OF ATHLETES', 'Research', 'Physical Education', 'The ability to obtain and to use precise information regarding the anthropometric and physiological status of athletes is a fundamental issue in contemporary sport various anthropometric and physiological characteristics have been found to be closely related to successful performance in any sport. The purpose of the study is to find out the significant differences on selected anthropometrical, physiological and psychological variables of sub junior, junior and senior athletes. A total of 60 athletes selected for the study, were grouped (n =20) into 3 groups: (i) under sub-junior, junior and senior group athletes on age category basis. The anthropometric variables such as chest girth, thigh girth, calf girth leg length, arm length, physiological variables like vital capacity, resting heart rate, breath holding capacity and anxiety as psychological variable. The data were collected and tabulated accordingly. The One-Way ANOVA statistical technique was used to find out the significant difference between the groups. A significant difference was found in chest length (P < 0.05), leg length (P<0.05) and anxiety (P< 0.05) and there was no significant difference in thigh, calf girth, arm length, vital capacity, resting heart rate and breath holding time of anthropometric and physiological variables respectively. This study would provide useful information for training and selection of athletes of different categories of athletes.', '1437474120_Article_Suresh_SM.doc', '2015-07-21', 'Suresh S.M.,Dr. P.C. Krishnaswamy', 'sureshmmandya1980@gmail.com,kswamypc@gmail.com', '9980937430', 'Suresh S.M., Physical Education Director,', 'Government Medical College', 'Mandya', 'Karnataka', 571, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1439795287_IJERSS1437474120.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue VIII, August 2015.', 112, 1),
(491, 'IJERSS-1437559684', 'editor@ijerss.com', 'Comparison of Selected Anthropometrical, Physiological and Psychological Variables among Different Categories of Athletes', 'Research', 'SPORTS SCIENCE', 'The ability to obtain and to use precise information regarding the anthropometric and physiological status of athletes is a fundamental issue in contemporary sport various anthropometric and physiological characteristics have been found to be closely related to successful performance in any sport. The purpose of the study is to find out the significant differences on selected anthropometrical, physiological and psychological variables of sub junior, junior and senior athletes. A total of 60 athletes selected for the study, were grouped (n =20) into 3 groups: (i) under sub-junior, junior and senior group athletes on age category basis. The anthropometric variables such as chest girth, thigh girth, calf girth leg length, arm length, physiological variables like vital capacity, resting heart rate, breath holding capacity and anxiety as psychological variable. The data were collected and tabulated accordingly. The One-Way ANOVA statistical technique was used to find out the significant difference between the groups. A significant difference was found in chest length (P < 0.05), leg length (P<0.05) and anxiety (P< 0.05) and there was no significant difference in thigh, calf girth, arm length, vital capacity, resting heart rate and breath holding time of anthropometric and physiological variables respectively. This study would provide useful information for training and selection of athletes of different categories of athletes', '1437559684_Article_Suresh_SM.doc', '2015-07-22', 'SURESH S.M,P.C. KRISHNASWAMY', 'sureshmmandya1980@gmail.com,pckrishnaswamy@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2015', 0, 0, 'New', 0, 0),
(492, 'IJERSS-1437657911', 'editor@ijerss.com', 'DATA DRIVEN DEEP LEARNING MODEL FOR PERFORMANCE ANALYSIS OF INDIAN CRICKET', 'Research', 'Cricket, Predictive Analytics, Deep Learning', 'In this paper we analyse the statistical behaviour and prediction analysis of performance of the Indian cricket players and the whole team. This is a refined work of existing models in the domain of cricket analytics. We propose a multi layered neural network architecture as a model and employed the Deep learning technique for estimation of the performance of individual players and the entire Indian cricket team. We design the data driven pipelines where the data is first cleaned and then by using statistical analysis, we estimate the consistency of the partnerships between the players. Finally, this data is used to process in the deep learning neural network through a parallel pipeline for the prediction of performance of the players. ', '1437657911_BTP_paper_07July_15.pdf', '2015-07-23', 'Jalem Raj Rohit,Desidi Siva Prakash,Gatla Rajasekhar Reddy,Dr. V.V.M.S Chandramouli', 'rajrohit@iitj.ac.in,desidisiva@iitj.ac.in,gatlarajasekhar@iitj.ac.in,chsarma@iitj.ac.in', '9441332531', 'Qtr No. - 215-D, Sector - 10,', 'Ukkunagaram', 'Visakhapatnam', 'Andhra Pradesh', 530032, 'IN', 'Pending', NULL, 'COMPUTER SCIENCE', '1439795628_IJERSS1437657911.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue VIII, August 2015.', 202, 1),
(493, 'IJERSS-1438519637', 'editor@ijerss.com', 'ASSESSMENT OF SELECTED, MOTOR ABILITY VARIABLES AND PSYCHOLOGICAL VARIABLES IN RELATION TO THE PERFORMANCE AMONG COLLEGIATE HANDBALL PLAYERS', 'Research', 'PHYSICAL EDUCATION', 'Sport being integral part of human life is getting more competitive and knowledge driven these days. The coaches are challenged with selection of best playing team and the criterion for their selection is getting systematic. The present study intended to assess the psychological and motor ability variables that most importantly influence the collegiate Handball players performance. The necessary data was collected previous day of the competition, using panel of two expert coaches and a national player. The data was analyzed using step-wise regression. The analysis indicated the psychological variables viz., reaction, self confidence and SCAT, the motor ability variables, arm power and leg power could be crucial factors.', '1438519637_ASSESSMENT_OF_HANDBALL_PERFORMANCE_FROM.docx', '2015-08-02', 'Rajeeva H.N,Dr.C.Venkatesh', 'ravirajdaya@gmail.com,ravirajdaya@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1439795716_IJERSS1438519637.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue VIII, August 2015.', 148, 1),
(494, 'IJERSS-1439031074', 'editor@ijerss.com', 'YOUTH AND EXERCISE  FEELING OF "FIT AND FINE"', 'Research', 'Physical Education and Sports Sciences', 'Abstract - The inner glow of happiness that is reflected on oneâ€™s expression is the real beauty of the person. It is true that regular exercises make us feel light and joyous, giveâ€™s great to become happiest and ecstatic feelings which canâ€™t really be put in words. It is important that equilibrium between body and mind is the most important factor in being fit and fine. Regular exercising and diet is the key to keep body fit and fine. In this paper author tried to create an awareness about the concept of fitness, nutrition and balanced diet, benefits of regular exercise, type of exercise, risk factor does exercising reduce, an ideal exercise program etc. \r\nIndex Termsâ€” Youth, Exercise, Fit and fine\r\n', '1439031074_youth_and_exercise_final_app.doc', '2015-08-08', 'Mr. Ananthapadmanabha Prabhu ,Dr. Kishore Kumar C K', 'sportstodream@gmail.com,Ckkkumar@yahoomail.com ', '+91 9164586621', 'Physical Education Teacher, ', 'Morarji Desai Residential School, Kandali, Hassan', 'Hassan', 'Karnataka', 573217, 'IN', 'Pending', '', 'SPORTS SCIENCE', '1439795768_IJERSS1439031074.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue VIII, August 2015.', 127, 1),
(495, 'IJERSS-1439258721', 'editor@ijerss.com', 'Effect of play and moment Education Approach on Selected Physical Fitness variable of Elementary school children', 'Research', 'PHYSICAL EDUCATION', 'Physical exercises have been considered as an essential part of human life.  The survival of man is physical and movement or the activity is the foremost important thing one learns soon after birth.  The literate meaning of â€˜physicalâ€™ is â€˜bodyâ€™ which strictly relates to physique, health, strength, endurance, speed, agility, flexibility, and physical performance on the sports ground (Uppal, 2000) . A well planned and regular lifetime programme of exercise will help us feel better, look better and enable us to enjoy a much comfortable life than we may have been leading until now.  Exercise means treating our body with new respect, working with it instead of against it.  And all this should be fun.  It is therefore important to select a method that suits an individual and their personality (Ann Carpenter, 1984) .', '1439258721_BALAKRISHNA.docx', '2015-08-11', 'S.Gafoor,Dr.P.P.S.Paul Kumar', 'sudhakarmande7@gmail.com,ppspaulkumar@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1440218923_IJERSS1439258721.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue VIII, August 2015.', 121, 1),
(496, 'IJERSS-1439607475', 'editor@ijerss.com', 'HEALTH RELATED PHYSICAL FITNESS STATUS OF SCHOOL CHILDREN IN KERALA, INDIA: FINDINGS FROM 2008 TPFP SURVEY', 'Research', 'Physical Education - Research Report', 'In the academic year 2008-2009, as part of the "Total Physical Fitness Programme" health related physical fitness testing was conducted in Kerala state schools in classesâ€™ five to nine. A total of 16,28,943 students enrolled in classes five to nine, were administered the Total Physical Fitness Programme: Health Related Physical Fitness Test (HRPFT) in 2008, from 4315 schools representing approximately 73 percent of Kerala State schools. Only 19.61 percent of state school population from classesâ€™ five to nine was found within the minimum recommended fitness standard on all the test items. Considering state averages on girlsâ€™ performance, only age 10 students met the recommended fitness standards on abdominal strength and all the other fitness variable state averages are below than the recommended standard. The data revealed that 53.69% of girl students failed to meet the recommended standard in abdominal strength and the percentage of failed students increased by their age (13=54.12%, 14= 64.62%, 15=68.3%). 64.82 percent girlâ€™s students failed to meet the recommended standard in flexibility and failed studentsâ€™ percentage increased by their age (13=59.73%, 14= 62.97%, 15=73.11%). The low performance in one mile run indicates low level cardio-respiratory capacity, 42.05% of the girls students did not meet the recommended standard, failed students percentage increased by their age (13=41.95%, 14= 47.23%, 15=49.89%). 7% of girls students were found to be under weight severely (BMI less than 13) and 54% of girls students were under weight when compared with WHO standard of 18.50 (normal range). Only 3.2% girlsâ€™ students were found over weight. The state wide averages on physical fitness of boys students showed that boys of 10, 11 and 12 years age met recommended criteria equal to grade D. The age group 13, 14 and 15 among boys, the mean scores did not meet the required zone of health standard recommended for the respective age groups in abdominal strength, flexibility and cardio respiratory endurance. In the case of cardio respiratory endurance of boys, the performance of age group of 14 and 15 is below than the age group of 13. The prime reasons for the above findings which is alarming and lead to a potential health disaster is as follows: Lack of physical activity, Even if physical activity is there it is either inadequate or improper, As the students reach higher standards emphasis on academics becomes greater and contributes to the lack of time for physical activity.', '1439607475_health_related_physical_fitness_status_of_school_children_in_kerala_2008.docx', '2015-08-15', 'Dr.T.I.Manoj, Dr.G. Bipin', 'manoj.ti@gmail.com,g.bipin@gmail.com', '9447063339', 'Dept of Physical Education', 'College of Agriculture, Vellayani', 'Thiruvanathapur', 'Kerala', 695522, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1442253037_IJERSS1439607475.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue IX, September 2015.', 127, 1),
(498, 'IJERSS-1440218035', 'editor@ijerss.com', 'COMPARATIVE STUDY ON SELECTED ANTHROPOMETRIC VARIABLE AMONG UNIVERSITY MEN SPRINTERS, THROWERS, JUMPERS AND LONG DISTANCE RUNNERS', 'Research', 'SPORTS SCIENCE', 'The human body is a machine of wondrous complexity capable of strong and violent movements.  This machine is made up of slightly more than two hundred bones to which are attached better than six hundred musclesâ€ (Eston, R., and Reilly, T. 2008). There are numerous factors, which are influencing performance of sportsman of the physical including shape, size, weight and height.  Each and every nation wants to show their supremacy in any sports and games.  The Olympic motto itself shows â€œFaster, higher and strongerâ€.  The challenges inspire the entire nation to exhibit greater performance in sports through application of research in modern science any technology.', '1440218035_Bala.docx', '2015-08-22', 'D.Bala Krishna,Dr.P.P.S.Paul Kumar', 'sudhakarmande7@gmail.com,ppspaulkumar@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1440218703_Bala.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue VIII, August 2015.', 112, 1),
(499, 'IJERSS-1440218130', 'editor@ijerss.com', 'EFFECT OF LOW, MEDIUM AND HIGH INTENSITY POLYMERIC TRAINING ON SELECTED PHYSIOLOGICAL VARIABLES ON COLLEGE MEN STUDENTS', 'Research', 'PHYSICAL EDUCATION', 'The science of sports training is a recent to the field of sports science.  The sports science discipline have improved at a very fast pace in the past few decades.  The knowledge gained by these disciplines has to be understood by the coaches and trainers to apply it correctly to the training process.  But majority of the coaches do not have sufficient scientific background and training to make full and effective use of the knowledge acquired by the sports science disciplines.  This creates a gap between scientists and coaches. The science of training with its workers having sufficient background of science and sports are able to fill this gap and can become mediator between the scientists and the coaches.', '1440218130_ravi1.docx', '2015-08-22', 'T.Ravikumar,Dr.P.P.S.Paul Kumar', 'sudhakarmande7@gmail.com,ppspaulkumar@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'PHYSICAL SCIENCE', '1440218602_ravi1.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue VIII, August 2015.', 111, 1),
(500, 'IJERSS-1440218206', 'editor@ijerss.com', 'EFFECT OF YOGIC TRAINING AND BRISK WALKING ON SELECTED BIOCHEMICAL VARIABLES AMONG DIABETIC PATIENTS', 'Research', 'PHYSICAL EDUCATION', 'Yoga means the experience of oneness or unity with inner being.  This unity comes after dissolving the duality of mind and matter into supreme reality.  It is a science by which the individual approaches truth.  The aim of all yoga practice is to achieve truth where the individual soul identifies itself with the supreme soul or God.  Yoga has the surest remedies for manâ€™s physical as well as psychological ailments.  It makes the organs of the body active in their functioning and has good effect on internal functioning of the human body.  Yoga is a re-education of oneâ€™s mental process, along with the physical.', '1440218206_susi.docx', '2015-08-22', 'T.Suselamma,Dr.P.P.S.Paul Kumar', 'sudhakarmande7@gmail.com,ppspaulkumar@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'PHYSICAL SCIENCE', '1440218515_susi.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue VIII, August 2015.', 114, 1);
INSERT INTO `papers` (`id`, `paper_id`, `paper_referral`, `paper_title`, `paper_type`, `subject_category`, `abstract`, `paper_attachment`, `uploaded_on`, `author`, `email`, `pnumber`, `address_line1`, `address_line2`, `city`, `state`, `pincode`, `country`, `status`, `comments`, `subject`, `pdf`, `active`, `news`, `conference`, `volume`, `issue`, `volume_issue_title`, `downloads`, `blogspot`) VALUES
(501, 'IJERSS-1440338929', 'editor@ijerss.com', 'EFFECTS OF AEROBIC TRAINING AND YOGIC PRACTICES ON HEALTH RELATED PHYSICAL FITNESS, BASAL METABOLIC               RATE AND LIPID PROFILES OF OBESE ADOLESCENTS', 'Research', 'PHYSICAL EDUCATION', 'The importance of regular physical activity is to prevent disease and premature death and to maintain a high quality of life. Primary goal of the physical activity is to develop and maintain cardio-respiratory fitness. Aerobic activity is useful to involve large muscle groups in a continuous, and rhythmical fashion. Indian philosophy of yoga also claims the role of such non-exercising technique in improving the inner self and positive effects on various body functions. However, a comparative study of physical activity with yoga is meager and therefore, the present study was planned to see the effect of respective techniques on selected variables. The purpose of the preset study was to find out the effects of aerobic training and yogic practices on health related physical fitness, basal metabolic rate, and lipid profiles of the obese adolescents. To achieve the purpose of this study, a qualified physician examined 650 male students from nine schools in Anantapurmau town, Andhra Pradesh, India, and found out 140 obese adolescents. Out of 140 obese adolescents forty five obese adolescents were selected at random as sujects for this study. Their age ranged from 13 to 15 years as per the school records. The selected subjects were divided into two experimental groups and a control group with fifteen subjects in each (n=15) . Experimental Group I underwent aerobic training (ATG), Group II underwent yogic practices (YPG) and Group III served as control group (CG) for the training period of 12 weeks. Subjects of the three groups (ATG, YPG and CG) were tested on selected criterion measures, namely, health related physical fitness variables, basal metabolic rate (BMR) and lipid profiles prior to and after the 12 weeks of a training period. The data collected from the three groups before and after the experimental period was statistically examined to find out the significant improvement using the analysis of covariance (ANCOVA). The aerobic training and yoga practices groups showed significant improvement in muscular strength and endurance, flexibility, and cardio respiratory endurance; significantly reduced the level of body mass index, body fat percentage and fat free mass; reduced the basal metabolic rate; and  improved the lipid level in blood among the obese adolescents when compared with a control group as well as pre test', '1440338929_SKUBhaskars_Research_Paper.doc', '2015-08-23', 'A. Bhaskar,Dr. M.V. Srinivasan', 'sudhakarmande7@gmail.com,ppspaulkumar@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'published online', '', 'SPORTS SCIENCE', '1443092615_IJERSS1440338929.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue IX, September 2015.', 96, 1),
(502, 'IJERSS-1441301395', 'editor@ijerss.com', 'Bio-Metric Protection Scheme based on Cryptography using Image Processing', 'Research', 'MPhil computer science', 'Cryptography is the science of information security. The word is derived from the Greek kryptos, meaning hidden. Cryptography isclosely related to the disciplines of cryptology and cryptanalysis. Cryptography includes techniques such as microdots, merging words with images, and other ways to hide information in storage or transit. However, in today''s computer-centric world, cryptography is most often associated with scrambling plaintext(ordinary text, sometimes referred to as cleartext) into cipher text (a process called encryption), then back again (known as decryption). Individuals who practice this field are known as cryptographers.\r\n\r\nModern cryptography concerns itself with the following four objectives:\r\n\r\nConfidentiality (the information cannot beunderstood by anyone for whom it was unintended) \r\n\r\nIntegrity (the information cannot be alteredin storage or transit between sender and intended receiver without the alteration being detected) \r\n\r\nNon-repudiation (the creator/sender of theinformation cannot deny at a later stage his or her intentions in the creation or transmission of the information) \r\n\r\n\r\n4) Authentication (the sender and receiver can confirm each others identity and the origin/destination of the information)\r\n\r\nBiometrics\r\n\r\nA biometric is defined as a unique, measurable, biological characteristic or trait for automatically recognizing or verifying the identity of a human being. Statistically analyzing these biological characteristics has become known as the science of biometrics. These days, biometric technologies are typically used to analyze human characteristics for security purposes. Five of the most common physical biometric patterns analyzed for security purposes are the fingerprint, hand, eye, face, and voice.\r\n\r\n\r\nThis paper at hand presents a series of automation of biometric identification for law enforcement purposes coincided with the development of automated systems for non-forensic applications, such as high-security access control. Biometric identification is the process of matching an individual to one of a large set of system users, whereas biometric authentication simply verifies that the individual is who he or she claims to be. By theproposed method, all the pixels of the marked image are equal to the original image.\r\n', '1441301395_BioMetric_Protection_Scheme_based_on_Cryptography_using_Image_Processing.docx', '2015-09-03', 'S.Archana ,Mr.kamalakannan', 'archanawedssankar@gmail.com', '9489106489 ', 'N.Sekar,11C,Prasad road,Narimedu main road,madur', 'near guru medical ', 'Madurai ', 'Tamilnadu ', 625002, 'IN', 'payment pending', '', '', NULL, 1, 0, 'IJERSS-2015', 0, 0, 'Volume II - Issue IX, September 2015.', 0, 0),
(503, 'IJERSS-1441764337', 'editor@ijerss.com', 'Using Rhodobacter capsulatus as a bio-remedial agent  for the treatment of industrial effluents', 'Research', 'Microbiology, Biotechnology', 'The present work evaluates the efficiency of a phototrophic bacterium Rhodobacter capsulatus in improving the quality (bioremediation) of industrial effluents. Certain parameters for the assessment of quality of effluents were considered, including pH, nitrates, sulphates, phosphate, ammonia and metal ions (Pb2+, CrO42- etc). Parameters were tested before, during and after the use of bioremedial agents. A comparison of three stages of testing has been of great help in assessing the bioremedial impact of Rhodobacter capsulatus.\r\nThe results of the study indicate that Rhodobacter capsulatus has a remarkable impact in improving various quality parameters of industrial waste water. Its use on a commercial scale along with other such agents can be very efficient and cost effective method of improving water quality.\r\n', '1441764337_wwwww.doc', '2015-09-09', 'P. K. Agrawal', 'dragrawalpk@gmail.com', '7417269421', '69 - A Govind Nagar', 'Opposite Govind Nagar Thana', 'Mathura', 'Uttar Pradesh', 281003, 'IN', 'payment pending', '', 'ZOOLOGY', '1444910548_IJERSS1441764337.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue X, October 2015.', 120, 1),
(504, 'IJERSS-1442246321', 'editor@ijerss.com', 'EFFECT OF PLAY AND MOMENT EDUCATION APPROACH ON SELECTED MOTAR FITNESS(FLEXIBILITY) VARIABLE OF ELEMENTARY SCHOOL CHILDREN', 'Research', 'PHYSICAL SCIENCE', 'Physical exercises have been considered as an essential part of human life.  The survival of man is physical and movement or the activity is the foremost important thing one learns soon after birth.  The literate meaning of â€˜physicalâ€™ is â€˜bodyâ€™ which strictly relates to physique, health, strength, endurance, speed, agility, flexibility, and physical performance on the sports ground (Uppal, 2000) . A well planned and regular lifetime programme of exercise will help us feel better, look better and enable us to enjoy a much comfortable life than we may have been leading until now.  Exercise means treating our body with new respect, working with it instead of against it.  And all this should be fun.  It is therefore important to select a method that suits an individual and their personality (Ann Carpenter, 1984)', '1442246321_gafoor_paper_2.docx', '2015-09-14', 'S.Gafoor,Dr.P.P.S.Paul Kumar', 'sudhakarmande7@gmail.com,sudhakarmande7@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'PHYSICAL SCIENCE', '1442251144_IJERSS1442246321.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue IX, September 2015.', 103, 1),
(505, 'IJERSS-1442246535', 'editor@ijerss.com', 'EFFECT OF LOW, MEDIUM AND HIGH INTENSITY POLYMERIC TRAINING ON SELECTED MOTOR FITNESS COMPONENTS ON COLLEGE MEN', 'Research', 'PHYSICAL SCIENCE', 'Sports training aims to improving the performance of sports persons. Weight training and plyometric training are very popular now a days and effective training methods to promote higher performance in sprinting and jumping events.  Plyometric exercises are included depth jumping, hopping, bounding drills etc are legs plyometric and medicine balls exercise are arms plyometric exercises.  these exercises are used to improve speed, explosive strength and other motor ability components.  Weight training is on activities of high intensity and short duration and opposite side low intensity and high volume or duration. Weight training exercises helps to build muscle, strength and endurance', '1442246535_ravi_paper_2.docx', '2015-09-14', 'T.Ravikumar,Dr.P.P.S.Paul Kumar', 'sudhakarmande7@gmail.com,sudhakarmande7@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'PHYSICAL SCIENCE', '1442251059_IJERSS1442246535.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue IX, September 2015.', 110, 1),
(506, 'IJERSS-1442246667', 'editor@ijerss.com', 'EFFECT OF SWISS BALL TRAINING AND CORE BOARD TRAINING ON SELECTED PHYSICAL FITNESS COMPONENTS  VARIABLE OF BATSMEN OF CRICKET', 'Research', 'SPORTS SCIENCE', 'Sports in the present world have become extremely competitive.  It is not the mere participation or practice that brings out victory to an individual.  Therefore, sports life is affected by various factors like physiology, biomechanics, sports training, sports medicine, sociology and psychology etcetera.  All the coaches, trainers, physical educational personals and doctors are doing their best to improve the performance of the players of their country.  Athlete players of all the countries are also trying hard to bring laurels, medals for their countries in International competitions', '1442246667_SALMAN_1.docx', '2015-09-14', 'C.Salmon sudheer,Dr.P.P.S.Paul Kumar', 'sudhakarmande7@gmail.com,sudhakarmande7@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1442250987_IJERSS1442246667.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue IX, September 2015.', 95, 1),
(507, 'IJERSS-1442331133', 'editor@ijerss.com', 'THE EFFECT OF DIFFERENT PACKAGES OF YOGIC PRACTICES ON SELECTED MOTOR FITNESS VARIABLES AMONG ADOLESCENT BOYS', 'Research', 'HEALTH SCIENCE', 'Modern world is the outcome of many scientific inventions through centuries.  Scientific instruments and machinery have helped to lead the daily life with ease and comfort.  The modern man depends mostly upon the scientific equipment for his daily routine, involving mainly his mental powers to have a comfortable life, resulting in fall and deterioration in his physical health and capacity.  Modern man need not toil like his forefathers in his daily life.  So he has become less vigorous and less active.  The inactivity and pressure of work result in stress, which is on the increase in the urban areas.  Fatal cardiac arrests affect even youngsters in their early thirties.  It is here the concept and the initiative for games and physical exercises become useful.  The twentieth century man is not even a chip of the giants that bestrode the world till the end of the last century', '1442331133_sujatha_madem.docx', '2015-09-15', 'K. Aruna Sujatha,Dr.P.P.S Paul Kumar ', 'sudhakarmande7@gmail.com,sudhakarmande7@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1442332584_IJERSS1442331133.pdf', 1, 1, 'IJERSS-2015', 0, 0, 'Volume II - Issue IX, September 2015.', 98, 1),
(508, 'IJERSS-1443451519', 'editor@ijerss.com', 'EFFECTS OF SAQ TRAINING ON SPECIFIC MOTOR ABILITIES OF SELECTED SCHOOL LEVEL SOCCER PLAYERS', 'Research', 'PHYSICAL EDUCATION', 'The purpose of the study was to analyse the effect of SAQ training on selected variable among school boys. It had the purpose of comparing and analysing the data collected from each variable during pre and post-test. For the purpose of the study, twenty boy students of 17 to 19 years old were selected as subjects for the investigation. These students were started SAQ training in Vocational higher secondary School, Irimpanam, Ernakulam. The pre-test was administrated by researcher during their first week of training and post-test were administrated after three weeks of training. . The selected variables for the study were Speed, Agility and Quickness. The test administrated to assess the speed, agility and quickness, 50 m dash (to assess the speed) Shuttle run (to assess the agility) and choice response test (to assess the quickness).. The test was about the effect of SAQ training for three weeks. A pre-test and post-test score of the experimental group and controlled group were analysed by employing the T-test. To find out the significance of difference between pre-test and post-test score of the experimental group and controlled group, the t-ratio was employed. The result of the study supported the hypothesis that there would be significant difference in the speed, agility and quickness of subjects as a result of three weeks of SAQ training programme is accepted since it was indicated that t-ratio obtained from pre-test and post test scores of the experimental group is speed- 5.00, agility- 3.26 and quickness- 4.36. This value was significant as it was greater than the t-value of 2.101 requires for the significance at 0.05 levels and the controlled group is speed- .677, agility- .625 and quickness- 33. This value was not significant as it was lesser than the t-value of 2.101 require for the significance at 0.05 level', '1443451519_Dr._Sujith.docx', '2015-09-28', 'Dr. Sujith S.,Dr. Dhinu M.R.,Mr. Prajishkumar P', 'sujithnair22@gmail.com,dhinumr@gmail.com,prajishkumar.mp@gmail.com', '09745677864', 'PREM VIHAR, CHITRANJALI ROAD,', 'THIRUVANKULAM-(P.O),', 'ERNAKULAM', 'KERALA', 682305, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1456853496_IJERSS1443451519.pdf', 1, 1, 'IJERSS-2016', 0, 0, 'Volume III - Issue II, February 2016.', 116, 1),
(509, 'IJERSS-1443458651', 'editor@ijerss.com', 'ENSURING QUALITY OF SERVICE OF REAL-WORLD WEB SERVICES COMUNICATION USING HETROGENEOUS ENVIRONMENT', 'Research', 'COMPUTER SCIENCE', ' Analysis the Quality of Service (QoS) complication is an important procedure in web service environment. It determines whatever users expectations are meet and itâ€™s becomes the vital factor for them to decide whether to continue the service for pay or not. The analysis is performed by checking the actual services performance against the Quality of Service stated in Service Level Agreement (SLA). In comparison to that, the need for analysis vague QoS specifications in SLA has become more usual nowadays. This paper reviews the published literature on web services QoS monitoring. The review shows that little information exists on analysis vague QoS specifications of web services. Providing ability for analysis QoS that is specified in the SLA could give new insights and implications to web services field.', '1443458651_international_journal_papper.docx', '2015-09-28', 'K.SHARMILAv,UMAPATHY.B', 'sharmilasenthil@ymail.com,umapathy2793@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'payment pending', '', '', NULL, 1, 0, 'IJERSS-2014', 0, 0, 'Volume II - Issue X, October 2015.', 0, 0),
(510, 'IJERSS-1444495777', 'editor@ijerss.com', 'EFFECT OF RESISTANCE TRAINING AND ENDURANCE TRAINING IN PARALLEL ON HEART RATE AT REST AND RESTING RESPIRATORY RATE', 'Research', 'HEALTH SCIENCE', 'The aim of this study was to determine the Effect of Resistance training and Endurance training in parallel on Heart rate at rest and Resting respiratory rate. To achieve this purpose, thirty (N=30) Degree College women students were randomly selected as subjects from K.V.R.College, Nandigama, Krishna Dist, Andhra Pradesh, India. They were divide into two equal groups of fifteen (n=15) each. Group-I underwent resistance training and endurance training in  parallel and Group-II control group. For both the groups, Heart rate at rest and resting respiratory rate were measured by using of Bio monitor and Manual method. The training group underwent 12-week resistance training and endurance training in parallel (12week) and no specific training was given to the control group. Prior to and after training, researcher has concluded that Heart rate at rest and resting respiratory rate are significantly improved among healthy untrained women.', '1444495777_TVBKRPAPER.doc', '2015-10-10', 'T V Bala Krishna Reddy,Dr.I.Devi Vara Prasad', 'sudhakarmande7@gmail.com,sudhakarmande7@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Published online', '', 'HEALTH SCIENCE', '1444661527_IJERSS1444495777.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume II - Issue X, October 2015.', 100, 1),
(511, 'IJERSS-1444497141', 'editor@ijerss.com', 'ASSOCIATION OF SELECTED MOTOR FITNESS, VARIABLES WITH PLAYING ABILITY OF BADMINTON PLAYERS', 'Research', 'SPORTS SCIENCE', 'Sports has an undeniable role in the society.  As society changes so does sport. Games in the early years  were local and informal.  The rules were simple and changing according to the number of participating and the local.  As cities grew, clubs were formed and interclub competitions began.  Eventually cities played against other cities as transportation developed and as coaches, steamboats and railways reduced the time to travel long distance.  Finally, there were regional, national and international competitions and corresponding governing bodies.  All these developments took time and occurred as cities reached a certain stage of development and inventions occurred to make these improvements possible', '1444497141_Khan_1.docx', '2015-10-10', 'Mohiddin Sattar Khan,Dr.P.P.S.Paul Kumar', 'sudhakarmande7@gmail.com,ppspaulkumar@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1444661670_IJERSS1444497141.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume II - Issue X, October 2015.', 97, 1),
(512, 'IJERSS-1444497661', 'editor@ijerss.com', 'ASSOCIATION OF SELECTED PHYSIOLOGICAL VARIABLES WITH PLAYING ABILITY OF BADMINTON PLAYERS', 'Research', 'SPORTS SCIENCE', 'Sports has an undeniable role in the society.  As society changes so does sport. Games in the early years  were local and informal.  The rules were simple and changing according to the number of participating and the local.  As cities grew, clubs were formed and interclub competitions began.  Eventually cities played against other cities as transportation developed and as coaches, steamboats and railways reduced the time to travel long distance.  Finally, there were regional, national and international competitions and corresponding governing bodies.  All these developments took time and occurred as cities reached a certain stage of development and inventions occurred to make these improvements possible', '1444497661_Khan_2.docx', '2015-10-10', 'Mohiddin Sattar Khan,Dr.P.P.S.Paul Kumar', 'sudhakarmande7@gmail.com,ppspaulkumar@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1444661798_IJERSS1444497661.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume II - Issue X, October 2015.', 92, 1),
(513, 'IJERSS-1444498062', 'editor@ijerss.com', 'EFFECT OF SWISS BALL TRAINING AND CORE BOARD TRAINING ON SELECTED PHYSICAL FITNESS COMPONENT  VARIABLE OF BATSMEN OF CRICKET', 'Research', 'SPORTS SCIENCE', 'Athletic performance has dramatically progressed over the past few years. Performance levels unimaginable before are now commonplace, and the number of athletes capable of outstanding results is increasing. One factor is that athletics is a challenging field, and intense motivation has encouraged long, hard hours of work. Also, coaching has become more sophisticated, partially from the assistance of sport specialists and scientists. A broader base of knowledge about athletes now exists, which is reflected in training methodology', '1444498062_SALMAN_2.docx', '2015-10-10', 'C.Salmon Sudheer,Dr.P.P.S.Paul Kumar', 'sudhakarmande7@gmail.com,ppspaulkumar@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1444557507_IJERSS1444498062.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume II - Issue X, October 2015.', 122, 1),
(514, 'IJERSS-1444498565', 'editor@ijerss.com', 'NUR JAHAN-AN INHOUSE FEMINIST', 'Research', 'ENGLISH', 'History is replete with enthralling and intriguing tales of prominent and powerful persona. Of a few women of the past, especially from the Mughal era, Mehrunnisa is one such captivating personality. History has portrayed her as an ambitious and vicious woman, but a careful analysis of her character will bring out several facets of her character along with her ambitiousness. It is quite fascinating to see Mehrunnisa rising to the Empress of Mughal India from a humble birth to rule the empire from behind the veil. The paper highlights how Mehrunnisa, a non-conformist by nature, in the novel The Twentieth Wife, stood as an in-house feminist with her brilliance and strength of character. The writer of the novel Indu Sundaresan, has brilliantly exploited Mehrunnisaâ€™s resistance to either doing gender or social construction theory', '1444498565_NUR_JAHAN_An_Inhouse_Feminist.docx', '2015-10-10', 'Ms. B.Venkata Ramana,Dr. C. Pradgna', 'ppspaulkumar@gmail.com,sudhakarmande7@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'ENGLISH', '1444558319_IJERSS1444498565.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume II - Issue X, October 2015.', 126, 1),
(515, 'IJERSS-1444498879', 'editor@ijerss.com', 'RELATIONSHIP OF SKILL RELATED PHYSICAL FITNESS VARIABLES TO ACADEMIC ACHIEVEMENT OF HIGH SCHOOL BOYS', 'Research', 'PHYSICAL SCIENCE', 'The purpose of the present study is to find out the relationship of skill Related Physical Fitness Variables to Academic achievement. To achieve the purpose of the study eight hundred sixty nine Male adolescent students, in grades from 8th through 10th ranging in age between 13 to 15 years from ten different recognized private schools of Mysore city were selected as subjects. The subjects were Measured for their Performance in Selected skill related fitness variables through respective  standard tests,  that included Agility (Shuttle Run); Balance,(Bass Stick test) ;coordination (soft ball throw); Power (Vertical Jump); and reaction time (Nelson Hand Reaction time test). Academic achievement was considered as the academic performance of the subjects measured in terms of percentage of marks obtained in the examinations conducted by the schools, as given in the school records. Data of various measures obtained by the performance of subjects were analysed using product moment correlation and step-wise regression  Analysis. Analysis of data revealed that, of the five variables considered, only agility correlated positively and significantly with academic achievement. When the selected variables were regressed on academic achievement, only agility emerged as the major predictor of academic achievement of the subjects. The other variables did not predict academic achievement significantly', '1444498879_skill_related_artical.docx', '2015-10-10', 'H N Shashidhar,Dr. S. Madialagan', 'sbeshwar@gmail.com,sbeshwar@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'payment pending', '', 'PHYSICAL SCIENCE', '1444908716_IJERSS1444498879.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume II - Issue X, October 2015.', 120, 1),
(516, 'IJERSS-1444499415', 'editor@ijerss.com', 'RELATIONSHIP OF HEALTH RELATED PHYSICAL FITNESS VARIABLES TO ACADEMIC ACHIEVEMENT OF HIGH SCHOOL BOYS', 'Research', 'PHYSICAL SCIENCE', 'The purpose of the present study is to find out the relationship of Health Related Physical Fitness Variables to Academic achievement of High School boys. To achieve the purpose of the study eight hundred sixty nine Male adolescent students, (N=869) in grades from 8th through 10th ranging in age between 13 to 15 years, from ten different recognized private schools of Mysore city, Were selected as subjects. Assessment of Health related fitness variables was made, that included, strength (grip And leg Strength) using a grip dynamometer and leg dynamometer; Cardio respiratory endurance (Harvard Step Test); Flexibility (sit and reach Test); Muscular endurance, (Sit-up Test); Body composition â€“ B M I (Queteletâ€™s Index). Academic achievement was considered as the academic performance of the subjects measured in terms of percentage of marks obtained in the examinations conducted by the schools, as given in the school records. Data of various measures obtained by the performance of subjects were analysed using product moment correlation and stepwise regression analysis. Analysis of data revealed that, Out of the seven variables only two variables, viz., cardio respiratory endurance and Flexibility were related to academic performance, where as, the other variables did not correlate significantly with academic achievement. When the selected variables were regressed on academic achievement, only three variables viz., Flexibility, cardio respiratory endurance and body composition (BMI), emerged as major predictors of academic performance. Rest of the variables did not predict academic performance', '1444499415_Health_related_articl_new.docx', '2015-10-10', 'H N Shashidhar,Dr. S. Madialagan', 'sbeshwar@gmail.com,sbeshwar@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'payment pending', '', 'PHYSICAL SCIENCE', '1444909608_IJERSS1444499415.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume II - Issue X, October 2015.', 153, 1),
(517, 'IJERSS-1444908620', 'editor@ijerss.com', 'JOB SATISFACTION AMONG PHYSICAL EDUCATION TEACHERS OF SECONDARY SCHOOLS IN KERALA, INDIA', 'Research', 'Physical Education', 'The present study has been undertaken to investigate job satisfaction among physical education teachers working in Kerala state schools and to find out the difference in job satisfaction among physical education teachers working in the three categories of schools i.e. government, aided and private schools in Kerala. The present study, on the basis of this objective, hypothesized that there would significant differences exists among physical education teachers working government, aided and private schools were following the state government syllabus regarding their job satisfaction. 256 physical education teachers working in secondary schools in Kerala state were participated in this study. JDI was used to measure the construct of job satisfaction, defined by P. C. Smith et al. (1969) â€œas the feelings a worker has about his jobâ€, in this study.  Significant differences are found among physical education teachers working in aided, government, and unaided schools in Kerala on the variable job satisfaction. There are significant differences on job satisfaction between government and unaided school physical education teachers. Physical education teachers working in government aided schools have the highest job satisfaction followed by government and unaided school physical education teachers respectively.', '1444908620_Job_satisfaction_among_physical_education_teachers_of_secondary_schools_in_Kerala.docx', '2015-10-15', 'Jyothish Kumar.L.K.,Dr.T.I.Manoj', 'jyothynalukettil001@gmail.com,manojti@gmail.com', '9447063339', 'Dept of Physical Education', 'College of Agriculture Vellayani', 'Thiruvanathapur', 'Kerala', 695522, 'IN', 'Pending', NULL, 'PHYSICAL SCIENCE', '1447605330_IJERSS1444908620.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume II - Issue XI, November 2015.', 134, 1),
(518, 'IJERSS-1444918683', 'editor@ijerss.com', 'Comparative Analysis of Self-Esteem in Sports Women and Non-Sports Women.', 'Research', 'PHYSICAL EDUCATION', 'The purpose of the study was to compare female athletes and non-athletes on the dimension of self-esteem. For this study 60 students from SSUS, Kalady, and Christ College of Physical Education Irinjalakkuda, were selected as subjects (30 Sports women and 30 Non-sports women). The average age of the subject ranged from 18-23 years. The data for the study was collected by using questionnaire method. The scores on self-esteem were collected by administrating Rosenberg Self-esteem Scale (1965). This survey was taken by the investigator visiting personally at their campus and training centers. Necessary instructions were given into the subjects before the administration of the questionnaire. It was clearly explained to the subjects that overall purpose of the study was to understand sports women and non-sports women in the variable of self-esteem.   However the subjects were made to respond as quickly as possible without brooding over any questions, or statement, once the instruction was understand carefully. To compare each group on their own scores of self-esteem â€˜tâ€™ ratio was computed for find out the difference. The research findings point out that Sports women have more self-esteem than non-sports women. Lastly techniques for improving self-esteem among women have been discussed.', '1444918683_Dr._Sujith_S_.docx', '2015-10-15', 'Dr. Sujith S.,Dr. Dhinu M.R.', 'sujithnair22@gmail.com,dhinumr@gmail.com', '09745677864', '"PREM VIHAR'', CHITRANJALI ROAD,', 'THIRUVANKULAM-(P.O),', 'ERNAKULAM', 'KERALA', 682305, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(519, 'IJERSS-1446657405', 'editor@ijerss.com', 'IMPACT OF GAME SKILL TRAINING WITH AND WITHOUT YOGIC PRACTICES ON SELECTED PHYSICAL PARAMETERS AMONG COLLEGE LEVEL WOMEN VOLLEYBALL PLAYERS', 'Research', 'PHYSICAL EDUCATION', 'IMPACT OF GAME SKILL TRAINING WITH AND WITHOUT YOGIC PRACTICES ON SELECTED PHYSICAL PARAMETERS AMONG COLLEGE LEVEL WOMEN VOLLEYBALL PLAYERS\r\n* J.Thenmozhi & ** Dr.M.Sundar\r\n* Ph.D (Research Scholar) & ** Principal\r\n*Periyar Maniammai University, Thanjavur & **Alagappa University College of Physical Education, Alagappa University, Karaikudi.\r\nEmail ID:risenthil76@gmail.com\r\n\r\nAbstract\r\n	The purpose of this present study was to investigate the impact of game skill training with and without yogic practices on selected physical parameters among college level women volleyball players. To achieve this purpose of the study thirty (N=30) college volleyball players were selected from Periyar Maniammai University, Thanjavur district, Tamil Nadu state, India, during the year 2015-16. The subjectâ€™s age ranges from 18 to 23 years. The selected subject were divided into three equal groups consists of (10 subject) each namely two experimental groups and control group from women volleyball players. The experimental group I underwent skill training and experimental group II underwent skill training with yogic practices programme for eight weeks. The control group was not taking part in any exercise during the course of the study. The dependent variables selected for the study were speed and muscular strength.Pre-test was taken before the exercise period and post- test was measured immediately after the eight weeks exercise period. The collected data were analyzed using the analysis of co-variance (ANCOVA) at 0.05 level of significance and showed significant changes in speed and muscular strength. Post hoc mean comparison showed Experimental group (game skill training and skill training with yogic practices) had significant difference with control group in speed and muscular strength. The results of the study showed that both type of training i.e. game skill training and skill training with yogic practices produced significant improvement in speed and muscular strength.\r\nKeywords: Game skill training, Skill training with yogic practices, Speed, Muscular strength and Volleyball players\r\n', '1446657405_journal_thenmozli_mam.docx', '2015-11-04', 'J.Thenmozhi ,Dr.M.Sundar', 'sindumadhan2012@gmail.com', '09600314180', 'M.MADHANKUMAR,Ph.D Research Scholar,', 'AUCPE, ALAGAPPA UNIVERSITY , KARAIKUDI', 'SIVAGANGAI', 'TAMIL NADU', 630004, 'IN', 'Pending', NULL, 'Physical Science', '1447990733_IJERSS1446657405.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume II - Issue XI, November 2015.', 120, 1),
(520, 'IJERSS-1447605668', 'editor@ijerss.com', 'EMPLOYEE STRESS REDUCTION AND WELLBEING THROUGH YOGA', 'Research', 'HEALTH SCIENCE', 'Employees face numerous psychological stresses that can undermine their work performance. Employees cope with various forms of stress on the job. Increased risk for psychological and physical disorders may be due to emerging work-related trends such as: working in repetitive and monotonous tasks, performing in a fast-paced environment and fearing a layoff during an unstable period in the economy. Psychological stress can be induced by extremely low or high demands on the individual and is a typical situation of many simple and repetitive work situations in which health problems are common. These factors have innumerous health and financial implications for both employees and employers. Mental and emotional states can impinge upon and alter, for good or ill, any of the bodyâ€™s organs or systems. Low job satisfaction and little variation in job task are significantly associated with back and shoulder pain. Job stress also may impact on an employeesâ€™ mental health and may cause depression, anxiety, or paranoid symptoms. The stress stem from a variety of possible causes have enormous health and financial impacts on employees as well as employers. Stress has been shown to be one of the factors leading to musculo-skeletal disorders (MSDs) such as: back pain, carpal tunnel syndrome, shoulder or neck tension, eye strain, or headaches. Yoga is an ancient form of exercise that can reduce stress and relieve muscular tension or pain. Practicing yoga at the workplace teaches employees to use relaxation techniques to reduce stress and risks of injury on the job. Yoga at the workplace is a convenient and practical outlet that improves work performance by relieving tension and job stress.', '1447605668_Udaya_Bhasker_1.docx', '2015-11-15', 'Y.Udaya Bhaskar', 'sudhakarmande7@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'PHYSICAL SCIENCE', '1447693469_IJERSS1447605668.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume II - Issue XI, November 2015.', 114, 1),
(521, 'IJERSS-1447692229', 'editor@ijerss.com', 'EFFECT OF SWISS BALL TRAINING AND CORE BOARD TRAINING ON SELECTED PHYSICAL FITNESS COMPONENTS AND PHYSIOLOGICAL VARIABLES OF BATSMEN OF CRICKET', 'Research', 'PHYSICAL SCIENCE', 'Athletic performance has dramatically progressed over the past few years. Performance levels unimaginable before are now commonplace, and the number of athletes capable of outstanding results is increasing.  One factor is that athletics is a challenging field, and intense motivation has encouraged long, hard hours of work. Also, coaching has become more sophisticated, partially from the assistance of sport specialists and scientists.  A broader base of knowledge about athletes now exists, which is reflected in training methodology.', '1447692229_Paper2.docx', '2015-11-16', 'T.Srinivasu,Sudhakara Babu M,Dr.P.P.S.Paul Kumar', 'sudhakarmande7@gmail.com,sudhakarmande7@gmail.com,sudhakarmande7@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'PHYSICAL SCIENCE', '1447989562_IJERSS1447692229.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume II - Issue XI, November 2015.', 141, 1),
(522, 'IJERSS-1447692376', 'editor@ijerss.com', 'EFFECT OF LOW, MEDIUM AND HIGH INTENSITY PLYOMETRIC TRAINING ON SELECTED PHYSIOLOGICAL VEREBULES ON COLLEGE MEN STUDENTS', 'Research', 'SPORTS SCIENCE', 'In physiology, one learn how the organs, systems, tissues, cells and molecules within cells work and how their functions are put together to maintain the internal environment.  Physiology is the science dealing with the study of human body functions.  Exercise physiology is the study of how bodyâ€™s structures and functions are changed as a result of exercise.  It applies the concept of exercise physiology to training the athlete and enhancing the athleteâ€™s sports performance', '1447692376_Paper3.docx', '2015-11-16', 'P.Srinivas,Dr.P.P.S.Paul Kumar', 'sudhakarmande7@gmail.com,sudhakarmande7@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1447693761_IJERSS1447692376.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume II - Issue XI, November 2015.', 143, 1),
(523, 'IJERSS-1447692497', 'editor@ijerss.com', 'THE EFFECT OF AEROBIC AND ANAEROBIC INTERVAL TRAINING COMBINED WITH YOGIC PRACTICES ON SELECTED PHYSIOLOGICAL VARIABLE OF HIGH SCHOOL MALE KABADDI PLAYER', 'Research', 'HEALTH SCIENCE', 'Athletic performance has dramatically progressed over the past few years. Performance levels unimaginable before are now commonplace, and the number of athletes capable of outstanding results is increasing.  One factor is that athletics is a challenging field, and intense motivation has encouraged long, hard hours of work. Also, coaching has become more sophisticated, partially from the assistance of sport specialists and scientists. A broader base of knowledge about athletes now exists, which is reflected in training methodology', '1447692497_Paper4.docx', '2015-11-16', 'Dr.Y.Poli Reddy,P.Srinivas,Dr.P.P.S.Paul Kumar', 'sudhakarmande7@gmail.com,sudhakarmande7@gmail.com,sudhakarmande7@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1447693950_IJERSS1447692497.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume II - Issue XI, November 2015.', 124, 1),
(524, 'IJERSS-1447694966', 'editor@ijerss.com', 'PLAYING PATTERNS OF THE ELITE AND YOUTH INTERNATIONAL LEVEL BADMINTONPLAYERS', 'Research', 'HEALTH SCIENCE', 'The aim of this study was to investigate the playing patterns and the differences in those between the Elite Level and Youth under 19 years of age (U-19) level International badminton players. A total of 14 matches including semi-finals and finals of International tournaments were selected.\r\nShots types and shot outcome were chosen for performance indicators of playing pattern.Independent Sample T-test was used for the comparison of all variables between the Elite Level and Youth Level categories. \r\nThere was significant differences in mean distribution of lift shots, net shots, drop shots, lob shots and smash shots between the Elite Level and Youth International Level categories (p<0.05).\r\nIn shot outcome, smash shot is the most successful shot with the highest number of winners while net shot ended up with the highest number of errors. Youth Level category had more winners and also errors compared to Elite Level but not at significantly different level.\r\nThe results of the present study and information obtained in the process can help improving technical and tactical skills of the badminton players at both junior and eliteat the international competing level', '1447694966_PLAYING_PATTERNS_KL_and_Oleks.docx', '2015-11-16', 'LEONG K.L,KRASILSHCHIKOV O', 'olek@usm.my,olek@usm.my', '9090909090', '', '', '', '', 0, 'MY', 'Pending', NULL, 'SPORTS SCIENCE', '1461386806_IJERSS1447694966.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume III - Issue IV, April 2016.', 67, 1),
(525, 'IJERSS-1447739393', 'editor@ijerss.com', 'DISCRIMINATION DISCOVERY AND PREVENTION WITH PRESERVING PRIVACY USING Î±-GENERALIZATION METHOD IN DATAMINING', 'Research', 'Datamining', 'Discrimination in data mining, is extracting patterns from the database without discriminating based on their age, gender, income etc. The data mining system is classified based on their functionality such as association, characterization, correlation analysis, discrimination, prediction and classification. The discrimination is a important issue when considering legal and ethical aspects unfairly treating based on their specific belonging group. The privacy and discrimination is a very important issues in data mining .The discrimination prevention  with privacy preserving  helpful for making decision in banking areas, insurance personal selection etc. Here we discuss about how can prevent discrimination and privacy preserving at a same time.', '1447739393_thesisss_paper1.docx', '2015-11-17', 'Aswathi babu,Vinuvarghese,Vidhya gopinath', 'asminibabu123@gmail.com,vinghese@gmail.com,vidhyaanair@gmail.com', '9400790680', 'maruthapathickal', 'arunapuram p.o,pala', 'kottayam', 'kerala', 686574, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(526, 'IJERSS-1447845081', 'editor@ijerss.com', 'â€œWomen entrepreneurship Development in India"', 'Review', 'MANAGEMENT (HR issues)', 'Women entrepreneurship Development is a very vital and important aspect of Human resource development. If we see the state of women entrepreneurship in India, the developments taking place in this regard, especially in the rural areas is extremely low. Entrepreneurship amongst women in India has been a recent concern. On the other hand women have become aware about their interests, goals and rights including their work situation. But women from the middle class section dose not seem to be that eager so as to alter their roles in fear of social backlash. The entrepreneurial progress is more active and vibrant among the upper class families in the urban cities of India. \r\nThis paper focuses on the concept of women entrepreneurship. An analysis and understanding of the Indian women discussing their identity, especially about their role taking and path breaking ideas and choices in career. The study remains incomplete without a slight touch of the journey in the corridors of Indian History where Indian women lived and performed various role models.\r\n\r\nKey words: Women Entrepreneurship, Indian Women, Womenâ€™s identity.\r\n', '1447845081_IJERSS_Paper.docx', '2015-11-18', 'MS SHIVALIKA VIPUL PATEL', 'shivalikasrict2014@gmail.com', '9824692899', '42, Manorath society', 'B/H Sardar Park. Opp to Ganesh Park. GIDC', 'ANKLESHWAR', 'GUJARAT', 393002, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(527, 'IJERSS-1448442578', 'editor@ijerss.com', 'A Novel Methodology for Clustering Uncertain Big Data using KL-Divergence in Hadoop.', 'Research', 'Computer Science & Engineering', 'Uncertainties in Big data are inherent properties in various applications due to several reasons. Data mining problems are significantly influenced by the uncertainties that present in those underlying data. Clustering is the most comprehensively studied problems in the uncertain Big data mining literature. In this paper we propose a new clustering method for handling uncertainties in Big Data using a similarity measure called KL-Divergence instead of traditional geometric distance based similarity. Also in this paper we introduce the clustering algorithm in a parallel environment preferably in Hadoop. So that a large amount of data can be processed in short time.', '1448442578_thesis_paper.docx', '2015-11-25', 'Sinu T S , ', 'sinusachin001@gmail.com', '8893309650', 'THUNDIPARAMBIL HOUSE', 'KUNDANOOR , MARADU P O', 'ERNAKULAM', 'Kerala', 682304, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(528, 'IJERSS-1449136962', 'editor@ijerss.com', '''CONSTRUCTION OF NORMS FOR SPEED FOR 10 TO 12 YEARS BOYS AND GIRLS PROBABLES'' ', 'Research', 'Physical Education', 'ABSTRACT\r\n	The purpose of the study was to construct norms for speed for 10 to 12 years boys and girls of Track and Field Probables. A sample of 3075 students was taken during coaching camp. Totally 3075 probables 2287 boys and 788 girls served as subjects. The speed performance data of subjects in athletics was collected. Norms were constructed for speed with three normative scales such as percentile, Hull, Sigma and T scale and standard for evaluation of probables also established under normal distribution.\r\nKeywords: Construction, Norms, Speed, Probables  \r\n', '1449136962_ARTICLE_VASANTHKUMAR2.doc', '2015-12-03', 'VASANTHA KUMAR Research Scholar,  Mangalore University ,Dr. KISHORE KUMAR C.K Director of physical E', 'hnavanku@gmail.com,ckkkumar@yaho', '9164586621', 'C/o Ananthapadmanabha Prabhu', 'Physical Education Teacher, MDRS, Kandali', 'Hassan', 'Karnataka', 573217, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(529, 'IJERSS-1449471440', 'rosemaryvarghese02@gmail.com', 'Distributed Inverted Index based PDF Searching in MapReduce framework', 'Research', 'Data mining ,Text mining', 'Abstract: Most of the data mining methods are processed to find the patterns from the data. For large number of patterns generated by using data mining approaches to effectively use and update pattern in an open research issue. So how to effectively use the patterns, update the discovered pattern and how we can apply into the field of text mining is the issue. Text mining also known as data mining is the process of extracting intersecting into form text documents. Those text documents can be any of type. Text mining is a technology that helps the user to find the useful information from large amount of digital text document. So the challenge used in text mining is to find accurate knowledge in text documents to help user to find what they want .Most of the PDF mining methods are for extracting figures and captions from the PDF document. But the search based on the user query in multiple PDF document is difficult. The proposed method performs PDF mining in multiple documents and retrieves the result based on user search. The preprocessing of PDF documents is done in Map-Reduce framework so that the indexing problem in pattern based method can be solved.', '1449471440_ros_paper_ieee_(1).docx', '2015-12-07', 'Rosemary Varghese, Kala Karun', 'rosemaryvarghese02@gmail.com,kalakarun@gmail.com', '8281339682', '', '', 'ernakulam', 'kerala', 683574, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2014', 0, 0, 'New', 0, 0),
(530, 'IJERSS-1449559563', 'sindumadhan2012@gamil.com', 'EFFECTS OF VARIED INTENSITY PLYOMETRIC TRAINING WITH AND WITHOUT WEIGHT TRAINING ON SELECTED PHYSICAL VARIABLE AMONG COLLEGE MEN STUDENTS', 'Research', 'PHYSICAL EDUCATION', 'EFFECT OF VARIED INTENSITY PLYOMETRIC TRAINING WITH AND WITHOUT WEIGHT TRAINING ON SELECTED PHYSICAL VARIABLE AMONG COLLEGE MEN STUDENTS\r\n*K.Sakthivel & ** Dr.M.Sundar\r\n* Ph.D (Research Scholar) & ** Principal\r\n*Periyar Maniammai University, Thanjavur & **Alagappa University College of Physical Education, Alagappa University, Karaikudi.\r\nEmail ID:rksnithin@gmail.com\r\n\r\nAbstract\r\nThe purpose of this present study was to investigate the effect of varied intensity plyometric training with and without weight training on selected physical variable among college men students. To achieve this purpose of the study forty five (N=45) college men students were selected from Alagappa University College of Physical Education, Karaikudi, Tamil Nadu state, India, during the year 2015-16. The subjectâ€™s age ranges from 18 to 25 years. The selected subject were divided into three equal groups consists of fifteen subject each namely two experimental groups and control group from college students. The experimental group I underwent plyometric training with weight training (PTWT) and experimental group II underwent Plyometric training (PT) programme for six weeks. The control group was not taking part in any exercise during the course of the study. The dependent variables selected for the study were Arm strength measure by push-ups and abdominal strength measure by sit-ups.Pre-test was taken before the exercise period and post- test was measured immediately after the six weeks exercise period. The data collected from the three groups were statistically analyzed for significance, the analysis of covariance (ANCOVA) was used and the F ratio was found out. The Scheffeâ€™s test is applied as post-hoc test to determine the paired mean differences.  The level of significance will be fixed at .05 level of confidence for all the cases.\r\nKeywords: Plyometric training, Weight training, Arm strength and Abdominal strength\r\n', '1449559563_journal.docx', '2015-12-08', 'K.Sakthivel ,Dr.M.Sundar', 'rksnithin@gmail.com,drmsundarcm@gmail.com', '9600314180', 'Dr.M.Sundar,Principal', 'AUCPE, ALAGAPPA UNIVERSITY,KARAIKUDI', 'SIVAGANAGAI', 'TAMIL NADU', 630004, 'IN', 'published online', '', 'SPORTS SCIENCE', '1456851625_IJERSS1449559563.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume III - Issue I, January 2016.', 94, 1);
INSERT INTO `papers` (`id`, `paper_id`, `paper_referral`, `paper_title`, `paper_type`, `subject_category`, `abstract`, `paper_attachment`, `uploaded_on`, `author`, `email`, `pnumber`, `address_line1`, `address_line2`, `city`, `state`, `pincode`, `country`, `status`, `comments`, `subject`, `pdf`, `active`, `news`, `conference`, `volume`, `issue`, `volume_issue_title`, `downloads`, `blogspot`) VALUES
(531, 'IJERSS-1452312766', 'editor@ijerss.com', 'POWER QUALITY IMPROVEMENT FOR GRID CONNECTED HYBRID ENERGY SYSTEM BY USING FUZZY LOGIC CONROLLER', 'Review', 'power systems', 'Abstractâ€” Power quality improvement for PV/battery hybrid system using fuzzy logic controlling technique has been presented this paper. The PV side cascaded boost DC-DC converter is controlled by IC algorithm to extract the maximum power from the solar irradiation. The battery energy storage system (BESS) is regulated to balance the power between PV generation and utility grid. In this paper a modified Instantaneous symmetrical components theory has been presented to the Micro Grid-VSC in micro-grid applications (i) to feed the generated active power in proportional to irradiation levels into the grid (ii) compensation of the reactive power, (iii) load balancing and (iv) mitigation of current harmonics, thus enabling the grid to supply only sinusoidal current at unity power factor. A new fuzzy logic control technique is also proposed in this paper for the battery converter with DC link voltage regulation capability. The dynamic performance of battery is improved with fuzzy logic controller, and shows the better performance compared with conventional method. A model of a hybrid PV Energy Conversion System is designed in MATLAB/Simulink software to test the effectiveness of the proposed control strategies.', '1452312766_SAGAR_PUBLICATION.docx', '2016-01-09', 'M E C Vidya Sagar,A N V J Rajagopal', 'mecvidyasagar@gmail.com,gopal.anvj@gmail.com', 'e c vidya sagar', '2-34 main road ', 'yedurlanka', 'i.polavaram man', 'andhra pradesh', 533464, 'IN', 'Pending', '', '', '1453750336_IJERSS1452312766.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'New', 34, 1),
(532, 'IJERSS-1452501139', 'editor@ijerss.com', 'COMPARATIVE STUDY OF JOB SATISFACTION AND JOB STRESS AMONG KERALA SECONDARY SCHOOL PHYSICAL EDUCATION TEACHERS', 'Research', 'PHYSICAL EDUCATION', 'In the present study, efforts have been made to make a comparative study of job satisfaction and job stress between male and female secondary schools physical education teachers of Kerala State. To make a gender wise (based on the sex of subjects), 83 female and 517 male physical education teachers was selected randomly from the Kerala State. The job satisfaction questionnaire by B. C. Muthaya and job stress questionnaire by T. R. Palival were found to be most suitable and reliable for the purpose and utilized both of them. The analysis was done by adopting statistical mean, â€œtâ€ ratio. We find that there is no difference between the job satisfaction and job stress of male and female physical education teachers. This study will play an important role in providing motivation and inspiration to physical education teachers and increasing their social status.\r\n Key Words:- Job satisfaction, Job stress, Physical education teacher, \r\n', '1452501139_Dr_Sujith.docx', '2016-01-11', 'Dr. Sujith S.,Dr. Ajithmohan K.R.', 'sujithnair22@gmail.com,ajithmoh@gmail.com', '09745677864', 'PREM VIHAR, CHITRANJALI ROAD,', 'THIRUVANKULAM-(P.O),', 'ERNAKULAM', 'KERALA', 682305, 'IN', 'Pending', NULL, 'PHYSICAL EDUCATION', '1456852103_IJERSS1452501139.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume III - Issue I, January 2016.', 76, 1),
(533, 'IJERSS-1452501525', 'editor@ijerss.com', 'COMPARATIVE EFFECT OF DIFFERENT RESISTANCE TRAINING ON SELECTED PHYSICAL AND PERFORMANCE RELATED VARIABLES OF VOLLEYBALL PLAYERS', 'Research', 'PHYSICAL EDUCATION', 'Sixty [N-60] students from the Government Higher Secondary School Puthenthode, Ernakulam, Kerala, India were selected as subjects at random and were divided into four equal groups of fifteen each, namely control group,dumbbell exercise training group, elastic exercise training group and own body weight exercise training group. The age of the selected subjects ranged from 12 to 17 years. The selected variables were agility, muscular endurance and flexibility. Group I (n=15) acted as the control group who did not participate in any training programme, Group II (n=15) underwent dumbbell exercise training, Group III (n=15) underwent elastic exercise training and Group IV (n=15) underwent own body weight exercise training three days per week for twelve weeks. The selected variables were assessed before and after the training programme. The result of the study showed that there was a significant improvement in agility and flexibility after different resistance training programmes. There was no significant difference in muscular endurance after the training programme.\r\nKeywords: Resistance training, Agility, Flexibility, Muscular Endurance, Elastic band, Dumbbell.\r\n', '1452501525_REAL_JOURN_1.docx', '2016-01-11', 'Shitto P. Jose, Dr. Dhinu M.R.', 'shittopjose@gmail.com,dhinumr@gmail.com', '09446057782', 'PATTATHUPARAMBIL (H)', 'KADUPPASSERY(P.O)', 'THRISSUR', 'KERALA', 689111, 'IN', 'Pending', NULL, 'HEALTH SCIENCE', '1456852331_IJERSS1452501525.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume III - Issue I, January 2016.', 69, 1),
(535, 'IJERSS-1453200072', 'editor@ijerss.com', 'EFFECTS OF PLYOMETRIC TRAINING AND WEIGHT TRAINING ON SELECTED SPEED AND  SPEED ENDURANCE PARAMETERS OF BASKET BALL PLAYERS', 'Research', 'SPORTS SCIENCE', 'Among all the games existing in the world, basketball is probably the leading ball game as far as action occurrence is concerned. The word action implied movement and basketball is very much a movement-oriented game. This is one of the most popular games in the world. The activities of physical education programme include aquatics, combative, gymnastics, individual sports, rhythmic, games and outing activities. Basketball is one of the games, which are popular among boys and girls at all schools and men and women at all colleges. The game basketball offers a wide range of opportunity for the development of strength, speed, endurance, and agility to all parts of the human body. A basketball player sprinting down the court on a fast break, driving to the basket for a shot or chasing down an opponent on defense, he must use speed to execute basketball''s most crucial plays. However, the type of speed he needs on the court is not necessarily developed by running endless miles. Basketball requires a player to start and stop throughout the game, forcing a player to accelerate, decelerate and change direction with equal proficiency. Endurance training in basketball is essential for players looking to maintain stamina throughout an entire game as well as the entire season. Although endurance training can be performed off the basketball court, it is possible for you to increase stamina and endurance during practice through on-court conditioning drills. Endurance training drills range from on-court line sprints to off-court jogging routines.', '1453200072_PAPER1.docx', '2016-01-19', 'D.V.Ramana,Dr.R.V.L.N.Ratnakara Rao,Dr.Raju sathuluri', 'raju_sathuluri4@rediffmail.com,raju_sathuluri4@rediffmail.com,raju_sathuluri4@rediffmail.com', '9090909090', '', '', '', '', 0, 'IN', 'published online', '', 'SPORTS SCIENCE', '1456852948_IJERSS1453200072.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume III - Issue I, January 2016.', 73, 1),
(536, 'IJERSS-1453200214', 'editor@ijerss.com', 'EFFECTS OF PLYOMETRIC TRAINING AND WEIGHT TRAINING ON SELECTED  STRIDE LENGTH AND MUSCLAR ENDURANCE PARAMETERS OF BASKET BALL PLAYERS', 'Research', 'SPORTS SCIENCE', 'Sports are most often played just for fun or for the simple fact that people need eXercise to stay in good physical condition. Although they do not always succeed, sports participants are eXpected to display good sportsmanship, standards of conduct such as being respectful of opponents and officials, and congratulating the winner when losing.\r\nThe game of basketball demands a high level of fitness that will enable the player to run strongly, to move quickly off the mark in any direction, to control, to pass accurately and to tackle efficiently through out the game. Basketball requires a fairly high standard of physical fitness along with skills. Since the game of basketball is played for 40 minutes it demands a high level of physical fitness and the training programme should be planned accordingly. The player in good physical condition is generally thought to have the ability to do sustained work over a long period. Hence speed, endurance, power, agility, cardiovascular endurance etcetera, are essential qualities required to be developed by all players. For good performance in any sport and standard to fitness is a basic requirement.', '1453200214_Paper2.docx', '2016-01-19', 'D.V.Ramana,Dr.R.V.L.N.Ratnakara Rao,Dr.Raju sathuluri', 'raju_sathuluri4@rediffmail.com,raju_sathuluri4@rediffmail.com,raju_sathuluri4@rediffmail.com', '9090909090', '', '', '', '', 0, 'IN', 'published online', '', 'SPORTS SCIENCE', '1456853353_IJERSS1453200214.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume III - Issue I, January 2016.', 69, 1),
(537, 'IJERSS-1453225432', 'editor@ijerss.com', 'BODY COMPOSITION AND PHYSICAL FITNESS OF GIRL STUDENTS OF PHYSICAL EDUCATION', 'Research', 'PHYSICAL EDUCATION', 'The present study was carried out to assess the physical fitness and body composition of the girl students of physical education. Thirty students within the age range 22-25 years without any kind of major illness of cardiovascular problems were selected for each activity as sample of the study. The mean age of girl students was 23.06 years with the mean height of 155.70 cm and mean body weight 51.10 kg. The blood pressure and pulse rate of the respondent were found to be normal. The selected age group subjects had high average to very good range of oxygen consumption i.e. VO2 max (ml/kg.min.). Majority of the girl students (96.67%) had mesomorph body type as per Quetlets Index. Highly significant and positive correlation was observed between weight, body mass index, per cent fat and lean body mass. While body density and per cent of fat had shown perfectly negative correlation. ', '1453225432_Prof._Ashwani_Kumar.docx', '2016-01-19', 'PROF. ASHWANI KUMAR', 'ashwani28.2010@rediffmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1461386870_IJERSS1453225432.pdf', 1, 1, 'IJERSS-2014', 0, 0, 'Volume III - Issue IV, April 2016.', 45, 1),
(538, 'IJERSS-1453279317', 'editor@ijerss.com', 'TRUSTED CLOUD COMPUTING METHODS USING TO PROTECTED FILE ENCRYPTION PERFORMANCE', 'Research', 'CLOUD COMPUTING ', 'In private cloud system, data is shared among the persons UN agency square measure therein cloud. For this, security or personal data concealing method hampers. though Cloud computing has achieved an excellent success in varied industries whether or not it''s a software package trade, during this paper we''ve got projected new security design for cloud computing platform. the shoppers in faithfully distinguishing trustworthy cloud suppliers multi-faceted Trust Management (TM) system design for a cloud computing marketplace is additionally attainable to let technical agents monitor every other''s behavior and respond consequently by increasing or decreasing trust. It ensures secure communication system and concealing data from others. during this system give Blowfish algorithmic rule for file secret writing and RSA primarily based secured communication. During this paper deals with varied problems related to Security and focus in the main on the info security and strategies of providing security by encryption. varied secret writing strategies of block cipher algorithms like RSA, Blowfish square measure mentioned for providing solutions to cloud security. The system exploitation totally different key for each secret writing and coding and increasing overall performance of cloud service supplier exploitation Fair-Share hardware. that the customers simply determine a decent or poor quality cloud supplier.', '1453279317_sivapaper1.doc', '2016-01-20', 'K.SIVAKUMAR', 'sivakumar_srec@yahoo.co.in', '09488062445', '', '', 'Comibatore', 'Tamilnadu', 641105, 'IN', 'Pending', '', '', NULL, 1, 0, 'IJERSS-2016', 0, 0, 'Volume III - Issue IV, April 2016.', 0, 0),
(541, 'IJERSS-1456395729', 'editor@ijerss.com', 'EFFECT OF POWERPOINT PRESENTATION IN LEARNING SKILLS OF THE GAMES - A CRITICAL ANALYSIS', 'Research', 'Physical Education', 'Abstract: Multimedia is no more an uncommon phenomena in the education arena of today. PowerPoint presentation is one of the essential elements of multimedia used habitually as teaching aid. This instructional approach had been used in the process of teaching and learning for many school subjects but there is very little application in Physical Education. The purpose of this study was to investigate the effects of PowerPoint presentation as teaching aid to teach physical education subject for high school students.  The power point presentation involves slides involving animated pictures and videos etc. were developed on the topic Kabaddi game. This type of study comprised of 50 samples from Morarji Desai Residential School, Kandali, Hassan District of Karnataka. Question paper was constructed according to blue print for evaluate theoretical aspects and observation method is used to evaluate practical skill performance. Pre-test and Post-test performance was analyzed through t-Test. The significant value of 0.05 showed that there were significance differences before and after learning with the use of multimedia in teaching of Kabaddi game. This means that there is an increase in knowledge in Kabaddi. \r\nKeywords: Physical and Health education, PowerPoint presentation, Teaching Aid, Game, Skills\r\n', '1456395729_PowerPoint_presentation_Final_for_Submission.doc', '2016-02-25', 'Dr. Kishore Kumar C K', 'sportstodream@gmail.com', '9164586621', 'Dr. Kishore Kumar C K, Dirctor of Phy Edn', 'Mangalore University', 'Mangalore ', 'Karnataka', 574203, 'IN', 'Pending', NULL, 'PHYSICAL EDUCATION', '1457856129_IJERSS1456395729.pdf', 1, 1, 'IJERSS-2016', 0, 0, 'Volume III - Issue III, March 2016.', 68, 1),
(544, 'IJERSS-1456418805', 'rayapativarma@gmail.com', 'A STUDY ON THE MOTOR FITNESS CONCEPT OF PHYSICAL EDUCATION TRAINEE-STUDENTS IN VISAKHAPATNAM AND WEST GODAVARI DIRSTRICTS ANDHRA PRADESH', 'Research', 'PHYSIAL EDUCATION', 'The main purpose of the present study is to compare the differences in the motor fitness components Nova College of Physical Education and Gonna College of Physical Education B.P.Ed Students. To achieve the purpose of the study, data was collected from eighty students of each College. The age of the subjects were ranging from 20-25 years. The data collected was treated with the statistical techniqueâ€˜tâ€™ test  and found there is a significant difference in speed, agility and endurance of  Nova College of Physical Education, West Godavari district and Gonna College of Physical Education, VisakhapatnamDistrict, B.P.Ed Students', '1456418805_A_Study_on_the_Fitness_Concept_of_Physical_Education_Personnel.docx', '2016-02-25', 'B.GOWRI NAIDU ,Dr.R.SATISH VARMA', 'bgowrinaiduindia@gmail.com,rayapativarma@gmail.com', '9348569159', 'Dr.R.S.VARMA,DOOR NO.49-26-43/16,FLAT-404,', 'GEETHA MANSION-7,MADHURANAGAR', 'visakhapatnam', 'andhra pradesh', 530016, 'IN', 'Pending', NULL, 'PHYSICAL EDUCATION', '1457856178_IJERSS1456418805.pdf', 1, 1, 'IJERSS-2016', 0, 0, 'Volume III - Issue III, March 2016.', 63, 1),
(545, 'IJERSS-1456753479', 'editor@ijerss.com', 'EFFECT OF BHARATANATYAM TRAINING ON EXPLOSIVE STRENGTH AND FLEXIBILITY AMONG COLLEGE GIRLS ', 'Research', 'SPORTS AND PHYSICAL EDUCATION', 'ABSTRACT \r\nThis investigation was undertaken to analyze the effect of Bharatanatyam training on selected variable among college girls. For the purpose of the study, 90 female students aged seventeen to twenty two years were selected as subjects for the investigation. The subjects were the students of B.A. Bharatanatyam of Sree Sankaracharya university of Sanskrit, Kalady. The pre-test was administered by researcher during their first week of training and post-test were administered after eight weeks of training. A training session was delimited to 60 minutes daily for 5 days in a week, as per the syllabus of B.A. Bharatanayam recognized by Sree Sankaracharya university of Sanskrit. The selected variables for the study were Flexibility and explosive strength. The test administered to assess the flexibility of lower back and hamstring muscles and explosive strength were sit and reach test and standing vertical jump respectively. The experimental group was single group design. The pre-test and post-test scores of the experimental group were analyzed by treated statistically. To find out the significant difference between pre-test and post-test score of the experimental group, the t-ratio was employed.  The level of significance was kept at 0.05 level. \r\n', '1456753479_JOURNAL.docx', '2016-02-29', 'MITHIN ANAND,Dr. K. VAITHIANATHAN', 'mithin1212@gmail.com', '+91 9895443607', '4/1232 BELLHOUSE THUNDIPARAMBU N.CHERLAI', 'MATTANCHERRY P.O.', 'COCHIN', 'KERALA', 682002, 'IN', 'Pending', NULL, 'PHYSICAL EDUCATION', '1457856201_IJERSS1456753479.pdf', 1, 1, 'IJERSS-2016', 0, 0, 'Volume III - Issue III, March 2016.', 87, 1),
(546, 'IJERSS-1456918618', 'editor@ijerss.com', 'MEDIA AND SPORTS', 'Short Communication', 'Physical Educaton and Sports, Media', 'Abstract: \r\nIt is an theoretical informative paper give information regarding the influence of media on sports promotion and its role on globalisation sports through out the world. \r\nKey words: Sports, Media', '1456918618_Media_and_Sports.doc', '2016-03-02', 'DR. KISHORE KUMAR C K', 'sportstodream@gmail.com', '9164586621', 'Director of Physical Education', 'Mangalore University, Konaje, ', 'Mangalore', 'Karnataka', 574199, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1457856223_IJERSS1456918618.pdf', 1, 1, 'IJERSS-2016', 0, 0, 'Volume III - Issue III, March 2016.', 51, 1),
(547, 'IJERSS-1457333210', 'sujithnair22@gmail.com', 'THE IMPORTANCE OF SPORTS MEDICINE', 'Research', 'PHYSICAL EDUCATION', 'Sports injuries are injuries that occur in athletic activities. They can result from acute trauma, or from overuse of a particular body part. Sports medicine, also known as sport and exercise medicine (SEM), is a branch of medicine that deals with physical fitness and the treatment and prevention of injuries related to sports and exercise. Although most sports teams have employed team physicians for many years, it is only since the late 20th century that sports medicine has emerged as a distinct field of health care.', '1457333210_Dr._SUJITH_sports_injury_.docx', '2016-03-07', 'Dr. SUJITH S.,Dr. AIJTHMOHAN K.R.', 'sujithnair22@gmail.com,ajithmoh@gmail.com', '9745677864', 'PREM VIHAR, CHITRANJALI ROAD,', 'THIRUVANKULAM-(P.O),', 'ERNAKULAM', 'KERALA', 682305, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1457856243_IJERSS1457333210.pdf', 1, 1, 'IJERSS-2016', 0, 0, 'Volume III - Issue III, March 2016.', 52, 1),
(549, 'IJERSS-1457369420', 'editor@ijerss.com', 'COMPARATIVE STUDY OF COMPETITIVE ANXIETY AND SUPERSTITION OF ATTACKERS AND DEFENDERS IN FOOTBALL ', 'Research', 'SPORTS AND PHYSICAL EDUCATION', 'The studywas undertaken to compare and analyses the superstition and competitive anxiety among attackers and defenders in football. For the purpose of the study, thirty male football players of 18 to 28 year were selected as subjects for the investigation. The subjects were the football players who were pursuing football training from Football Academy Cochin, Bhagat soccer, Mardu and Kurumasseri sports academy . For the test administration researcher randomly selected 30 attackers and 30 defenders in football. The selected variables for the study were superstition and competitive anxiety. The test item used to assess the superstition was The Superstitious Ritual Questionnaire (SRQ; Bleak & Frederick, 1998) and to asses competitive anxiety Competitive State Anxiety Inventory-2 questionnaire. The scores of the attackers and defenders on selected variables were analysed by treated statistically. To find out the significant difference between the selected groups of subjects on superstition and competitive anxiety, the t-ratio was employed with the level of significance was kept at 0.05 level', '1457369420_SARAN_K.S..docx', '2016-03-07', 'SARAN K.S.,Dr. K. VAITHIANATHAN', 'sarank32@gmail.com', '+91 9746393547', '4/1232 BELLHOUSE THUNDIPARAMBU N.CHERLAI', 'MATTANCHERRY P.O.', 'COCHIN', 'KERALA', 682002, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1457856265_IJERSS1457369420.pdf', 1, 1, 'IJERSS-2016', 0, 0, 'Volume III - Issue III, March 2016.', 69, 1),
(550, 'IJERSS-1457506458', 'editor@ijerss.com', 'COMPARISON OF THE SELECTED PHYSICAL FITNESS COMPONENTS OF HIGH ALTITUDE AND SEA LEVEL HIGH SCHOOL STUDENTS', 'Research', 'SPORTS AND PHYSICAL EDUCATION', '  This investigation was undertaken to compare the selected physical fitness components of high altitude and sea level high school students. It had the purpose of comparing and analyzing the data collected from each variable between subjects from high altitude and sea level regions.   \r\nFor the purpose of the study, twenty male students were selected as subjects. The ten subjects were selected from Gov. H.S.S. Pathinaramkandam (High altitude region) and ten subjects were from Hira Public school, Kochi (Sea Level). The selected variables for the study were Agility, Speed and Muscular Endurance. The test administrated to assess the agility, speed and muscular endurance were shuttle run, 50m Das and One minute Sit-up respectively. The experimental design was double group\r\nThe result of the study supported the hypothesis that there would be significant difference in the agility of subjects among high altitude region and sea level regions hence the hypothesis was accepted since it was indicated that t-ratio obtained from scores of the both group was 5.212. This value was significant as it was greater than the t-value of 2.101 require for the significance at 0.05 level.  \r\nThe result of the study is also supported that the hypothesis that there would be significant difference in \r\n\r\nmuscular endurance among the subjects from high altitude and sea level regions. The hypothesis is accepted since it was indicated that the t-ratio obtained from the scores of both group was 2.684. This value was significant as it was greater than the t-value of 2.101 required for the significance at 0.05 level. \r\nThe hypothesis was rejected in comparison of Speed among the subjects of high altitude and sea level region. The t-ratio obtained for the speed was 0.781, and it was lower than the t-value of 2.101 required for the significance at 0.05 level. \r\n', '1457506458_Antony.docx', '2016-03-09', 'ANTONY J. AKKARA,DR. N.C. JESUS RAJKUMAR', 'aakkara007@gmail.com', '+91 9539119493', 'AKKARA HOUSE  PANAMKUTTICHIRA', 'OLLUIR P.O.', 'THRISSUR ', 'KERALA', 680306, 'IN', 'Pending', NULL, 'PHYSICAL EDUCATION', '1457856286_IJERSS1457506458.pdf', 1, 1, 'IJERSS-2016', 0, 0, 'Volume III - Issue III, March 2016.', 57, 1),
(551, 'IJERSS-1457529300', 'editor@ijerss.com', 'EFFECT OF PILATES TRAINING ON ABDOMINAL STRENGTH AND FLEXIBILITY AMONG PHYSICAL EDUCATION STUDENTS ', 'Research', 'SPORTS AND PHYSICAL EDUCATION', 'This study was undertaken to analyze the effect of Pilates training on selected variable among the Physical Education students. It had the purpose of comparing and analyzing the data collected from each variables during pre-test and post-test.\r\nFor the purpose of the study, twenty boys of 22 to 28 years old were selected as the subjects for the investigation. These students were started Pilates training in Department of Physical education, Sree Sankaracharya University of Sanskrit, Kalady. The pre-test was administered after four weeks of training. The selected variables for the study were abdomen strength and flexibility. The test administered to assess the abdomen strength and flexibility were one minute sit-ups and sit and reach test respectively. A pre-test and post-test score of the experimental group and controlled group were analyzed by employing the T-test. To find out the significance of difference between pre-test and post-test scores of the experimental group and the controlled group, the t-ratio was employed.\r\n', '1457529300_vineesh.docx', '2016-03-09', 'VINEESH T.S.,DR. N.C. JESUS RAJKUMAR', 'vineeshsivan7@gmail.com ', '+91 9562652783', 'THACHIPARAMBIL HOUSE', 'PADIYOOR P.O., IRINJALAKUDA', 'THRISSUR ', 'KERALA', 680688, 'IN', 'Pending', NULL, 'PHYSICAL EDUCATION', '1457856308_IJERSS1457529300.pdf', 1, 1, 'IJERSS-2016', 0, 0, 'Volume III - Issue III, March 2016.', 53, 1),
(552, 'IJERSS-1457544014', 'editor@ijerss.com', 'EFFECT OF LADDER TRAINING ON SELECTED MOTOR ABILITIES OF UNIVERSITY LEVEL SOCCER PLAYERS', 'Research', 'SPORTS AND PHYSICAL EDUCATION', 'This research was undertaken to analyze the effect of ladder training on selected variables among university soccer players. It had the purpose of comparing and analyzing the data collected from each variable.  \r\nFor the purpose of the study, twenty players of 18 to 24 years old were selected as subjects for the investigation. These students were started ladder training in Sree Sankaracharya University of Sanskrit Kalady. The pre-test was administrated by researcher during their first day of training and post-test were administrated after six weeks of training. . The selected variables for the study were Speed, Agility and Quickness. The test administrated to assess the speed, agility and quickness, 50 m dash (to assess the speed) Shuttle run (to assess the agility) and choice response test (to assess the quickness).. The test was about the effect of ladder training for six weeks. A pre-test and post-test score of the experimental group and controlled group were analyzed by employing the T-test. To find out the significance of difference between pre-test and post-test score of the experimental group and controlled group, the t-ratio was employed. \r\n', '1457544014_noble_nw_(2).doc', '2016-03-09', 'NOBLE BABY,Mr. S.J. ALBERT CHANDRASEKAR', 'noble02@gmail.com', '+91 9747320884', 'KARIKULAM HOUSE', 'KEEZHOOR P.O.', 'KOTTAYAM', 'KERALA', 686605, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1457856332_IJERSS1457544014.pdf', 1, 1, 'IJERSS-2016', 0, 0, 'Volume III - Issue III, March 2016.', 88, 1),
(554, 'IJERSS-1458640359', 'editor@ijerss.com', 'A HIERARCHICAL FUZZY RELATIONAL CLUSTERING ALGORITHM FOR SENTENCE LEVEL TEXT CLUSTERING', 'Research', 'COMPUTER SCIENCE', 'Clustering is the process of grouping or aggregating of data items. Sentence clustering mainly used in variety of applications such as classify and categorization of documents, automatic summary generation, organizing the documents, etc. In text processing, sentence clustering plays a vital role this is used in text mining activities. Size of the clusters may change from one cluster to another. The traditional clustering algorithms have some problems in clustering the input dataset. The problems such as, instability of clusters, complexity and sensitivity. To overcome the drawbacks of these clustering algorithms, this paper proposes a algorithm called Hierarchical Fuzzy Relational Eigenvector Centrality-based Clustering Algorithm (HFRECCA) is extension of FRECCA which is used for the clustering of sentences. Contents present in text documents contain hierarchical structure and there are many terms present in the documents which are related to more than one theme hence HFRECCA will be useful algorithm for natural language documents. In this algorithm single object may belong to more than one cluster', '1458640359_Journal_paper.doc', '2016-03-22', 'K. SIVA KUMAR, Dr.P.SIVA KUMAR, Dr.N.S.NITHIYA', 'sivakumar_srec@yahoo.co.in,sivakumar_srec@yahoo.co.in,sivakumar_srec@yahoo.co.in,chpmukesh@gmail.com', '9090909090', 'Flat No : 202 , H.No : 2-38', 'Plot No : 10, Tara Nagar,', 'Hyderabad', 'Telangana', 500019, 'IN', 'Pending', NULL, 'COMPUTER SCIENCE', '1461386903_IJERSS1458640359.pdf', 1, 1, 'IJERSS-2016', 0, 0, 'Volume III - Issue IV, April 2016.', 57, 1),
(555, 'IJERSS-1459013984', 'editor@ijerss.com', 'MOBILE LEARNING - A NEW PARADIGM OF TEACHING ENGLISH WITH TECHNOLOGY', 'Research', 'ENGLISH', 'Information and Communication Technology (ICT) has grown so rapidly that without becoming conscious we have become a part of it today. A personal laptop, tablet and a mobile phone with android applications and hi-fi features have become the necessity of the citizen of 21st century. A small gadget called mobile phone has captured a variety of tools within a very small shape and affordable price. A mobile phone can also be used in support of teaching-learning process with the purposive interest of being the easiest and fastest tool for communication. There are many websites which provide the facility to create groups of numbers of your choice for sending SMS in bulk', '1459013984_ELT_Paper.docx', '2016-03-26', 'CH.KISHORE KUMAR', 'suneeta.kishore@gmail.com', '9912892877', '', '', '', '', 0, 'IN', 'Pending', NULL, 'ENGLISH', '1461386933_IJERSS1459013984.pdf', 1, 1, 'IJERSS-2016', 0, 0, 'Volume III - Issue IV, April 2016.', 50, 1),
(556, 'IJERSS-1459331500', 'tilakpedir@gmail.com', 'EFFECT OF 8 WEEKS OF YOGA TRAINING ON THE SOMATIZATION, AND VARIOUS PSYCHOLOGICAL SYMPTOMS, ON MEN OF ABOVE 48YEARS', 'Research', 'Physical Education', 'Effect of 8 weeks of yoga training on the somatization, and various psychological symptoms, on men of above 48years\r\nB.S. Tilak Kumar, Research Scholar, Bangalore University, Bangalore\r\nAbstract\r\nIt is little known about the beneficial effects of yogic practice on somatization, and other most common stress-related physical symptoms.  This prospective study was an attempt to examine the beneficial effects of 8 weeks of yoga training on somatization, psychological symptoms on men of above 48years.  For the study researcher selected men who had no experience with yoga. The data of 39 participants who were 48 years of age were selected to follow 8 weeks of yoga training were analyzed. Somatization and psychological symptoms (tension-anxiety, depression, anger-hostility, fatigue, and confusion) were assessed before and after 8 weeks of yoga training using the Profile of Mood State (POMS) and the Symptom Checklist-90-Revised (SCL-90-R) questionnaires.  The Wilcoxon signed-rank test was used to compare the scores of questionnaires before and after 8 weeks of yoga training. After 8 weeks of yoga training, all negative subscale scores (tension-anxiety, depression, anger-hostility, fatigue, and confusion) from the POMS and somatization, anxiety, depression, and hostility from the SCL-90-R were significantly decreased when compared with those before starting yoga training.  Yoga training has the potential to reduce the somatization score and the scores related to mental health indicators, such as anxiety, depression, anger, and fatigue. The present findings suggest that yoga can improve somatization and mental health status and has implications for the prevention of psychosomatic symptoms in middle-aged men. \r\n', '1459331500_Tiptur_seminar.docx', '2016-03-30', 'B.S. TILAK KUMAR', ' tilakpedir@gmail.com', '+919844393965', 'B.S. Tilak Kumar ', '#466, kaanishka maharaja Road, 2nd main, K.G.nagar', 'Bangalore', 'Karnataka', 560019, 'IN', 'Pending', '', 'SPORTS SCIENCE', '1465315034_IJERSS1459331500.pdf', 1, 1, 'IJERSS-2016', 0, 0, 'Volume III - Issue V, May 2016.', 24, 1),
(557, 'IJERSS-1460186228', 'shenba.drk@gmail.com', 'DYNAMIC IRRIGATION MANAGEMENT SYSTEM FOR CROP VARIANTS WITH REMOTE INVOCATION', 'Others', 'Embedded systems', 'Dynamic irrigation management system was mainly developed to optimize water use for agricultural crops and to irrigate crops variants automatically. The system has a single master and a slave unit. The slave consists of group of soil moisture sensor placed in the root zone of the plants. In addition, a gateway unit handles sensor information and transmits data to a micro controller. The flow sensors are used to find the quantity of water flows into the fields. An algorithm was developed with threshold values of humidity that was programmed into a microcontroller-based gateway to control water quantity which controls multiple fields with crop variants through the solenoid valves. This entire system is controlled by a single master says mobile phone of the farmer.', '1460186228_journal_ACTUAL_edited.docx', '2016-04-09', 'SHENBAGA DEVI.R,DEEPIKA.R,SWATHI.S,PRAVEEN KUMAR.S', 'shenba.drk@gmail.com,deepi.ad2606@gmail.com,swathiselva958@gmail.com,spraveenk.ece@gmail.com', '9677537070', '5B,Blamurugan nagar,3rd street', 'gandhi nagar( post)', 'Tirupur', 'Tamilnadu', 641603, 'IN', 'Pending', '', '', NULL, 1, 0, 'IJERSS-2016', 0, 0, 'Volume III - Issue IV, April 2016.', 0, 0),
(558, 'IJERSS-1460187013', 'kavi1795@gmail.com', 'INTELLIGENT ROAD TRAFFIC CONTROL SYSTEM AND AMBULANCE CLEARANCE USING WIRELESS SENSOR NETWORK', 'Others', 'Embedded systems', 'The main aim of our project is to reduce the problem of traffic congestion which is becoming a very severe problem nowadays.To optimize this problem we have made frame work for an road traffic control system.This paper presents an implementing road traffic control system for emergency vehicle to pass smoothly.  IR Sensor can counts the number of vehicles on a particular lane. It  determines the  traffic congestion, and  the green light duration for that path. In addition, when an ambulance is approaching the junction, it will communicate to the traffic controller in the junction to turn ON the green light. This module uses ZigBee modules and microcontroller for wireless communications between the ambulance and traffic controller.', '1460187013_01_IEEE_Format.docx', '2016-04-09', 'CHANDRIKA.N,BALACHANDAR.P,LOGESH.S,KAVIARASU', 'chandrikanavi29@gmail.com,bala12ece7@gmail.com,logeshmla037@gmail.com,kavi1795@gmail.com', '9659043004', '40,Mariamman koil street,', 'peelamedu puthur', 'coimbatore', 'Tamilnadu', 641004, 'IN', 'Pending', '', '', NULL, 1, 0, 'IJERSS-2016', 0, 0, 'Volume III - Issue IV, April 2016.', 0, 0),
(559, 'IJERSS-1460210261', 'pavithraestrella@gmail.com', 'EMBEDDED SYSTEMS', 'Review', 'Embedded Systems', 'Real-Time interactive classroom always plays an indispensable role in distance learning, where teachers and students located in different places can take part in the class through certain multimedia communication systems and obtain real-time and media rich interactions using pervasive computing technologies. The aim of this project is to record voice and transferring it through short-range wireless networks like Bluetooth and Wi-Fi network. The application is designed to receive audio streams from Bluetooth microphone and to store them in central database for future access using Ethernet. And the attendance of the staff is maintained in separate database maintained in server, along with the information of in-time and out-time.\r\n', '1460210261_LECTURE_ACCESS_AND_FACULTY_ATTENDANCE_SYSTEMjornal.docx', '2016-04-09', 'PAVITHR P,POORNIMA RAGAVI G,PRADEP B,VINODH KUMAR G', 'pavithraestrella@gmail.com,poornimaragavi@gmail.com,pradeepb014@gmail.com,vino711612106306@gmail.com', '9976682213', '10,Nehru Poonga road,N.G.R Colony ', 'Varatharajapuram,Uppilipalayam(po)', 'Coimbatore', 'Tamil Nadu', 641015, 'IN', 'Pending', '', '', NULL, 1, 0, 'IJERSS-2016', 0, 0, 'Volume III - Issue IV, April 2016.', 0, 0),
(560, 'IJERSS-1460210864', 'pavithraestrella@gmail.com', 'LECTURE ACCESS AND FACULTY ATTENDANCE SYSTEM', 'Review', 'Embedded Systems', 'Real-Time interactive classroom always plays an indispensable role in distance learning, where teachers and students located in different places can take part in the class through certain multimedia communication systems and obtain real-time and media rich interactions using pervasive computing technologies. The aim of this project is to record voice and transferring it through short-range wireless networks like Bluetooth and Wi-Fi network. The application is designed to receive audio streams from Bluetooth microphone and to store them in central database for future access using Ethernet. And the attendance of the staff is maintained in separate database maintained in server, along with the information of in-time and out-time.\r\n', '1460210864_LECTURE_ACCESS_AND_FACULTY_ATTENDANCE_SYSTEMjornal.docx', '2016-04-09', 'PAVITHR P,POORNIMA RAGAVI G,PRADEP B,VINODH KUMAR G', 'pavithraestrella@gmail.com,poornimaragavi@gmail.com,pradeepb014@gmail.com,vino711612106306@gmail.com', '9976682213', '10,Nehru Poonga road,N.G.R Colony ', 'Varatharajapuram,Uppilipalayam(po)', 'Coimbatore', 'Tamil Nadu', 641015, 'IN', 'Pending', '', '', NULL, 1, 0, 'IJERSS-2016', 0, 0, 'Volume III - Issue IV, April 2016.', 0, 0),
(561, 'IJERSS-1460359992', 'editor@ijerss.com', 'VIRAL MARKETING', 'Research', 'Commerce and Management', 'Viral marketing is a method of creating buzzwords or marketing pieces that are memorable and attention-grabbing in our modern, always-connected world. This method of marketing utilizes social media, videos, text messaging, and other person-to-person methods to spread information about a product or service instead of just creating a commercial and putting on TV or radio.\r\nViral marketing, viral advertising, or marketing buzz are buzzwords referring to marketing techniques that use pre-existing social networking services and other technologies to try to produce increases in brand awareness or to achieve marketing objectives (such as product sales) through self-replicating viral processes. It can be delivered by word of mouth or enhanced by the network effects of the Internet and mobile networks.\r\nViral advertising is personal and, while coming from an identified sponsor. Most of the well-known viral ads circulating online are ads paid by a sponsor company, launched either on their own platform or on social media websites such as YouTube. Viral marketing may take the form of video clips, interactive Flash games, advergames, eBooks, brand able software, images, text messages, email messages, or web pages', '1460359992_Viral_marketing_ppt_(1).docx', '2016-04-11', 'MRS PARVEEN VIJ', 'parveena09@yahoo.co.in', '9090909090', '', '', '', '', 0, 'IN', 'Pending', '', 'COMMERCE', '1461477019_IJERSS1460359992.pdf', 1, 1, 'IJERSS-2016', 0, 0, 'Volume III - Issue IV, April 2016.', 80, 1),
(562, 'IJERSS-1460371108', 'editor@ijerss.com', 'SPORTS INJURIES: TREATMENT AND PRECAUTIONS', 'Review', 'PHYSICAL EDUCATION', 'Potential risks are inherited in different physical activities because of their nature.  Body parts may be injured and most of these involve the muscular-skeletal system, such as bones, joints and soft tissues (examples include muscles, tendons, capsules, bursae and ligaments). If one is familiar with these factors, there is a greater chance of injury prevention or lessening the degree of injury. We may suffer from various types of injuries when participating in sports activities. Participants of contact sports such as football and rugby will have a chance of sustaining injuries, for example, bleeding, contusion, abrasion, etc. Similarly, participants of continuous aerobic exercises such as marathon running and cycling etc will be more likely to encounter overuse injuries like heat exhaustion or heat stroke, particularly in Hong Kong climate. Students should understand that any sport involves a risk of injury. Knowledge of the causes and treatment of common sports injuries enables students to take preventive measures and have rapid recovery after injury, leading to a quick return to sports participation.', '1460371108_Dr._Sujith_S..docx', '2016-04-11', 'DR. SUJITH S.,DR. AJITHMOHAN K. R.', 'sujithnair22@gmail.com,ajithmoh@gmail.com', '09745677864', 'Dr. Sujith S., "PREM VIHAR",', 'Chitranjali Road, Thiruvankulam P-O,', 'Ernakulam Dist.', 'Kerala', 682305, 'IN', 'Pending', '', '', NULL, 1, 0, 'IJERSS-2016', 0, 0, 'Volume III - Issue IV, April 2016.', 0, 0),
(563, 'IJERSS-1461385522', 'editor@ijerss.com', 'AGGRANDIZED ASPECT BASED MOSAICING TECHNIQUE FOR SCIENTIFICALLY STIGMATIZED AIRBORNE SYNTHETIC APERTURE RADAR', 'Research', 'COMPUTER SCIENCE', 'In the digital image processing, enhancement and removing the noise in the airborne synthetic aperture radar (SAR) image is a critical issue. We have proposed a Kaze algorithm to enhance radar image interpretation  and the computational time are reduced by using the Adaptive Random Sample theory which limits the search space  and work well for feature detection of synthetic aperture radar  image(SAR).The performance of the proposed approach  has been evaluated and compared to the existing technique, The statistics obtained from each randomly selected feature is used to update this distribution, by reducing the total required number of random trials. The re-estimation for those selected features are done within a smaller search space with a more accurate algorithm like the RANSAC fitting, thus the proposed technique show that this two-stage algorithm reduces the total computation time by limiting the search space. The entire algorithm is simple and effective. Thus the image interpretation is enhanced by invariant feature Point detector in the areas of computer vision, real time image matching and object recognition.', '1461385522_Bhavya_M.E_paper_(1)_(1).docx', '2016-04-23', 'D.Bhavya Lakshmi,Prof.N.Sathianandam', 'bhavyadhyalan@gmail.com,sathyamca@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2016', 0, 0, 'New', 0, 0),
(564, 'IJERSS-1461566964', 'jayantmech87@gmail.com', 'DESIGN A COMPETENCY MATRIX MODEL FOR PRODUCTIVITY IMPROVEMENT IN STEEL MELTING SHOP', 'Research', 'INDUSTRIAL ENGINEERING', 'Abstract: - Productivity of a manufacturing unit is crucial as it results in improved production through optimal utilization of available resources. Factors contributing to production line efficiency are men, material and machine. In the present study, an attempt to study a competency matrix model which, when used, will help enhance the proficiency of people working at different positions in the Steel Melting Shop.Form Job Description, Knowledge and Skill Requirement have been evolved. The current state of proficiency of each individual position holder has been put in a matrix form. The current level of competency has been compared with the required level of proficiency.This matrix is further utilized to draw up the training programs that can enhance the output through mistake free job performance in an efficient manner.\r\nKEY WORDS: - Productivity, Job Description, Skill, Competency Matrix.\r\n\r\n', '1461566964_ABSTRACT.docx', '2016-04-25', 'JAYANT SINGH,PRADEEP AGRAWAL,KAMALAKANT PATEL', 'jayantmech87@gmail.com,pradeep33.pa@gmail.com,kamalakant1@gmail.com', '09479049923', 'ADARSH COLONY PENDRA ROAD', '', 'BILASPUR', 'CHHATTISGARH', 495117, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2016', 0, 0, 'New', 0, 0),
(565, 'IJERSS-1463129079', 'editor@ijerss.com', 'A Study on Scientific Attitude among Physical Education Pre Service Teachers', 'Research', 'SPORTS SCIENCE', 'Scientific attitude is open-mindedness, a desire for accurate knowledge, confidence in procedures; seeking knowledge and expectation that solution of the problem will come out through the use of verified knowledge. The Physical Education teacher bears the responsibility of developing scientific attitude among students. Without scientific attitude aims of science cannot be attained. Scientific attitude, now days, is found to be lacking even in highly educated persons, Physical Education teachers and students. This is a hindrance in the path of acquiring knowledge and scientific training in Games and Sports. The Physical Education teachers and students need to have a scientific outlook. This study investigated the scientific attitude amongPhysical Education pre serviceteachers. The survey research design was used to carry out the study. A sample of 300 pre service Physical Educationteachers from Visakhapatnam and Vizianagaram Districts of Andhra Pradesh State. Samples were selected using stratified random sampling technique. In this study the investigator used by the scientific attitude scale was standardized by Sood, J.K. and Sandhya, R.P.The collected data were analyzed using the mean, standard deviation and t-test. It was revealed from the study that there are significant differences in the level of scientific attitude among pre service Physical Education teachers based on gender and subject group of the students and not significantly influenced by locality and age of the students.', '1463129079_A_Study_on_Scientific_Attitude_among_Pre_Service_Teachers_(1).docx', '2016-05-13', 'B.Gowri Naidu,Dr.R.Satish Varma', 'rayapativarma@gmail.com,rayapativarma@gmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', '', 'PHYSICAL EDUCATION', '1466418219_IJERSS1463129079.pdf', 1, 1, 'IJERSS-2016', 0, 0, 'Volume III - Issue V, May 2016.', 14, 1),
(566, 'IJERSS-1463231064', 'editor@ijerss.com', 'COMPARATIVE STUDY ON SELECTED PHYSICAL FITNESS AND PSYCHOLOGICAL FACTOR AMONG BASKETBALL AND VOLLEYBALL MEN PLAYERS', 'Research', 'SPORTS SCIENCE', 'The purpose of this study was to compare the selected physical fitness components and psychological variables among basketball and volleyball players.\r\nThe investigator randomly selected 15 for each game at the age group of 21-24\r\nYears from YMCA College of Physical Education.\r\nThe data for the psychological variable and physical components fitness test and were statistically analysed to find out the purpose of comparison whether there were any significant differences in the various selected components of physical fitness and psychological variables among basketball and volleyball players.\r\n', '1463231064_NAGARAJ,_M.Phil_journal_final_(1).docx', '2016-05-14', '          Mr. D . NAGARAJ,Dr . R.MOHANA KRISHNAN', 'vinonnd@gmail.com', '9952523565', 'DHANDUMA NAGAR, PERIYAPALAYAM', 'THIRUVALLUVAR DISTRICT ', 'CHENNAI', 'TAMIL NADU', 601102, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2016', 0, 0, 'New', 0, 0),
(567, 'IJERSS-1463487698', 'editor@ijerss.com', 'COMPARATIVE STUDY OF SELECTED PHYSICAL FITNESS COMPONENTS AMONG BASKETBALL, HANDBALL AND VOLLEYBALL PLAYERS', 'Research', 'SPORTS SCIENCE', 'The purpose of this study was to compare the selected physical fitness components among the basketball, handball and volleyball players. For this study investigator randomly selected ten for each game in volleyball, basketball and handball at the age group of 20 to 25 years from YMCA College of Physical Education, Chennai.\r\n         The data collected for the selected physical fitness test and were statistically analyzed to find out the purpose of comparison whether there were any significant difference in the various selected components of physical fitness among the volleyball, handball and basketball.\r\nThe mean was calculated from the obtained data. By computing the F ratio the difference in mean of the volleyball, handball and basketball players were tested for statistical significance. The level of significance was set at 0.05 level. Each dependent variable and the total scores were compared separately and each â€œfâ€ value was calculated.\r\n', '1463487698_DHANA,_M.Phil_journal_final_(1).docx', '2016-05-17', 'Mr. L.Dhanasekaran,Dr. R. Mohana Krishnan', 'dsekaran20@gmail.com', '9176327692', 'No.3, 3rd st, Amarar rajiv gandhi nagar', 'Pudur, Ambattur', 'CHENNAI', 'TAMIL NADU', 600053, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2016', 0, 0, 'New', 0, 0),
(568, 'IJERSS-1465313007', 'editor@ijerss.com', 'EFFECT OF PLYOMETRIC TRAINING AND WEIGHT TRAINING ON SPEED AND CARDIO VASCULARENDURANCE OF BASKET BALL PLAYERS', 'Research', 'SPORTS SCIENCE', 'The Present study find out the Effect of Plyometric Training and Weight Training on Speed and Cardio Vascular Endurance of Basketball Players,  Subjects of the  study 60 basketball players who represented in Inter University Tournament in Adikavi Nannayya And Andhra University Area and their aged ranged 16-25 years. And devided into three groups group-I treat with Plyometric training, group-II weight training and control group, each group consist of 20 Subjects.  Pre test and post test were conduct for this study. Variables are speed and cardio vascular endurance. Statistical  technics were used ANCOVA', '1465313007_Paper1.docx', '2016-06-07', 'Dr.Raju Sathuluri,Dr.K.Subbar Rao,Dr.P.P.S.Paul Kumar', 'raju_sathuluri4@rediffmail.com,raju_sathuluri4@rediffmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1465472507_IJERSS1465313007.pdf', 1, 1, 'IJERSS-2016', 0, 0, 'Volume III - Issue V, May 2016.', 38, 1);
INSERT INTO `papers` (`id`, `paper_id`, `paper_referral`, `paper_title`, `paper_type`, `subject_category`, `abstract`, `paper_attachment`, `uploaded_on`, `author`, `email`, `pnumber`, `address_line1`, `address_line2`, `city`, `state`, `pincode`, `country`, `status`, `comments`, `subject`, `pdf`, `active`, `news`, `conference`, `volume`, `issue`, `volume_issue_title`, `downloads`, `blogspot`) VALUES
(569, 'IJERSS-1465313077', 'editor@ijerss.com', 'THE RELATIONSHIP BETWEEN SELECTED MOTOR FITNESS ANTHROPOMETRIC PARAMETERS WITH PLAYING ABILITY OF SOFTBALL PLAYERS', 'Research', 'SPORTS SCIENCE', 'The Present study find out the the relationship between selected motor fitness and anthropometric parameters with playing ability of softball players. Subjects of the study 50 Softball players who participated in All India Softball Ranking Tournament in â€˜under 15â€™ category. The age of the subjects was between 14 to 15 years. And The study was delimited to the following motor fitness, and anthropometrical variables are Abdominal Strength and Trunk length. Multi Regression Analysis were used for this study', '1465313077_Paper2.docx', '2016-06-07', 'Dr.Raju Sathuluri,Dr.K.Subbar Rao, Dr.P.P.S.Paul Kumar', 'raju_sathuluri4@rediffmail.com,raju_sathuluri4@rediffmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1465472576_IJERSS1465313077.pdf', 1, 1, 'IJERSS-2016', 0, 0, 'Volume III - Issue V, May 2016.', 28, 1),
(570, 'IJERSS-1465313160', 'editor@ijerss.com', 'ASSES THE ISOLATED AND COMBINED EFFECT OF YOGIC PRACTICES AND PLYOMETRIC EXERCISES ON SELECTED SPEED AND SHOOTING ACCURACY AMONG WOMEN HOCKEY PLAYERS', 'Research', 'SPORTS SCIENCE', 'The Present study find out the assess the isolated and combined effect of yogic practices and plyometric exercises on speed and Shooting Accuracy among women hockey players.  To facilitate the study sixty women hockey players from different colleges in Andhra Pradesh were randomly selected as subjects and their age was between 19 and 23 years. The subjects were participating in different competitions representing their colleges in inter collegiate level competitions.. They were assigned into four groups of which one group served as yogic practices groups, second group served as plyometric group and the third group served as combined group and the fourth group served as control group. The study was formulated as a true random group design, consisting of a pre test and post test.  The subjects (n=60) were randomly assigned to four equal groups of fifteen women hockey players in each.  The groups were assigned as Experimental Groups I, II, III and control group respectively.  Pre tests were conducted for all the subjects on selected speed, shooting accuracy, dribbling prescribed for this purpose. The statistical significance of the differences were tested through ANCOVA.  In all cases 0.05 level was fixed to test the hypothesis of this research', '1465313160_PPPPP1.docx', '2016-06-07', 'M.KAVITHA,Dr.Raju Sathuluri,Dr.K.Subbar Rao,Dr. R. V. L. N. Ratnakar Rao', 'raju_sathuluri4@rediffmail.com,raju_sathuluri4@rediffmail.com,raju_sathuluri4@rediffmail.co', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1465396076_IJERSS1465313160.pdf', 1, 1, 'IJERSS-2016', 0, 0, 'Volume III - Issue V, May 2016.', 35, 1),
(571, 'IJERSS-1465313229', 'editor@ijerss.com', 'ASSES THE ISOLATED AND COMBINED EFFECT OF YOGIC PRACTICES AND PLYOMETRIC EXERCISES ON SELECTED AGILITY AND SCOOPING ABILITY AMONG WOMEN HOCKEY PLAYERS', 'Research', 'SPORTS SCIENCE', 'The Present study find out the assess the isolated and combined effect of yogic practices and plyometric exercises on Agility and Scooping Ability among women hockey players.  To facilitate the study sixty women hockey players from different colleges in Andhra Pradesh were randomly selected as subjects and their age was between 19 and 23 years. The subjects were participating in different competitions representing their colleges in inter collegiate level competitions.. They were assigned into four groups of which one group served as yogic practices groups, second group served as polymeric group and the third group served as combined group and the fourth group served as control group. The study was formulated as a true random group design, consisting of a pre test and post test.  The subjects (n=60) were randomly assigned to four equal groups of fifteen women hockey players in each.  The groups were assigned as Experimental Groups I, II, III and control group respectively.  Pre tests were conducted for all the subjects on selected Agility, Scooping Ability, dribbling prescribed for this purpose. The statistical significance of the differences were tested through ANCOVA.  In all cases 0.05 level was fixed to test the hypothesis of this research', '1465313229_PPPPP2.docx', '2016-06-07', 'M.Kavitha,Dr.Raju Sathuluri,Dr. R. V. L. N. Ratnakar Rao', 'raju_sathuluri4@rediffmail.com,raju_sathuluri4@rediffmail.com,raju_sathuluri4@rediffmail.co', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1465384647_IJERSS1465313229.pdf', 1, 1, 'IJERSS-2016', 0, 0, 'Volume III - Issue V, May 2016.', 29, 1),
(572, 'IJERSS-1465468915', 'editor@ijerss.com', 'EFFECT OF STRUCTURED RESISTANCE TRAINING AND VARIED INTENSITIES OF WEIGHT TRAINING ON AGILITY AND BREATH HOLD TIME AMONG ATHLETES', 'Research', 'SPORTS SCIENCE', 'The Present study find out the assess the effect of structured resistance training and varied intensities of weight training on Agility and breath hold time  among The study was formulated as a true random group design, consisting of a pre test and post test.  The subjects (n=60) were randomly assigned to three equal groups of twenty men sprinters in each group.  The groups were assigned as Experimental Groups I, II and control group respectively. Experimental group I was assigned as Structured Resistance Training (SRT) and Experimental group II was assigned as varied weight training (VWT) and control group. The control group was not given any special treatment except of their routine. Pre tests were conducted for all the subjects on selected agility, and  breath holding time The experimental groups participated in their respective training protocols for a period of twelve weeks.  The statistical significance of the differences were tested through ANCOVA.  In all cases 0.05 level was fixed to test the hypothesis of this research', '1465468915_Paper5.docx', '2016-06-09', 'Dr.Raju Sathuluri ,Dr.Y.Madhusudhana Rao ,Pavan Kumar .P ,M.Veera Raghavaiah', 'raju_sathuluri4@rediffmail.com,raju_sathuluri4@rediffmail.com,raju_sathuluri4@rediffmail.com,raju_sa', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1465470847_IJERSS1465468915.pdf', 1, 1, 'IJERSS-2016', 0, 0, 'Volume III - Issue V, May 2016.', 25, 1),
(573, 'IJERSS-1465831344', 'editor@ijerss.com', 'EFFECT OF STRUCTURED RESISTANCE TRAINING AND VARIED INTENSITIES OF WEIGHT TRAINING ON SPEED AND BREATH HOLD TIME AMONG ATHLETES', 'Research', 'SPORTS SCIENCE', 'Aim of the Study find out the assess the effect of structured resistance training and varied intensities of weight training on Speed and breath hold time  among The study was formulated as a true random group design, consisting of a pre test and post test.  The subjects (n=60) were randomly assigned to three equal groups of twenty men sprinters in each group.  The groups were assigned as Experimental Groups I, II and control group respectively. Experimental group I was assigned as Structured Resistance Training (SRT) and Experimental group II was assigned as varied weight training (VWT) and control group. The control group was not given any special treatment except of their routine. Pre tests were conducted for all the subjects on selected Speed, and  breath holding time The experimental groups participated in their respective training protocols for a period of twelve weeks.  The statistical significance of the differences were tested through ANCOVA.  In all cases 0.05 level was fixed to test the hypothesis of this research.', '1465831344_Paper6.docx', '2016-06-13', 'Dr.Raju Sathuluri,Y.Udaya  Bhaskar,P.Ganesh,B.Uday Kumar', 'raju_sathuluri4@rediffmail.com,raju_sathuluri4@rediffmail.com,raju_sathuluri4@rediffmail.com,raju_sa', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1465834167_IJERSS1465831344.pdf', 1, 1, 'IJERSS-2016', 0, 0, 'Volume III - Issue V, May 2016.', 27, 1),
(574, 'IJERSS-1466837758', 'editor@ijerss.com', 'Computer Technology in Teaching and Learning communication skills', 'Research', 'English', 'Abstract\r\n	The last two decades have witnessed a revolution of technology, and has changed the dynamics of educational institutes, and has also influenced the educational system and the way people interact and work in the society. Using multimedia to create a context to teach communication skill has its unique advantages. As a result technology plays a very important role in teaching communication skill. This paper presents the necessity of computer technology in teaching and learning communication skills through Television, CD-Rom, the Internet, Electronic Dictionary, Blogs, Audio Cassettes, Power Point, Videos, DVDâ€™s and VCDâ€™s.\r\n\r\n\r\nKeywords: Teaching communication skills, Multimedia Technology, Optimization, Strategies.\r\n\r\n', '1466837758_Computer_Technology_in_Teaching_and_Learning_communication_skills.docx', '2016-06-25', '         P. Dinesh Babu , M.A', 'dineshbabu.potini@gmail.com', '9248574770', 'Lecturer in English ', 'VRS & YRN College', 'Chirala ', 'Andhra Pradesh', 0, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2016', 0, 0, 'New', 0, 0),
(575, 'IJERSS-1466848372', 'editor@ijerss.com', 'TONY MORRISON''S THE BLUEST EYE: WHITENESS AND COLOUR', 'Research', 'ENGLISH', 'The Bluest Eye is Toni Morrison''s first novel, published in 1970. It tells the tragic story of Pecola Breedlove, a young black girl growing up in Morrison''s hometown of Lorain, Ohio, after the Great Depression. Due to its unflinching portrayal of incest, prostitution, domestic violence, child molestation, and racism, there have been numerous attempts to ban the book from libraries and schools across the United States. ', '1466848372_Mohan_English.docx', '2016-06-25', 'Konduru Mohan Rao', 'raju_sathuluri4@rediffmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Published Online', '', 'ENGLISH', '1466850352_IJERSS1466848372.pdf', 1, 1, 'IJERSS-2016', 0, 0, 'Volume III - Issue V, May 2016.', 19, 1),
(576, 'IJERSS-1466849416', 'editor@ijerss.com', 'POSTMODERN ASPECT OF VIKRAM CHANDRA', 'Research', 'ENGLISH', 'Red Earth and Pouring Rain (1995) is Vikram Chandraâ€™s first novel.  Chandraâ€™s writing like Salman Rushdieâ€™s can be classified as both â€˜magical realistâ€™ and as â€˜Post-colonialâ€™.  Red Earth and Pouring Rain deals with Indiaâ€™s colonial past, with the British attitude towards India and with Indiaâ€™s and Indiansâ€™ responses.  It is also about identity, almost by definition a central concern of post-colonial literature.  References to religion are scattered throughout the book and some knowledge of Hinduism may help readers to decipher the plot.  The text qualifies as â€˜magical realismâ€™ because reality and fantasy merge in the telling of the story.  Chandraâ€™s inspiration in part comes from The Arabian Nights.', '1466849416_166CHAP21_(1).DOC', '2016-06-25', 'V ANAND KUMAR', 'raju_sathuluri4@rediffmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'ENGLISH', '1466850267_IJERSS1466849416.pdf', 1, 1, 'IJERSS-2016', 0, 0, 'Volume III - Issue V, May 2016.', 12, 1),
(577, 'IJERSS-1467616996', 'editor@ijerss.com', 'Computer Technology in Teaching and Learning communication skills', 'Research', 'English Language', 'Computer Technology in Teaching and Learning communication skills\r\nAbstract\r\n	The last two decades have witnessed a revolution of technology, and has changed the dynamics of educational institutes, and has also influenced the educational system and the way people interact and work in the society. Using multimedia to create a context to teach communication skill has its unique advantages. As a result technology plays a very important role in teaching communication skill. This paper presents the necessity of computer technology in teaching and learning communication skills through Television, CD-Rom, the Internet, Electronic Dictionary, Blogs, Audio Cassettes, Power Point, Videos, DVDâ€™s and VCDâ€™s.\r\n\r\n\r\nKeywords: Teaching communication skills, Multimedia Technology, Optimization, Strategies.\r\n', '1467616996_Computer_Technology_in_Teaching_and_Learning_communication_skills.docx', '2016-07-04', '           P.Dinesh Babu M.A., ', 'dineshbabu.potini@gmail.com', '9912892877', 'Lecturer in English', 'VRS & YRN College', 'CHIRALA', 'ANDHRA PRADESH', 0, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2016', 0, 0, 'New', 0, 0),
(578, 'IJERSS-1467636917', 'editor@ijerss.com', 'FAMILY INFLUENCE ON SPORTS PARTICIPATION AMONG SPORTS PERSONS OF GOVERNMENT COLLEGE STUDENTS ', 'Research', 'Physical Education and Sports Science', 'The present study deals with the assessment of influence of family conditions including paternal, maternal and other conditions on sports participation among sports persons of government college students in University of Mysore. A total of 120 sports participants including 60 male and 60 female sports persons were interviewed along with a semi structured questionnaire. The questionnaire elicited information on parental participation and support, sibling participation and support, income etc. The analysis was done qualitatively and only frequency and percent analysis was done to compare across gender.  Results revealed that most of the participation came from rural area, fatherâ€™s educational qualifications were higher than motherâ€™s educational qualifications, and very few of them were involved in sports including their siblings.   However, encouragement was high both for male and female respondents, higher again for male respondents including moral support. Financially there was higher support both for male and female respondents and income wise higher income was reported for female respondents than male respondents.  The results are discussed highlighting the importance of family in sports participation. ', '1467636917_FAMILY_INFLUENCE_ON_SPORTS_PARTICIPATION_AMONG_SPORTS_PERSONS_OF_GOVERNMENT_COLLEGE_STUDE', '2016-07-04', 'Dr. KRISHNAKUMAR ', 'hsk.mcm@gmail.com', '9448246112', 'Dept. of Physical Education, University of Mysore,', 'Sports Pavilion, Mysore', 'Mysore', 'Karnataka', 570005, 'IN', 'Pending', NULL, NULL, NULL, 0, 0, 'IJERSS-2016', 0, 0, 'New', 0, 0),
(579, 'IJERSS-1467908436', 'editor@ijerss.com', 'POST COLONIAL AND COSMOPOLITAN CULTURE OF VIKRAM CHANDRAâ€™S LOVE AND LONGING IN BOMBAY', 'Research', 'ENGLISH', 'Vikram Chandraâ€™s second novel, Love and Longing in Bombay (1997) is able to evoke something of the cultural complexity, the contradictions and vitality of life in post-colonial Asia.  The book consists of a collection of five interlinked short stories. Each of the stories has been described as a tale from a well-established genre, i.e., â€œthe ghost storyâ€, â€œthe love storyâ€, or â€œthe murder mysteryâ€.  The stories use the devices of â€œthe ghost story, â€œthe romanceâ€, romantic love, post-colonial culture and the like.  Each story explores the inner lives of the characters in question. It delves into their emotional experiences, their ambitious, passions and fears.  The characters carry a kind of realistic weight to them.  They are not simply symbols or archetypes but are constructed to communicate the authorâ€™s ideas. ', '1467908436_English_Paper.DOC', '2016-07-07', 'V.Anand Kumar', 'raju_sathuluri4@rediffmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'ENGLISH', '1467916028_IJERSS1467908436.pdf', 1, 1, 'IJERSS-2016', 0, 0, 'Volume III - Issue VI, June 2016.', 2, 1),
(580, 'IJERSS-1467908571', 'editor@ijerss.com', 'STUDY ON RELATIONSHIP OF SHOOTING ABILITY WITH SELECTED PHYSICAL FITNESS COMPONENTS AND ANTROPOMETRIC MEASUREMENTS OF MEN HANDBALL', 'Research', 'SPORTS SCIENCE', 'Aim of the Study find out the relationship of shooting ability with selected physical fitness components and anthropometric measurements of men hand ball Players. The study was formulated as a true random group design, The subjects (n=60) were randomly selected for this study. Physical fitness variables are Speed, and Agility, Antropometric variables are Height & Weight. Shooting Ability.  The statistical techniques used for this study Pearson Coefficient of Correlation.  Data also was subjected to statistical treatment using Multiple Correlation', '1467908571_Physical_Education_Paper1.docx', '2016-07-07', 'Vasireddy Nageswara Rao,Dr.I.Devi Vara Prasad', 'raju_sathuluri4@rediffmail.com,raju_sathuluri4@rediffmail.com', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1467916182_IJERSS1467908571.pdf', 1, 1, 'IJERSS-2016', 0, 0, 'Volume III - Issue VI, June 2016.', 2, 1),
(581, 'IJERSS-1467909144', 'editor@ijerss.com', 'INFLUENCE OF INCLINE AND DECLINE TRAINING ON TREADMILL WITH AND WITHOUT WEIGHT ON SELECTED SPEED AND VO2 MAX AMONG ATHLETES', 'Research', 'SPORTS SCIENCE', 'Aim of the Study find out the assess the effect Influence of  incline and decline training on treadmill with without weight on selected speed and vo2 max among Athletes. The study was formulated as a true random group design, consisting of a pre test and post test.  The subjects (n=60) were randomly assigned to three equal groups of twenty men sprinters in each group.  The groups were assigned as Experimental Groups I, II and control group respectively. Experimental group I was assigned as with weights and Experimental group II without weights and control group. The control group was not given any special treatment except of their routine. Pre tests were conducted for all the subjects on selected Speed, and Vo2 Max  The experimental groups participated in their respective training protocols for a period of twelve weeks.  The statistical significance of the differences were tested through ANCOVA.  In all cases 0.05 level was fixed to test the hypothesis of this research.', '1467909144_Physical_Education_Paper2.docx', '2016-07-07', 'Dr.Raju Sathuluri,B.Rama Prasad,B.Uday Kumar,T.Rama Krishna', 'raju_sathuluri4@rediffmail.com,raju_sathuluri4@rediffmail.com,raju_sathuluri4@rediffmail.com,raju_sa', '9090909090', '', '', '', '', 0, 'IN', 'Pending', NULL, 'SPORTS SCIENCE', '1467915889_IJERSS1467909144.pdf', 1, 1, 'IJERSS-2016', 0, 0, 'Volume III - Issue VI, June 2016.', 2, 1);
